INSERT INTO `reb` VALUES ('1467', '山东世家置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b6d91dd1-b624-4f7a-9642-58729932966e.shtml', '', '013822', '高远峰', '济南市历下区经十东路200号', '88192256', 'jnsjzy@163.com', '2000 万元', '民营企业', '山东世家置业有限公司于2001年4月20日在济南市工商行政管理局注册成立，于2001年7月16日取得房地产开发经营资质，主要是从事房地产开发建设的股份制企业。 公司曾用名济南世家置业有限公司，后于2006年3月迁往山东省工商行政管理局，更名为山东世家置业有限公司，并于2003年4月10日房地产开发资质由原暂定变更为房地产开发叁级资质。 公司于2002年5月协议取得济南市历下区龙泉山庄规划居住区1号组团，荷兰庄园北侧55亩规划建设用地的开发建设权，由于当时政府政策影响，该项目停滞至今。 同年公司协议受让龙泉山庄规划居住区南部，不受政策影响的规划建设用地地块，即现新建旅游路两侧约160亩建设开发用地的开发权。小区定名山水庭院，规划建筑面积约16万平方米，其中多层住宅约7万平方米、小高层住宅约6万平方米、公建3万平方米。至2007年底公司以投资8750万元。 注：由于历下区管理部门在村民拆迁、补偿等工作尚未完成，本项目还未具备开工条件。', '山东世家置业有限公司null高远峰济南市历下区经十东路200号88192256jnsjzy@163.com2000 万元民营企业山东世家置业有限公司于2001年4月20日在济南市工商行政管理局注册成立，于2001年7月16日取得房地产开发经营资质，主要是从事房地产开发建设的股份制企业。 公司曾用名济南世家置业有限公司，后于2006年3月迁往山东省工商行政管理局，更名为山东世家置业有限公司，并于2003年4月10日房地产开发资质由原暂定变更为房地产开发叁级资质。 公司于2002年5月协议取得济南市历下区龙泉山庄规划居住区1号组团，荷兰庄园北侧55亩规划建设用地的开发建设权，由于当时政府政策影响，该项目停滞至今。 同年公司协议受让龙泉山庄规划居住区南部，不受政策影响的规划建设用地地块，即现新建旅游路两侧约160亩建设开发用地的开发权。小区定名山水庭院，规划建筑面积约16万平方米，其中多层住宅约7万平方米、小高层住宅约6万平方米、公建3万平方米。至2007年底公司以投资8750万元。 注：由于历下区管理部门在村民拆迁、补偿等工作尚未完成，本项目还未具备开工条件。');
INSERT INTO `reb` VALUES ('1468', '济南旧城开发投资集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/21658a28-cf2e-4770-9a31-5fd2abaeba75.shtml', '', '013802', '杨庆绪', '阳光新路69号泉景鸿园商务大厦11—15层', '81271097', '20511062@qq.com', '150000 万元', '国有企业', '', '济南旧城开发投资集团有限公司null杨庆绪阳光新路69号泉景鸿园商务大厦11—15层8127109720511062@qq.com150000 万元国有企业');
INSERT INTO `reb` VALUES ('1469', '山东三庆城市置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c44f10fc-ef9e-400b-b535-8f321432883f.shtml', '', '013813', '吴立胜', '济南市高新区世纪财富中心AB座三层', '67803311', '138651778@qq.com', '5000 万元', '民营企业', '山东三庆城市置业有限公司成立于1998年，注册资金5000万元人民币。公司自成立起就以全新的开发理念引领各项开发事务，并极力投入到山东省城市建设当中。多年来，坚持走大众化得精品路线和专业化的经营道路，以雄厚的经济实力和良好的市场信誉雄踞房地产开发企业前列，凭借上乘的建筑质量与优秀的物业管理在强手如林的泉城房地产市场找到适合自己的领域，并取得了良好的市场信誉。目前，山东三庆城市置业有限公司正准备在高新区开发一片住宅项目，请大家拭目以待！', '山东三庆城市置业有限公司null吴立胜济南市高新区世纪财富中心AB座三层67803311138651778@qq.com5000 万元民营企业山东三庆城市置业有限公司成立于1998年，注册资金5000万元人民币。公司自成立起就以全新的开发理念引领各项开发事务，并极力投入到山东省城市建设当中。多年来，坚持走大众化得精品路线和专业化的经营道路，以雄厚的经济实力和良好的市场信誉雄踞房地产开发企业前列，凭借上乘的建筑质量与优秀的物业管理在强手如林的泉城房地产市场找到适合自己的领域，并取得了良好的市场信誉。目前，山东三庆城市置业有限公司正准备在高新区开发一片住宅项目，请大家拭目以待！');
INSERT INTO `reb` VALUES ('1470', '山东荣宝斋文化投资置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/9b65c9b2-6537-44e8-93ef-aedd11f0bc20.shtml', '', '013806', '吴金莲', '济南市槐荫区河王商业街颐海宾馆二楼201室', '66716777', '', '9000 万元', '民营企业', '山东荣宝斋文化投资置业有限公司经山东省工商行政管理局批准，于2010年4月成立，注册资本为：3000万元人民币。 本项目选址于济南市槐荫区，紧邻济南高铁西客站站前三大中心，作为济南市未来规划发展的主要方向，依托于2011年6月30日正式通车使用的济南高铁西客站，2013年中国艺术节前片 区将完成基础设施建造、环境打造、完善城市配套及功能，形成以文化、商务、会展为中心，高端居住、商业为主体的西部城市综合体。将片区打造成为“齐鲁新门户”、“泉城新商埠”、 “城市新中心”，使之成为继2009年济南全运会东部城区开发之后的城市运营新篇章。 项目毗邻城市共建绿地，位置景观优越，与片区内十字景观轴和济西湿地公园相呼应，未来将配套公交线路始发站、城规、BRT等交通线路，出行方便，片区发展前景广阔，市场巨大。作 为济南西部新城开发建设、打造城市综合体、培育现代服务业的重要内容之一，济南荣宝斋文化艺术广场项目是济南市与荣宝斋共同创新文化发展的新模式、新探索。项目建成后，旅游文化 交易广场将以荣宝斋济南分店为依托，建设成为全国性的文化艺术品交易市场及高端艺术品集散地。 作为济南新城市运营的一份子，山东荣宝斋文化投资置业有限公司传承荣宝斋对“诚 信、品牌”的苦心经营与珍视，将与华润置地、恒大地产、绿地集团、中航、中铁、中建等开发企业一道，强强联合，一道打造济南西部新城的辉煌明天！', '山东荣宝斋文化投资置业有限公司null吴金莲济南市槐荫区河王商业街颐海宾馆二楼201室667167779000 万元民营企业山东荣宝斋文化投资置业有限公司经山东省工商行政管理局批准，于2010年4月成立，注册资本为：3000万元人民币。 本项目选址于济南市槐荫区，紧邻济南高铁西客站站前三大中心，作为济南市未来规划发展的主要方向，依托于2011年6月30日正式通车使用的济南高铁西客站，2013年中国艺术节前片 区将完成基础设施建造、环境打造、完善城市配套及功能，形成以文化、商务、会展为中心，高端居住、商业为主体的西部城市综合体。将片区打造成为“齐鲁新门户”、“泉城新商埠”、 “城市新中心”，使之成为继2009年济南全运会东部城区开发之后的城市运营新篇章。 项目毗邻城市共建绿地，位置景观优越，与片区内十字景观轴和济西湿地公园相呼应，未来将配套公交线路始发站、城规、BRT等交通线路，出行方便，片区发展前景广阔，市场巨大。作 为济南西部新城开发建设、打造城市综合体、培育现代服务业的重要内容之一，济南荣宝斋文化艺术广场项目是济南市与荣宝斋共同创新文化发展的新模式、新探索。项目建成后，旅游文化 交易广场将以荣宝斋济南分店为依托，建设成为全国性的文化艺术品交易市场及高端艺术品集散地。 作为济南新城市运营的一份子，山东荣宝斋文化投资置业有限公司传承荣宝斋对“诚 信、品牌”的苦心经营与珍视，将与华润置地、恒大地产、绿地集团、中航、中铁、中建等开发企业一道，强强联合，一道打造济南西部新城的辉煌明天！');
INSERT INTO `reb` VALUES ('1471', '山东祥泰森林河湾置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c5100d41-c1ac-41a8-80cc-b46534378329.shtml', '', '013814', '于大卫', '济南市历下区化纤厂路2号', '053188060150', 'liulili@samtak.cn', '2000 万元', '民营企业', '2009年9月，祥泰实业有限公司出资成立山东祥泰森林河湾置业有限公司，注册资金2000万，全面负责祥泰实业在中心城市济南的首个地块——祥泰?森林河湾项目开发建设和销售等工作。 山东祥泰森林河湾置业汇聚业内精英，秉承“识时务、共荣辱、有爱心、说到做到”的核心价值观，必将凭借其快速开发建设之经验，于济南花园路与化纤厂路交汇处东南兴建发轫之作，倾力打造出“环抱一片森林、纵贯一条河流”的花园路生态大盘——祥泰?森林河湾！', '山东祥泰森林河湾置业有限公司null于大卫济南市历下区化纤厂路2号053188060150liulili@samtak.cn2000 万元民营企业2009年9月，祥泰实业有限公司出资成立山东祥泰森林河湾置业有限公司，注册资金2000万，全面负责祥泰实业在中心城市济南的首个地块——祥泰?森林河湾项目开发建设和销售等工作。 山东祥泰森林河湾置业汇聚业内精英，秉承“识时务、共荣辱、有爱心、说到做到”的核心价值观，必将凭借其快速开发建设之经验，于济南花园路与化纤厂路交汇处东南兴建发轫之作，倾力打造出“环抱一片森林、纵贯一条河流”的花园路生态大盘——祥泰?森林河湾！');
INSERT INTO `reb` VALUES ('1472', '济南华泰城镇建设开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8e03a4ab-2755-41de-8b10-e0ce02e1ead6.shtml', '', '013780', '张际干', '济南市市中区杆南东街31号', '13854124999', 'huatai0531@sina.com', '2100 万元', '国有企业', '济南华泰城镇建设开发有限公司成立于2004年4月,注册资金2100万元,是集房地产开发、房地产营销策划、物业管理、装饰装修，为一体的三级房地产开发企业，开发项目遍及江苏、山东等市、县。 华泰房产自成立以来，一直本着“诚信、务实、奉献、创新”的宗旨以“创品牌、建精品”为目标，立足于自身发展，广泛合作，不断开拓进取，为求将最好的建筑产品奉献给我们的用户，在济南先后开发了“明湖苑、花阁小区、药山花园”，江苏徐州“阳光花园”等项目。2007年初在东营新开发的项目“水岸花庭”已启动。 公司之所以发展到今天,正是归功于“诚信和品牌”的理念，同时也有员工的辛勤工作，广大业主、社会各界的信任及支持，才有我们的发展和成长，我们将会继续发扬“诚信务实、开拓创新”的精神，使华泰房产真正成为销费者最满意的品牌。', '济南华泰城镇建设开发有限公司null张际干济南市市中区杆南东街31号13854124999huatai0531@sina.com2100 万元国有企业济南华泰城镇建设开发有限公司成立于2004年4月,注册资金2100万元,是集房地产开发、房地产营销策划、物业管理、装饰装修，为一体的三级房地产开发企业，开发项目遍及江苏、山东等市、县。 华泰房产自成立以来，一直本着“诚信、务实、奉献、创新”的宗旨以“创品牌、建精品”为目标，立足于自身发展，广泛合作，不断开拓进取，为求将最好的建筑产品奉献给我们的用户，在济南先后开发了“明湖苑、花阁小区、药山花园”，江苏徐州“阳光花园”等项目。2007年初在东营新开发的项目“水岸花庭”已启动。 公司之所以发展到今天,正是归功于“诚信和品牌”的理念，同时也有员工的辛勤工作，广大业主、社会各界的信任及支持，才有我们的发展和成长，我们将会继续发扬“诚信务实、开拓创新”的精神，使华泰房产真正成为销费者最满意的品牌。');
INSERT INTO `reb` VALUES ('1473', '济南永大军安置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ac1d7c91-f339-4564-a252-d7c06210ea13.shtml', '', '013788', '田永龙', '济南市历城区港沟镇潘庄村永大颐和园15号楼3-101室', '82666666', 'aqiking@163.com', '2002 万元', '国有企业', '该项目位于济南市历城区港沟镇潘庄村永大颐和园15号楼3-101室。注册资本贰仟零贰万元整。', '济南永大军安置业有限公司null田永龙济南市历城区港沟镇潘庄村永大颐和园15号楼3-101室82666666aqiking@163.com2002 万元国有企业该项目位于济南市历城区港沟镇潘庄村永大颐和园15号楼3-101室。注册资本贰仟零贰万元整。');
INSERT INTO `reb` VALUES ('1474', '山东鑫海置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/92e67137-82a2-4953-ba4e-e3ee1226873f.shtml', '', '013793', '王绪柱', '济南市长清区经十西路7888号', '87998018', 'sdxh06@163.com', '2000 万元', '国有企业', '山东鑫海置业有限公司简介 山东鑫海置业有限公司是山东平安建设集团的控股子公司，成立于2002年，注册资本2000万元。自公司成立以来，先后开发了平安山庄东西区、天福源、老年公寓、济柴家园等项目，开发面积达到30多万平方米。平安国际雅都园等一系列高标准的住宅区也即将动工建设。 鑫海置业有限公司坚持依托平安、服务平安、面向社会的宗旨，坚持走社会化、市场化发展的道路，确立了“做稳济南基地、做强山东市场”的发展战略。一如既往地遵循\"唯实创新，追求卓越\"的企业精神和\"双赢\"的经营理念，全力开发出舒适型、环保型、个性化、智能化、人性化等符合国际标准的优质地产，并将以优质的物业管理作为坚实的后盾，来满足用户需求。 同时，公司也积极致力于解决中低收入家庭住房问题，以“老百姓愿意买和买得起”为出发点，精心打造了“ 建设速度快、工程质量高、配套设施到位、物业管理好、销售价格低”的住宅小区，使广大低收入家庭乔迁新居，安居乐业。 公司拥有一个团结开拓的管理梯队和充满朝气的人才队伍，全体员工正以饱满的热情，工作高标准、严要求，以质量为核心，以创品牌为目标，努力为泉城人民营造“人性化高、环保性强”的精品家园。', '山东鑫海置业有限公司null王绪柱济南市长清区经十西路7888号87998018sdxh06@163.com2000 万元国有企业山东鑫海置业有限公司简介 山东鑫海置业有限公司是山东平安建设集团的控股子公司，成立于2002年，注册资本2000万元。自公司成立以来，先后开发了平安山庄东西区、天福源、老年公寓、济柴家园等项目，开发面积达到30多万平方米。平安国际雅都园等一系列高标准的住宅区也即将动工建设。 鑫海置业有限公司坚持依托平安、服务平安、面向社会的宗旨，坚持走社会化、市场化发展的道路，确立了“做稳济南基地、做强山东市场”的发展战略。一如既往地遵循\"唯实创新，追求卓越\"的企业精神和\"双赢\"的经营理念，全力开发出舒适型、环保型、个性化、智能化、人性化等符合国际标准的优质地产，并将以优质的物业管理作为坚实的后盾，来满足用户需求。 同时，公司也积极致力于解决中低收入家庭住房问题，以“老百姓愿意买和买得起”为出发点，精心打造了“ 建设速度快、工程质量高、配套设施到位、物业管理好、销售价格低”的住宅小区，使广大低收入家庭乔迁新居，安居乐业。 公司拥有一个团结开拓的管理梯队和充满朝气的人才队伍，全体员工正以饱满的热情，工作高标准、严要求，以质量为核心，以创品牌为目标，努力为泉城人民营造“人性化高、环保性强”的精品家园。');
INSERT INTO `reb` VALUES ('1475', '山东安大置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ae5e17c2-03a9-48b6-8cde-5ec618151e90.shtml', '', '013811', '刘延杰', '济南市高新区舜华路2000号舜泰广场11号楼北座第八层C区802', '85039202', 'sdadzy@163.com', '5000 万元', '国有企业', '', '山东安大置业有限公司null刘延杰济南市高新区舜华路2000号舜泰广场11号楼北座第八层C区80285039202sdadzy@163.com5000 万元国有企业');
INSERT INTO `reb` VALUES ('1476', '济阳县城建开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/bc1e1d52-84c4-4b79-87f7-f101b98a3e16.shtml', '', '013821', '石传彬', '山东省济南市济阳县纬一路42号', '84211567', 'jiyangkaifa@163.com', '3000 万元', '国有企业', '济阳县城建开发有限公司隶属济阳县建设局,是我县从事房地产开发的龙头企业.公司注册资金1845万元,拥有资产5870万元,开发资质三级,公司现有职工150名,其中具有初级以上专业技术职称人员80人,具有项目经理资质的38人.企业年开发量8万平方米,年产值8000万元,年实现利税558万元.公司下属二级资质企业2个(济南科信达建筑安装有限公司,济南新奥装饰有限公司),预制厂,塑钢厂,物业管理公司等6个子公司.', '济阳县城建开发有限公司null石传彬山东省济南市济阳县纬一路42号84211567jiyangkaifa@163.com3000 万元国有企业济阳县城建开发有限公司隶属济阳县建设局,是我县从事房地产开发的龙头企业.公司注册资金1845万元,拥有资产5870万元,开发资质三级,公司现有职工150名,其中具有初级以上专业技术职称人员80人,具有项目经理资质的38人.企业年开发量8万平方米,年产值8000万元,年实现利税558万元.公司下属二级资质企业2个(济南科信达建筑安装有限公司,济南新奥装饰有限公司),预制厂,塑钢厂,物业管理公司等6个子公司.');
INSERT INTO `reb` VALUES ('1477', '济南正大建业发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/bc242f1d-5da8-45a7-b33c-4ff11aeae411.shtml', '', '013845', '张新', '济南市历城区董家街道机场路办公楼99号一楼', '82386988', 'zhengdajianye@163.com', '5000 万元', '国有企业', '济南正大建业发展有限公司成立于1996年，注册资金2000万元，年开发能力20万平方米。 公司成立以来，坚持科学发展观，坚持“企业追求的不仅是效益，更重要的是信誉和质量”的前瞻性思维，内强素质，外塑形象，以人为本，构建企业文化。先后成功开发了正大城市花园一期、明泉花园，以及正在开发的正大城市花园二期及百脉豪庭花园式经典居住小区。骄人的业绩，彰显本公司雄厚的综合实力。 公司秉承“谦虚谨慎、求实创新、自强不息、诚信卓越”的创业理念，以技术实力、经济实力、智慧实力为后盾，重合同、守信用，在合作单位中有口皆碑，赢得了有关部门及广大购房者的信赖和赞誉！ 公司法人代表郑焕刚愿与各界同仁精诚合作，放眼未来，共同开创繁花似锦的明天！', '济南正大建业发展有限公司null张新济南市历城区董家街道机场路办公楼99号一楼82386988zhengdajianye@163.com5000 万元国有企业济南正大建业发展有限公司成立于1996年，注册资金2000万元，年开发能力20万平方米。 公司成立以来，坚持科学发展观，坚持“企业追求的不仅是效益，更重要的是信誉和质量”的前瞻性思维，内强素质，外塑形象，以人为本，构建企业文化。先后成功开发了正大城市花园一期、明泉花园，以及正在开发的正大城市花园二期及百脉豪庭花园式经典居住小区。骄人的业绩，彰显本公司雄厚的综合实力。 公司秉承“谦虚谨慎、求实创新、自强不息、诚信卓越”的创业理念，以技术实力、经济实力、智慧实力为后盾，重合同、守信用，在合作单位中有口皆碑，赢得了有关部门及广大购房者的信赖和赞誉！ 公司法人代表郑焕刚愿与各界同仁精诚合作，放眼未来，共同开创繁花似锦的明天！');
INSERT INTO `reb` VALUES ('1478', '山东永安房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/e816571b-c71b-4a36-9612-852382704725.shtml', '', '013816', '伊茂强', '济南市泉城路264号', '82685369', 'SDTYKFB@163.com', '42200 万元', '民营企业', '山东永安房地产开发有限公司简介 公司成立于1998年，由山东永安股份企业公司和山东永大工贸有限公司发起成立，注册资本1000万元。2003年10月，公司股权结构变更为济南百货占注册资本的50% ，山东天业房地产开发有限公司占注册资本的40% ，济南百大电子商务网络责任有限公司占注册资本的10% 。2005年10月增资扩股后，注册资本变更为3850万元，股权结构变更为济南百货87% ，山东天业10.4% ，济南百大电子商务2.6% 。2007年5月股权结构变更，山东天业恒基股份有限公司股权100%，成为天业恒基的全子公司。目前公司开发资质为三级，总资产2.6亿元，曾昭秦任董事长，伊茂强任总经理。公司已开发建设的项目有泉城路永安大厦写字楼，建筑面积3.8万平方米，2005年10月竣工。乳山滨海花园住宅小区，批准规划面积6万平方米，现已竣工4万平方米。公司发展势头良好。 天业中心位于济南市奥体东路以东北路以北。区内基础设施万蛇，交通便利。', '山东永安房地产开发有限公司null伊茂强济南市泉城路264号82685369SDTYKFB@163.com42200 万元民营企业山东永安房地产开发有限公司简介 公司成立于1998年，由山东永安股份企业公司和山东永大工贸有限公司发起成立，注册资本1000万元。2003年10月，公司股权结构变更为济南百货占注册资本的50% ，山东天业房地产开发有限公司占注册资本的40% ，济南百大电子商务网络责任有限公司占注册资本的10% 。2005年10月增资扩股后，注册资本变更为3850万元，股权结构变更为济南百货87% ，山东天业10.4% ，济南百大电子商务2.6% 。2007年5月股权结构变更，山东天业恒基股份有限公司股权100%，成为天业恒基的全子公司。目前公司开发资质为三级，总资产2.6亿元，曾昭秦任董事长，伊茂强任总经理。公司已开发建设的项目有泉城路永安大厦写字楼，建筑面积3.8万平方米，2005年10月竣工。乳山滨海花园住宅小区，批准规划面积6万平方米，现已竣工4万平方米。公司发展势头良好。 天业中心位于济南市奥体东路以东北路以北。区内基础设施万蛇，交通便利。');
INSERT INTO `reb` VALUES ('1479', '山东和润置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/2ac4f49f-a4e5-4b03-ac70-c9a0467a4fb7.shtml', '', '013843', '葛兆生', '唐冶新区围子山1号', '88767197', '', '2000 万元', '民营企业', '和润幸福城项目位于唐冶新城，南邻南水北调调度运行中心、煤田地质局综合服务中心，东临唐冶西路、北邻敬德街。唐冶新城作为济南东拓的重点发展区域及首批“中美可持续城镇发展示范项目”，将成为继奥体文博片区后济南最重要的发展区域，也是济南对外展示的新的“门户”和“窗口”。', '山东和润置业有限公司null葛兆生唐冶新区围子山1号887671972000 万元民营企业和润幸福城项目位于唐冶新城，南邻南水北调调度运行中心、煤田地质局综合服务中心，东临唐冶西路、北邻敬德街。唐冶新城作为济南东拓的重点发展区域及首批“中美可持续城镇发展示范项目”，将成为继奥体文博片区后济南最重要的发展区域，也是济南对外展示的新的“门户”和“窗口”。');
INSERT INTO `reb` VALUES ('1480', '章丘市新世纪房地产开发有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/bd2655c6-c39d-4fac-aea7-75c04bdbeeef.shtml', '', '013827', '刘其金', '章丘市开发区唐王山路东段', '83316688', 'xinshijixsj@126.com', '1800 万元', '民营企业', '章丘市新世纪房地产开发公司成立于1999年5月，前身为章丘市开发区城建综合开发公司。公司于2001年12月改制，更名为章丘市新世纪房地产开发有限责任公司，房地产开发资质为三级，注册资金1800万元。公司在董事会的领导下，设公司总经理一名、副总经理三名、总工程师一名，下设办公室、工程部、技术部、材料部、财务部、售房部、档案室、物业公司等五部、两室、一公司，在册管理人员22名，其中具有高、中级职称的专业人员13人，初级职称人员5人。公司自成立以来，本着“高起点规划、高标准建设、高水平管理”的原则，邀请有关专家进行论证，提出了“一流的规划设计、一流的环境塑造、一流的配套设施和一流的物业管理”的整体开发思路。1999年首先开发建设了开发区商贸一条街——天街，天街以新颖的设计、一流的施工赢得了社会各界的赞誉。2000年，公司按照国家建设部小区建设标准，规划在建了新世纪住宅花园小区。新世纪住宅小区总占地面积215亩，总建筑面积21.6万平方米，可居住户数1600户，人口6000余人，总投资3.02亿元。公司于2003年底竞得东山小区土地170亩，总建筑面积16.8万平方米，可入住1300户，5000余人，总投资2.8亿元人民币。在立足章丘房地产市场的同时，努力开拓外部市场，2004年5月份，公司在德州市庆云县征得土地240亩，总建筑面积21.8万平方米，可入住2700户，9600余人，总投资2.6亿元人民币。', '章丘市新世纪房地产开发有限责任公司null刘其金章丘市开发区唐王山路东段83316688xinshijixsj@126.com1800 万元民营企业章丘市新世纪房地产开发公司成立于1999年5月，前身为章丘市开发区城建综合开发公司。公司于2001年12月改制，更名为章丘市新世纪房地产开发有限责任公司，房地产开发资质为三级，注册资金1800万元。公司在董事会的领导下，设公司总经理一名、副总经理三名、总工程师一名，下设办公室、工程部、技术部、材料部、财务部、售房部、档案室、物业公司等五部、两室、一公司，在册管理人员22名，其中具有高、中级职称的专业人员13人，初级职称人员5人。公司自成立以来，本着“高起点规划、高标准建设、高水平管理”的原则，邀请有关专家进行论证，提出了“一流的规划设计、一流的环境塑造、一流的配套设施和一流的物业管理”的整体开发思路。1999年首先开发建设了开发区商贸一条街——天街，天街以新颖的设计、一流的施工赢得了社会各界的赞誉。2000年，公司按照国家建设部小区建设标准，规划在建了新世纪住宅花园小区。新世纪住宅小区总占地面积215亩，总建筑面积21.6万平方米，可居住户数1600户，人口6000余人，总投资3.02亿元。公司于2003年底竞得东山小区土地170亩，总建筑面积16.8万平方米，可入住1300户，5000余人，总投资2.8亿元人民币。在立足章丘房地产市场的同时，努力开拓外部市场，2004年5月份，公司在德州市庆云县征得土地240亩，总建筑面积21.8万平方米，可入住2700户，9600余人，总投资2.6亿元人民币。');
INSERT INTO `reb` VALUES ('1481', '山东金田建设开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a16a9dfc-b918-482b-acd3-3bbe6fe615f4.shtml', '', '013829', '金位海', '章丘市汇泉路666号E1号楼', '83327222', 'jnjt88888@163.com', '10000 万元', '民营企业', '山东金田建设开发有限公司成立于二00六年六月六日，集房地产开发、商品房销售于一体。公司下设行政人事部、财务部、工程部、企划部、营销一部、营销二部、保安部等，共有员工70人。公司投资建设的济南国际商贸城项目，是济南市、章丘市的重点工程项目，已于2006年8月20日全面开工建设，工程总投资15亿元人民币总体规划建筑面积65万平方米，一期工程建筑面积25万平方米，投资5亿元人民币。', '山东金田建设开发有限公司null金位海章丘市汇泉路666号E1号楼83327222jnjt88888@163.com10000 万元民营企业山东金田建设开发有限公司成立于二00六年六月六日，集房地产开发、商品房销售于一体。公司下设行政人事部、财务部、工程部、企划部、营销一部、营销二部、保安部等，共有员工70人。公司投资建设的济南国际商贸城项目，是济南市、章丘市的重点工程项目，已于2006年8月20日全面开工建设，工程总投资15亿元人民币总体规划建筑面积65万平方米，一期工程建筑面积25万平方米，投资5亿元人民币。');
INSERT INTO `reb` VALUES ('1482', '济南永大明珠房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c14c4506-9836-4e86-be87-1569005468bf.shtml', '', '013342', '', '章丘市明水开发区东山小区', '83326007', '', '1800 万元', '', '', '济南永大明珠房地产开发有限公司null章丘市明水开发区东山小区833260071800 万元');
INSERT INTO `reb` VALUES ('1483', '山东才高置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/6a74a87c-6fa2-443c-b6f6-2c1f6d162aac.shtml', '', '013772', '秦毅', '济南市高新区颖秀路2755号602室', '58836577', 'cgzyjn@126.com', '2000 万元', '民营企业', '山东才高置业有限公司是由青岛才高集团公司与青岛诚基置业有限公司共同出资合建的有限责任公司，于2008年8月21日向山东省工商局注册成立，注册资金为2000万元人民币。主营范围为房地产开发经营及技术服务，公司坚持诚实、守信、平等、互利为经营原则，以兴业报国为己任，以国际化知名企业为目标，抓住机遇，稳步、快速、和谐发展。目前在济南奥体中心东侧进行房地产开发，愿为济南的发展和繁荣做出贡献。', '山东才高置业有限公司null秦毅济南市高新区颖秀路2755号602室58836577cgzyjn@126.com2000 万元民营企业山东才高置业有限公司是由青岛才高集团公司与青岛诚基置业有限公司共同出资合建的有限责任公司，于2008年8月21日向山东省工商局注册成立，注册资金为2000万元人民币。主营范围为房地产开发经营及技术服务，公司坚持诚实、守信、平等、互利为经营原则，以兴业报国为己任，以国际化知名企业为目标，抓住机遇，稳步、快速、和谐发展。目前在济南奥体中心东侧进行房地产开发，愿为济南的发展和繁荣做出贡献。');
INSERT INTO `reb` VALUES ('1484', '济南中海地产投资有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/6ac71497-de9b-4b5d-8458-d5d6ff7315c5.shtml', '', '013792', '欧阳国欣', '山东省济南市市中区二环南路6636号中海广场写字楼三楼', '66773850', 'xuhe0090732@163.com', '5000 万元', '民营企业', '济南中海地产投资有限公司成立于2009年9月，注册资本金5000万元，主营房地产开发、销售、物业管理。目前已成功获取济南市市中区九曲片区优质综合性用地，总建筑面积约300万平米，目前正准备开发建设中。公司将秉承中海地产“诚信卓越、精品永恒”的一贯理念，为济南市场提供高尚的住宅产品和配套服务。', '济南中海地产投资有限公司null欧阳国欣山东省济南市市中区二环南路6636号中海广场写字楼三楼66773850xuhe0090732@163.com5000 万元民营企业济南中海地产投资有限公司成立于2009年9月，注册资本金5000万元，主营房地产开发、销售、物业管理。目前已成功获取济南市市中区九曲片区优质综合性用地，总建筑面积约300万平米，目前正准备开发建设中。公司将秉承中海地产“诚信卓越、精品永恒”的一贯理念，为济南市场提供高尚的住宅产品和配套服务。');
INSERT INTO `reb` VALUES ('1485', '山东广宇置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a429f03a-656c-4713-b186-0c5e4f8953e0.shtml', '', '012720', '张善春', '济南市章丘明水经济开发区世纪大道1996号', '81793098', '315129954@qq.com', '11000 万元', '民营企业', '山东广宇置业有限公司成立于2006年9月1日，由英大国际信托投资有限公司出资8793万，山东丰汇集团有限公司出资207万而成立的法人有限责任公司，注册地址位于济南市章丘明水经济开发区唐王山路，注册资本壹亿壹仟万元整，主要经营范围为：房地产开发、销售；钢材、木材、五金交电、汽车（不含小轿车）及配件的销售，商品信息咨询服务。 广宇置业根据“济南东拓、章丘西进”城市发展战略的时代背景，紧紧把握章丘作为济南卫星城的城市地位，适时地调整企业发展战略，将开发重心转向章丘，于2006年取得了黄旗山片区开发一期项目的开发权。项目位于章丘圣井街道办事处辖区，总占地69万平方米（合1037亩），总开发面积约83万平方米。北侧紧邻济南市第一交通大道经十东路，东西向分布有自然村落，使项目具备了良好的自然、地理优势。结合章丘市的自然资源、人文资源，依托项目周边丰富的大学资源，经过深入的市场调研，项目定位为高品质高尚住宅区，着力打造中国首创的大学校园式国际社区。以高标准策划、高起点规划，力争将该项目建设成章丘乃至济南甚至山东的名片项目、亮点楼盘，为章丘市民提供质优价廉的居住产品，以改善章丘市民居住环境。 山东广宇置业有限公司自成立以来，秉承“追求进步，超越自我”的企业精神，以“创建美好家园是我们的共同心愿”为企业使命，为济南与章丘早日实现零距离对接发挥应有的作用，为章丘市的繁荣发展作出更大的贡献。', '山东广宇置业有限公司null张善春济南市章丘明水经济开发区世纪大道1996号81793098315129954@qq.com11000 万元民营企业山东广宇置业有限公司成立于2006年9月1日，由英大国际信托投资有限公司出资8793万，山东丰汇集团有限公司出资207万而成立的法人有限责任公司，注册地址位于济南市章丘明水经济开发区唐王山路，注册资本壹亿壹仟万元整，主要经营范围为：房地产开发、销售；钢材、木材、五金交电、汽车（不含小轿车）及配件的销售，商品信息咨询服务。 广宇置业根据“济南东拓、章丘西进”城市发展战略的时代背景，紧紧把握章丘作为济南卫星城的城市地位，适时地调整企业发展战略，将开发重心转向章丘，于2006年取得了黄旗山片区开发一期项目的开发权。项目位于章丘圣井街道办事处辖区，总占地69万平方米（合1037亩），总开发面积约83万平方米。北侧紧邻济南市第一交通大道经十东路，东西向分布有自然村落，使项目具备了良好的自然、地理优势。结合章丘市的自然资源、人文资源，依托项目周边丰富的大学资源，经过深入的市场调研，项目定位为高品质高尚住宅区，着力打造中国首创的大学校园式国际社区。以高标准策划、高起点规划，力争将该项目建设成章丘乃至济南甚至山东的名片项目、亮点楼盘，为章丘市民提供质优价廉的居住产品，以改善章丘市民居住环境。 山东广宇置业有限公司自成立以来，秉承“追求进步，超越自我”的企业精神，以“创建美好家园是我们的共同心愿”为企业使命，为济南与章丘早日实现零距离对接发挥应有的作用，为章丘市的繁荣发展作出更大的贡献。');
INSERT INTO `reb` VALUES ('1486', '济南鲁邦置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c3d35147-a426-4f31-9d9e-269298a6672f.shtml', '', '013834', '李胜德', '济南市历下区经十路10777号东楼27层', '82071622', 'lubang2000@126.com', '5000 万元', '国有企业', '济南鲁邦置业有限公司成立于二OO八年七月十日，是由山东省鲁邦房地产开发有限公司单独出资设立的。公司注册资金为人民币5000万元。 公司目前经营范围为：房地产开发、出租、经营、房地产置换及相关咨询服务；装饰装修工程的设计及施工；建筑设备、建筑材料、装饰材料的销售。', '济南鲁邦置业有限公司null李胜德济南市历下区经十路10777号东楼27层82071622lubang2000@126.com5000 万元国有企业济南鲁邦置业有限公司成立于二OO八年七月十日，是由山东省鲁邦房地产开发有限公司单独出资设立的。公司注册资金为人民币5000万元。 公司目前经营范围为：房地产开发、出租、经营、房地产置换及相关咨询服务；装饰装修工程的设计及施工；建筑设备、建筑材料、装饰材料的销售。');
INSERT INTO `reb` VALUES ('1487', '济南四建集团房地产开发有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/5eaa3263-af71-42f0-af30-fb741721c1b7.shtml', '', '建开企[2011]1163号', '曹晓岩', '济南市天桥区济洛路163号办公楼五层', '85916599', 'sjfc@163.com', '5000 万元', '国有企业', '济南四建集团房地产开发公司简介 济南四建集团房地产开发有限责任公司成立于1993年，注册资金1800万元人民币，年开发能力20余万平方米。并拥有万盛物业、万盛园餐饮有限公司、万盛游泳馆等三产项目。 自公司成立以来，一贯秉承诚信、稳健、卓越的经营理念和“质量重于泰山，奉献温馨家园”的质量方针，以“善创实干、勇于夺冠”为宗旨，靠建房质量、经营信誉、优质服务去占领市场、赢得市场。先后在济南市成功地开发了万盛园、荷花园、万盛园新区、槐苑小区、春天花园等精品小区。其中万盛园新区、春天花园均获得济南市房产界唯一“泉城杯双十佳优良小区”奖。四建房产开发公司连年荣获济南市“十佳”房地产开发企业；济南市重合同守信用企业；济南市首批承诺放心房企业；济南市综合实力20强企业；百姓信得过放心房；房地产影响力企业；春天花园——济南市实力名盘、消费者最信赖的楼盘、优秀景观设计楼盘。四建房产温馨家园已成为济南市民传颂的佳话。', '济南四建集团房地产开发有限责任公司null曹晓岩济南市天桥区济洛路163号办公楼五层85916599sjfc@163.com5000 万元国有企业济南四建集团房地产开发公司简介 济南四建集团房地产开发有限责任公司成立于1993年，注册资金1800万元人民币，年开发能力20余万平方米。并拥有万盛物业、万盛园餐饮有限公司、万盛游泳馆等三产项目。 自公司成立以来，一贯秉承诚信、稳健、卓越的经营理念和“质量重于泰山，奉献温馨家园”的质量方针，以“善创实干、勇于夺冠”为宗旨，靠建房质量、经营信誉、优质服务去占领市场、赢得市场。先后在济南市成功地开发了万盛园、荷花园、万盛园新区、槐苑小区、春天花园等精品小区。其中万盛园新区、春天花园均获得济南市房产界唯一“泉城杯双十佳优良小区”奖。四建房产开发公司连年荣获济南市“十佳”房地产开发企业；济南市重合同守信用企业；济南市首批承诺放心房企业；济南市综合实力20强企业；百姓信得过放心房；房地产影响力企业；春天花园——济南市实力名盘、消费者最信赖的楼盘、优秀景观设计楼盘。四建房产温馨家园已成为济南市民传颂的佳话。');
INSERT INTO `reb` VALUES ('1488', '山东绿地泉控股集团股份有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/3b70f729-26ad-4b01-b0f9-903f844ef5a2.shtml', '', '建开企【2001】196号', '刘民', '阳光新路69号泉景鸿园商务大厦', '66696811', '809399901@qq.com', '29224.8 万元', '民营企业', '济南市房地产开发总公司成立于1975年,是具有国家一级房地产开发资质、山东省成立时间最早的从事城市综合开发建设的大型国有公司。公司成立30年来，坚持统一规划、合理布局、综合开发、配套建设的方针，按照城市总体规划，先后开发建设住宅及配套、办公商业楼宇600多万平方米，改造建设道路30多公里，为济南市城市建设和旧城改造做出了突出贡献。 　　 济南市房地产开发总公司作为全国成立时间较早的国有房地产公司，先后承建了一大批科技含量高、综合质量好、社会反响好的住宅小区，其中全国第一批实验住宅小区之一的燕子山小区获国家质量银质奖,并被建设部授予“优秀住宅实验小区”称号；全国第二批实验住宅小区之一的佛山苑小区获国家15城市住宅小区建设试点综合奖金牌奖，并被中国建筑业学会授予“鲁班奖”。泉景·四季花园住区是山东省第一个墙改与建筑节能示范小区，1999年被评为济南市唯一的住宅“双十佳”小区，2001年获建设部授予的“全国物业管理示范住宅小区”称号；泉景·卧龙花园2003年获中国房地产业协会授予的“健康住区”称号，它们分别成为展示济南市各个时期城市建设成就的窗口。总公司先后被市政府评为质量管理先进单位，被省建设厅授予“管理示范企业”称号。 　　 近几年来，总公司着力塑造“泉景地产”品牌，一系列以“泉景”冠名的住宅小区和写字楼已成为泉城一道靓丽的风景线。“泉景地产”致力于为百姓“建筑和谐生活”，努力争创中国最受尊敬的地产品牌。', '山东绿地泉控股集团股份有限公司null刘民阳光新路69号泉景鸿园商务大厦66696811809399901@qq.com29224.8 万元民营企业济南市房地产开发总公司成立于1975年,是具有国家一级房地产开发资质、山东省成立时间最早的从事城市综合开发建设的大型国有公司。公司成立30年来，坚持统一规划、合理布局、综合开发、配套建设的方针，按照城市总体规划，先后开发建设住宅及配套、办公商业楼宇600多万平方米，改造建设道路30多公里，为济南市城市建设和旧城改造做出了突出贡献。 　　 济南市房地产开发总公司作为全国成立时间较早的国有房地产公司，先后承建了一大批科技含量高、综合质量好、社会反响好的住宅小区，其中全国第一批实验住宅小区之一的燕子山小区获国家质量银质奖,并被建设部授予“优秀住宅实验小区”称号；全国第二批实验住宅小区之一的佛山苑小区获国家15城市住宅小区建设试点综合奖金牌奖，并被中国建筑业学会授予“鲁班奖”。泉景·四季花园住区是山东省第一个墙改与建筑节能示范小区，1999年被评为济南市唯一的住宅“双十佳”小区，2001年获建设部授予的“全国物业管理示范住宅小区”称号；泉景·卧龙花园2003年获中国房地产业协会授予的“健康住区”称号，它们分别成为展示济南市各个时期城市建设成就的窗口。总公司先后被市政府评为质量管理先进单位，被省建设厅授予“管理示范企业”称号。 　　 近几年来，总公司着力塑造“泉景地产”品牌，一系列以“泉景”冠名的住宅小区和写字楼已成为泉城一道靓丽的风景线。“泉景地产”致力于为百姓“建筑和谐生活”，努力争创中国最受尊敬的地产品牌。');
INSERT INTO `reb` VALUES ('1489', '山东天业恒基股份有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d334c4ec-69f9-4384-97cc-9eaa715e27c4.shtml', '', '建开企（2016）1692号', '曾昭秦', '济南市高新开发区新宇南路1号济南国际会展中心A区', '86079991', '', '88463.4731 万元', '民营企业', '山东天业恒基股份有限公司，原山东济南百货大楼（集团）股份有限公司（以下简称“本公司”）经山东省经济体制改革委员会、中国人民银行山东省分行以鲁体改生字[199 2]第90 号文批准以公开募集的形式，于1992 年7 月26 日成立。并于1993年 1 月16 日取得山东省工商行政管理局颁发的3700001801070 号企业法人营业执照。1993 年11月26 日经中国证券监督委员会[1993]105 号文复审通过，并经上海证券交易所以上证上[1993]第111 号文审核批准，于1994 年1 月3 日在上海证券交易所上市交易。', '山东天业恒基股份有限公司null曾昭秦济南市高新开发区新宇南路1号济南国际会展中心A区8607999188463.4731 万元民营企业山东天业恒基股份有限公司，原山东济南百货大楼（集团）股份有限公司（以下简称“本公司”）经山东省经济体制改革委员会、中国人民银行山东省分行以鲁体改生字[199 2]第90 号文批准以公开募集的形式，于1992 年7 月26 日成立。并于1993年 1 月16 日取得山东省工商行政管理局颁发的3700001801070 号企业法人营业执照。1993 年11月26 日经中国证券监督委员会[1993]105 号文复审通过，并经上海证券交易所以上证上[1993]第111 号文审核批准，于1994 年1 月3 日在上海证券交易所上市交易。');
INSERT INTO `reb` VALUES ('1490', '山东三箭房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/97454b13-8a66-4680-bbe3-041875066068.shtml', '', '建开企【2003】390号', '王令强', '济南市高新区新宇路西侧世纪财富中心B座二楼', '58796167', 'sdsjfdc@126.com', '27000 万元', '国有企业', '山东三箭房地产开发有限公司是三箭集团所属的具有国家一级开发资质的房地产开发企业。公司以房地产开发为主，是集建筑设计、房产营销、建材供应和物业管理为一体的综合性房地产开发企业。 公司秉承“诚信、创新、团结、奉献”的企业精神，以“科学民主决策，健康有序发展，认真快乐工作，构建和谐三箭”工作方针为指引，先后开发了铜元局小区、银苑、吉祥苑、平安苑、如意苑、三吉花园、东荷苑、洪山苑、财大馨苑、汇福山庄、豫林嘉园等高档住宅小区；山东邮政大厦、济南数码科技大厦、七星吉祥大厦等高档写字楼，积极参与了济南市旧改安置项目——经八纬一西南片区（瑞福苑）、经四纬十二西北片区（和平嘉园）的开发建设，累计开发面积逾200万平方米，是山东省知名的房地产开发大型企业。 公司自成立以来，屡获好评。开发建设的吉祥苑、银苑、如意苑均被国家建设部终审为2A级住宅性能认证楼盘。吉祥苑小区于2008年获得建设部首届中国房地产业最高奖——广厦奖。此外公司还先后被评为中国房地产企业500强，中国值得尊敬的房地产品牌企业，建设部销售“放心房”履行承诺企业，山东省重点扶持的房地产企业，省市先进开发企业，开发质量先进单位，济南市房地产开发企业综合信用评定AAA级企业，济南市房地产开发十佳先进企业，济南市住宅性能认定先进单位等殊荣。 在近几年的发展中，除自主开发以外，公司还创新性的拓展出合作开发、定向开发、顾问咨询等发展模式。2015年，公司布局济南北城，开发了健康生态的精装社区——三箭瑞景苑，引领着北城居住品质的升级，同时积极对接济南北夸城市发展战略。面向未来，山东三箭房地产开发有限公司将在新的发展形式与机遇下，健康稳步发展，积极探索开发模式的转型，升级产品和服务，努力打造济南本土国企地产第一品牌。', '山东三箭房地产开发有限公司null王令强济南市高新区新宇路西侧世纪财富中心B座二楼58796167sdsjfdc@126.com27000 万元国有企业山东三箭房地产开发有限公司是三箭集团所属的具有国家一级开发资质的房地产开发企业。公司以房地产开发为主，是集建筑设计、房产营销、建材供应和物业管理为一体的综合性房地产开发企业。 公司秉承“诚信、创新、团结、奉献”的企业精神，以“科学民主决策，健康有序发展，认真快乐工作，构建和谐三箭”工作方针为指引，先后开发了铜元局小区、银苑、吉祥苑、平安苑、如意苑、三吉花园、东荷苑、洪山苑、财大馨苑、汇福山庄、豫林嘉园等高档住宅小区；山东邮政大厦、济南数码科技大厦、七星吉祥大厦等高档写字楼，积极参与了济南市旧改安置项目——经八纬一西南片区（瑞福苑）、经四纬十二西北片区（和平嘉园）的开发建设，累计开发面积逾200万平方米，是山东省知名的房地产开发大型企业。 公司自成立以来，屡获好评。开发建设的吉祥苑、银苑、如意苑均被国家建设部终审为2A级住宅性能认证楼盘。吉祥苑小区于2008年获得建设部首届中国房地产业最高奖——广厦奖。此外公司还先后被评为中国房地产企业500强，中国值得尊敬的房地产品牌企业，建设部销售“放心房”履行承诺企业，山东省重点扶持的房地产企业，省市先进开发企业，开发质量先进单位，济南市房地产开发企业综合信用评定AAA级企业，济南市房地产开发十佳先进企业，济南市住宅性能认定先进单位等殊荣。 在近几年的发展中，除自主开发以外，公司还创新性的拓展出合作开发、定向开发、顾问咨询等发展模式。2015年，公司布局济南北城，开发了健康生态的精装社区——三箭瑞景苑，引领着北城居住品质的升级，同时积极对接济南北夸城市发展战略。面向未来，山东三箭房地产开发有限公司将在新的发展形式与机遇下，健康稳步发展，积极探索开发模式的转型，升级产品和服务，努力打造济南本土国企地产第一品牌。');
INSERT INTO `reb` VALUES ('1491', '山东道通置业投资有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d84960db-4854-4a6d-83d0-87e201885e33.shtml', '', '建开企【2013】1344号', '孙毅', '双山街道府前街文博中心规划馆内西北角二层', '61327733', '45693040@qq.com', '20000 万元', '国有企业', '', '山东道通置业投资有限公司null孙毅双山街道府前街文博中心规划馆内西北角二层6132773345693040@qq.com20000 万元国有企业');
INSERT INTO `reb` VALUES ('1492', '山东黄金地产旅游集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/913d9b08-8d80-461d-8fcf-f660d7ec4dd7.shtml', '', '建开企[2011]1160号', '孙秀恩', '济南市高新开发区崇华路1587号', '67875757', '', '30000 万元', '国有企业', '', '山东黄金地产旅游集团有限公司null孙秀恩济南市高新开发区崇华路1587号6787575730000 万元国有企业');
INSERT INTO `reb` VALUES ('1493', '山东鑫苑置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d9edeb9b-c538-4b9d-9302-fa9c744e5835.shtml', '', '建开企[2015]1463号', '张立洲', '济南市天桥区小清河北路188号', '87912228', '', '30000 万元', '民营企业', '山东鑫苑置业有限公司是河南鑫苑置业有限公司的全资子公司，成立于2006年6月，注册资本金2000万元，公司总部位于济南市槐荫区经七路516号汇统大厦A座18楼。公司现有员工全部具有大专以上学历，其中中高级技术人员占员工总数的36%。 　　公司目前已取得了济南市张庄路66、68号地块和原济南第一印染厂地块的经营开发权，两个项目将于2006年10月1日和2006年12月1日开工建设，2007年底全面交付使用。', '山东鑫苑置业有限公司null张立洲济南市天桥区小清河北路188号8791222830000 万元民营企业山东鑫苑置业有限公司是河南鑫苑置业有限公司的全资子公司，成立于2006年6月，注册资本金2000万元，公司总部位于济南市槐荫区经七路516号汇统大厦A座18楼。公司现有员工全部具有大专以上学历，其中中高级技术人员占员工总数的36%。 　　公司目前已取得了济南市张庄路66、68号地块和原济南第一印染厂地块的经营开发权，两个项目将于2006年10月1日和2006年12月1日开工建设，2007年底全面交付使用。');
INSERT INTO `reb` VALUES ('1494', '祥泰实业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/791195ba-a187-4d64-ba9f-e3ba0bc2191b.shtml', '', '建开企[2013]1372号', '于大卫', '舜华路2000号舜泰广场7号楼6层', '053181666708', 'Liulili@samtak.cn', '32000 万元', '民营企业', '祥泰实业有限公司（以下简称“祥泰实业”）是一家集开发建设、建筑施工、国内外贸易、中介服务、物业管理等产业链环节于一体，住宅开发与商业地产运营并重的综合性房地产发展商。2009年进驻济南，注册资金3.2亿元，拥有20余家全资、控股公司，具有房地产开发一级、物业管理二级、装饰一体化二级、公路施工二级、园林施工三级等多项专业资质。 随着企业规模的不断扩大，祥泰实业正在被越来越多的消费者熟知和信赖，并在行业中取得了一系列成绩和荣誉。先后被评为：CIHAF2011中国房地产名企、中国房地产齐鲁名企大奖、中国房地产（齐鲁）领航企业、山东品质运营商、济南十大城市运营商、年度城市贡献房企、山东地产十大领军企业等。 二十余年矢志耕耘，我们心系民生，回馈大众，面向未来“祥泰人”在做大做强与世界接轨的同时，更将继续为实现\"国家富强、民族复兴、人们都能过上美好生活\"的理想而努力！', '祥泰实业有限公司null于大卫舜华路2000号舜泰广场7号楼6层053181666708Liulili@samtak.cn32000 万元民营企业祥泰实业有限公司（以下简称“祥泰实业”）是一家集开发建设、建筑施工、国内外贸易、中介服务、物业管理等产业链环节于一体，住宅开发与商业地产运营并重的综合性房地产发展商。2009年进驻济南，注册资金3.2亿元，拥有20余家全资、控股公司，具有房地产开发一级、物业管理二级、装饰一体化二级、公路施工二级、园林施工三级等多项专业资质。 随着企业规模的不断扩大，祥泰实业正在被越来越多的消费者熟知和信赖，并在行业中取得了一系列成绩和荣誉。先后被评为：CIHAF2011中国房地产名企、中国房地产齐鲁名企大奖、中国房地产（齐鲁）领航企业、山东品质运营商、济南十大城市运营商、年度城市贡献房企、山东地产十大领军企业等。 二十余年矢志耕耘，我们心系民生，回馈大众，面向未来“祥泰人”在做大做强与世界接轨的同时，更将继续为实现\"国家富强、民族复兴、人们都能过上美好生活\"的理想而努力！');
INSERT INTO `reb` VALUES ('1495', '济南市市中区房地产开发（集团）总公司', 'http://www.jnfdc.gov.cn/kfqy/show/18ade412-4a54-4999-b743-fd6563ee99d4.shtml', '', '012399', '仲崇斋', '济南市英雄山路10号', '82078900', 'guihuabu209@126.com', '6000 万元', '国有企业', '济南市市中区房地产开发（集团）总公司成立于1985年，隶属于市中区人民政府，是经建设部审核批准的房地产开发资质壹级企业。组建二十年来。累计投资20多亿元，建成各类房屋260余万平方米，合格率100%，先后开发改造了回民小区、玉函小区、山景园小区、山景·明珠花园等十多个居民小区，建成了济南大厦、顺河商业街、新世界商城、中华名优小吃城等一批有影响的办公、商业及文教公益设施，盛负社会各界赞誉。特别是近年来开发建设的山景园小区、山景·明珠花园，公司在产品质量、设计、施工、配套、绿化、售后服务乃至项目命名等各方面都做出了不懈的努力，立志将小区建设成为我公司的品牌小区。公司适应市场需求，不断转换经营机制，坚持“用户至上，质量为本”的经营方针，内抓管理，外拓市场，企业综合经济实力及市场竞争力日趋增强。 公司内部管理机构完备，下设六部一室及物业、热力、建筑装修、建材等多家公司。2001年成立一家股份制公司。从前期设计到施工、到装修、到物业管理，对用户实行一条龙服务，避免开发、物业不是一家给用户带来的麻烦，最大限度地保护用户的利益。现有管理人员120余名，高级工程师9名，工程师27名，有专业技术职称者占90%以上，是一家以房地产开发经营为主的集团性公司。 公司现为建设部批准的房地产开发资质壹级公司，曾入选由国家建设部和统计局联合发布的中国房地产综合效益百强企业，山东省房地产开发百强企业，一直保持着济南市房地产开发“十佳”企业称号，2002年、2003年、2004年连续叁年评为济南市开发企业20强。2003年评为全国房地产联网直报先进企业。2004年评为济南市承诺销售放心单位、齐鲁名盘50强、文明鲁名企50强、守合同重信用企业。由公司开发管理的玉函南区曾被建设部评为“优秀物业管理小区”荣誉称号，并通过ISO9002的认证。', '济南市市中区房地产开发（集团）总公司null仲崇斋济南市英雄山路10号82078900guihuabu209@126.com6000 万元国有企业济南市市中区房地产开发（集团）总公司成立于1985年，隶属于市中区人民政府，是经建设部审核批准的房地产开发资质壹级企业。组建二十年来。累计投资20多亿元，建成各类房屋260余万平方米，合格率100%，先后开发改造了回民小区、玉函小区、山景园小区、山景·明珠花园等十多个居民小区，建成了济南大厦、顺河商业街、新世界商城、中华名优小吃城等一批有影响的办公、商业及文教公益设施，盛负社会各界赞誉。特别是近年来开发建设的山景园小区、山景·明珠花园，公司在产品质量、设计、施工、配套、绿化、售后服务乃至项目命名等各方面都做出了不懈的努力，立志将小区建设成为我公司的品牌小区。公司适应市场需求，不断转换经营机制，坚持“用户至上，质量为本”的经营方针，内抓管理，外拓市场，企业综合经济实力及市场竞争力日趋增强。 公司内部管理机构完备，下设六部一室及物业、热力、建筑装修、建材等多家公司。2001年成立一家股份制公司。从前期设计到施工、到装修、到物业管理，对用户实行一条龙服务，避免开发、物业不是一家给用户带来的麻烦，最大限度地保护用户的利益。现有管理人员120余名，高级工程师9名，工程师27名，有专业技术职称者占90%以上，是一家以房地产开发经营为主的集团性公司。 公司现为建设部批准的房地产开发资质壹级公司，曾入选由国家建设部和统计局联合发布的中国房地产综合效益百强企业，山东省房地产开发百强企业，一直保持着济南市房地产开发“十佳”企业称号，2002年、2003年、2004年连续叁年评为济南市开发企业20强。2003年评为全国房地产联网直报先进企业。2004年评为济南市承诺销售放心单位、齐鲁名盘50强、文明鲁名企50强、守合同重信用企业。由公司开发管理的玉函南区曾被建设部评为“优秀物业管理小区”荣誉称号，并通过ISO9002的认证。');
INSERT INTO `reb` VALUES ('1496', '山东连城置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/14885604-2348-4c9f-8d0e-9d0742e450bb.shtml', '', '012715', '陆建林', '济南市槐荫区段店路8号', '80679666', 'Lixuxu2003@yahoo.com.cn', '3000 万元', '民营企业', '山东连城置业有限公司成立于2005年九月二十九日，法定代表人陆建林，注册资本叁仟万元人民币，经营范围包括房地产的开发、销售、物业管理。 公司现有员工20余人，其中专业工程师及以上级别的人员约10人，均有丰富的房地产开发经营管理经验。 公司秉承以质量求生存、以信誉求发展的创业之路,雄厚的资金和人力资源为公司的发展奠定了基础。相信,在上级主管部门的监督下,公司员工齐心协力,发扬开拓、创新、拼搏、奉献的企业精神,走出一条自我发展的创业之路,为社会的发展做出贡献。', '山东连城置业有限公司null陆建林济南市槐荫区段店路8号80679666Lixuxu2003@yahoo.com.cn3000 万元民营企业山东连城置业有限公司成立于2005年九月二十九日，法定代表人陆建林，注册资本叁仟万元人民币，经营范围包括房地产的开发、销售、物业管理。 公司现有员工20余人，其中专业工程师及以上级别的人员约10人，均有丰富的房地产开发经营管理经验。 公司秉承以质量求生存、以信誉求发展的创业之路,雄厚的资金和人力资源为公司的发展奠定了基础。相信,在上级主管部门的监督下,公司员工齐心协力,发扬开拓、创新、拼搏、奉献的企业精神,走出一条自我发展的创业之路,为社会的发展做出贡献。');
INSERT INTO `reb` VALUES ('1497', '济南泰悦房地产开发集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/3100e0eb-cdbc-4882-8584-4b3795d599e2.shtml', '', '012742', '许金金', '济南市天桥区明湖西路1192号', '87157799', '35306555@qq.com', '30000 万元', '民营企业', '济南泰悦房地产开发集团有限公司位于济南市天桥区明湖西路1192号，注册资本三亿元整，项目为发祥福邸。', '济南泰悦房地产开发集团有限公司null许金金济南市天桥区明湖西路1192号8715779935306555@qq.com30000 万元民营企业济南泰悦房地产开发集团有限公司位于济南市天桥区明湖西路1192号，注册资本三亿元整，项目为发祥福邸。');
INSERT INTO `reb` VALUES ('1498', '山东地平置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/4a707145-46ef-4615-b6a9-23458e19fc52.shtml', '', '012737', '任鹤年', '济南市经十西路239号', '87299986', 'sddiping@runhua.com.cn', '15000 万元', '民营企业', '山东地平置业有限公司隶属于润华集团股份有限公司，是其全资子公司。润华集团股份有限公司是一家跨地区、跨行业、跨所有制的综合性大型股份制企业，山东省政府确定的全省首批51家现代企业制度试点单位之一。山东地平置业有限公司由润华集团2008年1月投资成立，注册资金2000万元。经营领域涉及房地产开发及销售，建筑及装饰材料、金属材料、五金交电销售。 公司现有职工18人。人员的专业、年龄搭配合理：既有高级经济师职称的管理人员、财务人员，又有高级工程师职称的专业技术人员；既具有丰富经验的中高级管理人员、又有具有良好专业基础朝气蓬勃的年轻员工。 我们正依靠高素质的员工，雄厚的资金支持，在工作进程之中兢兢业业、不断创新、不断前进，力争把最好的产品、最好的服务呈现在您的面前。', '山东地平置业有限公司null任鹤年济南市经十西路239号87299986sddiping@runhua.com.cn15000 万元民营企业山东地平置业有限公司隶属于润华集团股份有限公司，是其全资子公司。润华集团股份有限公司是一家跨地区、跨行业、跨所有制的综合性大型股份制企业，山东省政府确定的全省首批51家现代企业制度试点单位之一。山东地平置业有限公司由润华集团2008年1月投资成立，注册资金2000万元。经营领域涉及房地产开发及销售，建筑及装饰材料、金属材料、五金交电销售。 公司现有职工18人。人员的专业、年龄搭配合理：既有高级经济师职称的管理人员、财务人员，又有高级工程师职称的专业技术人员；既具有丰富经验的中高级管理人员、又有具有良好专业基础朝气蓬勃的年轻员工。 我们正依靠高素质的员工，雄厚的资金支持，在工作进程之中兢兢业业、不断创新、不断前进，力争把最好的产品、最好的服务呈现在您的面前。');
INSERT INTO `reb` VALUES ('1499', '济南东拓置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/51a1ccd2-5c58-465a-9e35-83ec5af15a33.shtml', '', '012535', '刘金辉', '山东省济南市高新区舜华路2000号舜泰广场6号楼3401室', '86518290', '2209449061@qq.com', '14000 万元', '国有企业', '济南东拓置业有限公司是在原济南高新区建设发展中心基础上经过企业公司制改制成立的专业房地产开发公司，系有限责任公司，注册资金1.4亿元，现有员工21人，具有大专以上学历和专业技术职称的占90％以上，企业成立以来，先后开发建设了齐鲁软件大厦、济南消防局高新区消防大厦、济南将军集团高新区车间及综合楼、雅居园小区，建筑面积20余万平米，开发的雅居园小区被建设部评为国家康居示范工程。 济南东拓置业有限公司以质量求生存，以企业服务为开发立足点，努力为高新区济南市打造上佳商务办公和居住环境，服务社会，造福于民。', '济南东拓置业有限公司null刘金辉山东省济南市高新区舜华路2000号舜泰广场6号楼3401室865182902209449061@qq.com14000 万元国有企业济南东拓置业有限公司是在原济南高新区建设发展中心基础上经过企业公司制改制成立的专业房地产开发公司，系有限责任公司，注册资金1.4亿元，现有员工21人，具有大专以上学历和专业技术职称的占90％以上，企业成立以来，先后开发建设了齐鲁软件大厦、济南消防局高新区消防大厦、济南将军集团高新区车间及综合楼、雅居园小区，建筑面积20余万平米，开发的雅居园小区被建设部评为国家康居示范工程。 济南东拓置业有限公司以质量求生存，以企业服务为开发立足点，努力为高新区济南市打造上佳商务办公和居住环境，服务社会，造福于民。');
INSERT INTO `reb` VALUES ('1500', '山东中齐房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/083818c6-2472-4069-809b-de5fff8a2a16.shtml', '', '012197', '赵喜传', '济南市历城区花园路21号5号楼', '88326333', '510461541@qq.com', '3000 万元', '民营企业', '山东中齐房地产开发有限公司成立于公元2000年，是经山东省工商行政管理局批准注册的具有独立法人资格的房地产开发公司。公司注册资金为3000万人民币，经营范围以房地产开发经营为主。 自公司成立以来，先后开发了齐鲁世纪园、泉印兰亭、锦绣泉城等项目，深受市场追捧与好评。其中锦绣泉城为在建在售项目，该项目立志重现济南名泉印痕，循一路叮咚，带领人们回归古典的、优雅的济南人依泉而居生活，并传承济南传统人文精神，融合现代时尚元素，演绎一种本土、纯粹又现代的生活方式。 公司坚持以对社会、客户和企业声誉负责的精神精雕细琢项目和产品的每一个细节，致力于为社会和消费者提供优秀的、经得起时间考验的房地产产品，为消费者创造最温馨的家园！ ●中齐的使命： 中蕴诚信 齐志利万家 ●中齐品牌核心：城市个性生活的塑造者 城市人文精神的守望者 ●中齐品牌利益：守望城市个性的理想生活 ●中齐品牌口号：守望城市美好家园', '山东中齐房地产开发有限公司null赵喜传济南市历城区花园路21号5号楼88326333510461541@qq.com3000 万元民营企业山东中齐房地产开发有限公司成立于公元2000年，是经山东省工商行政管理局批准注册的具有独立法人资格的房地产开发公司。公司注册资金为3000万人民币，经营范围以房地产开发经营为主。 自公司成立以来，先后开发了齐鲁世纪园、泉印兰亭、锦绣泉城等项目，深受市场追捧与好评。其中锦绣泉城为在建在售项目，该项目立志重现济南名泉印痕，循一路叮咚，带领人们回归古典的、优雅的济南人依泉而居生活，并传承济南传统人文精神，融合现代时尚元素，演绎一种本土、纯粹又现代的生活方式。 公司坚持以对社会、客户和企业声誉负责的精神精雕细琢项目和产品的每一个细节，致力于为社会和消费者提供优秀的、经得起时间考验的房地产产品，为消费者创造最温馨的家园！ ●中齐的使命： 中蕴诚信 齐志利万家 ●中齐品牌核心：城市个性生活的塑造者 城市人文精神的守望者 ●中齐品牌利益：守望城市个性的理想生活 ●中齐品牌口号：守望城市美好家园');
INSERT INTO `reb` VALUES ('1501', '山东国华时代投资发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/67af64d8-a79c-4683-8a9e-eb69e7122b73.shtml', '', '012122', '宫宇飞', '济南市市中区旅游路28666号1区8号楼', '88388999', '', '5000 万元', '国有企业', '山东国华时代投资发展有限公司（以下简称我公司）的前身是济南国华置业有限公司，于2000年6月17日经济南市工商局注册成立，目前注册资本5000万元，具有房地产开发企业二级资质。主营房地产开发，兼营物业及其它主业延伸。 我公司的总公司——国华能源投资有限公司是经国务院批准成立的国有独资公司,隶属于中央53家大型国有骨干企业神华集团公司。我公司投资北京国华建筑设备租赁有限公司，拥有20％的股份。 作为国华公司在山东的全资子公司，我公司自成立以来，始终坚持“以人为本、勤奋好学、爱岗敬业、团结协作、稳步经营、健康生活”的国华企业精神，形成了“以精品求生存、以品牌求发展”的经营理念，坚持精简高效、一岗多责、一专多能的定位和用人原则，目前公司共有员工45人，平均年龄不到35岁，绝大部分具备大专以上文化水平。经验丰富、作风优良的高素质员工队伍为公司的稳步、快速、持续、健康发展奠定了坚实的基础。至2004年底公司资产总额86105万元，当年实现利润2808.72万元，上缴税金1840.67万元。 目前，我公司立足济南，面向山东，在泰安、青岛等地投资成立了全资、控股公司，开发经营了五个房地产项目。 济南国华经典一期项目----项目位于市解放路30-1号，占地40亩，建有一座高层商务写字楼，两座高层公寓和四座小高层公寓，总建筑面积10万平方米，总投资4亿元人民币。整体建筑风格简洁、实用并具现代感。小区配套设施齐全，内设游泳馆、多功能健身房、购物超市等，室外配置儿童老人活动场地，大面积绿地为居民提供了安静、健康、环保环境，整个小区实行全封闭式智能化管理。小区几年来先后荣获济南市“精品工程”、“双十佳住宅”、“典范写字楼”和济南市“安静居住小区”等多项荣誉称号，公司也荣获“2003年济南地产品牌企业”称号。项目于2004年底实现销售封盘，取得了良好的经济效益。它的成功运作，为公司在济南乃至山东房地产界赢得了良好的声誉。', '山东国华时代投资发展有限公司null宫宇飞济南市市中区旅游路28666号1区8号楼883889995000 万元国有企业山东国华时代投资发展有限公司（以下简称我公司）的前身是济南国华置业有限公司，于2000年6月17日经济南市工商局注册成立，目前注册资本5000万元，具有房地产开发企业二级资质。主营房地产开发，兼营物业及其它主业延伸。 我公司的总公司——国华能源投资有限公司是经国务院批准成立的国有独资公司,隶属于中央53家大型国有骨干企业神华集团公司。我公司投资北京国华建筑设备租赁有限公司，拥有20％的股份。 作为国华公司在山东的全资子公司，我公司自成立以来，始终坚持“以人为本、勤奋好学、爱岗敬业、团结协作、稳步经营、健康生活”的国华企业精神，形成了“以精品求生存、以品牌求发展”的经营理念，坚持精简高效、一岗多责、一专多能的定位和用人原则，目前公司共有员工45人，平均年龄不到35岁，绝大部分具备大专以上文化水平。经验丰富、作风优良的高素质员工队伍为公司的稳步、快速、持续、健康发展奠定了坚实的基础。至2004年底公司资产总额86105万元，当年实现利润2808.72万元，上缴税金1840.67万元。 目前，我公司立足济南，面向山东，在泰安、青岛等地投资成立了全资、控股公司，开发经营了五个房地产项目。 济南国华经典一期项目----项目位于市解放路30-1号，占地40亩，建有一座高层商务写字楼，两座高层公寓和四座小高层公寓，总建筑面积10万平方米，总投资4亿元人民币。整体建筑风格简洁、实用并具现代感。小区配套设施齐全，内设游泳馆、多功能健身房、购物超市等，室外配置儿童老人活动场地，大面积绿地为居民提供了安静、健康、环保环境，整个小区实行全封闭式智能化管理。小区几年来先后荣获济南市“精品工程”、“双十佳住宅”、“典范写字楼”和济南市“安静居住小区”等多项荣誉称号，公司也荣获“2003年济南地产品牌企业”称号。项目于2004年底实现销售封盘，取得了良好的经济效益。它的成功运作，为公司在济南乃至山东房地产界赢得了良好的声誉。');
INSERT INTO `reb` VALUES ('1502', '山东丰润置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/5c65e5a9-452c-4b42-ac42-c7ecd6865723.shtml', '', '012536', '张龙涛', '山东省济南市历下区解放路12号', '85120267', 'frzy@163.com', '6000 万元', '民营企业', '山东丰润置业投资（集团）有限公司前身是山东嘉和实业有限公司。经过若干年的规范发展，已具有一定规模。丰润集团注册资本金3000万元，现有资产3.3亿元，员工队伍近700人。具有博士学位的2人、硕士学位的8人、大学学历的近40人。公司高管人员中大学以上学历的占80%以上。丰润集团目前拥有六家控股、参股公司，已形成以房地产开发为主，包括房地产咨询策划、营销策划、物业管理、宾馆业、休闲旅游业、矿山开采及对外投资参股等多元化产业的集团公司。丰润集团目前全资公司有：山东嘉和明珠餐饮有限公司、山东润丰开发置业有限公司及济南润业房地产开发有限公司。集团公司构架设置：运营中心、管理中心、资金结算管理中心、财务部、审计部、人力资源部、市场营销拓展部、董事长办公室及行政中心等部门。 丰润集团的企业理念是“诚信勤奋、创新求精、合作共赢”，秉承“认真做人、踏实做事”的企业作风，坚持“精细化管理、专业化运作”的管理理念。在企业的运作过程中始终注重企业品牌的建立和发展。“不只要开发能够开发的房屋，更要开发消费者想购买的房屋”是丰润集团一贯的原则。“让业主入住后满意”的实实在在的品牌承诺，使丰润集团在房地产市场中形成了良好的声誉。集团公司下属的全资子公司润业房地产开发有限公司连年被相关媒体和上级部门评为：山东地产年度最具性价比楼盘；2006年度其所开发的楼盘获得中国最佳户型设计奖；评为山东住交会06年度齐鲁名盘50强等诸多奖项。集团董事长李雷同志05-07年度先后连续获得济南市“五?一”劳动奖章、济南市劳动模范奖章、济南市青年企业家；2006年被中国国土资源部选为珍爱土地年度贡献人物；2007年被评为济南市道德模范等荣誉。', '山东丰润置业有限公司null张龙涛山东省济南市历下区解放路12号85120267frzy@163.com6000 万元民营企业山东丰润置业投资（集团）有限公司前身是山东嘉和实业有限公司。经过若干年的规范发展，已具有一定规模。丰润集团注册资本金3000万元，现有资产3.3亿元，员工队伍近700人。具有博士学位的2人、硕士学位的8人、大学学历的近40人。公司高管人员中大学以上学历的占80%以上。丰润集团目前拥有六家控股、参股公司，已形成以房地产开发为主，包括房地产咨询策划、营销策划、物业管理、宾馆业、休闲旅游业、矿山开采及对外投资参股等多元化产业的集团公司。丰润集团目前全资公司有：山东嘉和明珠餐饮有限公司、山东润丰开发置业有限公司及济南润业房地产开发有限公司。集团公司构架设置：运营中心、管理中心、资金结算管理中心、财务部、审计部、人力资源部、市场营销拓展部、董事长办公室及行政中心等部门。 丰润集团的企业理念是“诚信勤奋、创新求精、合作共赢”，秉承“认真做人、踏实做事”的企业作风，坚持“精细化管理、专业化运作”的管理理念。在企业的运作过程中始终注重企业品牌的建立和发展。“不只要开发能够开发的房屋，更要开发消费者想购买的房屋”是丰润集团一贯的原则。“让业主入住后满意”的实实在在的品牌承诺，使丰润集团在房地产市场中形成了良好的声誉。集团公司下属的全资子公司润业房地产开发有限公司连年被相关媒体和上级部门评为：山东地产年度最具性价比楼盘；2006年度其所开发的楼盘获得中国最佳户型设计奖；评为山东住交会06年度齐鲁名盘50强等诸多奖项。集团董事长李雷同志05-07年度先后连续获得济南市“五?一”劳动奖章、济南市劳动模范奖章、济南市青年企业家；2006年被中国国土资源部选为珍爱土地年度贡献人物；2007年被评为济南市道德模范等荣誉。');
INSERT INTO `reb` VALUES ('1503', '济南东城建设置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d20d0a01-39b5-4131-ad28-ee69b5e3d789.shtml', '', '012794', '杨恺明', '明塘路西侧（明堂街2455号）5#楼2-3层', '83266377', 'dczy2010@126.com', '3000 万元', '民营企业', '', '济南东城建设置业有限公司null杨恺明明塘路西侧（明堂街2455号）5#楼2-3层83266377dczy2010@126.com3000 万元民营企业');
INSERT INTO `reb` VALUES ('1504', '山东新地置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b4333ea1-9fbc-4bac-8d5e-ea4b2ec63b3c.shtml', '', '012191', '杨连玉', '济南市长清区宾谷街东段路北', '0531-87216098', '', '5000 万元', '', '企业简介 　　 济南新地房地产开发有限公司成立于2001年10月,注册资本2100万元.属股份制有限公司，具有房地产开发三级资质，经营范围涉及房地产开发和商品房销售． 公司制度健全，管理严谨，现有管理体制人员１４人，其中高级工程师、注册会计师、造价工程师各一人，中级职称以上管理人员11人，具有较强的管理能力和决策能力。 公司自成立以来，以“建人民满意的房子，做客户满意的服务”为宗旨，先后开发了峰山路沿街综合楼、宾谷街沿街综合楼、国泰小区、文昌山庄别墅区、鸣泉嘉园等项目，共计10余万平方米，是长清区纳税务局先进单位，并被济南市消费者协会评为“消费者满意单位”，被济南工商局评为“重合同守信用企业”等荣誉称号，受到社会各界及用户的赞誉和认可，取得了经济效益和社会效益的双丰收。 面对政策、经济、文化带来的良好机遇，公司将坚持以客户需求为导向，以客户满意为目标，不断推出更多更好的精品楼盘，促进长清经济的快速发展。济南新地房地产开发有限公司董事长杨连玉携全体员工共创美好未来。', '山东新地置业有限公司null杨连玉济南市长清区宾谷街东段路北0531-872160985000 万元企业简介 　　 济南新地房地产开发有限公司成立于2001年10月,注册资本2100万元.属股份制有限公司，具有房地产开发三级资质，经营范围涉及房地产开发和商品房销售． 公司制度健全，管理严谨，现有管理体制人员１４人，其中高级工程师、注册会计师、造价工程师各一人，中级职称以上管理人员11人，具有较强的管理能力和决策能力。 公司自成立以来，以“建人民满意的房子，做客户满意的服务”为宗旨，先后开发了峰山路沿街综合楼、宾谷街沿街综合楼、国泰小区、文昌山庄别墅区、鸣泉嘉园等项目，共计10余万平方米，是长清区纳税务局先进单位，并被济南市消费者协会评为“消费者满意单位”，被济南工商局评为“重合同守信用企业”等荣誉称号，受到社会各界及用户的赞誉和认可，取得了经济效益和社会效益的双丰收。 面对政策、经济、文化带来的良好机遇，公司将坚持以客户需求为导向，以客户满意为目标，不断推出更多更好的精品楼盘，促进长清经济的快速发展。济南新地房地产开发有限公司董事长杨连玉携全体员工共创美好未来。');
INSERT INTO `reb` VALUES ('1505', '山东高速置业发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d3ffa8ca-c1d7-4a67-9c4e-65f1310e931a.shtml', '', '012755', '李占辰', '济南市历下区和平路36号', '81307729', 'gaosuzhiye@163.com', '20000 万元', '国有企业', '山东高速置业发展有限公司隶属于山东省高速公路集团有限公司，是在原山东省路桥房地产开发有限公司基础上重组而成。公司注册资本1亿元人民币，由山东省高速公路集团有限公司、山东省路桥集团有限公司和山东省鲁桥建设有限公司出资组建，分别占注册资本70％、18％、和12％。 公司的经营范围是：房地产开发、经营，物业管理，建筑材料、水暖器材、建筑电器经营等。公司遵循经济效益与社会责任并生的原则，坚持诚信经营、和谐发展的宗旨，立足山东高速集团内部土地资源的整合与开发，积极参加政府组织的旧城改造和经济使用房建设，发挥资金优势，慎选合作伙伴走联合开发之路，适度开展全流程商业化的房地产开放项目。 组织架构：公司设有股东会、董事会和执行监事。董事会成员5人，设董事长、副董事长各1名;执行监事1名。公司设有综合部、投资开发部、财务部、工程项目部、营销部等部门，总部人员编制40人。', '山东高速置业发展有限公司null李占辰济南市历下区和平路36号81307729gaosuzhiye@163.com20000 万元国有企业山东高速置业发展有限公司隶属于山东省高速公路集团有限公司，是在原山东省路桥房地产开发有限公司基础上重组而成。公司注册资本1亿元人民币，由山东省高速公路集团有限公司、山东省路桥集团有限公司和山东省鲁桥建设有限公司出资组建，分别占注册资本70％、18％、和12％。 公司的经营范围是：房地产开发、经营，物业管理，建筑材料、水暖器材、建筑电器经营等。公司遵循经济效益与社会责任并生的原则，坚持诚信经营、和谐发展的宗旨，立足山东高速集团内部土地资源的整合与开发，积极参加政府组织的旧城改造和经济使用房建设，发挥资金优势，慎选合作伙伴走联合开发之路，适度开展全流程商业化的房地产开放项目。 组织架构：公司设有股东会、董事会和执行监事。董事会成员5人，设董事长、副董事长各1名;执行监事1名。公司设有综合部、投资开发部、财务部、工程项目部、营销部等部门，总部人员编制40人。');
INSERT INTO `reb` VALUES ('1506', '济南楚天置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d8acd36a-2d41-40ad-a82a-1d636da802f5.shtml', '', '012194', '张勇', '济南市历下区解放东路95号院内东楼310室', '88025188', '351055380@qq.com', '5000 万元', '民营企业', '济南楚天置业有限公司成立于2000年7月1日，主要从事房地产开发、销售及信息咨询服务业务。2001年5月，经山东省建设厅批准为房地产开发叁级资质企业。公司成立以来，得到了各级政府、工商、税务、建委及有关部门的大力支持，近几年，公司各项业务有了长足的发展。本公司十分注重科技开发和人才的培训工作，现有高、中级各类管理人员28人，全部在岗管理人员30余人。公司以优质高效、信守合同为宗旨，近几年开发建设的项目，受到了广大业主和社会的一致好评。本公司管理原则恪守质量第一、信誉至上，产值利润连年提高，公司发展进入快轨道。公司真诚欢迎各界领导给予大力支持和帮助，真诚欢迎各位领导为公司的发展提供宝贵意见。', '济南楚天置业有限公司null张勇济南市历下区解放东路95号院内东楼310室88025188351055380@qq.com5000 万元民营企业济南楚天置业有限公司成立于2000年7月1日，主要从事房地产开发、销售及信息咨询服务业务。2001年5月，经山东省建设厅批准为房地产开发叁级资质企业。公司成立以来，得到了各级政府、工商、税务、建委及有关部门的大力支持，近几年，公司各项业务有了长足的发展。本公司十分注重科技开发和人才的培训工作，现有高、中级各类管理人员28人，全部在岗管理人员30余人。公司以优质高效、信守合同为宗旨，近几年开发建设的项目，受到了广大业主和社会的一致好评。本公司管理原则恪守质量第一、信誉至上，产值利润连年提高，公司发展进入快轨道。公司真诚欢迎各界领导给予大力支持和帮助，真诚欢迎各位领导为公司的发展提供宝贵意见。');
INSERT INTO `reb` VALUES ('1507', '商河县鑫隆房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8e1801b2-278d-4140-a635-beda897c2ebe.shtml', '', '012786', '尚开义', '商河县武夷山御泉名城A区7号楼1单元401室', '053182541680', '', '3000 万元', '民营企业', '商河县鑫隆房地产开发有限公司是2010年投资成立的一家房地产开发企业，具有房地产开发资质，公司注册资金1000万元，现有在职职工38人，其中中级以上职称20人。公司按照现代企业制度的管理模式，遵循有限公司制度的运作方式，下设人力资源部、企划营销部、工程部、财务部，在总经理的领导下，通力合作，相互协调，初步形成了一个上进、勇于开拓的企业团队。公司始终坚持以市场为导向、开发为重点，经营为龙头，质量为根本的开发理念和经营方针，切实转变观念，解放思想，紧紧围绕市场狠抓经营，强化管理，树立责任感、认识危机感；不断留意和观察房地产市场行情，积极寻求探索与市场机制相适应的经营策略和经营方针，走品牌化之路。 公司竭诚希望与社会各界携手并进，共谋发展，同创美好未来。', '商河县鑫隆房地产开发有限公司null尚开义商河县武夷山御泉名城A区7号楼1单元401室0531825416803000 万元民营企业商河县鑫隆房地产开发有限公司是2010年投资成立的一家房地产开发企业，具有房地产开发资质，公司注册资金1000万元，现有在职职工38人，其中中级以上职称20人。公司按照现代企业制度的管理模式，遵循有限公司制度的运作方式，下设人力资源部、企划营销部、工程部、财务部，在总经理的领导下，通力合作，相互协调，初步形成了一个上进、勇于开拓的企业团队。公司始终坚持以市场为导向、开发为重点，经营为龙头，质量为根本的开发理念和经营方针，切实转变观念，解放思想，紧紧围绕市场狠抓经营，强化管理，树立责任感、认识危机感；不断留意和观察房地产市场行情，积极寻求探索与市场机制相适应的经营策略和经营方针，走品牌化之路。 公司竭诚希望与社会各界携手并进，共谋发展，同创美好未来。');
INSERT INTO `reb` VALUES ('1508', '济南建邦置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/915c802f-f227-4cec-853d-e5161a90b0c4.shtml', '', '012740', '陈志承', '济南市长清区海棠路5555号', '83186500', '', '8000 万元', '国有企业', '', '济南建邦置业有限公司null陈志承济南市长清区海棠路5555号831865008000 万元国有企业');
INSERT INTO `reb` VALUES ('1509', '山东福创置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a073b566-383c-4cc7-a907-f024eed22972.shtml', '', '012482', '吴锡琛', '山东省章丘市明水经济开发区办公大楼6楼618室', '83227711', '53515826@qq.com', '888.88 万元', '中外合资经营企业', '山东福创置业有限公司是福泰集团发展有限公司响应山东省政府发展济南大城市框架的号召，在济南章丘市投资成立的一家中外合资企业。本公司在章丘市的注册资本为888.88万美元，主要从事房地产开发与经营及商业服务设施的建设为经营。', '山东福创置业有限公司null吴锡琛山东省章丘市明水经济开发区办公大楼6楼618室8322771153515826@qq.com888.88 万元中外合资经营企业山东福创置业有限公司是福泰集团发展有限公司响应山东省政府发展济南大城市框架的号召，在济南章丘市投资成立的一家中外合资企业。本公司在章丘市的注册资本为888.88万美元，主要从事房地产开发与经营及商业服务设施的建设为经营。');
INSERT INTO `reb` VALUES ('1510', '银丰地产集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/867ddef5-04d7-4f7b-9671-13edb81cd90a.shtml', '', '012225', '刘旭', '济南市市中区历阳大街六号银丰大厦', '89019777', '345074490@qq.com', '68000 万元', '民营企业', '济南银丰房地产开发有限公司成立于2001年4月，注册资本9500万元，具房地产开发企业三级资质。 公司实行董事会领导下的总经理负责制，目前设立综合管理部、计划财务部、合约审计部、开发部、设计部、工程管理部、材料采购部、营销策划部等部门。现有经营管理人员14人，具中、高级职称的专业技术人员29人。公司组织机构健全，分工明确，层次分明，构建了一套科学的经营管理系统，企业运作高效有序。在以人为本的思想指导下，公司确立了“诚信做人、认真做事、张弛有度、开拓进取”的企业理念。在公司文化建设上，以打造一支能征善战的优秀团队为目标，点燃激情，激励斗志，不断增强企业的凝聚力，培育团队精神。', '银丰地产集团有限公司null刘旭济南市市中区历阳大街六号银丰大厦89019777345074490@qq.com68000 万元民营企业济南银丰房地产开发有限公司成立于2001年4月，注册资本9500万元，具房地产开发企业三级资质。 公司实行董事会领导下的总经理负责制，目前设立综合管理部、计划财务部、合约审计部、开发部、设计部、工程管理部、材料采购部、营销策划部等部门。现有经营管理人员14人，具中、高级职称的专业技术人员29人。公司组织机构健全，分工明确，层次分明，构建了一套科学的经营管理系统，企业运作高效有序。在以人为本的思想指导下，公司确立了“诚信做人、认真做事、张弛有度、开拓进取”的企业理念。在公司文化建设上，以打造一支能征善战的优秀团队为目标，点燃激情，激励斗志，不断增强企业的凝聚力，培育团队精神。');
INSERT INTO `reb` VALUES ('1511', '济南铁路房产建设集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c0c71cd0-671f-4b76-bd38-d2742dd8cfcc.shtml', '', '012833', '孙向阳', '济南市天桥区车站街30号', '82422303', 'yzfdckfzz@163.com', '26737.5 万元', '国有企业', '企业简介： 我公司成立于1993年1月1日，原企业名称为：济南铁路局房地产开发公司，2006年11月经济南市工商行政管理局核准更名为：济南铁路房产建设集团有限公司。注册地址：济南市天桥区车站街30号，注册资本：1800万元整。公司类型：法人独资的有限责任公司。法人代表：法建堂。经营范围：房地产开发，房屋建筑物维修，建筑工程施工，土石方施工，园林绿化，制冷供暖、压力管道维修，机电设备安装；铝、塑钢门窗、涂料加工生产；物业管理，房屋信息中介；建筑设计。 我公司是按照济南铁路局、路局党委关于加快辅业发展的总体要求，为加快职工住房建设，稳步推进房地产业发展，经路局党政联席会议研究决定，组建济南铁路房产建设集团有限公司（济南铁路局职工住宅建设指挥部）。公司是全局7个房建单位，济南铁路局建设项目管理中心以及改制前“济南铁路分局建设项目管理中心”所属房建部门的上级主管单位。公司现有机关职工38人，其中公司领导7人，内部管理机构为25人，公司内部管理机构设置：综合部、计划财务部、人力资源部、安全质量部、经营开发部、党群工作部、行政检察部、技术设备部。主要负责济南铁路局住宅建设和房地产开发，承担着全局职工住宅建设的实施任务。', '济南铁路房产建设集团有限公司null孙向阳济南市天桥区车站街30号82422303yzfdckfzz@163.com26737.5 万元国有企业企业简介： 我公司成立于1993年1月1日，原企业名称为：济南铁路局房地产开发公司，2006年11月经济南市工商行政管理局核准更名为：济南铁路房产建设集团有限公司。注册地址：济南市天桥区车站街30号，注册资本：1800万元整。公司类型：法人独资的有限责任公司。法人代表：法建堂。经营范围：房地产开发，房屋建筑物维修，建筑工程施工，土石方施工，园林绿化，制冷供暖、压力管道维修，机电设备安装；铝、塑钢门窗、涂料加工生产；物业管理，房屋信息中介；建筑设计。 我公司是按照济南铁路局、路局党委关于加快辅业发展的总体要求，为加快职工住房建设，稳步推进房地产业发展，经路局党政联席会议研究决定，组建济南铁路房产建设集团有限公司（济南铁路局职工住宅建设指挥部）。公司是全局7个房建单位，济南铁路局建设项目管理中心以及改制前“济南铁路分局建设项目管理中心”所属房建部门的上级主管单位。公司现有机关职工38人，其中公司领导7人，内部管理机构为25人，公司内部管理机构设置：综合部、计划财务部、人力资源部、安全质量部、经营开发部、党群工作部、行政检察部、技术设备部。主要负责济南铁路局住宅建设和房地产开发，承担着全局职工住宅建设的实施任务。');
INSERT INTO `reb` VALUES ('1512', '济南蓝石田源置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a1f6da0f-f007-4b80-871a-d6f847511912.shtml', '', '012736', '陈敬伟', '经十西路2999号大溪地花园入口公建', '82677773', 'lszhywb@163.com', '10000 万元', '民营企业', '济南蓝石田源置业有限公司成立于2006年6月，公司注册资金2000万元，目前公司已经通过招牌挂取得275亩土地的开发使用权。', '济南蓝石田源置业有限公司null陈敬伟经十西路2999号大溪地花园入口公建82677773lszhywb@163.com10000 万元民营企业济南蓝石田源置业有限公司成立于2006年6月，公司注册资金2000万元，目前公司已经通过招牌挂取得275亩土地的开发使用权。');
INSERT INTO `reb` VALUES ('1513', '山东中润置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d8e57396-61c9-4435-9576-066fba61b41b.shtml', '', '002315', '马庆军', '济南市历下区经十路12111号中润世纪中心1号楼', '88196601', '', '5000 万元', '民营企业', '1996年4月 成立山东中润装饰防腐工程有限公司 1999年12月 更名为山东中润置业有限公司 1997年5月-2000年4月 开发完成中润裕华园小区 1998年1月-2000年12月 开发完成中润富华园小区 1999年1月-2000年12月 开发完成中润文东裕华园小区 2001年10月-2003年12月 开发完成中润世纪城一期 2004年1月-今 开发中润世纪城二期 累计开发22.4万平方米，完成投资6.6亿元 山东中润置业有限公司是一家具有一级开发资质的房地产开发企业，先后开发了“中润裕华园”“中润富华园”“文东裕华园”等高尚社区，销售率100％，正在开发建设的“中润世纪城”项目，充分展现了公司“诚信经营，服务创新”的经营理年。 公司先后被评为\"济南市十佳房地产开发企业\"“济南市先进民营企业”“济南市纳税明星企业”等荣誉称号', '山东中润置业有限公司null马庆军济南市历下区经十路12111号中润世纪中心1号楼881966015000 万元民营企业1996年4月 成立山东中润装饰防腐工程有限公司 1999年12月 更名为山东中润置业有限公司 1997年5月-2000年4月 开发完成中润裕华园小区 1998年1月-2000年12月 开发完成中润富华园小区 1999年1月-2000年12月 开发完成中润文东裕华园小区 2001年10月-2003年12月 开发完成中润世纪城一期 2004年1月-今 开发中润世纪城二期 累计开发22.4万平方米，完成投资6.6亿元 山东中润置业有限公司是一家具有一级开发资质的房地产开发企业，先后开发了“中润裕华园”“中润富华园”“文东裕华园”等高尚社区，销售率100％，正在开发建设的“中润世纪城”项目，充分展现了公司“诚信经营，服务创新”的经营理年。 公司先后被评为\"济南市十佳房地产开发企业\"“济南市先进民营企业”“济南市纳税明星企业”等荣誉称号');
INSERT INTO `reb` VALUES ('1514', '济南华凯源置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a7959ff7-ec14-4d51-97dd-45381807e41b.shtml', '', '012289', '王金忠', '济阳县济北开发区龙海私营园龙海路东侧海天街北侧办公楼二楼', '84232158', '15866677351@126.com', '5500 万元', '民营企业', '企业简介 济南华凯源置业有限公司成立于2002年5月，是集房地产开发、建材经营、公民建筑工程施工、地基基础工程施工的等综合性企业，房地产开发资质贰级，注册资金5500万元，具有年开发十万平方米能力，该公司人员63人，下设财务部、营销部、工程技术部、核算部及行政办公室5个部门。 先后开发完成了济南济北私营园、济北新世纪商贸城、华宇舜苑小区、乐陵富贵华府住宅小区、济阳万鑫舜花园、美凯龙住宅小区、金色家园住宅小区、济阳盛世瑞城小区、运河鑫城住宅小区等项目，完成销售额达9.618亿元；公司投资代建了济阳劳动就业培训中心、民政局星光之家综合楼、中国农村信用社济阳分社写字楼、福建达利食品有限公司济南分公司、新阳煤矿生活区住宅工程等工程，累计投资达5.16亿元。在建的开发项目有禹城市辛寨梁河社区、平原王庙后王明社区、德州运河鑫城住宅小区、鑫星国际商业写字间项目。 　　　公司成立以来一直遵照“惠民筑业、卓越高效”的企业精神，秉承“关注顾客、开拓进取、铸造精品、诚信为本”的质量方针，作风稳健，信誉卓著，公司连续三年被评为“市级重合同守信誉”企业，合同履行率99%，商品房销售满意率98%以上. TEC.0531---84232158 住址:济北开发区开元大街龙海路南段东侧', '济南华凯源置业有限公司null王金忠济阳县济北开发区龙海私营园龙海路东侧海天街北侧办公楼二楼8423215815866677351@126.com5500 万元民营企业企业简介 济南华凯源置业有限公司成立于2002年5月，是集房地产开发、建材经营、公民建筑工程施工、地基基础工程施工的等综合性企业，房地产开发资质贰级，注册资金5500万元，具有年开发十万平方米能力，该公司人员63人，下设财务部、营销部、工程技术部、核算部及行政办公室5个部门。 先后开发完成了济南济北私营园、济北新世纪商贸城、华宇舜苑小区、乐陵富贵华府住宅小区、济阳万鑫舜花园、美凯龙住宅小区、金色家园住宅小区、济阳盛世瑞城小区、运河鑫城住宅小区等项目，完成销售额达9.618亿元；公司投资代建了济阳劳动就业培训中心、民政局星光之家综合楼、中国农村信用社济阳分社写字楼、福建达利食品有限公司济南分公司、新阳煤矿生活区住宅工程等工程，累计投资达5.16亿元。在建的开发项目有禹城市辛寨梁河社区、平原王庙后王明社区、德州运河鑫城住宅小区、鑫星国际商业写字间项目。 　　　公司成立以来一直遵照“惠民筑业、卓越高效”的企业精神，秉承“关注顾客、开拓进取、铸造精品、诚信为本”的质量方针，作风稳健，信誉卓著，公司连续三年被评为“市级重合同守信誉”企业，合同履行率99%，商品房销售满意率98%以上. TEC.0531---84232158 住址:济北开发区开元大街龙海路南段东侧');
INSERT INTO `reb` VALUES ('1515', '山东金羚置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/81a9b96e-ddef-4733-b5e0-634863ef3cd2.shtml', '', '012117', '杨金峰', '济南市槐荫区南辛庄西路50号', '82919777', 'sdjlzy@163.com', '3000 万元', '国有企业', '山东金羚置业有限公司隶属于山东金羚集团。山东金羚集团是一家集毛纺、药业、房地产、航运、国际贸易和餐饮服务为一体的综合性集团公司。公司是在始建于1995年的山东金羚毛纺有限公司的基础上发展而来的，自创建以来，集团以创建一流的公司为抱负，基业长青为使命，本着以人为本，积极进取，开拓创新的理念不断壮大，凭借清晰的经营理念和浓郁鲜明的企业文化，精心打造具有自身特色的优秀品牌企业。经过多年的努力拼搏，已成为具有相当规模的产权多元化、经营多角化、投资多方位的集团公司，现拥有山东金羚毛纺有限公司，山东天顺药业股份有限公司，山东金羚置业有限公司、山东金羚置业（青岛）有限公司、山东金羚置业无棣分公司，山东金羚置业阳信分公司，上海硕今船务有限公司等企业，分布在滨州、济南、青岛、上海等地。集团现有员工1000多人，资产近10亿元，年实现利税近亿元。', '山东金羚置业有限公司null杨金峰济南市槐荫区南辛庄西路50号82919777sdjlzy@163.com3000 万元国有企业山东金羚置业有限公司隶属于山东金羚集团。山东金羚集团是一家集毛纺、药业、房地产、航运、国际贸易和餐饮服务为一体的综合性集团公司。公司是在始建于1995年的山东金羚毛纺有限公司的基础上发展而来的，自创建以来，集团以创建一流的公司为抱负，基业长青为使命，本着以人为本，积极进取，开拓创新的理念不断壮大，凭借清晰的经营理念和浓郁鲜明的企业文化，精心打造具有自身特色的优秀品牌企业。经过多年的努力拼搏，已成为具有相当规模的产权多元化、经营多角化、投资多方位的集团公司，现拥有山东金羚毛纺有限公司，山东天顺药业股份有限公司，山东金羚置业有限公司、山东金羚置业（青岛）有限公司、山东金羚置业无棣分公司，山东金羚置业阳信分公司，上海硕今船务有限公司等企业，分布在滨州、济南、青岛、上海等地。集团现有员工1000多人，资产近10亿元，年实现利税近亿元。');
INSERT INTO `reb` VALUES ('1516', '德州市鲁班房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/f96724fb-d1cd-447c-9906-bf56e579a71e.shtml', '', '132094', '甄宗杰', '济南市历下区旅游路26188号', '82677277', '958743038@qq.com', '3000 万元', '国有企业', '德州市鲁班房地产开发有限公司成立于2002年10月29日，隶属于德州市公路管理局，是一家集房地产开发、物业管理、建材销售、房地产业务咨询等为一体的综合型企业。公司注册资本3000万元，属房产开发二级资质。公司先后获得德州市房地产十强企业、十佳诚信房地产企业，消费者满意单位、重信用守合同企业等称号。公司拥有一支高素质、高效率的专业人才队伍，现有员工60余人，其中本科以上学历占70%，中、高级职称30多人。公司自02年成立以来，在德州市公路局领导的大力支持下，取得了长足发展。先后开发了“尚东-公路小区”、“鲁班御景园”、“鲁班紫麟阁”等住宅项目。', '德州市鲁班房地产开发有限公司null甄宗杰济南市历下区旅游路26188号82677277958743038@qq.com3000 万元国有企业德州市鲁班房地产开发有限公司成立于2002年10月29日，隶属于德州市公路管理局，是一家集房地产开发、物业管理、建材销售、房地产业务咨询等为一体的综合型企业。公司注册资本3000万元，属房产开发二级资质。公司先后获得德州市房地产十强企业、十佳诚信房地产企业，消费者满意单位、重信用守合同企业等称号。公司拥有一支高素质、高效率的专业人才队伍，现有员工60余人，其中本科以上学历占70%，中、高级职称30多人。公司自02年成立以来，在德州市公路局领导的大力支持下，取得了长足发展。先后开发了“尚东-公路小区”、“鲁班御景园”、“鲁班紫麟阁”等住宅项目。');
INSERT INTO `reb` VALUES ('1517', '山东茗筑世家置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/df936606-3fe7-4588-8326-625d3505ca5d.shtml', '', '012398', '杨星', '浪潮路1036号浪潮科技园s06号楼北6楼', '86133238', '754545303@qq.com', '10000 万元', '民营企业', '济南浪潮置业有限公司成立于2003年4月，公司经营范围包括房地产开发及物业管理、高新技术产业及房地产投资等。于2004年7月注册资金增至四亿元人民币。增资后的浪潮只有公司还将负责浪潮产业基地等的建设。 公司现有人员22名，其中工程技术及财务管理人员12人，高级工程师2名、中级工程师3名、助理工程师5名、会计师1名、造价工程1名。 自成立以来，公司致力于以人性化和人文的角度去开发项目。“做实齐鲁，构筑全中国，走向国际化”是浪潮置业所坚持的战略；“人本、诚信、卓越”的理念是浪潮品牌的核心；“科学管理，创建精品，以人为本，优质服务”始终是公司坚持的质量方针。 济南浪潮置业公司将坚持面向社会、服务社会的宗旨，不断追求卓越，凭借实力和诚信汇报社会，与广大客户及员工携手共创美好未来，为济南房地产的发展贡献力量。', '山东茗筑世家置业有限公司null杨星浪潮路1036号浪潮科技园s06号楼北6楼86133238754545303@qq.com10000 万元民营企业济南浪潮置业有限公司成立于2003年4月，公司经营范围包括房地产开发及物业管理、高新技术产业及房地产投资等。于2004年7月注册资金增至四亿元人民币。增资后的浪潮只有公司还将负责浪潮产业基地等的建设。 公司现有人员22名，其中工程技术及财务管理人员12人，高级工程师2名、中级工程师3名、助理工程师5名、会计师1名、造价工程1名。 自成立以来，公司致力于以人性化和人文的角度去开发项目。“做实齐鲁，构筑全中国，走向国际化”是浪潮置业所坚持的战略；“人本、诚信、卓越”的理念是浪潮品牌的核心；“科学管理，创建精品，以人为本，优质服务”始终是公司坚持的质量方针。 济南浪潮置业公司将坚持面向社会、服务社会的宗旨，不断追求卓越，凭借实力和诚信汇报社会，与广大客户及员工携手共创美好未来，为济南房地产的发展贡献力量。');
