INSERT INTO `reb` VALUES ('1520', '石家庄市日晔兴房地产开发有限公司济南分公司', 'http://www.jnfdc.gov.cn/kfqy/show/4323e5bd-bacd-4e88-9eb4-7ef5931eb4dd.shtml', '', '冀建房开石字第710号', '李相奇', '榆山街道北山东社区', '053187718616', '', '5000 万元', '民营企业', '石家庄市日晔兴房地产开发有限公司成立于2003年7月，系专业从事房地产开发与经营的国家二级资质房地产开发企业，下设石家庄市通融物业及济南分公司。现在我公司在济南榆山街道办事处北山片区开发腾跃苑项目。', '石家庄市日晔兴房地产开发有限公司济南分公司null李相奇榆山街道北山东社区0531877186165000 万元民营企业石家庄市日晔兴房地产开发有限公司成立于2003年7月，系专业从事房地产开发与经营的国家二级资质房地产开发企业，下设石家庄市通融物业及济南分公司。现在我公司在济南榆山街道办事处北山片区开发腾跃苑项目。');
INSERT INTO `reb` VALUES ('1521', '济南明湖天地房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a4565265-5d78-46b2-a34f-c9c305bab408.shtml', '', '013775', '张大学', '济南市高新区颖秀北路', '88997897', '', '2000 万元', '国有企业', '济南明湖天地房地产开发有限公司，成立于2010年10月10日；法定代表人张大学；注册地址为济南高新区颖秀北路；注册资金1亿元人民币．目前增资至５亿元人民币。', '济南明湖天地房地产开发有限公司null张大学济南市高新区颖秀北路889978972000 万元国有企业济南明湖天地房地产开发有限公司，成立于2010年10月10日；法定代表人张大学；注册地址为济南高新区颖秀北路；注册资金1亿元人民币．目前增资至５亿元人民币。');
INSERT INTO `reb` VALUES ('1522', '济南中海地产有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d94678ea-c389-4af1-a338-33fea0ae767b.shtml', '', '013851', '欧阳国欣', '济南市历下区工业南路43号', '68652888', 'xuhe0090732@163.com', '9800 万元', '外资企业', '济南中海地产有限公司成立于2008年3月，注册资本金9800万美元，主营房地产开发与销售。目前已成功获取济南东部高新区汇展中心以北一块优质居住用地，总建筑面积34万平米。公司将秉承中海地产“诚信卓越、精品永恒”的一贯理念，为济南市场提供高尚的住宅产品与优质服务。', '济南中海地产有限公司null欧阳国欣济南市历下区工业南路43号68652888xuhe0090732@163.com9800 万元外资企业济南中海地产有限公司成立于2008年3月，注册资本金9800万美元，主营房地产开发与销售。目前已成功获取济南东部高新区汇展中心以北一块优质居住用地，总建筑面积34万平米。公司将秉承中海地产“诚信卓越、精品永恒”的一贯理念，为济南市场提供高尚的住宅产品与优质服务。');
INSERT INTO `reb` VALUES ('1523', '济南实力房地产开发有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/6d9d2e7e-1c1e-4d93-aaf9-a17d98724420.shtml', '', '013047', '刘兆龙', '槐荫区腊山北路6号', '87516001', 'shilifangchan2005@126.com', '2010 万元', '民营企业', '济南实力房地产开发有限责任公司成立于1998年7月，注册资本2010万元，具有三级开发资质。公司设在济南东西主干道经十西路中段南侧，腊山北路6号，法定代表人为刘兆龙。 实力房地产开发公司是一家以房地产开发、商品房销售、物业管理为主，集建筑工程施工、建筑材料、房地产租赁、机电产品、五金交电、钢材木材、化工产品、卫生洁具等销售为一体的综合性、跨行业的股份制企业,公司以开发高层住宅为主,冠名为“实力荣祥花园”。近年来，公司以质量为基础、以人才为根本、以管理为保障，立形象、塑品牌、图发展，形成了多元化经营、一体化管理、诚信为本、稳健经营的战略发展格局. 实力公司视知识与管理为第一生产力，十分重视基础管理工作，为尽快向国际接轨，完善了法人治理结构，建立健全了各项管理制度，内部确立了分工明确、科学高效的组织管理机构，在财务资金管理、人力资源管理、规划设计管理、工程建设管理、商品房销售管理以及计划统计、档案管理等方面，制定了严格规范的管理制度体系，保障了企业经营高质量、高效率的运转。公司经过不断发展已经拥有一支素质精良的员工队伍，现有职工56人，其中高级职称5人，中级职称18人，初级职称20人，人才结构合理，适应了公司事业发展的需要。公司一贯重视企业文化建设，推崇严密的组织机构、严格的组织纪律、科学的经营策略、务实的工作态度、快捷的办事效率、友爱的工作氛围，团结向上的精神状态，进一步增强了企业的凝聚力及亲和力，促进了实力公司各项事业的健康快速发展.', '济南实力房地产开发有限责任公司null刘兆龙槐荫区腊山北路6号87516001shilifangchan2005@126.com2010 万元民营企业济南实力房地产开发有限责任公司成立于1998年7月，注册资本2010万元，具有三级开发资质。公司设在济南东西主干道经十西路中段南侧，腊山北路6号，法定代表人为刘兆龙。 实力房地产开发公司是一家以房地产开发、商品房销售、物业管理为主，集建筑工程施工、建筑材料、房地产租赁、机电产品、五金交电、钢材木材、化工产品、卫生洁具等销售为一体的综合性、跨行业的股份制企业,公司以开发高层住宅为主,冠名为“实力荣祥花园”。近年来，公司以质量为基础、以人才为根本、以管理为保障，立形象、塑品牌、图发展，形成了多元化经营、一体化管理、诚信为本、稳健经营的战略发展格局. 实力公司视知识与管理为第一生产力，十分重视基础管理工作，为尽快向国际接轨，完善了法人治理结构，建立健全了各项管理制度，内部确立了分工明确、科学高效的组织管理机构，在财务资金管理、人力资源管理、规划设计管理、工程建设管理、商品房销售管理以及计划统计、档案管理等方面，制定了严格规范的管理制度体系，保障了企业经营高质量、高效率的运转。公司经过不断发展已经拥有一支素质精良的员工队伍，现有职工56人，其中高级职称5人，中级职称18人，初级职称20人，人才结构合理，适应了公司事业发展的需要。公司一贯重视企业文化建设，推崇严密的组织机构、严格的组织纪律、科学的经营策略、务实的工作态度、快捷的办事效率、友爱的工作氛围，团结向上的精神状态，进一步增强了企业的凝聚力及亲和力，促进了实力公司各项事业的健康快速发展.');
INSERT INTO `reb` VALUES ('1524', '济南富海置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/9cc198d0-c440-4625-aa3f-e5a02e850e9e.shtml', '', '013787', '陆吉法', '山东省济南市平阴县城五岭路13号', '83109697', '', '1800 万元', '国有企业', '济南富海置业有限公司(原平阴建工房地产开发有限公司),始建于2002年，注册资金1800万元,房地产开发三级资质，经营范围为房地产开发、房屋租赁、园林绿化、物业管理、道路修建等。 现有各类技术人员26人，其中高级工程师、经济师、会计师、初级会计师等20人，内设市场开发部、施工部、营销部、财务部等部室，有强大的物业管理体系。实行董事会领导下的经理负责制，体制合理、运作科学、制度健全、管理规范；始终遵循“高起点规划，高标准实施，高效能管理，高目标发展”的企业发展原则，本着“信誉至上、创新发展、管实高效、严细管理”的企业精神，出资规划建设了建工花苑小区工程，总投资4000多万元。富海家园小区，总规划建筑面积49857.76平方米，商品住宅400余套，总投资7000多万元。代建国税局办公楼6000多平方米，总投资1000多万元，代建代销了龙口碧海苑67#楼4000多平方米，总投资400多万元，大佛寺富海居小区占地面积40余亩，土地已出让正在规划当中。 本公司自成立以来，取得了良好的经济效益和社会效益，内强管理素质，外树企业形象，视业主为上帝，数年来未发生一起房产纠纷。小区绿化道路及公建设施正在逐步完善，购房户已陆续迁入新居，回访满意率达到100％，赢得了社会各界的一致好评，为今后开拓市场创造了条件。 济南富海置业有限公司以良好的信誉，秉承“以人为本，建绿色健康家园”的企业理念，引领人民居住质量的飞跃。', '济南富海置业有限公司null陆吉法山东省济南市平阴县城五岭路13号831096971800 万元国有企业济南富海置业有限公司(原平阴建工房地产开发有限公司),始建于2002年，注册资金1800万元,房地产开发三级资质，经营范围为房地产开发、房屋租赁、园林绿化、物业管理、道路修建等。 现有各类技术人员26人，其中高级工程师、经济师、会计师、初级会计师等20人，内设市场开发部、施工部、营销部、财务部等部室，有强大的物业管理体系。实行董事会领导下的经理负责制，体制合理、运作科学、制度健全、管理规范；始终遵循“高起点规划，高标准实施，高效能管理，高目标发展”的企业发展原则，本着“信誉至上、创新发展、管实高效、严细管理”的企业精神，出资规划建设了建工花苑小区工程，总投资4000多万元。富海家园小区，总规划建筑面积49857.76平方米，商品住宅400余套，总投资7000多万元。代建国税局办公楼6000多平方米，总投资1000多万元，代建代销了龙口碧海苑67#楼4000多平方米，总投资400多万元，大佛寺富海居小区占地面积40余亩，土地已出让正在规划当中。 本公司自成立以来，取得了良好的经济效益和社会效益，内强管理素质，外树企业形象，视业主为上帝，数年来未发生一起房产纠纷。小区绿化道路及公建设施正在逐步完善，购房户已陆续迁入新居，回访满意率达到100％，赢得了社会各界的一致好评，为今后开拓市场创造了条件。 济南富海置业有限公司以良好的信誉，秉承“以人为本，建绿色健康家园”的企业理念，引领人民居住质量的飞跃。');
INSERT INTO `reb` VALUES ('1525', '济南长兴房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/cadade7c-9cd5-4fce-bf05-eb594019e218.shtml', '', '013804', '刘旭东', '长清区归德镇第四建筑工程公司驻地', '87218798', 'jncxfdc@126.com', '6000 万元', '国有企业', '济南长兴房地产开发有限公司成立于2001年12月，注册资本金贰仟万元，具有房地产开发三级资质。公司现有员工36人，其中：高级职称12人，中级职称8人，大中专以上人员及专业技术人员占90%以上。公司下设开发部、工程部、技术部、材料部、财务部、销售部、物业部、办公室等七部一室，是集市场开发论证、报批报建、工程管理、楼盘销售于一体的房地产开发公司。 公司自成立以来，始终秉承“诚信为本、铸造精品”的开发建设理念，开发的长兴小高层1#、2#公寓楼，以优秀的楼盘品质、诚实守信的原则和积极、热情、快捷的服务，赢得了广大消费者的信赖和认可，取得了良好的经济效益和社会效益，树立了“长兴房产、温馨家园”的良好形象。 董事长刘继营携全体员工热忱欢迎各界朋友莅临指导，共创辉煌！', '济南长兴房地产开发有限公司null刘旭东长清区归德镇第四建筑工程公司驻地87218798jncxfdc@126.com6000 万元国有企业济南长兴房地产开发有限公司成立于2001年12月，注册资本金贰仟万元，具有房地产开发三级资质。公司现有员工36人，其中：高级职称12人，中级职称8人，大中专以上人员及专业技术人员占90%以上。公司下设开发部、工程部、技术部、材料部、财务部、销售部、物业部、办公室等七部一室，是集市场开发论证、报批报建、工程管理、楼盘销售于一体的房地产开发公司。 公司自成立以来，始终秉承“诚信为本、铸造精品”的开发建设理念，开发的长兴小高层1#、2#公寓楼，以优秀的楼盘品质、诚实守信的原则和积极、热情、快捷的服务，赢得了广大消费者的信赖和认可，取得了良好的经济效益和社会效益，树立了“长兴房产、温馨家园”的良好形象。 董事长刘继营携全体员工热忱欢迎各界朋友莅临指导，共创辉煌！');
INSERT INTO `reb` VALUES ('1526', '章丘市碧桂园房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/9f464762-ab6e-4780-b6de-9c4f98f8821b.shtml', '', '013769', '杨文杰', '章丘市枣园街道办事处芙蓉街230号', '81292210', 'liuxiufeng@countrygarden.com', '10000 万元', '民营企业', '本公司于2011年8月17日成立,主要经营范围房地产开发、建设、销售、出租，经营管理自建的商住楼宇及配套设施。', '章丘市碧桂园房地产开发有限公司null杨文杰章丘市枣园街道办事处芙蓉街230号81292210liuxiufeng@countrygarden.com10000 万元民营企业本公司于2011年8月17日成立,主要经营范围房地产开发、建设、销售、出租，经营管理自建的商住楼宇及配套设施。');
INSERT INTO `reb` VALUES ('1527', '华润置地（山东）发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ba276b1f-c568-4766-8ccc-2b7177b294d2.shtml', '', '013826', '唐勇', '济南市市中区纬二路51号山东商会大厦15层', '66669100', 'zhangxiaoli92@crland.com.cn', '68500 万元', '国有企业', '华润置地山东省公司作为置地全国规划的十个大区之一，成立于2010年11月,总部设在济南，由省公司与青岛公司、淄博公司、威海公司、日照公司等几个城市公司组成。 华润置地山东省公司预计投资规模超过870亿港币，在\"大山东、大格局\"战略以及\"住宅+商业\"开发模式的引领下，山东省公司深耕齐鲁大地，呈现出势如破竹、锐意进取的发展态势，先后在青岛、淄博、济南、威海、日照城市核心区位开发多个优质项目，同时，烟台、潍坊、太原等地的项目也在积极洽谈中。目前，山东省公司已经进入城市待开发建筑面积超过620万平方米，在洽谈建筑面积约570万平方米，涵盖华润置地8大产品线，并将创造新的旅游地产产品系列。 华润置地山东省公司，已经形成了在山东“五城联动”的发展格局，彻底改变山东城市面貌。华润置地依托最具成长性的公司品牌和优秀的项目品牌，秉承华润集团\"诚信、务实、专业、团队、积级、创新\"的企业精神，崇尚\"简单、坦诚、阳光\"的企业文化，坚持\"品质给城市更多改变\"的品牌理念，以\"与您携手，改变生活\"为承诺，向山东大众传递更高追求的生活理念，缔造更加完美的生活空间。', '华润置地（山东）发展有限公司null唐勇济南市市中区纬二路51号山东商会大厦15层66669100zhangxiaoli92@crland.com.cn68500 万元国有企业华润置地山东省公司作为置地全国规划的十个大区之一，成立于2010年11月,总部设在济南，由省公司与青岛公司、淄博公司、威海公司、日照公司等几个城市公司组成。 华润置地山东省公司预计投资规模超过870亿港币，在\"大山东、大格局\"战略以及\"住宅+商业\"开发模式的引领下，山东省公司深耕齐鲁大地，呈现出势如破竹、锐意进取的发展态势，先后在青岛、淄博、济南、威海、日照城市核心区位开发多个优质项目，同时，烟台、潍坊、太原等地的项目也在积极洽谈中。目前，山东省公司已经进入城市待开发建筑面积超过620万平方米，在洽谈建筑面积约570万平方米，涵盖华润置地8大产品线，并将创造新的旅游地产产品系列。 华润置地山东省公司，已经形成了在山东“五城联动”的发展格局，彻底改变山东城市面貌。华润置地依托最具成长性的公司品牌和优秀的项目品牌，秉承华润集团\"诚信、务实、专业、团队、积级、创新\"的企业精神，崇尚\"简单、坦诚、阳光\"的企业文化，坚持\"品质给城市更多改变\"的品牌理念，以\"与您携手，改变生活\"为承诺，向山东大众传递更高追求的生活理念，缔造更加完美的生活空间。');
INSERT INTO `reb` VALUES ('1528', '济南增富房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ba307a9b-4acd-4352-8e92-710a17fcf476.shtml', '', '013774', '李宗增', '章丘市济青路山阳西村段路北', '83233687', 'zqqyja@163.com', '1800.2 万元', '民营企业', '章丘市百脉房地产开发有限公司是二OO三年一月二十九日在济南市工商局章丘分局注册的一家股份制房地产开发企业,经营范围是房地产开发、商品房销售。二OO三年四月十日经山东省建设厅批准从事房地产开发经营，资质等级为暂定资质，二OO五年七月五日经济南市建设委员会批准资质等级为四级。 公司自成立以来，按照“统一规划、合理布局、有效开发、奉献社会”的方针，坚持高标准、高投入、高要求、高质量、先后开发了章丘市妇幼保健院3#住宅楼、荣元兴盛苑1#2#商住楼、公用事业局自来水公司4#、5#住宅楼、圣井花苑一区1#、2#商品楼、圣井花苑二区商住楼、1#、2#商品住宅楼、圣井花苑三区1#、2#商住楼、1#、2#商品住宅楼、龙山花苑1#-6#商品住宅楼、荣元花园1#-5#住宅楼，商业楼A段、B段。曹范青旗山花园小区。待开发建设的项目有：大站水库1#-3#楼、枣园粮所商品楼、明泉馨居住宅小区。2007年开发房屋建筑施工面积77262平方米，2008年开发房屋建筑面积39277平方米，2007年9月至2008年9月累计完成投资额10975万元。', '济南增富房地产开发有限公司null李宗增章丘市济青路山阳西村段路北83233687zqqyja@163.com1800.2 万元民营企业章丘市百脉房地产开发有限公司是二OO三年一月二十九日在济南市工商局章丘分局注册的一家股份制房地产开发企业,经营范围是房地产开发、商品房销售。二OO三年四月十日经山东省建设厅批准从事房地产开发经营，资质等级为暂定资质，二OO五年七月五日经济南市建设委员会批准资质等级为四级。 公司自成立以来，按照“统一规划、合理布局、有效开发、奉献社会”的方针，坚持高标准、高投入、高要求、高质量、先后开发了章丘市妇幼保健院3#住宅楼、荣元兴盛苑1#2#商住楼、公用事业局自来水公司4#、5#住宅楼、圣井花苑一区1#、2#商品楼、圣井花苑二区商住楼、1#、2#商品住宅楼、圣井花苑三区1#、2#商住楼、1#、2#商品住宅楼、龙山花苑1#-6#商品住宅楼、荣元花园1#-5#住宅楼，商业楼A段、B段。曹范青旗山花园小区。待开发建设的项目有：大站水库1#-3#楼、枣园粮所商品楼、明泉馨居住宅小区。2007年开发房屋建筑施工面积77262平方米，2008年开发房屋建筑面积39277平方米，2007年9月至2008年9月累计完成投资额10975万元。');
INSERT INTO `reb` VALUES ('1529', '山东蓝石置地集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/cf55ed7e-53dd-46d4-8dba-7e621e665729.shtml', '', '013771', '王仕祥', '济南市千佛山西路26号', '82677076', '250164305@qq.com', '3000 万元', '民营企业', '济南蓝石置业有限公司创建于2002年5月，注册资金2000万元人民币，为国家房地产开发资质三级企业。公司是以房产开发为主，集房产营销、建材供应和物业管理为一体的综合性房地产开发企业。目前公司设有综合业务部、财务部、工程部、销售部、合同预算部、物业部，拥有员工40余名，其中本科学历占53.7%，高级职称占19.5％，相应的技术人才也都具备了中级以上职称。 公司自成立以来恪守“建精品工程、树蓝石品牌，以诚信换取尊重”的经营理念，根据企业规范化、标准化、国际化的要求，以适应市场经济竞争为导向，全面引进现代企业管理机制，认真规范企业内部管理，2002年以来，公司完成开发面积5万平方米。先后开发了济南蓝石商务中心（一期）高档写字楼和青岛蓝石海景中高档住宅小区；目前，公司正致力于蓝石商务中心二期项目的开发建设，拟开发济南“宏济堂”和“月亮河”高档住宅项目。 公司自成立以来，以优异的开发业绩，得到社会各界的好评。开发建设的青岛蓝石海景高档住宅小区，被青岛市评为“2004年度青岛最具投资价值楼盘”和“2005年度青岛最具居住价值典范楼盘”。随着企业的发展，蓝石置业公司将继续秉承诚信为本、精益求精、开拓进取、求实创新”的企业精神，与时俱进，超越自我，紧抓市场脉搏，规划企业发展蓝图，致力于建设省内知名房地产开发企业，促进公司从优秀走向卓越，全面实现公司的科学、快速、健康发展。', '山东蓝石置地集团有限公司null王仕祥济南市千佛山西路26号82677076250164305@qq.com3000 万元民营企业济南蓝石置业有限公司创建于2002年5月，注册资金2000万元人民币，为国家房地产开发资质三级企业。公司是以房产开发为主，集房产营销、建材供应和物业管理为一体的综合性房地产开发企业。目前公司设有综合业务部、财务部、工程部、销售部、合同预算部、物业部，拥有员工40余名，其中本科学历占53.7%，高级职称占19.5％，相应的技术人才也都具备了中级以上职称。 公司自成立以来恪守“建精品工程、树蓝石品牌，以诚信换取尊重”的经营理念，根据企业规范化、标准化、国际化的要求，以适应市场经济竞争为导向，全面引进现代企业管理机制，认真规范企业内部管理，2002年以来，公司完成开发面积5万平方米。先后开发了济南蓝石商务中心（一期）高档写字楼和青岛蓝石海景中高档住宅小区；目前，公司正致力于蓝石商务中心二期项目的开发建设，拟开发济南“宏济堂”和“月亮河”高档住宅项目。 公司自成立以来，以优异的开发业绩，得到社会各界的好评。开发建设的青岛蓝石海景高档住宅小区，被青岛市评为“2004年度青岛最具投资价值楼盘”和“2005年度青岛最具居住价值典范楼盘”。随着企业的发展，蓝石置业公司将继续秉承诚信为本、精益求精、开拓进取、求实创新”的企业精神，与时俱进，超越自我，紧抓市场脉搏，规划企业发展蓝图，致力于建设省内知名房地产开发企业，促进公司从优秀走向卓越，全面实现公司的科学、快速、健康发展。');
INSERT INTO `reb` VALUES ('1530', '济南金艺林房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b29fd50e-44b3-40ef-82da-f1b80d0e4a27.shtml', '', '013799', '隗金元', '济南市历城区唐冶新区围子山路1号', '66697569', '', '10000 万元', '国有企业', '1、单位名称：济南金艺林房地产开发有限公司 2、企业性质：有限责任公司（法人独资） 3、法定代表人：隗金元 4、注册资本：2000万元 为鲁商集团的全资子公司', '济南金艺林房地产开发有限公司null隗金元济南市历城区唐冶新区围子山路1号6669756910000 万元国有企业1、单位名称：济南金艺林房地产开发有限公司 2、企业性质：有限责任公司（法人独资） 3、法定代表人：隗金元 4、注册资本：2000万元 为鲁商集团的全资子公司');
INSERT INTO `reb` VALUES ('1531', '济南博纳置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/fe86923a-e75d-4d46-9f13-6c326613467c.shtml', '', '013847', '胡剑峰', '山东省济南市济阳县纬三路39号', '81176897', '48450874@163.com', '3000 万元', '民营企业', '济南博纳置业有限公司由胡剑锋、吴林冲等三位股东组建而成。2011年8月22日经济南市工商行政管理局济阳分局批准成立，法人代表胡剑锋，企业类型为有限责任公司，注册资本为3000万元人民币。公司现有员工46名，其中有职称的专业人员16名。 现公司运转良好，员工齐心，对今后公司发展事业充满信心。', '济南博纳置业有限公司null胡剑峰山东省济南市济阳县纬三路39号8117689748450874@163.com3000 万元民营企业济南博纳置业有限公司由胡剑锋、吴林冲等三位股东组建而成。2011年8月22日经济南市工商行政管理局济阳分局批准成立，法人代表胡剑锋，企业类型为有限责任公司，注册资本为3000万元人民币。公司现有员工46名，其中有职称的专业人员16名。 现公司运转良好，员工齐心，对今后公司发展事业充满信心。');
INSERT INTO `reb` VALUES ('1532', '山东力高房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/f5fda354-606a-4990-af59-859620333ed3.shtml', '', '013862', '黄恒政', '济南市历下区工业南路65-9号', '88169911', '570254240@qq.com', '10000 万元', '中外合资经营企业', '企业简介 山东力高房地产开发有限公司以力高集团为强大的源动力，秉承力高集团“用心做事，诚信为人”的企业理念，在企业经营、团队建设、人才管理、项目开发、客户服务上坚持“以人为本，诚信求实”的经营宗旨，鼎新革故，迅速适应市场变化，确立了自身品牌。 目前山东力高房地产开发有限公司有两个项目已进入前期开发准备阶段。 一、2005年6月在香港签定了济南市旧村改造项目，该项目位于济南市东区，占地面积628亩，改造后建筑面积将达80万平方米，销售收入预计达30亿元人民币。 二、济南市花园路项目，地块位于花园路东段北首，用地面积约90亩，规划建筑面积约8万平方米。 秉承力高集团的中国品牌战略，山东力高公司重点拓展“环渤海经济圈”的房地产市场，打造精品工程，奠定集团在“环渤海经济圈”房地产市场的领导地位，以坚实的步伐迈向新的征程！', '山东力高房地产开发有限公司null黄恒政济南市历下区工业南路65-9号88169911570254240@qq.com10000 万元中外合资经营企业企业简介 山东力高房地产开发有限公司以力高集团为强大的源动力，秉承力高集团“用心做事，诚信为人”的企业理念，在企业经营、团队建设、人才管理、项目开发、客户服务上坚持“以人为本，诚信求实”的经营宗旨，鼎新革故，迅速适应市场变化，确立了自身品牌。 目前山东力高房地产开发有限公司有两个项目已进入前期开发准备阶段。 一、2005年6月在香港签定了济南市旧村改造项目，该项目位于济南市东区，占地面积628亩，改造后建筑面积将达80万平方米，销售收入预计达30亿元人民币。 二、济南市花园路项目，地块位于花园路东段北首，用地面积约90亩，规划建筑面积约8万平方米。 秉承力高集团的中国品牌战略，山东力高公司重点拓展“环渤海经济圈”的房地产市场，打造精品工程，奠定集团在“环渤海经济圈”房地产市场的领导地位，以坚实的步伐迈向新的征程！');
INSERT INTO `reb` VALUES ('1533', '山东宏海置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/17a7fde5-34d5-48f8-981e-7dbe376f4a4e.shtml', '', '013849', '张岑', '山大路140号', '55706609', '76782627@qq.com', '11000 万元', '民营企业', '山东宏海置业有限公司成立于2010年，注册资金一亿元，为中国五百强企业浙江广厦集团旗下大型综合房地产开发企业。是广厦控股创业投资有限公司为依托山东、融入山东、跻身山东市场而谋求更高更快发展，在山东注册的房地产开发公司。重点发展领域为国内一二线城市核心地区城市综合体以及酒店、写字楼、公寓、大型商业物业的开发与运营。　　 公司目前开发项目位于历城区黄金地段，总规模超过70万平方米，业态涵盖住宅、公寓、写字楼以及大型大型综合商业项目，具有优越的商业发展潜力。一经建成，将成为历城区地标性建筑群，济南市代表性城市综合体。', '山东宏海置业有限公司null张岑山大路140号5570660976782627@qq.com11000 万元民营企业山东宏海置业有限公司成立于2010年，注册资金一亿元，为中国五百强企业浙江广厦集团旗下大型综合房地产开发企业。是广厦控股创业投资有限公司为依托山东、融入山东、跻身山东市场而谋求更高更快发展，在山东注册的房地产开发公司。重点发展领域为国内一二线城市核心地区城市综合体以及酒店、写字楼、公寓、大型商业物业的开发与运营。　　 公司目前开发项目位于历城区黄金地段，总规模超过70万平方米，业态涵盖住宅、公寓、写字楼以及大型大型综合商业项目，具有优越的商业发展潜力。一经建成，将成为历城区地标性建筑群，济南市代表性城市综合体。');
INSERT INTO `reb` VALUES ('1534', '泰安同创置业有限公司平阴分公司', 'http://www.jnfdc.gov.cn/kfqy/show/602cfc54-caa6-4d6b-a343-505886511177.shtml', '', '103167', '李道久', '平阴镇东关村', '87873877', '', '3200 万元', '民营企业', '公司成立于2012年06月06日，项目地址为平阴县会仙街以南、东关街以北、东关二路以东。玫城丽都小区总建筑面积为4.94万平方米，总栋数为8栋，计划开工日期为2015年1月1日，计划竣工日期为2017年12月31日。', '泰安同创置业有限公司平阴分公司null李道久平阴镇东关村878738773200 万元民营企业公司成立于2012年06月06日，项目地址为平阴县会仙街以南、东关街以北、东关二路以东。玫城丽都小区总建筑面积为4.94万平方米，总栋数为8栋，计划开工日期为2015年1月1日，计划竣工日期为2017年12月31日。');
INSERT INTO `reb` VALUES ('1535', '济南祥顺置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/87f25a6c-7d2e-4b85-9fdf-e08049457a1d.shtml', '', '013810', '朱炳福', '济北开发区正安路8号（济阳县国土资源局东办公楼一、二层）', '81173387', '641892243@qq.cm', '10000 万元', '民营企业', '济南祥顺置业有限公司投资建设山东济阳徐家片区旧城改造项目。公司成立于2013年1月，注册资金1亿元。公司属于祥生实业集团有限公司的子公司。公司设有财务资金部、设计工程部、成本合约部、营销策划部、综合管理部等部门，主要经营:小城镇住房建设、改造；新农村社区建设、改造；房地产开发、销售；建筑材料销售。本公司实力雄厚，前景广阔。', '济南祥顺置业有限公司null朱炳福济北开发区正安路8号（济阳县国土资源局东办公楼一、二层）81173387641892243@qq.cm10000 万元民营企业济南祥顺置业有限公司投资建设山东济阳徐家片区旧城改造项目。公司成立于2013年1月，注册资金1亿元。公司属于祥生实业集团有限公司的子公司。公司设有财务资金部、设计工程部、成本合约部、营销策划部、综合管理部等部门，主要经营:小城镇住房建设、改造；新农村社区建设、改造；房地产开发、销售；建筑材料销售。本公司实力雄厚，前景广阔。');
