INSERT INTO `reb` VALUES ('1540', '济南瑞诚置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/aa7633b1-a168-4cf8-ae95-b3ea197e9c04.shtml', '', '013858', '柳丽', '济南市高新区崇华路以东世纪财富中心C座405室', '13361073170', 'jnrczy01@163.com', '1000 万元', '民营企业', '济南瑞诚置业有限公司目前在建项目为瑞诚星港湾，项目位于平阴县锦东大街；已竣工项目有瑞诚羲和雅居住宅小区，位于平阴县榆山路南首。', '济南瑞诚置业有限公司null柳丽济南市高新区崇华路以东世纪财富中心C座405室13361073170jnrczy01@163.com1000 万元民营企业济南瑞诚置业有限公司目前在建项目为瑞诚星港湾，项目位于平阴县锦东大街；已竣工项目有瑞诚羲和雅居住宅小区，位于平阴县榆山路南首。');
