INSERT INTO `reb` VALUES ('1542', '山东融汇置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a1146170-331a-4729-80d8-4a577b89bb60.shtml', '', '013861', '黄祖仕', '济南市市中区拥军路与刘长山路交口南1000米融汇城售楼处202室', '82677650', '76811494@qq.com', '50000 万元', '民营企业', '山东融汇置业有限公司于2011年4月15日成立，公司注册资金伍亿元，办公地址位于济南市市中区舜耕路28号舜华园D楼7层。 公司秉承秉承“融汇城市梦想·筑就品质生活”的经营理念，以“融汇世界·成就梦想”为使命，追求融汇世界卓越的人才和先进的科技、理念，把“融汇”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。', '山东融汇置业有限公司null黄祖仕济南市市中区拥军路与刘长山路交口南1000米融汇城售楼处202室8267765076811494@qq.com50000 万元民营企业山东融汇置业有限公司于2011年4月15日成立，公司注册资金伍亿元，办公地址位于济南市市中区舜耕路28号舜华园D楼7层。 公司秉承秉承“融汇城市梦想·筑就品质生活”的经营理念，以“融汇世界·成就梦想”为使命，追求融汇世界卓越的人才和先进的科技、理念，把“融汇”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。');
INSERT INTO `reb` VALUES ('1543', '济南路劲隽成房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ae6906a4-78a3-4e18-aab7-f8f2f7e38e50.shtml', '', '013855', '刁露', '北园大街43号', '87107077', '626473362@qq.com', '15000 万元', '民营企业', '济南路劲隽成房地产开发有限公司开发有路劲东城项目，第一期已取得综合验收备案证明，第二期根据资质等级开工建设，第三期在方案设计阶段。', '济南路劲隽成房地产开发有限公司null刁露北园大街43号87107077626473362@qq.com15000 万元民营企业济南路劲隽成房地产开发有限公司开发有路劲东城项目，第一期已取得综合验收备案证明，第二期根据资质等级开工建设，第三期在方案设计阶段。');
INSERT INTO `reb` VALUES ('1544', '济南航发建设开发有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/d91f17e7-e954-4f84-b2df-bd4ca8a87e86.shtml', '', '013094', '张淑华', '济洛路93号', '18906315066', 'jnhangfa@126.com', '1806 万元', '民营企业', '济南航发建设开发有限责任公司成立于一九九四年，总部位于济南，主营房地产开发。自公司成立起，始终坚持“质量第一、品牌效应”的原则，先后开发建设了济南西八小区、千禧嘉园、福泰园、山东医学科学研究院办公楼等多项优良工程，取得了令人瞩目的成绩，获得社会各界的赞誉。随着公司业务的蓬勃发展，二零零三年济南航发建设开发有限责任公司乳山分公司正式成立，并于二零零六年在乳山银滩AAAA级旅游度假区开发了维利亚花园小区，该小区是航发地产奉献给社会的又一个品位高尚、健康生态的花园小区，是银滩旅游度假区的样板工程。', '济南航发建设开发有限责任公司null张淑华济洛路93号18906315066jnhangfa@126.com1806 万元民营企业济南航发建设开发有限责任公司成立于一九九四年，总部位于济南，主营房地产开发。自公司成立起，始终坚持“质量第一、品牌效应”的原则，先后开发建设了济南西八小区、千禧嘉园、福泰园、山东医学科学研究院办公楼等多项优良工程，取得了令人瞩目的成绩，获得社会各界的赞誉。随着公司业务的蓬勃发展，二零零三年济南航发建设开发有限责任公司乳山分公司正式成立，并于二零零六年在乳山银滩AAAA级旅游度假区开发了维利亚花园小区，该小区是航发地产奉献给社会的又一个品位高尚、健康生态的花园小区，是银滩旅游度假区的样板工程。');
INSERT INTO `reb` VALUES ('1545', '济南保利房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/fcd9ec09-2fdb-4eef-a4ca-6b40e7a066e0.shtml', '', '013852', '李阳', '山东省济南市槐荫区纬十路17号', '82391888', '258180550@qq.com', '20000 万元', '国有企业', '济南保利房地产开发有限公司成立于2010年，由济南保利置业集团有限公司和山东和顺投资有限公司出资20000万元在济南市工商行政管理局注册成立。从事房地产开发与经营、物业管理和房地产营销策划等经营活动。公司拥有优秀的管理团队和丰富的房地产项目开发经验，凭借自身优势，在济南积极开拓房地产开发业务，为济南的经济发展做出贡献。', '济南保利房地产开发有限公司null李阳山东省济南市槐荫区纬十路17号82391888258180550@qq.com20000 万元国有企业济南保利房地产开发有限公司成立于2010年，由济南保利置业集团有限公司和山东和顺投资有限公司出资20000万元在济南市工商行政管理局注册成立。从事房地产开发与经营、物业管理和房地产营销策划等经营活动。公司拥有优秀的管理团队和丰富的房地产项目开发经验，凭借自身优势，在济南积极开拓房地产开发业务，为济南的经济发展做出贡献。');
INSERT INTO `reb` VALUES ('1546', '山东省诚建工程总承包有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/20097111-052d-4512-8407-138d391d87ed.shtml', '', '013801', '温智运', '济南市市中区经六小纬四路46-1号', '87087103', 'chengjian2163@163.com', '2000 万元', '国有企业', '山东省诚建工程总承包有限公司是从事房地产开发和各类建筑工程施工的大型专业化公司，为山东省建设厅直属企业，山东省房地产开发集团核心层单位。公司注册资金贰仟万元，具有房地产开发贰级、房屋建筑工程总承包贰级、市政公用工程总承包叁级、钢结构专业承包贰级等企业资质，拥有雄厚的资金和技术实力，可进行大型房地产项目的开发，并独立承揽各类工业、民用、公共建筑工程和市政公用工程的施工。诚建公司也是省建设厅直属的第一家完成股份制改造的企业，其率先按照现代企业制度的要求建立起法人治理结构和公司运营机制，并在企业管理方面吸收借鉴了国内外的成功经验，具有严格、高效的企业管理和诚信、求实的企业文化。公司还先后通过了ISO9001和ISO14001体系的认证，在管理的规范化、制度化、程序化方面精益求精。 山东省诚建工程总承包有限公司自组建以来，先后开发并承揽了明珠花园、五环花苑等多个大型房地产项目和各类建筑工程，以卓越的品质、良好的信誉和优质的服务赢得了社会各界及政府主管部门的广泛赞誉，为省内知名的房地产开发及工程总承包企业。', '山东省诚建工程总承包有限公司null温智运济南市市中区经六小纬四路46-1号87087103chengjian2163@163.com2000 万元国有企业山东省诚建工程总承包有限公司是从事房地产开发和各类建筑工程施工的大型专业化公司，为山东省建设厅直属企业，山东省房地产开发集团核心层单位。公司注册资金贰仟万元，具有房地产开发贰级、房屋建筑工程总承包贰级、市政公用工程总承包叁级、钢结构专业承包贰级等企业资质，拥有雄厚的资金和技术实力，可进行大型房地产项目的开发，并独立承揽各类工业、民用、公共建筑工程和市政公用工程的施工。诚建公司也是省建设厅直属的第一家完成股份制改造的企业，其率先按照现代企业制度的要求建立起法人治理结构和公司运营机制，并在企业管理方面吸收借鉴了国内外的成功经验，具有严格、高效的企业管理和诚信、求实的企业文化。公司还先后通过了ISO9001和ISO14001体系的认证，在管理的规范化、制度化、程序化方面精益求精。 山东省诚建工程总承包有限公司自组建以来，先后开发并承揽了明珠花园、五环花苑等多个大型房地产项目和各类建筑工程，以卓越的品质、良好的信誉和优质的服务赢得了社会各界及政府主管部门的广泛赞誉，为省内知名的房地产开发及工程总承包企业。');
INSERT INTO `reb` VALUES ('1547', '济南银丰唐冶房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/20662b89-2efa-4ca2-836c-3ae431b8a221.shtml', '', '013805', '王彤', '济南市历城区唐冶新区围子山路1号', '053162325278', 'yinfengtangye@126.com', '20000 万元', '民营企业', '济南银丰唐冶房地产开发有限公司是银丰地产集团有限公司和济南银丰财盈壹号投资中心共同出资的，成立于2010年7月，是银丰地产集团有限公司为配合济南历城唐冶新区七村整合项目专门成立的房地产公司，目前公司有在职员工68人，服务于七村整合项目或进行相关工作。作为向济南银丰唐冶房地产开发有限公司注资的银丰地产集团产有限公司成立于2001年4月，注册资金9500万元，具有房地产开发企业二级资质。在短短几年中，迅速成长为有实力、有影响、有价值的房地产开发企业。公司在济南市南部城区成功开发“银丰山庄”、“银丰花园”住宅小区、“银丰大厦”办公楼等项目，在全市房地产开发企业综合信用评价中荣获 “AAA级企业”荣誉称号。 经过不懈地追求和努力，银丰地产得到了政府、社会各界的肯定以及消费者的信任。', '济南银丰唐冶房地产开发有限公司null王彤济南市历城区唐冶新区围子山路1号053162325278yinfengtangye@126.com20000 万元民营企业济南银丰唐冶房地产开发有限公司是银丰地产集团有限公司和济南银丰财盈壹号投资中心共同出资的，成立于2010年7月，是银丰地产集团有限公司为配合济南历城唐冶新区七村整合项目专门成立的房地产公司，目前公司有在职员工68人，服务于七村整合项目或进行相关工作。作为向济南银丰唐冶房地产开发有限公司注资的银丰地产集团产有限公司成立于2001年4月，注册资金9500万元，具有房地产开发企业二级资质。在短短几年中，迅速成长为有实力、有影响、有价值的房地产开发企业。公司在济南市南部城区成功开发“银丰山庄”、“银丰花园”住宅小区、“银丰大厦”办公楼等项目，在全市房地产开发企业综合信用评价中荣获 “AAA级企业”荣誉称号。 经过不懈地追求和努力，银丰地产得到了政府、社会各界的肯定以及消费者的信任。');
INSERT INTO `reb` VALUES ('1548', '济南保利置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/3fdcefb7-7f50-49fe-8549-741166638fd7.shtml', '', '013803', '李阳', '明湖东路777号', '82391888', 'polysdzy@163.com', '23730.62 万元', '国有企业', '保利海德公馆是由保利山东投资开发的。保利是央企房地产第一品牌，中国房地产开发企业综合实力TOP10企业。保利在济南已经先后开发保利?芙蓉、保利花园、保利?大名湖项目，属于济南房地产开发第一品牌序列。海德公馆项目是保利TOP系精装豪宅产品线首次进入济南，未来必定为您呈现济南最顶级的精装豪宅产品。项目位于济南市历城区祝舜路南侧，华信路西侧。该项目可规划总用地面积142100㎡，规划总建筑面积497350㎡，主要建设高层住宅，另有小学、幼儿园等配套设施。项目将由保利物业进行物业管理服务。', '济南保利置业有限公司null李阳明湖东路777号82391888polysdzy@163.com23730.62 万元国有企业保利海德公馆是由保利山东投资开发的。保利是央企房地产第一品牌，中国房地产开发企业综合实力TOP10企业。保利在济南已经先后开发保利?芙蓉、保利花园、保利?大名湖项目，属于济南房地产开发第一品牌序列。海德公馆项目是保利TOP系精装豪宅产品线首次进入济南，未来必定为您呈现济南最顶级的精装豪宅产品。项目位于济南市历城区祝舜路南侧，华信路西侧。该项目可规划总用地面积142100㎡，规划总建筑面积497350㎡，主要建设高层住宅，另有小学、幼儿园等配套设施。项目将由保利物业进行物业管理服务。');
INSERT INTO `reb` VALUES ('1549', '山东会兴置业有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/604ac425-2a35-472f-9e59-c746d66f4034.shtml', '', '013840', '刘宝章', '山东省济南市济阳县济北开发区永安路15号闻韶佳苑沿街房11号商铺', '84230977', 'sdhuixingzhiye@163.com', '2000 万元', '民营企业', '山东会兴置业有限责任公司（以下简称“会兴置业”）成立于2010年4月，注册资金2000万元，注册地址位于济阳县济北开元大街131号， 法人代表为刘宝章，是一家从事房地产开发建设的专业公司。主要经营范围有：房地产开发、销售；物业管理；建材销售等。公司现有员工26 人，其中大专文凭10人；高职职称2人、中级职称9人、初级职称4人。 会兴置业自成立以来，秉承“顾客的需要时我的机遇，顾客的满意是我的追求”的企业宗旨，本着“质量为本、用户至上”的管理方针和 “锐意进取、精益求精”的企业精神，先后与其他房地产公司合作在济阳承建过多家建设项目，现独立开发建设“闻韶佳苑”小区。', '山东会兴置业有限责任公司null刘宝章山东省济南市济阳县济北开发区永安路15号闻韶佳苑沿街房11号商铺84230977sdhuixingzhiye@163.com2000 万元民营企业山东会兴置业有限责任公司（以下简称“会兴置业”）成立于2010年4月，注册资金2000万元，注册地址位于济阳县济北开元大街131号， 法人代表为刘宝章，是一家从事房地产开发建设的专业公司。主要经营范围有：房地产开发、销售；物业管理；建材销售等。公司现有员工26 人，其中大专文凭10人；高职职称2人、中级职称9人、初级职称4人。 会兴置业自成立以来，秉承“顾客的需要时我的机遇，顾客的满意是我的追求”的企业宗旨，本着“质量为本、用户至上”的管理方针和 “锐意进取、精益求精”的企业精神，先后与其他房地产公司合作在济阳承建过多家建设项目，现独立开发建设“闻韶佳苑”小区。');
INSERT INTO `reb` VALUES ('1550', '济南天泰置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/61d46c08-5109-43e9-9421-ec7dff01330e.shtml', '', '013781', '黄运林', '济南市高新区新宇路西侧世纪财富中心AB座712-9室', '68610576', 'tiantaizhiye@sinan.com', '15000 万元', '民营企业', '济南天泰置业有限公司是由青岛天泰房地产开发股份有限公司投资，2011年1月14日成立的房地产开发公司。公司注册资金贰亿元人民币，计划投资开发奥体?天泰广场项目，该项目位于济南市东部奥体中心与经十路北侧，涵盖高端写字楼、商业、高端住宅、商务公寓等多种建筑形态。', '济南天泰置业有限公司null黄运林济南市高新区新宇路西侧世纪财富中心AB座712-9室68610576tiantaizhiye@sinan.com15000 万元民营企业济南天泰置业有限公司是由青岛天泰房地产开发股份有限公司投资，2011年1月14日成立的房地产开发公司。公司注册资金贰亿元人民币，计划投资开发奥体?天泰广场项目，该项目位于济南市东部奥体中心与经十路北侧，涵盖高端写字楼、商业、高端住宅、商务公寓等多种建筑形态。');
INSERT INTO `reb` VALUES ('1551', '济南汇中新实业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/6304e8dd-d700-4e56-ad06-983f555ac0f5.shtml', '', '013797', '陈松', '济南市天桥区铜元局前街1号', '67870370', '1249864500@qq.com', '5000 万元', '民营企业', '我公司济南汇中新实业有限公司成立于2005年11月，公司在济南汇中置业有限公司的基础上发展而来。公司本着“以人为本，造福社会”的企业经营宗旨，注重企业文化建设和企业品牌建设，致力于集团化发展力图把企业打造成为先进的、符合现代企业制度的济南市知明房地产企业。公司正式插手开发“龙泉山庄”住宅小区项目开发，该项目占地72亩,由13栋多层住宅楼、1栋办公楼组成，总建筑面积6万平方米。把该项目打造成济南市乃至山东省的精品楼盘，为济南市的房地产开发事业贡献更大的力量。', '济南汇中新实业有限公司null陈松济南市天桥区铜元局前街1号678703701249864500@qq.com5000 万元民营企业我公司济南汇中新实业有限公司成立于2005年11月，公司在济南汇中置业有限公司的基础上发展而来。公司本着“以人为本，造福社会”的企业经营宗旨，注重企业文化建设和企业品牌建设，致力于集团化发展力图把企业打造成为先进的、符合现代企业制度的济南市知明房地产企业。公司正式插手开发“龙泉山庄”住宅小区项目开发，该项目占地72亩,由13栋多层住宅楼、1栋办公楼组成，总建筑面积6万平方米。把该项目打造成济南市乃至山东省的精品楼盘，为济南市的房地产开发事业贡献更大的力量。');
INSERT INTO `reb` VALUES ('1552', '章丘市鑫达房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/208ff258-1aab-4133-a4fb-d577ce03a359.shtml', '', '013839', '弭守林', '明水眼明泉小区', '83268369', '178320233@qq.com', '2010 万元', '民营企业', '章丘市鑫达房地产开发有限公司，成立于2003年8月20日，公司位于章丘市明水眼明泉住宅小区，企业注册资金2010万元，公司类型为私营有限责任公司，主要经营范围为房地产开发。', '章丘市鑫达房地产开发有限公司null弭守林明水眼明泉小区83268369178320233@qq.com2010 万元民营企业章丘市鑫达房地产开发有限公司，成立于2003年8月20日，公司位于章丘市明水眼明泉住宅小区，企业注册资金2010万元，公司类型为私营有限责任公司，主要经营范围为房地产开发。');
INSERT INTO `reb` VALUES ('1553', '恒大地产集团济南置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/cd836294-3485-42f2-90d2-226fc147ff61.shtml', '', '013850', '廖嘉宁', '洪家楼南路11-2号', '80975935', '285785006@qq.com', '700000 万元', '民营企业', '恒大地产集团济南置业有限公司成立于2009年9月，截至目前已在济南建立18个项目子公司，开发项目逾千万平方米，为省城济南房地产事业做出了突出贡献', '恒大地产集团济南置业有限公司null廖嘉宁洪家楼南路11-2号80975935285785006@qq.com700000 万元民营企业恒大地产集团济南置业有限公司成立于2009年9月，截至目前已在济南建立18个项目子公司，开发项目逾千万平方米，为省城济南房地产事业做出了突出贡献');
INSERT INTO `reb` VALUES ('1554', '济南高新控股集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/43af6b3e-7392-42c6-89e2-a7ed41e276e2.shtml', '', '013812', '李昊', '济南市工业南路28号', '86518210', '330737236@qq.com', '200000 万元', '国有企业', '济南高新控股集团有限公司成立于2005年12月26日，属济南高新区管委会的国有独资公司。集团公司注册资本10亿元人民币。下辖6家控股子公司，12家参股公司。公司立足于本地化，在投融资、公共设施、房地产开发、园区经营等方面积极拓展业务，为高新区提供良好的投资环境和生活环境，促进产业积聚和发展。 在房地产开发方面，集团公司以投资兴建了高新技术产业基地、资本营运科技园、济南国际会展中心、东正科技厂房等总建筑面积达30万平米的项目。', '济南高新控股集团有限公司null李昊济南市工业南路28号86518210330737236@qq.com200000 万元国有企业济南高新控股集团有限公司成立于2005年12月26日，属济南高新区管委会的国有独资公司。集团公司注册资本10亿元人民币。下辖6家控股子公司，12家参股公司。公司立足于本地化，在投融资、公共设施、房地产开发、园区经营等方面积极拓展业务，为高新区提供良好的投资环境和生活环境，促进产业积聚和发展。 在房地产开发方面，集团公司以投资兴建了高新技术产业基地、资本营运科技园、济南国际会展中心、东正科技厂房等总建筑面积达30万平米的项目。');
INSERT INTO `reb` VALUES ('1555', '山东宏昌置业集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/57094348-4014-42a3-bea5-55d6b12484aa.shtml', '', '013835', '马岳振', '章丘市双山路74号', '83319651', 'hongchangzhiye@163.com', '6000 万元', '国有企业', '济南宏昌置业有限公司成立于一九九四年十一月十九日，是一家专门从事房地产开发的企业，具有三级开发资质，注册资金3000万元，法人代表杨殿明。公司的质量方针：业主的满意是我们永恒的追求；质量目标：期房合同兑现率100%，预售销售超过70%，顾客满意率90%以上。公司自成立以来，相继开发了宏昌“花园小区”、“丽园花苑小区”、“文宏小区”等，累计开发面积26万平方米，在章丘树立起房地产业优质“宏昌”品牌。公司二OO六年实现销售收入7484万元，利税1200万元，列章丘市民营企业税收第二名，公司2003至2006年被章丘市评为“最佳效益企业”，被济南市评为“重合同守信用”企业，2002年通过国家ISO9001质量管理体系认证，开发的宏昌“花园小区”被济南市房管局评为“物业管理优秀住宅小区”。', '山东宏昌置业集团有限公司null马岳振章丘市双山路74号83319651hongchangzhiye@163.com6000 万元国有企业济南宏昌置业有限公司成立于一九九四年十一月十九日，是一家专门从事房地产开发的企业，具有三级开发资质，注册资金3000万元，法人代表杨殿明。公司的质量方针：业主的满意是我们永恒的追求；质量目标：期房合同兑现率100%，预售销售超过70%，顾客满意率90%以上。公司自成立以来，相继开发了宏昌“花园小区”、“丽园花苑小区”、“文宏小区”等，累计开发面积26万平方米，在章丘树立起房地产业优质“宏昌”品牌。公司二OO六年实现销售收入7484万元，利税1200万元，列章丘市民营企业税收第二名，公司2003至2006年被章丘市评为“最佳效益企业”，被济南市评为“重合同守信用”企业，2002年通过国家ISO9001质量管理体系认证，开发的宏昌“花园小区”被济南市房管局评为“物业管理优秀住宅小区”。');
INSERT INTO `reb` VALUES ('1556', '济南天建房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/37083d2c-5bd7-4e9b-a3f7-da52e72968dd.shtml', '', '0161603', '石玮华', '济南市天桥区无影山东路38-1号', '85069298', 'jntjfdc@163.com', '5000 万元', '民营企业', '济南天建房地产开发总公司成立于1992年，公司注册资金2020万元，国家二级房地产开发资质。 2003年8月企业成功改制为济南天建房地产开发有限公司。现公司下辖9个部门及天建营销、天建物业分公司。现有员工37余人。 公司成立以来，始终坚持“诚信、严谨、务实、高效”的天建精神，秉承＂以人为本，追求卓越＂的企业发展理念，１５年成功地产经验，自改制后成功的开发建设了各类房屋及公建配套建筑面积15万平方米，工程合格率１００％，专业功力铸就经典的楼盘丰姿。 　　近年来天建房地产依靠公司本身财力，综合利用各方面的优势，一方面注意引进国内外先进的设计思想和一流的建造技术，注重质量，讲究信誉；另一方面在每一个经营环节中不断纳入新的理念，注重形象策划、包装设计，以全新的思想、全新的企业形象向市场的深度和广度拓展，不断实施品牌战略。 凭借良好的信誉和开发实力，公司成功入选了“全国房地产领先企业”，并连年荣获“山东省房地产综合效益百强企业”，“济南市十佳房地产开发企业”，“济南市文明单位”、“天桥区纳税大户”等荣誉称号。其开发的影山花园、天福苑小区先后获得省、市优秀小区荣誉称号。 企业的昨日的辉煌，已转变为今日的宝贵财富，面对充满机遇的新世纪，我们将继往开来，再创伟业。', '济南天建房地产开发有限公司null石玮华济南市天桥区无影山东路38-1号85069298jntjfdc@163.com5000 万元民营企业济南天建房地产开发总公司成立于1992年，公司注册资金2020万元，国家二级房地产开发资质。 2003年8月企业成功改制为济南天建房地产开发有限公司。现公司下辖9个部门及天建营销、天建物业分公司。现有员工37余人。 公司成立以来，始终坚持“诚信、严谨、务实、高效”的天建精神，秉承＂以人为本，追求卓越＂的企业发展理念，１５年成功地产经验，自改制后成功的开发建设了各类房屋及公建配套建筑面积15万平方米，工程合格率１００％，专业功力铸就经典的楼盘丰姿。 　　近年来天建房地产依靠公司本身财力，综合利用各方面的优势，一方面注意引进国内外先进的设计思想和一流的建造技术，注重质量，讲究信誉；另一方面在每一个经营环节中不断纳入新的理念，注重形象策划、包装设计，以全新的思想、全新的企业形象向市场的深度和广度拓展，不断实施品牌战略。 凭借良好的信誉和开发实力，公司成功入选了“全国房地产领先企业”，并连年荣获“山东省房地产综合效益百强企业”，“济南市十佳房地产开发企业”，“济南市文明单位”、“天桥区纳税大户”等荣誉称号。其开发的影山花园、天福苑小区先后获得省、市优秀小区荣誉称号。 企业的昨日的辉煌，已转变为今日的宝贵财富，面对充满机遇的新世纪，我们将继往开来，再创伟业。');
INSERT INTO `reb` VALUES ('1557', '山东融汇建设开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/74dcb5a3-d676-4554-a370-ececcb1a993e.shtml', '', '013820', '黄祖仕', '济南市市中区舜耕路28号舜华园D楼402', '82678982', '76811494@qq.com', '20000 万元', '民营企业', '山东融汇建设开发有限公司于2011年11月9日成立，公司注册资金贰仟万元，是由重庆融汇实业、重庆融友经贸合资控股的房地产开发企业。 公司秉承秉承“融汇城市梦想，筑就品质生活”的经营理念，以“融汇世界，成就梦想”为使命，追求融汇世界卓越的人才和先进的科技、理念，把“融汇”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。', '山东融汇建设开发有限公司null黄祖仕济南市市中区舜耕路28号舜华园D楼4028267898276811494@qq.com20000 万元民营企业山东融汇建设开发有限公司于2011年11月9日成立，公司注册资金贰仟万元，是由重庆融汇实业、重庆融友经贸合资控股的房地产开发企业。 公司秉承秉承“融汇城市梦想，筑就品质生活”的经营理念，以“融汇世界，成就梦想”为使命，追求融汇世界卓越的人才和先进的科技、理念，把“融汇”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。');
INSERT INTO `reb` VALUES ('1558', '山东新世纪温州工业基地发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/0d70e112-b844-4df4-af18-8cc4dd1bcfe8.shtml', '', '013836', '黄益治', '济南市天桥区蓝翔路15号时代总部基地二区一号楼', '81267081', '343437619@qq.com', '3000 万元', '民营企业', '山东新世纪（温州）工业基地发展有限公司于2004年12月10日，经山东省工商行政管理局登记设立。公司位于繁华中心市区大观园，注册资本为2000万元人民币。公司经营范围为：基础设施建设开发、市场建设开发、工业园区建设开发、工业厂房及房地产开发建设等。 公司以强大浙商资源为背景，公司具有各类园区建设开发的丰富经验，拥有包括各类高级、中级技术人才共20余人。公司高级技术及管理人员多来自浙江省，具有多年的金融、建筑设计和房地产管理经验。 2006年1月，坐落于天桥区药山工业园内首个“总部经济”项目——“时代总部基地”正式宣告启动，山东新世纪（温州）工业基地发展有限公司也因此成为山东省内第一个倡导并成功引进总部经济新模式的典范，受到政府、经济、学术等各界人士的极大关注。在总部经济方兴未艾的今天，山东新世纪（温州）工业基地发展有限公司高举总部经济大旗，以崭新的总部经济模式，为山东企业的未来腾跃发展指引导航。', '山东新世纪温州工业基地发展有限公司null黄益治济南市天桥区蓝翔路15号时代总部基地二区一号楼81267081343437619@qq.com3000 万元民营企业山东新世纪（温州）工业基地发展有限公司于2004年12月10日，经山东省工商行政管理局登记设立。公司位于繁华中心市区大观园，注册资本为2000万元人民币。公司经营范围为：基础设施建设开发、市场建设开发、工业园区建设开发、工业厂房及房地产开发建设等。 公司以强大浙商资源为背景，公司具有各类园区建设开发的丰富经验，拥有包括各类高级、中级技术人才共20余人。公司高级技术及管理人员多来自浙江省，具有多年的金融、建筑设计和房地产管理经验。 2006年1月，坐落于天桥区药山工业园内首个“总部经济”项目——“时代总部基地”正式宣告启动，山东新世纪（温州）工业基地发展有限公司也因此成为山东省内第一个倡导并成功引进总部经济新模式的典范，受到政府、经济、学术等各界人士的极大关注。在总部经济方兴未艾的今天，山东新世纪（温州）工业基地发展有限公司高举总部经济大旗，以崭新的总部经济模式，为山东企业的未来腾跃发展指引导航。');
INSERT INTO `reb` VALUES ('1559', '济南长远房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/32741b70-82ca-48b7-965f-d5f00b187d9d.shtml', '', '013767', '崔吉顺', '商河县振业街12号', '84876222', 'changyuan.zhiye@163.com', '2000 万元', '民营企业', '济南长远房地产开发有限公司，成立于二00三年九月二十四日，注册资金3000万元。 公司经营范围：房地产开发。 经营以来，在政府及建管局、国土、财政等单位的大力支持和帮助下，公司汇集一批多年从事房地产开发经营的专业人才，同时拥有一批从事施工建设的技术人才。本公司以董事会为领导核心，下设总经理、副总经理及办公室、经营部、工程部一部、工程二部、财务统计部和人力资源部。总公司框架清晰，分工明确，是一个实力雄厚、信誉卓越、经验丰富的房地产开发企业。 公司本着“信誉第一、质量至上”的企业品牌理念，对所建工程精益求精，将人文环境注入楼盘之中，受到了有关主管部门的表彰和客户的好评。 长远房地产有限公司坚持以“市场为主导、客户为中心”的经营方针，信奉“开发一个项目、造福一方人民、广交一批朋友”的精神，竭诚欢迎各界人士携手并进，开拓进取，共创辉煌！ 地址：商河县振业街12号 企业类型：有限责任公司 成立日期：2003年9月24日', '济南长远房地产开发有限公司null崔吉顺商河县振业街12号84876222changyuan.zhiye@163.com2000 万元民营企业济南长远房地产开发有限公司，成立于二00三年九月二十四日，注册资金3000万元。 公司经营范围：房地产开发。 经营以来，在政府及建管局、国土、财政等单位的大力支持和帮助下，公司汇集一批多年从事房地产开发经营的专业人才，同时拥有一批从事施工建设的技术人才。本公司以董事会为领导核心，下设总经理、副总经理及办公室、经营部、工程部一部、工程二部、财务统计部和人力资源部。总公司框架清晰，分工明确，是一个实力雄厚、信誉卓越、经验丰富的房地产开发企业。 公司本着“信誉第一、质量至上”的企业品牌理念，对所建工程精益求精，将人文环境注入楼盘之中，受到了有关主管部门的表彰和客户的好评。 长远房地产有限公司坚持以“市场为主导、客户为中心”的经营方针，信奉“开发一个项目、造福一方人民、广交一批朋友”的精神，竭诚欢迎各界人士携手并进，开拓进取，共创辉煌！ 地址：商河县振业街12号 企业类型：有限责任公司 成立日期：2003年9月24日');
