INSERT INTO `reb` VALUES ('1562', '绿地地产济南滨河置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/4c566ca8-8a85-4bf9-bdcb-03fc03ea14f8.shtml', '', '013777', '金成发', '济南市天桥区济泺路57号', '66696955', '317253209@qq.com', '84000 万元', '民营企业', '绿地地产济南滨河置业有限公司是一家有限责任公司，注册资金 壹亿元整。 绿地地产济南滨河置业有限公司由上海绿地集团有限公司出资 成立,是上海绿地集团的全资子公司。 绿地地产济南滨河置业有限公司成立日期是2010年11月12日。 营业期限自2010年11月12日开始。 上海绿地集团，是集房地产规划设计、开发建设、物业管理于一体的现代化大型房地产综合企业，是中国房地产行业的标杆企业；拥有中国一级资质的房地产开发公司、中国甲级资质的建筑设计规划研究院、中国一级资质的建筑施工公司、中国一级资质的物业管理公司。 目前在济南、广州、上海、天津、重庆、沈阳、武汉、成都、南京、西安等主要城市拥有房地产开发目，覆盖高端、中端及中高端等多个产品系列，先后获得“中国名盘”“中国房地产成功开发典范”等多项国家级殊荣。', '绿地地产济南滨河置业有限公司null金成发济南市天桥区济泺路57号66696955317253209@qq.com84000 万元民营企业绿地地产济南滨河置业有限公司是一家有限责任公司，注册资金 壹亿元整。 绿地地产济南滨河置业有限公司由上海绿地集团有限公司出资 成立,是上海绿地集团的全资子公司。 绿地地产济南滨河置业有限公司成立日期是2010年11月12日。 营业期限自2010年11月12日开始。 上海绿地集团，是集房地产规划设计、开发建设、物业管理于一体的现代化大型房地产综合企业，是中国房地产行业的标杆企业；拥有中国一级资质的房地产开发公司、中国甲级资质的建筑设计规划研究院、中国一级资质的建筑施工公司、中国一级资质的物业管理公司。 目前在济南、广州、上海、天津、重庆、沈阳、武汉、成都、南京、西安等主要城市拥有房地产开发目，覆盖高端、中端及中高端等多个产品系列，先后获得“中国名盘”“中国房地产成功开发典范”等多项国家级殊荣。');
INSERT INTO `reb` VALUES ('1563', '济南中铁置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/6800546c-e18f-43ca-ba2e-f3552f779af5.shtml', '', '013828', '刘序勇', '济南市高新区工业南路59号中铁财智中心8号楼16层', '58836666', '525785305@qq.com', '5000 万元', '国有企业', '济南中铁置业有限公司成立于2011年5月20日，注册资金5000万元，法人代表张学军，公司住所：济南市高新区工业南路59号中铁财智中心8号楼16层，公司经营范围：房地产开发、经营；自有房屋租赁；场地租赁；房地产中介服务（未取得专项许可的项目除外）。', '济南中铁置业有限公司null刘序勇济南市高新区工业南路59号中铁财智中心8号楼16层58836666525785305@qq.com5000 万元国有企业济南中铁置业有限公司成立于2011年5月20日，注册资金5000万元，法人代表张学军，公司住所：济南市高新区工业南路59号中铁财智中心8号楼16层，公司经营范围：房地产开发、经营；自有房屋租赁；场地租赁；房地产中介服务（未取得专项许可的项目除外）。');
INSERT INTO `reb` VALUES ('1564', '济南海信置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/12717b22-02c2-4fa6-8d50-6bce21f5a94b.shtml', '', '013860', '刘浩', '济南市高新区舜华北路180号慧园二区7号楼商业楼103（北）', '88878097', 'zhucui@hisense.com', '1000 万元', '民营企业', '青岛海信房地产股份有限公司成立于1995年，已发展成为海信集团的主导产业，拥有建设部颁发的国家一级开发资质、一级物业管理资质、甲级设计资质，是山东省综合实力最强的房地产企业之一。　　 公司秉承“有爱·建筑也动情”的核心理念，坚持以人为本，致力于打造“令人尊敬的企业”，至今开发建设了海信·慧园、海信·燕岛国际公寓、海信·清泉墅、海信大厦、海信信息产业园等40余个项目，开发类型涉及住宅、公寓、别墅、高级写字楼以及大型工业园区，年开发面积连续多年逾百万平方米。其中，海信大厦荣膺2002年度中国建筑工程最高奖——“鲁班奖”，“海信·慧园”、“海信·燕岛国际公寓”被中国住交会评为“中国名盘”。2007年，“海信·金色慧谷”荣获首届全国“广厦奖”。 　　 近几年，海信地产的综合实力迅速扩大，开发面积、销售收入、土地储备量连年大幅增长，自2003年开始，连续五年排名“青岛市房地产综合实力十强企业”首位，连续三年荣膺“中国房地产品牌企业”，并于2004年获得“中国城市运营商50强”称号，2005年入选“中国房地产百强企业成长性10强”，2006年年度纳税突破2亿元，2007年纳税3亿元，成为山东省房地产行业的纳税龙头企业。 　　 随着公司实力的日益壮大，海信地产自2005年开始实施省域化发展战略，目前已初步完成在山东省内的战略布局，开发业务遍及青岛、济南、烟台、潍坊、东营、即墨等六个城市，成功转型为区域性房地产开发企业，力争发展为全国著名的住宅产业集团。 济南海信置业有限公司是青岛海信房地产股份有限公司在济南的全资子公司，目前在济南开发建设济南海信慧园项目。', '济南海信置业有限公司null刘浩济南市高新区舜华北路180号慧园二区7号楼商业楼103（北）88878097zhucui@hisense.com1000 万元民营企业青岛海信房地产股份有限公司成立于1995年，已发展成为海信集团的主导产业，拥有建设部颁发的国家一级开发资质、一级物业管理资质、甲级设计资质，是山东省综合实力最强的房地产企业之一。　　 公司秉承“有爱·建筑也动情”的核心理念，坚持以人为本，致力于打造“令人尊敬的企业”，至今开发建设了海信·慧园、海信·燕岛国际公寓、海信·清泉墅、海信大厦、海信信息产业园等40余个项目，开发类型涉及住宅、公寓、别墅、高级写字楼以及大型工业园区，年开发面积连续多年逾百万平方米。其中，海信大厦荣膺2002年度中国建筑工程最高奖——“鲁班奖”，“海信·慧园”、“海信·燕岛国际公寓”被中国住交会评为“中国名盘”。2007年，“海信·金色慧谷”荣获首届全国“广厦奖”。 　　 近几年，海信地产的综合实力迅速扩大，开发面积、销售收入、土地储备量连年大幅增长，自2003年开始，连续五年排名“青岛市房地产综合实力十强企业”首位，连续三年荣膺“中国房地产品牌企业”，并于2004年获得“中国城市运营商50强”称号，2005年入选“中国房地产百强企业成长性10强”，2006年年度纳税突破2亿元，2007年纳税3亿元，成为山东省房地产行业的纳税龙头企业。 　　 随着公司实力的日益壮大，海信地产自2005年开始实施省域化发展战略，目前已初步完成在山东省内的战略布局，开发业务遍及青岛、济南、烟台、潍坊、东营、即墨等六个城市，成功转型为区域性房地产开发企业，力争发展为全国著名的住宅产业集团。 济南海信置业有限公司是青岛海信房地产股份有限公司在济南的全资子公司，目前在济南开发建设济南海信慧园项目。');
INSERT INTO `reb` VALUES ('1565', '济南西城投资开发集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/28265ba5-50e4-4966-87ca-a28f7844f5ea.shtml', '', '013733', '张伟', '济南市长清大学科技园大学路4366号', '69900617', '470912812@qq.com', '500000 万元', '国有企业', '济南西城投资开发集团有限公司简介 济南西城投资开发集团有限公司于2011年9月正式注册成立，是经济南市人民政府批准组建的国有独资有限责任公司，与济南市西区投融资管理中心“一套机构，两块牌子”。 济南市西区投融资管理中心是市政府直属全额预算管理正局级事业单位。 主要职能是：按照市政府批准的政府投融资计划，管理西区政府项目的投融资业务；编制年度计划，统一对外融资、偿还借款；根据批准的融资方案，拨付资金、监督运行；根据市政府批准的建设项目，进行项目和房产、地产投资、合作、开发经营；受市国土资源局的委托，负责西部新城建设用地的整理、储备和前期土地熟化；从事政府授权范围内的国有资产运营、管理，承担保值增值责任；代表政府行使国有资产出资人收益权；办理市政府交办的其它事项。 中心（集团）主要负责济南西部新城450平方公里范围内的规划建设。近期，主要围绕大学科技园、西客站片区和济西湿地生态区3个核心组团开展了约130平方公里的济南西部新城规划建设工作。其中，西客站片区55平方公里，大学科技园片区43.1平方公里，济西湿地生态区（一期）33.4平方公里。截至目前，西部新城范围内累计完成政府投资300多亿元，带动社会化投资500亿元。建成和在建房建工程1000多万平方米，新建和在建道路200多公里，建成绿化和景观工程6000多亩，新建和整合各类管网4000多公里，整治河道50多公里。新建成10所高校，入驻18万师生。整体搬迁整合了40多个村庄，拆迁700多万平方米，10万多人由农民变市民。收储和熟化了7万多亩土地，出让土地近8000亩，出让收入120多亿元，存量的可开发土地1.7万亩，预计出让收入500多亿元。 今后，公司将围绕土地熟化、房地产、商业运营、产业园开发、文化旅游、金融等6大板块全面开展城市经营，不断壮大公司实力，逐步实现做实、做大、做强的目标，继续在新城开发建设工作中发挥主力军作用。', '济南西城投资开发集团有限公司null张伟济南市长清大学科技园大学路4366号69900617470912812@qq.com500000 万元国有企业济南西城投资开发集团有限公司简介 济南西城投资开发集团有限公司于2011年9月正式注册成立，是经济南市人民政府批准组建的国有独资有限责任公司，与济南市西区投融资管理中心“一套机构，两块牌子”。 济南市西区投融资管理中心是市政府直属全额预算管理正局级事业单位。 主要职能是：按照市政府批准的政府投融资计划，管理西区政府项目的投融资业务；编制年度计划，统一对外融资、偿还借款；根据批准的融资方案，拨付资金、监督运行；根据市政府批准的建设项目，进行项目和房产、地产投资、合作、开发经营；受市国土资源局的委托，负责西部新城建设用地的整理、储备和前期土地熟化；从事政府授权范围内的国有资产运营、管理，承担保值增值责任；代表政府行使国有资产出资人收益权；办理市政府交办的其它事项。 中心（集团）主要负责济南西部新城450平方公里范围内的规划建设。近期，主要围绕大学科技园、西客站片区和济西湿地生态区3个核心组团开展了约130平方公里的济南西部新城规划建设工作。其中，西客站片区55平方公里，大学科技园片区43.1平方公里，济西湿地生态区（一期）33.4平方公里。截至目前，西部新城范围内累计完成政府投资300多亿元，带动社会化投资500亿元。建成和在建房建工程1000多万平方米，新建和在建道路200多公里，建成绿化和景观工程6000多亩，新建和整合各类管网4000多公里，整治河道50多公里。新建成10所高校，入驻18万师生。整体搬迁整合了40多个村庄，拆迁700多万平方米，10万多人由农民变市民。收储和熟化了7万多亩土地，出让土地近8000亩，出让收入120多亿元，存量的可开发土地1.7万亩，预计出让收入500多亿元。 今后，公司将围绕土地熟化、房地产、商业运营、产业园开发、文化旅游、金融等6大板块全面开展城市经营，不断壮大公司实力，逐步实现做实、做大、做强的目标，继续在新城开发建设工作中发挥主力军作用。');
INSERT INTO `reb` VALUES ('1566', '章丘市第二城市建设综合开发有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/7212c013-6438-4802-a264-4a8b2f097031.shtml', '', '013798', '孙继华', '章丘市眼明泉小区', '83269579', 'zqekf@163.com', '1886 万元', '民营企业', '章丘市第二城市建设综合开发有限责任公司 简 介 章丘市第二城市建设综合开发有限责任公司成立于1996年12月，注册资本1886万元，是一家具有三级开发资质房地产企业，下设资质等级为建筑工程施工总承包二级的明泉建筑安装有限公司、物业管理等级为三级的龙大物业管理有限公司两个子公司，是集房地产开发、房屋销售、建筑工程施工、物业管理为一体的集团化企业。 　　公司技术力量雄厚，大中专毕业生占职工总数的83％，各类专业技术人员占职工总数的75％，其中中高级专业技术人员占50％。 　　公司坚持\"以经济建设为中心，以城市建设综合开发为龙头，以住宅建设为主导，积极拓展房地产相关市场\"的指导思想，按照\"注重规模、梯次开发、创建品牌、滚动发展\"的开发思路，在改革的浪潮中激流勇进，在激烈的市场竞争中独占鳌头，公司成立十多年来，先后开发建设了锦绣花苑小区；辛庄小区；马棚山小区；眼明泉小区；东山花园小区二区，阳光花园西区等小区及双山花苑、胶济铁路回迁等建筑群体工程，总计开发建设面积130余万平方米。近期以高标准规划、高层次设计、高质量建设的工业二路阳光花园小区东区、金如意花园小区即将将开工建设，该地块建设面积30余万平方米。　　 公司奉行\"团结务实、开拓进取、勤勉敬业、攀高创新\"的企业精神，秉承\"以人为本\"的宗旨，坚持\"积极慎重、新颖超前、人无我有，人有我新\"的方针，积极实施品牌战略。公司连续多年被济南市地税局评为 “AAA级纳税信誉企业”；被章丘市工商局评为“重合同、守信用”企业及“ 2006—2007年度文明诚信企业”；数次被市消费者协会推荐为“放心房销售单位”，2008年又荣获市“十佳效益企业”等荣誉称号，房屋销售连续多年跻身于销售榜前列，荣膺章丘市同行业排头企业。开发建设的眼明泉小区2002年被评为“济南市物业管理文明小区”；2003年被评为“省物业管理优秀小区”；2005年2月被评为“济南市绿色社区”和“安静居住小区”；2008年东山花园小区、阳光花园小区双双被评为“济南市文明先进单位”。', '章丘市第二城市建设综合开发有限责任公司null孙继华章丘市眼明泉小区83269579zqekf@163.com1886 万元民营企业章丘市第二城市建设综合开发有限责任公司 简 介 章丘市第二城市建设综合开发有限责任公司成立于1996年12月，注册资本1886万元，是一家具有三级开发资质房地产企业，下设资质等级为建筑工程施工总承包二级的明泉建筑安装有限公司、物业管理等级为三级的龙大物业管理有限公司两个子公司，是集房地产开发、房屋销售、建筑工程施工、物业管理为一体的集团化企业。 　　公司技术力量雄厚，大中专毕业生占职工总数的83％，各类专业技术人员占职工总数的75％，其中中高级专业技术人员占50％。 　　公司坚持\"以经济建设为中心，以城市建设综合开发为龙头，以住宅建设为主导，积极拓展房地产相关市场\"的指导思想，按照\"注重规模、梯次开发、创建品牌、滚动发展\"的开发思路，在改革的浪潮中激流勇进，在激烈的市场竞争中独占鳌头，公司成立十多年来，先后开发建设了锦绣花苑小区；辛庄小区；马棚山小区；眼明泉小区；东山花园小区二区，阳光花园西区等小区及双山花苑、胶济铁路回迁等建筑群体工程，总计开发建设面积130余万平方米。近期以高标准规划、高层次设计、高质量建设的工业二路阳光花园小区东区、金如意花园小区即将将开工建设，该地块建设面积30余万平方米。　　 公司奉行\"团结务实、开拓进取、勤勉敬业、攀高创新\"的企业精神，秉承\"以人为本\"的宗旨，坚持\"积极慎重、新颖超前、人无我有，人有我新\"的方针，积极实施品牌战略。公司连续多年被济南市地税局评为 “AAA级纳税信誉企业”；被章丘市工商局评为“重合同、守信用”企业及“ 2006—2007年度文明诚信企业”；数次被市消费者协会推荐为“放心房销售单位”，2008年又荣获市“十佳效益企业”等荣誉称号，房屋销售连续多年跻身于销售榜前列，荣膺章丘市同行业排头企业。开发建设的眼明泉小区2002年被评为“济南市物业管理文明小区”；2003年被评为“省物业管理优秀小区”；2005年2月被评为“济南市绿色社区”和“安静居住小区”；2008年东山花园小区、阳光花园小区双双被评为“济南市文明先进单位”。');
INSERT INTO `reb` VALUES ('1567', '济南香江置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/1295bf74-f83f-4636-b05e-55a193145c9a.shtml', '', '013776', '张波', '济南市济阳县垛石镇经委', '82705137', 'xjzy108@163.com', '6000 万元', '民营企业', '香江置业公司简介 济南香江置业有限公司是一家以房地产开发为核心业务的民营企业，具有房地产开发三级资质，公司现有专业技术人员30余名，正在运作和推出的项目有高层住宅项目峰景鉴筑和别墅项目峰景上院，这些项目的高品质运作将有效提升公司的品牌效益，为公司长期发展开辟广阔的空间。 公司以稳健务实的工作作风，依托自己的企业文化，在激烈的市场竞争中占有一席之地，成为一家颇具实力的开发公司。公司本着精益求精、努力营造人性化优质生活空间的开发理念，一直致力于品牌化及市场化运作，不断拓展房地产开发领域，以更加积极的策略和态度，追求高品质，回报全社会。 高层住宅项目峰景鉴筑位于郎茂山西路，总建筑面积近7万平米，该项目由国际大师级团队精心打造，在济南首次引进高层入户花园。匠心独运的“空中院落”，让高层住宅住户同样可以拥有私家院落生活。独创5.8米的入户大堂，让每一位业主在峰景鉴筑都能享受到“高门大院”尊崇；国际园林规划大师亲手设计的空中园林，小桥流水，再现老济南“水边的婉约”；绿篱成荫为每一位业主构建美丽的家园。峰景鉴筑主力户型面积从95—135㎡，是为济南市精英白领阶层量身定做精品家园。', '济南香江置业有限公司null张波济南市济阳县垛石镇经委82705137xjzy108@163.com6000 万元民营企业香江置业公司简介 济南香江置业有限公司是一家以房地产开发为核心业务的民营企业，具有房地产开发三级资质，公司现有专业技术人员30余名，正在运作和推出的项目有高层住宅项目峰景鉴筑和别墅项目峰景上院，这些项目的高品质运作将有效提升公司的品牌效益，为公司长期发展开辟广阔的空间。 公司以稳健务实的工作作风，依托自己的企业文化，在激烈的市场竞争中占有一席之地，成为一家颇具实力的开发公司。公司本着精益求精、努力营造人性化优质生活空间的开发理念，一直致力于品牌化及市场化运作，不断拓展房地产开发领域，以更加积极的策略和态度，追求高品质，回报全社会。 高层住宅项目峰景鉴筑位于郎茂山西路，总建筑面积近7万平米，该项目由国际大师级团队精心打造，在济南首次引进高层入户花园。匠心独运的“空中院落”，让高层住宅住户同样可以拥有私家院落生活。独创5.8米的入户大堂，让每一位业主在峰景鉴筑都能享受到“高门大院”尊崇；国际园林规划大师亲手设计的空中园林，小桥流水，再现老济南“水边的婉约”；绿篱成荫为每一位业主构建美丽的家园。峰景鉴筑主力户型面积从95—135㎡，是为济南市精英白领阶层量身定做精品家园。');
INSERT INTO `reb` VALUES ('1568', '山东省齐龙地产有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/139d61bc-0795-4582-b0e5-68de380cc569.shtml', '', '013842', '', '济南市马鞍山路56号', '0531-82028012', 'qilongdichan@163.com', '1800 万元', '', '', '山东省齐龙地产有限责任公司null济南市马鞍山路56号0531-82028012qilongdichan@163.com1800 万元');
INSERT INTO `reb` VALUES ('1569', '绿地地产（济南）有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/2c7372b8-09bb-4698-911e-8b194d0e72b1.shtml', '', '013789', '金成发', '山东省济南市槐荫区济兖路462号218房间', '66696955', '317253209@qq.com', '162200 万元', '国有企业', '成立于2010年06月12日。开发建设绿地缤纷城项目、绿地国际花都项目、绿地齐鲁之门项目、绿地中央广场项目及绿地实验中学项目。', '绿地地产（济南）有限公司null金成发山东省济南市槐荫区济兖路462号218房间66696955317253209@qq.com162200 万元国有企业成立于2010年06月12日。开发建设绿地缤纷城项目、绿地国际花都项目、绿地齐鲁之门项目、绿地中央广场项目及绿地实验中学项目。');
INSERT INTO `reb` VALUES ('1570', '济南宏大房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/4408aeb0-3de6-42dc-a26e-f8619d6f74b9.shtml', '', '013857', '于仁贵', '章丘市双山大街', '83319878', 'jinanhongda2010@163.com', '1800 万元', '国有企业', '济南宏大房地产开发有限公司创建于一九九三年，公司注册资本金1800万元，是具有房地产开发资质的有限公司。 经过多年的艰苦创业，公司经营规模逐步扩大，效益不断增长，积累了丰富的房地产开发管理经验，拥有一支高素质的职工队伍。并以坚持追求卓越，不断改进质量，以国内一流的品质和完善的服务，最大限度的满足顾客要求，获得顾客永久的信任作为自己的质量方针；以开发优良工程，不断提高顾客满意度作为自己的质量目标。公司独立开发了：双山花园小区、圣井花苑小区等以质优速快赢得了用户的好评，现正在积极推进宏大泉山逸品小区的开发建设。 公司将秉承“以人为本”的开发理念，按照现代企业管理制度，开发优质精品工程，打造经典服务品牌，注重每一个细节，以提升大众生活品质为己任，脚踏实地，不断进取，服务社会。', '济南宏大房地产开发有限公司null于仁贵章丘市双山大街83319878jinanhongda2010@163.com1800 万元国有企业济南宏大房地产开发有限公司创建于一九九三年，公司注册资本金1800万元，是具有房地产开发资质的有限公司。 经过多年的艰苦创业，公司经营规模逐步扩大，效益不断增长，积累了丰富的房地产开发管理经验，拥有一支高素质的职工队伍。并以坚持追求卓越，不断改进质量，以国内一流的品质和完善的服务，最大限度的满足顾客要求，获得顾客永久的信任作为自己的质量方针；以开发优良工程，不断提高顾客满意度作为自己的质量目标。公司独立开发了：双山花园小区、圣井花苑小区等以质优速快赢得了用户的好评，现正在积极推进宏大泉山逸品小区的开发建设。 公司将秉承“以人为本”的开发理念，按照现代企业管理制度，开发优质精品工程，打造经典服务品牌，注重每一个细节，以提升大众生活品质为己任，脚踏实地，不断进取，服务社会。');
INSERT INTO `reb` VALUES ('1571', '山东南侨房地产发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/1f52d444-bfe8-4628-8c26-571ebf5b8d97.shtml', '', '013795', '徐伟福', '济南市天桥区三角线街2号', '81857755', 'nanqiao@southasisgroup.com', '57100 万元', '外资企业', '山东南侨房地产发展有限公司是香港南益集团在山东投资的外商独资企业，公司成立于2007年10月，注册资金6.5亿港元。是南益集团在济南的第二家项目公司，负责天桥区宝华街“南益名泉春晓”新项目的开发，总建筑面积55万平米。名泉春晓项目，是南益地产继成功开发名士豪庭之后，2011推出又一力作，作为济南市最大的棚户区改造项目宝华街、官扎营城市旧改的一部分，北临堤口路，南临宝华街，西临纬六路，东临通普街；向南约一公里可达济南火车站南广场，北面正对济南长途汽车站和天桥区政府办公楼。该项目地理位置优越，交通便利，是聚集情景商业街、高档写字楼、精品公寓、高尚住宅群为一体的城市综合体，是一个整体布局完善、功能特色明显的现代化国际新街区。', '山东南侨房地产发展有限公司null徐伟福济南市天桥区三角线街2号81857755nanqiao@southasisgroup.com57100 万元外资企业山东南侨房地产发展有限公司是香港南益集团在山东投资的外商独资企业，公司成立于2007年10月，注册资金6.5亿港元。是南益集团在济南的第二家项目公司，负责天桥区宝华街“南益名泉春晓”新项目的开发，总建筑面积55万平米。名泉春晓项目，是南益地产继成功开发名士豪庭之后，2011推出又一力作，作为济南市最大的棚户区改造项目宝华街、官扎营城市旧改的一部分，北临堤口路，南临宝华街，西临纬六路，东临通普街；向南约一公里可达济南火车站南广场，北面正对济南长途汽车站和天桥区政府办公楼。该项目地理位置优越，交通便利，是聚集情景商业街、高档写字楼、精品公寓、高尚住宅群为一体的城市综合体，是一个整体布局完善、功能特色明显的现代化国际新街区。');
INSERT INTO `reb` VALUES ('1572', '济南天鸿房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/2506e25e-53fc-4aa3-b0de-c3041f329355.shtml', '', '013807', '薛振友', '济南市历城区工业北路69-1号', '88820516', 'quxinjiaisme@126.com', '51020.4082 万元', '民营企业', '济南天鸿房地产开发有限公司作为天鸿地产区域公司——山东天鸿置业开发有限公司旗下济南新城地产有限公司的全资项目公司，注册资金1000万元,现在员工30余人。济南天鸿房地产开发有限公司以房地产开发建设为主业，室内外装潢、信息咨询、建筑材料经营销售为辅业。 公司以人本为中心，重视员工发展和成长，为员工提供了具有竞争力的薪资计划和完善的福利保证，并为员工提供各种培训和职位再提升的机会和动力。依托集团公司的强大实力，济南天鸿房地产开发有限公司本着“以品牌赢得市场”的宗旨在不断成长,并迅速发展壮大。 目前，济南天鸿房地产开发有限公司在济南东部正运营大型住宅项目——天鸿?田园新城。项目总体规划数百万平米，其中启动区占地约678亩，总建筑面积近100万平米，是济南东部又一大规模的现代高品质复合型社区。', '济南天鸿房地产开发有限公司null薛振友济南市历城区工业北路69-1号88820516quxinjiaisme@126.com51020.4082 万元民营企业济南天鸿房地产开发有限公司作为天鸿地产区域公司——山东天鸿置业开发有限公司旗下济南新城地产有限公司的全资项目公司，注册资金1000万元,现在员工30余人。济南天鸿房地产开发有限公司以房地产开发建设为主业，室内外装潢、信息咨询、建筑材料经营销售为辅业。 公司以人本为中心，重视员工发展和成长，为员工提供了具有竞争力的薪资计划和完善的福利保证，并为员工提供各种培训和职位再提升的机会和动力。依托集团公司的强大实力，济南天鸿房地产开发有限公司本着“以品牌赢得市场”的宗旨在不断成长,并迅速发展壮大。 目前，济南天鸿房地产开发有限公司在济南东部正运营大型住宅项目——天鸿?田园新城。项目总体规划数百万平米，其中启动区占地约678亩，总建筑面积近100万平米，是济南东部又一大规模的现代高品质复合型社区。');
INSERT INTO `reb` VALUES ('1573', '济南伟业房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/1af35aef-0c74-4638-9123-21691d3b48c4.shtml', '', '013824', '白珂', '济南市平阴县济西工业园', '87869111', 'jnlf688@163.com', '2000 万元', '民营企业', '济南伟业房地产开发有限公司成立于二○○二年八月，是经山东省建设厅批准设立的，注册资金1000万元。实行独立核算、自主经营、自负盈亏的经济实体。 公司隶属平阴县建设局。占地40亩，建筑面积3900平方米的综合办公楼，位于平阴县济西工业园内。公司现有职工32人，其中技术人员13人，大专以上学历7人，中专学历6人，中级以上职称6人。公司内设企业管理办公室、技术管理部、质量保证部、客户回访中心等科室，各科室之间互相协作，配合默契，以其雄厚的技术设备实力和高素质的施工队伍，具有较强的房地产开发能力。 公司二○○二年投资620万元开发的平阴县玫瑰花苑小区A1、A3住宅楼，以设计新颖、配套齐全、建筑质量上承而倍受消费者青睐。公司拟将开发的平阴县坛屋山住宅小区已经上级有关部门批准，并办理了有关手续，即将开工建设。 公司必将以优质的服务贡献于社会、服务于人民，并在市场经济的大潮中，取得较好的效益，得到更快的发展。', '济南伟业房地产开发有限公司null白珂济南市平阴县济西工业园87869111jnlf688@163.com2000 万元民营企业济南伟业房地产开发有限公司成立于二○○二年八月，是经山东省建设厅批准设立的，注册资金1000万元。实行独立核算、自主经营、自负盈亏的经济实体。 公司隶属平阴县建设局。占地40亩，建筑面积3900平方米的综合办公楼，位于平阴县济西工业园内。公司现有职工32人，其中技术人员13人，大专以上学历7人，中专学历6人，中级以上职称6人。公司内设企业管理办公室、技术管理部、质量保证部、客户回访中心等科室，各科室之间互相协作，配合默契，以其雄厚的技术设备实力和高素质的施工队伍，具有较强的房地产开发能力。 公司二○○二年投资620万元开发的平阴县玫瑰花苑小区A1、A3住宅楼，以设计新颖、配套齐全、建筑质量上承而倍受消费者青睐。公司拟将开发的平阴县坛屋山住宅小区已经上级有关部门批准，并办理了有关手续，即将开工建设。 公司必将以优质的服务贡献于社会、服务于人民，并在市场经济的大潮中，取得较好的效益，得到更快的发展。');
INSERT INTO `reb` VALUES ('1574', '山东海那产业集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/674d5077-2179-4574-8f20-d5b888bfbf96.shtml', '', '013844', '陈瑛', '济南市槐荫区新沙北路20号', '053166569966', '1178226251@qq.com', '10000 万元', '民营企业', '山东海那产业有限公司，简称“海那产业”，成立于二零零五年六月，由MR.GORDON WU（加拿大）、华迪钢业集团有限公司、温州市嘉乐服装有限公司、济南如果商业有限公司、温州市联众经济发展有限公司共同出资组建成立，注册资本1亿元人民币。 海那产业专注大型商业、物流、住宅、农业景观等复合型地产投资开发。“海那城”，是公司在济南的重大投资项目，占地1500亩，包括海那农贸城、海那物流港、海那农博园、海那花城四大产业。 海那产业秉承“诚信互达，创新共赢”的企业精神，为资本和员工创造最大价值。 海那产业致力于打造精简高效的核心高管团队，讲求五湖四海的兄弟情谊和智慧碰撞。“志趣同道、向上职场、和谐家庭、丰盛人生”，是海那人的共同愿景！', '山东海那产业集团有限公司null陈瑛济南市槐荫区新沙北路20号0531665699661178226251@qq.com10000 万元民营企业山东海那产业有限公司，简称“海那产业”，成立于二零零五年六月，由MR.GORDON WU（加拿大）、华迪钢业集团有限公司、温州市嘉乐服装有限公司、济南如果商业有限公司、温州市联众经济发展有限公司共同出资组建成立，注册资本1亿元人民币。 海那产业专注大型商业、物流、住宅、农业景观等复合型地产投资开发。“海那城”，是公司在济南的重大投资项目，占地1500亩，包括海那农贸城、海那物流港、海那农博园、海那花城四大产业。 海那产业秉承“诚信互达，创新共赢”的企业精神，为资本和员工创造最大价值。 海那产业致力于打造精简高效的核心高管团队，讲求五湖四海的兄弟情谊和智慧碰撞。“志趣同道、向上职场、和谐家庭、丰盛人生”，是海那人的共同愿景！');
INSERT INTO `reb` VALUES ('1575', '济南雅致房地产有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/0ad8a769-9685-463d-8383-4bc869c86814.shtml', '', '013815', '张家有', '济南市天桥区车站街107号', '82429031', 'yzfdckfzz@163.com', '3020.6507 万元', '国有企业', '济南雅致房地产有限责任公司根据济铁分编发[2002]2号文件于年1月9日正式组建。并于2001年9月13日在济南市工商局登记注册，注册资金为1000万元。同年12月1日由山东省建设厅颁发房地产开发企业暂定资质。房地产属高投入、高风险行业，作为市场主体，实行独立经营、自负盈亏，发挥铁路资源优势，拓展和开发房地产业，积极参与市场竞争，开发试销对路的房地产产品，对济南铁路局所投1000万元资本金负有保值增值的作用。', '济南雅致房地产有限责任公司null张家有济南市天桥区车站街107号82429031yzfdckfzz@163.com3020.6507 万元国有企业济南雅致房地产有限责任公司根据济铁分编发[2002]2号文件于年1月9日正式组建。并于2001年9月13日在济南市工商局登记注册，注册资金为1000万元。同年12月1日由山东省建设厅颁发房地产开发企业暂定资质。房地产属高投入、高风险行业，作为市场主体，实行独立经营、自负盈亏，发挥铁路资源优势，拓展和开发房地产业，积极参与市场竞争，开发试销对路的房地产产品，对济南铁路局所投1000万元资本金负有保值增值的作用。');
INSERT INTO `reb` VALUES ('1576', '济南胜明房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/029dd6c1-d806-41bf-828f-439b9b14e8c6.shtml', '', '013809', '王坚', '章丘市双山大街中段', '83311131', 'qlzy-zh@vip.163.com', '6000 万元', '民营企业', '济南胜明房地产开发有限公司成立于2004年8月4日，位于章丘市双山大街35号，公司总部设在济南，山东省内知名的房地产开发企业齐鲁置业房地产开发公司，公司开发的齐鲁涧桥项目是继齐鲁骏园、齐鲁花园之后，为适应居住郊区化需求，在济南卫星城市在章丘推出的又一大型国际主流文化社区。', '济南胜明房地产开发有限公司null王坚章丘市双山大街中段83311131qlzy-zh@vip.163.com6000 万元民营企业济南胜明房地产开发有限公司成立于2004年8月4日，位于章丘市双山大街35号，公司总部设在济南，山东省内知名的房地产开发企业齐鲁置业房地产开发公司，公司开发的齐鲁涧桥项目是继齐鲁骏园、齐鲁花园之后，为适应居住郊区化需求，在济南卫星城市在章丘推出的又一大型国际主流文化社区。');
INSERT INTO `reb` VALUES ('1577', '济南新世界阳光发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/03ce69d7-3c92-4445-a67f-1f4148ee9068.shtml', '', '013790', '孙雷', '济南市槐荫区经六路500号新世界阳光花园（西区）33号楼三层301室', '87165958', 'newworld_jn@163.com', '6998 万元', '国有企业', '槐荫区道德街一带是济南市的棚户区，济南市从1992年就把这一片列入开发计划，并三次规划，终因拆迁量大、资金投入大，政府无钱投资、开发商不敢问而搁浅。 为使项目尽快启动，在政府搭桥，各方努力下，经过多方联络，济南阳光置业有限公司与香港新世界集团经过多次磋商，最终于1999年10月组建了济南新世界阳光发展有限公司，共同开发道德街旧城改造，建设新世界阳光花园项目。 新世界中国地产有限公司于1999年在香港上市的新世界中国地产有限公司（香港股份代号：0917），是新世界发展有限公司的中国物业发展旗舰，而新世界发展自八十年代初就已积极发展中国内地房地产业务。新世界中国地产业务以住宅物业销售为主、经营出租商业及酒店物业为辅、并提供物业管理服务的全方位经营模式。 企业经营宗旨：为城市缔造新天地、为社会引进新商机、为地方建设新社区、为顾客带来新生活 质量方针：努力打造极品 注重优质服务 质量目标：坚持质量与品质，是我们的核心价值。', '济南新世界阳光发展有限公司null孙雷济南市槐荫区经六路500号新世界阳光花园（西区）33号楼三层301室87165958newworld_jn@163.com6998 万元国有企业槐荫区道德街一带是济南市的棚户区，济南市从1992年就把这一片列入开发计划，并三次规划，终因拆迁量大、资金投入大，政府无钱投资、开发商不敢问而搁浅。 为使项目尽快启动，在政府搭桥，各方努力下，经过多方联络，济南阳光置业有限公司与香港新世界集团经过多次磋商，最终于1999年10月组建了济南新世界阳光发展有限公司，共同开发道德街旧城改造，建设新世界阳光花园项目。 新世界中国地产有限公司于1999年在香港上市的新世界中国地产有限公司（香港股份代号：0917），是新世界发展有限公司的中国物业发展旗舰，而新世界发展自八十年代初就已积极发展中国内地房地产业务。新世界中国地产业务以住宅物业销售为主、经营出租商业及酒店物业为辅、并提供物业管理服务的全方位经营模式。 企业经营宗旨：为城市缔造新天地、为社会引进新商机、为地方建设新社区、为顾客带来新生活 质量方针：努力打造极品 注重优质服务 质量目标：坚持质量与品质，是我们的核心价值。');
INSERT INTO `reb` VALUES ('1578', '山东科信达置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/3c764d41-744c-4aa9-b525-52b02afcf521.shtml', '', '013831', '李荣涛', '山东省济南市济阳县太平镇庙廊北街10号（原庙廊乡政府老院四排左数9-10间）', '15726155677', 'sdkxdzy@163.com', '2000 万元', '民营企业', '山东科信达置业有限公司以房地产开发为主，兼营房屋销售、房地产咨询服务、房地产营销策划、物业管理、房屋租赁等业务的房地产开发企业，公司成立于2011年，注册资本1000万元。凭借公司雄厚的技术力量、充足的财力资源，正在蓬勃发展。公司队伍素质较高，人员结构优化，现拥有高级职称人员2人，中级职称人员4人。公司坚持“诚信为本，用户至上，创建精品，服务大众”的经营原则，全体员工齐心协力，奋力拼搏，以“管理创品牌，品牌促发展，诚信赢顾客”的工作思路和“追求卓越，力臻完美”的经营方针，积极开展各项生产经营工作，增强了企业的整体实力、发展后劲。“开发一个楼盘，造福一方人民，树立一座丰碑”是公司永远不懈的追求。以先进的开发理念、诚实守信的经营作风，同心协力，开拓创新，改善人民的住房条件和美化城市面貌做出更大的贡献。', '山东科信达置业有限公司null李荣涛山东省济南市济阳县太平镇庙廊北街10号（原庙廊乡政府老院四排左数9-10间）15726155677sdkxdzy@163.com2000 万元民营企业山东科信达置业有限公司以房地产开发为主，兼营房屋销售、房地产咨询服务、房地产营销策划、物业管理、房屋租赁等业务的房地产开发企业，公司成立于2011年，注册资本1000万元。凭借公司雄厚的技术力量、充足的财力资源，正在蓬勃发展。公司队伍素质较高，人员结构优化，现拥有高级职称人员2人，中级职称人员4人。公司坚持“诚信为本，用户至上，创建精品，服务大众”的经营原则，全体员工齐心协力，奋力拼搏，以“管理创品牌，品牌促发展，诚信赢顾客”的工作思路和“追求卓越，力臻完美”的经营方针，积极开展各项生产经营工作，增强了企业的整体实力、发展后劲。“开发一个楼盘，造福一方人民，树立一座丰碑”是公司永远不懈的追求。以先进的开发理念、诚实守信的经营作风，同心协力，开拓创新，改善人民的住房条件和美化城市面貌做出更大的贡献。');
INSERT INTO `reb` VALUES ('1579', '山东华创置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b3614cfc-24cf-402e-85e4-7735072af7f4.shtml', '', '013778', '王爱民', '济南市历下区舜海路219号华创观礼中心4号楼2层', '81699678', '', '5000 万元', '中外合资经营企业', '山东华创置业有限公司是山东华鲁集团有限公司﹑山东华创集团有限公司共同出资设立的房地产开发企业。公司于2005年11月成立，注册资本2000万元。下设办公室﹑财务部﹑工程部﹑经营部和物业管理部五个职能管理部门。 公司成立后，按照高起点的发展要求，组织建立了一支充满活力的经营团队，并从“创新﹑进取﹑奉献”的企业理念，着手策划开发第一个高档社区—港澳花园。港澳花园占地61亩，计划为高层次消费群体打造精品住宅58000平方米。', '山东华创置业有限公司null王爱民济南市历下区舜海路219号华创观礼中心4号楼2层816996785000 万元中外合资经营企业山东华创置业有限公司是山东华鲁集团有限公司﹑山东华创集团有限公司共同出资设立的房地产开发企业。公司于2005年11月成立，注册资本2000万元。下设办公室﹑财务部﹑工程部﹑经营部和物业管理部五个职能管理部门。 公司成立后，按照高起点的发展要求，组织建立了一支充满活力的经营团队，并从“创新﹑进取﹑奉献”的企业理念，着手策划开发第一个高档社区—港澳花园。港澳花园占地61亩，计划为高层次消费群体打造精品住宅58000平方米。');
INSERT INTO `reb` VALUES ('1580', '山东外海置业投资有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d13bc9b8-888c-463f-8b99-c49cdf612a08.shtml', '', '013808', '谭跃进', '济兖路779号', '82789889', '', '5000 万元', '民营企业', '山东外海置业投资有限公司简介 　　山东外海置业投资有限公司于2006年4月成立，注册资本5000万元，系杭州外海集团投资设立的二级集团型企业。公司投资开发的“外海?中央花园”项目位于济南西部新城南翼，北临经十西路，与槐荫区政府中心毗邻相望。项目占地面积600余亩，总建筑面积约78万平方米，共分4个组团，社区内还设配套小学、幼儿园、中心会所和大型地下停车场，沿经十西路一侧将规划商务中心、星级酒店、大型商场以及开放式城市广场。 　　项目预计总投资20多亿元，开发周期5-6年，项目建成后将成为济南西部最具规模的现代高档复合型城市社区。', '山东外海置业投资有限公司null谭跃进济兖路779号827898895000 万元民营企业山东外海置业投资有限公司简介 　　山东外海置业投资有限公司于2006年4月成立，注册资本5000万元，系杭州外海集团投资设立的二级集团型企业。公司投资开发的“外海?中央花园”项目位于济南西部新城南翼，北临经十西路，与槐荫区政府中心毗邻相望。项目占地面积600余亩，总建筑面积约78万平方米，共分4个组团，社区内还设配套小学、幼儿园、中心会所和大型地下停车场，沿经十西路一侧将规划商务中心、星级酒店、大型商场以及开放式城市广场。 　　项目预计总投资20多亿元，开发周期5-6年，项目建成后将成为济南西部最具规模的现代高档复合型城市社区。');
INSERT INTO `reb` VALUES ('1581', '山东中铁诺德房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d14d3712-6561-4f3e-ab84-fcdfa49a7ce1.shtml', '', '013779', '何海强', '山东省济南市章丘区世纪大道1526号', '61331007', 'Sdztndhr@163.com', '6000 万元', '国有企业', '山东中铁诺德房地产开发有限公司成立于2010年4月1日，是中国中铁下属企业中铁建工集团诺德投资有限公司独资设立的从事房地产开发的有限责任公司，注册资本6000万，法定代表人何海强', '山东中铁诺德房地产开发有限公司null何海强山东省济南市章丘区世纪大道1526号61331007Sdztndhr@163.com6000 万元国有企业山东中铁诺德房地产开发有限公司成立于2010年4月1日，是中国中铁下属企业中铁建工集团诺德投资有限公司独资设立的从事房地产开发的有限责任公司，注册资本6000万，法定代表人何海强');
INSERT INTO `reb` VALUES ('1582', '济南市历下区燕山工业小区开发建设总公司', 'http://www.jnfdc.gov.cn/kfqy/show/79d89cd3-0828-4c2f-ae0d-4921908a48ca.shtml', '', '013825', '张凯', '济南市历下区下井村东200米', '81792973', 'Jihuake6@163.com', '3000 万元', '国有企业', '济南市历下区燕山工业小区开发建设总公司座落在景观大道经下东路南，旅游路北首，风景秀丽，气候宜人． 　　公司不仅所处地理位置优越，更以＂优质高效重视人文＂的企业宗旨向二十一世纪大开发迈出了辉煌步伐．我们的质量目标是＂力争优良，确保合格工程＂杜绝违规现象． 　　我公司自1996年成立以来，开发了龙泉山庄居住区组团，总用地为232.80公顷，可规划用地190.58公顷，居住用地为190.58公顷，总建筑面积184.42万平方米，其中规划住宅面积为110.83万平方米，规划配套公建建筑面积16.78万平方米，现状面积56.8万平方米，居住用地内容积率为0.97', '济南市历下区燕山工业小区开发建设总公司null张凯济南市历下区下井村东200米81792973Jihuake6@163.com3000 万元国有企业济南市历下区燕山工业小区开发建设总公司座落在景观大道经下东路南，旅游路北首，风景秀丽，气候宜人． 　　公司不仅所处地理位置优越，更以＂优质高效重视人文＂的企业宗旨向二十一世纪大开发迈出了辉煌步伐．我们的质量目标是＂力争优良，确保合格工程＂杜绝违规现象． 　　我公司自1996年成立以来，开发了龙泉山庄居住区组团，总用地为232.80公顷，可规划用地190.58公顷，居住用地为190.58公顷，总建筑面积184.42万平方米，其中规划住宅面积为110.83万平方米，规划配套公建建筑面积16.78万平方米，现状面积56.8万平方米，居住用地内容积率为0.97');
INSERT INTO `reb` VALUES ('1583', '山东建大教育置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/79eb86d8-4d48-4cd8-8f48-c39b94bfa16c.shtml', '', '013818', '闫卫国', '济南市历城区港沟镇山东建筑大学', '58718060', 'Jdzyhr@163.com', '2000 万元', '民营企业', '山东建大教育置业有限公司是由山东建筑大学发起，与省内知名企业共同出资注册的以房地产经营开发为主，集工程咨询、项目管理、房产营销、物业管理、住宅区规划设计研究为一体的综合性房地产开发企业。公司自成立以来，本着“依托高校、服务教育、回馈社会”的原则，充分依靠高校的技术和人才优势，与国内外著名的房地产策划机构、居住区规划机构合作，积极探索具有教育置业特色的绿色地产的发展之路。 目前，公司正在开发的“建大·教授花园”，占地320余亩，总建筑面积24万平方米，是为高校教职工量身打造的高品质住宅项目，建成后将成为济南东部具有浓郁文化氛围和优雅人文气息的大型高尚社区。公司紧紧抓住教育发展的大好时机，积极参与教育资产的盘活与置换。近期通过招牌挂成功取得了阳光舜城附近的原中华女子学院山东分院地块，该项目占地3.8万平方米，建筑面积1.7万平方米。 公司秉承“稳健、专业、卓越、诚信”的企业理念，不断探索企业发展的新思路，逐步发展为以创新为先导，以品牌为核心，以先进的管理理念为支撑，以房地产开发为主业，以相关产业为辅助，以企业资产运作为重点的规模化、科技型企业。', '山东建大教育置业有限公司null闫卫国济南市历城区港沟镇山东建筑大学58718060Jdzyhr@163.com2000 万元民营企业山东建大教育置业有限公司是由山东建筑大学发起，与省内知名企业共同出资注册的以房地产经营开发为主，集工程咨询、项目管理、房产营销、物业管理、住宅区规划设计研究为一体的综合性房地产开发企业。公司自成立以来，本着“依托高校、服务教育、回馈社会”的原则，充分依靠高校的技术和人才优势，与国内外著名的房地产策划机构、居住区规划机构合作，积极探索具有教育置业特色的绿色地产的发展之路。 目前，公司正在开发的“建大·教授花园”，占地320余亩，总建筑面积24万平方米，是为高校教职工量身打造的高品质住宅项目，建成后将成为济南东部具有浓郁文化氛围和优雅人文气息的大型高尚社区。公司紧紧抓住教育发展的大好时机，积极参与教育资产的盘活与置换。近期通过招牌挂成功取得了阳光舜城附近的原中华女子学院山东分院地块，该项目占地3.8万平方米，建筑面积1.7万平方米。 公司秉承“稳健、专业、卓越、诚信”的企业理念，不断探索企业发展的新思路，逐步发展为以创新为先导，以品牌为核心，以先进的管理理念为支撑，以房地产开发为主业，以相关产业为辅助，以企业资产运作为重点的规模化、科技型企业。');
INSERT INTO `reb` VALUES ('1584', '济南汇富建设开发集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/95aea17f-934f-4ecd-b63f-a6f219c1e04f.shtml', '', '013823', '李长元', '长清区灵岩路南首路东', '87224927', 'glzx@huifujituan.com', '3000 万元', '民营企业', '济南汇富建设集团 简介 济南汇富建设集团是一家以房地产开发为龙头,建筑安装为主导，融建材产销、物业管理、商务服务为一体的专业化与多元化协调发展的现代化企业集团。旗下拥有五家法人企业，集团所有公司总注册资本4308万元,员工约2300人。集团秉承“厚德文治、以人为本”的企业理念，弘扬“求实、务实、开拓、进取”的企业精神，致力于为客户创造价值，以真情回报社会。 集团前身是“济南市长清建筑安装工程公司”，始建于1994年。企业成立之初一切从零开始，始终以市场为导向，紧紧围绕“以质量求信誉、以速度求效益、树样板创牌子”的经营方针，向社会奉献了一大批优质工程，企业得以快速发展，企业信誉和综合实力大大提高，2000年晋升为二级施工资质企业。于2000年注册成立“济南汇富房地产开发有限公司”，并确定以房地产开发为核心产业。之后于2002年相继成立济南汇富物业管理有限公司、济南汇富建材有限公司，同时拓展餐饮服务、休闲娱乐、旅游开发等业务，逐步形成自我配套、产业互补的集团化发展格局。2004年7月，汇富集团正式成立，使汇富步入品牌战略阶段。 汇富在品牌战略的思想指导下，社会效益、经济效益不断提高，自2000年已先后开发了天润小区、汇富苑、汇富商城等多个引领长清房地产市场的优秀品牌项目，累计开发面积３０万平方米。2007年集团房地产开发面积17万平方米，实现销售收入2.4亿元；建筑安装工程施工面积18万平方米，完成产值1.26亿元；物业管理服务面积达30万平方米。汇富建材公司是国家建设部粘土陶粒科研项目定点生产厂家，陶粒、砌块、隔墙板、铝塑门窗、混凝土砖、彩砖彩瓦等新型建材年产值400万元。集团2007年上交税金2826余万元，居长清区民企之首。', '济南汇富建设开发集团有限公司null李长元长清区灵岩路南首路东87224927glzx@huifujituan.com3000 万元民营企业济南汇富建设集团 简介 济南汇富建设集团是一家以房地产开发为龙头,建筑安装为主导，融建材产销、物业管理、商务服务为一体的专业化与多元化协调发展的现代化企业集团。旗下拥有五家法人企业，集团所有公司总注册资本4308万元,员工约2300人。集团秉承“厚德文治、以人为本”的企业理念，弘扬“求实、务实、开拓、进取”的企业精神，致力于为客户创造价值，以真情回报社会。 集团前身是“济南市长清建筑安装工程公司”，始建于1994年。企业成立之初一切从零开始，始终以市场为导向，紧紧围绕“以质量求信誉、以速度求效益、树样板创牌子”的经营方针，向社会奉献了一大批优质工程，企业得以快速发展，企业信誉和综合实力大大提高，2000年晋升为二级施工资质企业。于2000年注册成立“济南汇富房地产开发有限公司”，并确定以房地产开发为核心产业。之后于2002年相继成立济南汇富物业管理有限公司、济南汇富建材有限公司，同时拓展餐饮服务、休闲娱乐、旅游开发等业务，逐步形成自我配套、产业互补的集团化发展格局。2004年7月，汇富集团正式成立，使汇富步入品牌战略阶段。 汇富在品牌战略的思想指导下，社会效益、经济效益不断提高，自2000年已先后开发了天润小区、汇富苑、汇富商城等多个引领长清房地产市场的优秀品牌项目，累计开发面积３０万平方米。2007年集团房地产开发面积17万平方米，实现销售收入2.4亿元；建筑安装工程施工面积18万平方米，完成产值1.26亿元；物业管理服务面积达30万平方米。汇富建材公司是国家建设部粘土陶粒科研项目定点生产厂家，陶粒、砌块、隔墙板、铝塑门窗、混凝土砖、彩砖彩瓦等新型建材年产值400万元。集团2007年上交税金2826余万元，居长清区民企之首。');
INSERT INTO `reb` VALUES ('1585', '山东天齐房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b4dfe267-ee66-4ca7-a80c-aa28c830951e.shtml', '', '013841', '吕超', '山东省济南市历下区龙奥北路8号4号楼2301', '68658377', 'tqfdc01@163.com', '10000 万元', '民营企业', '山东天齐房地产有限公司，成立于2008年，现公司位于济南市高新区舜华路1117号。由北京森林半岛科技发展有限公司与山东天齐置业集团股份有限公司共同出资组建，其性质为股份有限责任公司，注册资金为10000万元。公司是自主经营、独立核算、自负盈亏、有独立法人资格的经济实体，主要从事房地产开发、房产营销等综合性房地产开发。', '山东天齐房地产开发有限公司null吕超山东省济南市历下区龙奥北路8号4号楼230168658377tqfdc01@163.com10000 万元民营企业山东天齐房地产有限公司，成立于2008年，现公司位于济南市高新区舜华路1117号。由北京森林半岛科技发展有限公司与山东天齐置业集团股份有限公司共同出资组建，其性质为股份有限责任公司，注册资金为10000万元。公司是自主经营、独立核算、自负盈亏、有独立法人资格的经济实体，主要从事房地产开发、房产营销等综合性房地产开发。');
INSERT INTO `reb` VALUES ('1586', '济南庆龙置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d64a2c47-a19a-461d-95ef-9627d44022a2.shtml', '', '013783', '张清仙', '解放东路99号历下大厦18层', '053188385803', '', '2000 万元', '国有企业', '济南庆龙置业有限公司成立于2010年1月21日，为中铁十四局集团凯华置业有限公司全资子公司。中铁十四局集团隶属于中国铁建股份有限公司(中国铁建股份有限公司是国资委管理的“世界500强”特大型上市企业)。中铁十四局集团凯华置业有限公司组建于2001年2月27日，注册资金26677万元，现有资产逾二十亿元，下设四个分公司和五个子公司，年开发建筑面积在200万平米以上。 历经数载市场洗礼与品牌积淀，凯华置业先后投资建设了中国铁建?舟山岛街、中国铁建?盈泰嘉园、中国铁建?麟瑞商务广场、中国铁建?兴隆山庄、中国铁建?岸芷汀兰、中国铁建?柳岸雅舍、中国铁建?江佑铂庭、中国铁建?明山秀水等项目。开发的中国铁建?盈泰嘉园小区荣获了“中国新区建筑经典”、“中国新区环境经典”称号和青岛市名盘金房奖及各类荣誉多项；“中国铁建?麟瑞商务广场”被评为“泰山杯”项目；“ 中国铁建?岸芷汀兰”被列为“中国人居环境与新城镇发展推进工程，人居环境金牌建设试点项目”。另外，凯华置业先后荣获山东省“AAA”级信誉企业、青岛市“守合同、重信用”企业和A级诚信房地产开发企业、“中国建设系统企业信用?信誉AAA级单位”、“2007年山东省企业文化建设创新成果奖”、山东省“青年文明号”、“中国企业文化建设先进单位”。', '济南庆龙置业有限公司null张清仙解放东路99号历下大厦18层0531883858032000 万元国有企业济南庆龙置业有限公司成立于2010年1月21日，为中铁十四局集团凯华置业有限公司全资子公司。中铁十四局集团隶属于中国铁建股份有限公司(中国铁建股份有限公司是国资委管理的“世界500强”特大型上市企业)。中铁十四局集团凯华置业有限公司组建于2001年2月27日，注册资金26677万元，现有资产逾二十亿元，下设四个分公司和五个子公司，年开发建筑面积在200万平米以上。 历经数载市场洗礼与品牌积淀，凯华置业先后投资建设了中国铁建?舟山岛街、中国铁建?盈泰嘉园、中国铁建?麟瑞商务广场、中国铁建?兴隆山庄、中国铁建?岸芷汀兰、中国铁建?柳岸雅舍、中国铁建?江佑铂庭、中国铁建?明山秀水等项目。开发的中国铁建?盈泰嘉园小区荣获了“中国新区建筑经典”、“中国新区环境经典”称号和青岛市名盘金房奖及各类荣誉多项；“中国铁建?麟瑞商务广场”被评为“泰山杯”项目；“ 中国铁建?岸芷汀兰”被列为“中国人居环境与新城镇发展推进工程，人居环境金牌建设试点项目”。另外，凯华置业先后荣获山东省“AAA”级信誉企业、青岛市“守合同、重信用”企业和A级诚信房地产开发企业、“中国建设系统企业信用?信誉AAA级单位”、“2007年山东省企业文化建设创新成果奖”、山东省“青年文明号”、“中国企业文化建设先进单位”。');
INSERT INTO `reb` VALUES ('1587', '绿地集团山东置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/6cdb95b0-c7a7-4b22-a588-c709ade16c0d.shtml', '', '013734', '金成发', '山东省济南市市中区七里山南村七里山办事处四楼', '66696955', 'lvdishandong@126.com', '131000 万元', '民营企业', '绿地集团是中国综合性地产领军企业，在2009中国企业500强排名中位列第169位，在中国房地产企业排名中位居第2位，在上海地区企业集团中排名第17位。上海绿地集团山东置业有限公司是上海绿地集团在山东出资成立的全资子公司，公司成立于2009年9月，注册资金2亿元。截止目前公司在职员工23人，其中中高级职称人数12人。 2010年1月5日，由绿地集团投资开发的济南绿地普利中心和中大南旧城改造项目正式开工建设，标志着绿地集团在济南总投资为300亿元的一揽子开发项目正式启动。上海市人大常委会主任刘云耕，山东省人大常委会常务副主任高新亭，山东省委常委、济南市委书记焉荣竹，济南市市长张建国，济南市人大常委会主任徐华东等领导出席项目开工典礼。', '绿地集团山东置业有限公司null金成发山东省济南市市中区七里山南村七里山办事处四楼66696955lvdishandong@126.com131000 万元民营企业绿地集团是中国综合性地产领军企业，在2009中国企业500强排名中位列第169位，在中国房地产企业排名中位居第2位，在上海地区企业集团中排名第17位。上海绿地集团山东置业有限公司是上海绿地集团在山东出资成立的全资子公司，公司成立于2009年9月，注册资金2亿元。截止目前公司在职员工23人，其中中高级职称人数12人。 2010年1月5日，由绿地集团投资开发的济南绿地普利中心和中大南旧城改造项目正式开工建设，标志着绿地集团在济南总投资为300亿元的一揽子开发项目正式启动。上海市人大常委会主任刘云耕，山东省人大常委会常务副主任高新亭，山东省委常委、济南市委书记焉荣竹，济南市市长张建国，济南市人大常委会主任徐华东等领导出席项目开工典礼。');
