INSERT INTO `reb` VALUES ('1589', '中建信和山东置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/dcdb79f6-7af1-4d72-96fe-ee73fdbcb437.shtml', '', '014900', '王庆云', '济南市长清区大学科技园紫薇路6677号中建瀛园小区会所二楼', '66585778', '', '2000 万元', '民营企业', '中建信和山东置业有限公司是经山东省济南市建委审批成立的房地产开发企业。 中建信和山东置业有限公司是中国建筑第五工程局有限公司下属机构。公司主要开发中建瀛园项目，项目地块位于长清区大学科技园区山东艺术学院南侧，用地面积300余亩，可开发建筑面积约20万平方米，规划建设中高档生态园住宅社区。', '中建信和山东置业有限公司null王庆云济南市长清区大学科技园紫薇路6677号中建瀛园小区会所二楼665857782000 万元民营企业中建信和山东置业有限公司是经山东省济南市建委审批成立的房地产开发企业。 中建信和山东置业有限公司是中国建筑第五工程局有限公司下属机构。公司主要开发中建瀛园项目，项目地块位于长清区大学科技园区山东艺术学院南侧，用地面积300余亩，可开发建筑面积约20万平方米，规划建设中高档生态园住宅社区。');
