INSERT INTO `reb` VALUES ('1592', '山东力高江浩房地产有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7448b14b-dee1-4c93-b634-7bfffe87253c.shtml', '', '0161522', '罗淇晋', '粟山路80号', '88167111', '570254240@qq.com', '10000 万元', '民营企业', '山东力高江浩房地产有限公司成立于2013年，公司位于济南市天桥区粟山路80号。公司于2015年10月通过招拍挂形式取得澜湖郡项目土地，项目位于济南市天桥区粟山路以北、东宇大街以西。项目用地面积约68066平方米，规划建筑面积约26.63万平方米。项目包括1#-17#楼、换热站、地下车库及设备用房。', '山东力高江浩房地产有限公司null罗淇晋粟山路80号88167111570254240@qq.com10000 万元民营企业山东力高江浩房地产有限公司成立于2013年，公司位于济南市天桥区粟山路80号。公司于2015年10月通过招拍挂形式取得澜湖郡项目土地，项目位于济南市天桥区粟山路以北、东宇大街以西。项目用地面积约68066平方米，规划建筑面积约26.63万平方米。项目包括1#-17#楼、换热站、地下车库及设备用房。');
INSERT INTO `reb` VALUES ('1593', '山东广嘉置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/494f06d6-5192-4532-b4ca-54b7fd1d8d3f.shtml', '', '0161274', '朱光', '济南市历下区明湖小区东七区1号楼底层公建2号', '053155710557', 'zhuangjing8100@163.com', '1000 万元', '民营企业', '主营房地产开发与销售，物业管理服务，房屋中介服务、国内广告业务。', '山东广嘉置业有限公司null朱光济南市历下区明湖小区东七区1号楼底层公建2号053155710557zhuangjing8100@163.com1000 万元民营企业主营房地产开发与销售，物业管理服务，房屋中介服务、国内广告业务。');
INSERT INTO `reb` VALUES ('1594', '济阳县安居开发有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/631f1c32-fbb0-47cb-8bc7-c0d66d1f97e5.shtml', '', '016(JY010)', '杨剑锋', '经一纬二路口', '84215511', '', '1800 万元', '国有企业', '济阳县安居开发有限责任公司成立于一九九八年，公司主营房地产开发、住宅建设及建筑材料销售，资质等级为叁级。 济阳县安居开发有限责任公司管理职能健全，下设施工科、安全科办公室、项目部等科室，各科室各负其责，使企业在良性的轨道上正常运营。 公司经过十余年的发展，规模不断壮大，现公司拥有高级职称3人，中级职称8人，初级职称6人，建筑工人百余人。塔机，井字架，搅拌机，经纬仪，水准仪等各种建筑机械设备齐全，能承担资质等级范围内的各种建筑工程施工。公司自成立以来，先后施工了房管局办公楼、济北花园小区四区2号楼、四区3号楼、新世纪商贸城综合楼、华宇舜苑2号楼、4号楼,济北花园小区等数栋工程施工，济阳嘉禾小区正在施工中，到目前为止公司已完成建筑面积40余万平方米，建筑工程合格率100%。公司从最初的注册资金壹仟零捌拾万元，发展到今天的几千万元\"安居\"的形象得到县内客户与业主的交口称誉。 客户是公司的衣食父母，业主满意始终是我们追求的方向，二00三年我公司被评为\"重合同，守信用\"单位。公司规范的施工，专业化的技术水平，诚信的服务，赢得了广大客户的信任。目前，公司多项的高分中标的工程正在顺利地施工之中，这些工程的建设标志着公司在与老客户的良好合作中，又结识了越来越多的新朋友。也标志着公司又在迈向一个新台阶，在立足济阳的同时，我们的目标是走出济阳。 安居人正在努力奋斗，真诚希望与社会各界朋友一起在合作中建立友谊，共建美好家园，创造更加美好的未来。', '济阳县安居开发有限责任公司null杨剑锋经一纬二路口842155111800 万元国有企业济阳县安居开发有限责任公司成立于一九九八年，公司主营房地产开发、住宅建设及建筑材料销售，资质等级为叁级。 济阳县安居开发有限责任公司管理职能健全，下设施工科、安全科办公室、项目部等科室，各科室各负其责，使企业在良性的轨道上正常运营。 公司经过十余年的发展，规模不断壮大，现公司拥有高级职称3人，中级职称8人，初级职称6人，建筑工人百余人。塔机，井字架，搅拌机，经纬仪，水准仪等各种建筑机械设备齐全，能承担资质等级范围内的各种建筑工程施工。公司自成立以来，先后施工了房管局办公楼、济北花园小区四区2号楼、四区3号楼、新世纪商贸城综合楼、华宇舜苑2号楼、4号楼,济北花园小区等数栋工程施工，济阳嘉禾小区正在施工中，到目前为止公司已完成建筑面积40余万平方米，建筑工程合格率100%。公司从最初的注册资金壹仟零捌拾万元，发展到今天的几千万元\"安居\"的形象得到县内客户与业主的交口称誉。 客户是公司的衣食父母，业主满意始终是我们追求的方向，二00三年我公司被评为\"重合同，守信用\"单位。公司规范的施工，专业化的技术水平，诚信的服务，赢得了广大客户的信任。目前，公司多项的高分中标的工程正在顺利地施工之中，这些工程的建设标志着公司在与老客户的良好合作中，又结识了越来越多的新朋友。也标志着公司又在迈向一个新台阶，在立足济阳的同时，我们的目标是走出济阳。 安居人正在努力奋斗，真诚希望与社会各界朋友一起在合作中建立友谊，共建美好家园，创造更加美好的未来。');
INSERT INTO `reb` VALUES ('1595', '山东长安建设物业开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/18540dec-8657-41ba-970b-f4711d3cc486.shtml', '', '0161647', '靳海天', '千佛山东路18号', '82661971', 'qujw2008@163.com', '5000 万元', '民营企业', '山东长安建设物业开发有限公司成立于1997年，注册资本5000万元，具有三级开发资质。经过十几年的风雨路程，山东长安建设物业开发有限公司已发展成为一个专注于品质和服务的专业房地产开发公司。长安公司以完美居住为根基使命，秉承长安“艰苦创业、诚信为本、稳健经营、科学管理”的经营理念，相继开发建设了“马鞍山路居住组团”“千佛山东路长安居住组团”“长安欣苑”、“乳山-海岸壹号”、“莱芜-白马庄园”“上海-威尼斯花园”“北京-研创总部基地”等房地产项目，并得到了市场的高指数认可和荣誉口碑。踏实的工作态度，诚信的经营作风，精品的开发意识，使“长安地产”在山东市场成为颇具实力和美誉度的知名地产品牌，并在行业内享有盛誉。', '山东长安建设物业开发有限公司null靳海天千佛山东路18号82661971qujw2008@163.com5000 万元民营企业山东长安建设物业开发有限公司成立于1997年，注册资本5000万元，具有三级开发资质。经过十几年的风雨路程，山东长安建设物业开发有限公司已发展成为一个专注于品质和服务的专业房地产开发公司。长安公司以完美居住为根基使命，秉承长安“艰苦创业、诚信为本、稳健经营、科学管理”的经营理念，相继开发建设了“马鞍山路居住组团”“千佛山东路长安居住组团”“长安欣苑”、“乳山-海岸壹号”、“莱芜-白马庄园”“上海-威尼斯花园”“北京-研创总部基地”等房地产项目，并得到了市场的高指数认可和荣誉口碑。踏实的工作态度，诚信的经营作风，精品的开发意识，使“长安地产”在山东市场成为颇具实力和美誉度的知名地产品牌，并在行业内享有盛誉。');
INSERT INTO `reb` VALUES ('1596', '山东鲁鼎置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/188fd985-487f-471c-9e95-9f91ccc456eb.shtml', '', '0161613', '张蕾', '济南市天桥区西工商河6号', '87937777', '366295168@qq.com', '1000 万元', '民营企业', '山东鲁鼎置业有限公司成立于2010年1月，注册资金1000万元，是一家以房地产开发为龙头，涵盖房地产营销策划、物业管理服务等多种配套管理服务为一体的综合性房地产开发企业。公司投资人均属于国内大型企业股东，公司凭借与广东国泰家具集团、上海中发电气（集团）股份有限公司等国内知名企业的强强联合，依托山东市场资源，积极拓展房地产开发业务，以谋求在山东房地产业高起点、快速增长的长足发展。 公司一直秉承“求实、创新、进取、恒心”的企业精神和“为客户创造高品质生活”的开发理念，以“创中国名牌，树百年鲁鼎”为目标，以“追求卓越品质，创造一流品牌、培养忠诚客户、寻求持续发展” 为经营方针,以“创新、拼搏、互敬、团结、协作”的人性化管理为理念,为社会奉献高品质商业、住宅、写字楼、公寓及酒店等多种产品。 公司本着“诚实守信，规范运营，实施品牌战略”的宗旨，追求“规划设计的精心、建筑质量的专心、配套服务的用心”的质量方针，紧紧抓住市场机遇，适应市场发展的需求，将公司打造成为山东省地产界的知名品牌！ 公司的发展战略以山东省内济南、青岛为起点，向下发展临沂、济宁、枣庄等三线城市及金乡等四线城市，向上逐步开拓一线城市，着力打造区域优势与品牌优势，吸引高端人才，拓宽经营思路，丰富合作模式，实现企业快速、稳定、可持续发展。 公司发展初期，把济南作为发展的起点，现已取得位于长途汽车站北侧的鲁鼎美博广场项目开发权，项目紧邻长途汽车站、火车站，雄踞城市交通枢纽、城市商务中心，项目规划建设以美博城商业为特色主题，涵盖住宅、写字楼、精装公寓及酒店等配套的大型城市综合体，建成后将成为引领区域发展的标志性建筑， 引领城市活力发展的潮流！公司位于济宁金乡的项目也已经开始投资运营，同时在济南、青岛、临沂、枣庄、潍坊等多个城市公司有多个项目正在稳步和迅速推进中。 新起点，新征程。山东鲁鼎置业有限公司将以开放的姿态、广阔的胸襟、恢宏的气度吸纳一切先进的理念和思想，昂首阔步迈向未来！', '山东鲁鼎置业有限公司null张蕾济南市天桥区西工商河6号87937777366295168@qq.com1000 万元民营企业山东鲁鼎置业有限公司成立于2010年1月，注册资金1000万元，是一家以房地产开发为龙头，涵盖房地产营销策划、物业管理服务等多种配套管理服务为一体的综合性房地产开发企业。公司投资人均属于国内大型企业股东，公司凭借与广东国泰家具集团、上海中发电气（集团）股份有限公司等国内知名企业的强强联合，依托山东市场资源，积极拓展房地产开发业务，以谋求在山东房地产业高起点、快速增长的长足发展。 公司一直秉承“求实、创新、进取、恒心”的企业精神和“为客户创造高品质生活”的开发理念，以“创中国名牌，树百年鲁鼎”为目标，以“追求卓越品质，创造一流品牌、培养忠诚客户、寻求持续发展” 为经营方针,以“创新、拼搏、互敬、团结、协作”的人性化管理为理念,为社会奉献高品质商业、住宅、写字楼、公寓及酒店等多种产品。 公司本着“诚实守信，规范运营，实施品牌战略”的宗旨，追求“规划设计的精心、建筑质量的专心、配套服务的用心”的质量方针，紧紧抓住市场机遇，适应市场发展的需求，将公司打造成为山东省地产界的知名品牌！ 公司的发展战略以山东省内济南、青岛为起点，向下发展临沂、济宁、枣庄等三线城市及金乡等四线城市，向上逐步开拓一线城市，着力打造区域优势与品牌优势，吸引高端人才，拓宽经营思路，丰富合作模式，实现企业快速、稳定、可持续发展。 公司发展初期，把济南作为发展的起点，现已取得位于长途汽车站北侧的鲁鼎美博广场项目开发权，项目紧邻长途汽车站、火车站，雄踞城市交通枢纽、城市商务中心，项目规划建设以美博城商业为特色主题，涵盖住宅、写字楼、精装公寓及酒店等配套的大型城市综合体，建成后将成为引领区域发展的标志性建筑， 引领城市活力发展的潮流！公司位于济宁金乡的项目也已经开始投资运营，同时在济南、青岛、临沂、枣庄、潍坊等多个城市公司有多个项目正在稳步和迅速推进中。 新起点，新征程。山东鲁鼎置业有限公司将以开放的姿态、广阔的胸襟、恢宏的气度吸纳一切先进的理念和思想，昂首阔步迈向未来！');
INSERT INTO `reb` VALUES ('1597', '济南华昱置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/351e199d-6e6e-472a-a5a9-c7582b6bd0fc.shtml', '', '0161463', '陈瑞屿', '济南市高新区颖秀路1356号智慧大厦B座2楼', '86559792', '', '4000 万元', '国有企业', '济南华昱置业有限公司成立于2005年12月22日，注册资本4000万元，以房地产开发与经营、物业管理为主要经营范围。公司以“热情”“勤勉”“诚实”“服从”“整洁”为企业信念；以“诚信”“专业”“高效”“务实”为经营理念。 由济南华昱置业有限公司开发建设的银都国际大厦为国际顶级高层写字楼，项目坐拥政治中心、商业中心、金融中心、交通中心。其造型设计庄重、高雅，采用高档装饰材料，总建筑面积50929.24m2。银都国际大厦项目将建成经七路上又一道美丽的风景线。', '济南华昱置业有限公司null陈瑞屿济南市高新区颖秀路1356号智慧大厦B座2楼865597924000 万元国有企业济南华昱置业有限公司成立于2005年12月22日，注册资本4000万元，以房地产开发与经营、物业管理为主要经营范围。公司以“热情”“勤勉”“诚实”“服从”“整洁”为企业信念；以“诚信”“专业”“高效”“务实”为经营理念。 由济南华昱置业有限公司开发建设的银都国际大厦为国际顶级高层写字楼，项目坐拥政治中心、商业中心、金融中心、交通中心。其造型设计庄重、高雅，采用高档装饰材料，总建筑面积50929.24m2。银都国际大厦项目将建成经七路上又一道美丽的风景线。');
