INSERT INTO `reb` VALUES ('1600', '济南恒兴房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/dd63fca9-0fb6-4dc8-8572-1ec3b1563f76.shtml', '', '0161288', '张宵', '七里河路北段2号12号楼1-4-09', '89000577', '751719193@qq.com', '2900 万元', '民营企业', '济南恒兴房地产开发有限公司位于七里河路北段2号12号楼1-4-09，注册资本贰仟玖佰万元，项目为左邻右舍。', '济南恒兴房地产开发有限公司null张宵七里河路北段2号12号楼1-4-0989000577751719193@qq.com2900 万元民营企业济南恒兴房地产开发有限公司位于七里河路北段2号12号楼1-4-09，注册资本贰仟玖佰万元，项目为左邻右舍。');
INSERT INTO `reb` VALUES ('1601', '济南洪永置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/15074941-f70c-4f27-8761-ee531fc025e9.shtml', '', '0161660', '张洪杰', '孙耿镇迎新大街259号镇政府院内南排房屋第十四间', '84557677', '13156176011@163.com', '1000 万元', '民营企业', '济南洪永置业有限公司成立于2011年3月，注册资金1000万元。济南洪永置业有限公司是一个现代新型的民营企业，自成立以来，始终秉承\"专注品质·建筑无限生活\"的开发理念和坚持\"一流的规划设计，一流的施工管理，一流的营销服务，一流的物业管理\"为开发建设原则，充分发扬敢为人先、开拓创新、追求卓越的优良作风、吸纳并融合现代管理制度和经营理念，以市场为导向、以打造精品社区为宗旨，以房地产开发经营为战略核心的专业化公司。公司现有员工20余人，部门员工均由房地产业的专业、资深人士组成。济南洪永置业有限公司以创新为根本出发点，打造精品工程。济阳县孙耿镇项目是公司全力打造的第一个楼盘，建筑全部采用现代主义建筑风格，成为孙耿镇沿104国道一带一道靓丽的风景线。济南洪永置业有限公司在社会各界的关心和支持经过全体员工的努力，在未来的发展中，将以十倍的努力创造精品，百倍的奉献精神服务社会，诚实对待每一个客户，为提高城镇居民居住水平贡献一份真情。', '济南洪永置业有限公司null张洪杰孙耿镇迎新大街259号镇政府院内南排房屋第十四间8455767713156176011@163.com1000 万元民营企业济南洪永置业有限公司成立于2011年3月，注册资金1000万元。济南洪永置业有限公司是一个现代新型的民营企业，自成立以来，始终秉承\"专注品质·建筑无限生活\"的开发理念和坚持\"一流的规划设计，一流的施工管理，一流的营销服务，一流的物业管理\"为开发建设原则，充分发扬敢为人先、开拓创新、追求卓越的优良作风、吸纳并融合现代管理制度和经营理念，以市场为导向、以打造精品社区为宗旨，以房地产开发经营为战略核心的专业化公司。公司现有员工20余人，部门员工均由房地产业的专业、资深人士组成。济南洪永置业有限公司以创新为根本出发点，打造精品工程。济阳县孙耿镇项目是公司全力打造的第一个楼盘，建筑全部采用现代主义建筑风格，成为孙耿镇沿104国道一带一道靓丽的风景线。济南洪永置业有限公司在社会各界的关心和支持经过全体员工的努力，在未来的发展中，将以十倍的努力创造精品，百倍的奉献精神服务社会，诚实对待每一个客户，为提高城镇居民居住水平贡献一份真情。');
INSERT INTO `reb` VALUES ('1602', '山东裕都房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/5b399cc0-a785-4d7d-9fa5-5f1c785095fa.shtml', '', '016670', '王庚业', '济南市商河经济开发区凯源路6号', '84772222', 'alexma02010@163.com', '3500 万元', '国有企业', '山东裕都房地产开发有限公司简介 山东裕都房地产有限公司成立于2010年1月，注册资金3500万元。公司下设：财务部、工程技术部、销售部、市场开发部、综合管理部。山东裕都地产公司，2010年在商河县玉皇庙镇代建了商河最大的开方式休闲景观公园，建成后受广大群众的高度赞誉，后期在玉皇庙镇以高水平高质量开发了裕都温泉花城住宅楼项目，打造商河第一个高端乡镇小区住宅项目。公司现有员工33人，其中高级技术职称3人，工程师3人，经济师1人，会计师2人，统计1人。本公司始终坚持“以质量求生存、取信社会、以诚信对待人、服务大众”的服务经营理念，先后开发各类商品房近23.6万平方米，并在早期开发中，多次参加了青岛市政府、市新闻媒体组织的与房地产开发有关的各项公益活动，深受广大市民和同行业人士的好评。 　　进入新世纪以来，本公司注重项目开发与大自然的亲密接触、追求环境、规模。提升开发项目的亲和力，在开发青岛市的《富泉苑》、《盛福山庄》等项目中，分别多次采用多种新型材料和新的科技成果，力争使所开发的项目更具有亲和力、更具有人性化，在多年以来的开发进程中，着力打造绿色环保、艺术生活的品牌，使您随时享受最舒适的尊贵生活，为您提供安全可靠、充足舒适、集最先进科技成果于一身的物业服务。 本公司本次进驻济南商河县，将一如既往的为商河县人民服务，开发出更具有现代生活气息、更贴近广大百姓的楼盘，切实为商河县人民提供更优质的居住空间和居住环境，并严格遵循：依法经营、规范管理、平等自愿、诚实信用、文明服务的原则，真诚地为社会各界和房地产购销双方牵线搭桥，以满足社会各界的不同需求，公司愿与社会各界朋友真诚合作、共创美好未来。', '山东裕都房地产开发有限公司null王庚业济南市商河经济开发区凯源路6号84772222alexma02010@163.com3500 万元国有企业山东裕都房地产开发有限公司简介 山东裕都房地产有限公司成立于2010年1月，注册资金3500万元。公司下设：财务部、工程技术部、销售部、市场开发部、综合管理部。山东裕都地产公司，2010年在商河县玉皇庙镇代建了商河最大的开方式休闲景观公园，建成后受广大群众的高度赞誉，后期在玉皇庙镇以高水平高质量开发了裕都温泉花城住宅楼项目，打造商河第一个高端乡镇小区住宅项目。公司现有员工33人，其中高级技术职称3人，工程师3人，经济师1人，会计师2人，统计1人。本公司始终坚持“以质量求生存、取信社会、以诚信对待人、服务大众”的服务经营理念，先后开发各类商品房近23.6万平方米，并在早期开发中，多次参加了青岛市政府、市新闻媒体组织的与房地产开发有关的各项公益活动，深受广大市民和同行业人士的好评。 　　进入新世纪以来，本公司注重项目开发与大自然的亲密接触、追求环境、规模。提升开发项目的亲和力，在开发青岛市的《富泉苑》、《盛福山庄》等项目中，分别多次采用多种新型材料和新的科技成果，力争使所开发的项目更具有亲和力、更具有人性化，在多年以来的开发进程中，着力打造绿色环保、艺术生活的品牌，使您随时享受最舒适的尊贵生活，为您提供安全可靠、充足舒适、集最先进科技成果于一身的物业服务。 本公司本次进驻济南商河县，将一如既往的为商河县人民服务，开发出更具有现代生活气息、更贴近广大百姓的楼盘，切实为商河县人民提供更优质的居住空间和居住环境，并严格遵循：依法经营、规范管理、平等自愿、诚实信用、文明服务的原则，真诚地为社会各界和房地产购销双方牵线搭桥，以满足社会各界的不同需求，公司愿与社会各界朋友真诚合作、共创美好未来。');
INSERT INTO `reb` VALUES ('1603', '山东省新天地房地产开发公司', 'http://www.jnfdc.gov.cn/kfqy/show/717a178c-2d42-4d9f-96f0-d04a563fba4f.shtml', '', '013514', '张女英', '二环南路与英雄山路交汇处西行500米外海蝶泉山庄', '82728111', '', '4300 万元', '民营企业', '', '山东省新天地房地产开发公司null张女英二环南路与英雄山路交汇处西行500米外海蝶泉山庄827281114300 万元民营企业');
INSERT INTO `reb` VALUES ('1604', '济南恒大西区置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/69f89a4f-3053-45b1-96e6-0a2544491048.shtml', '', '0161406', '廖嘉宁', '山东省济南市槐荫区经十路29851号', '55628666', '285785006@qq.com', '100000 万元', '民营企业', '恒大集团（3333.HK）是在香港联交所主板上市，以住宅产业为主，集商业、酒店、体育及文化产业为一体的特大型企业集团，是中国规模最大、销售面积最多的龙头房地产企业，目前在3个直辖市及25个省会级城市设立分公司（地区公司），在中国120多个主要城市拥有大型住宅项目200多个，覆盖中端、中高端、高端及旅游地产等多个产品系列。2011年，恒大销售804亿元，纳税89亿元；2012年上半年，恒大实现营业收入370.4亿元，中国第一。作为中国精品地产的领导者，恒大开发的楼盘在中国十大房地产企业里价格最低、品质卓越，性价比高，被中国很多老百姓誉为“民生地产”。十多年来，恒大还为中国慈善公益事业捐款超20亿元，连续五年获得国家民政部颁发的“中华慈善奖”。 未来，恒大将继续全面推进规模化、精品化、品牌化产业战略，全力打造二十一世纪规模一流、品牌一流、团队一流的具国际竞争力的世界顶级企业。 济南恒大西区置业有限公司为恒大地产集团与济南西城投资开发集团有限公司合资子公司。', '济南恒大西区置业有限公司null廖嘉宁山东省济南市槐荫区经十路29851号55628666285785006@qq.com100000 万元民营企业恒大集团（3333.HK）是在香港联交所主板上市，以住宅产业为主，集商业、酒店、体育及文化产业为一体的特大型企业集团，是中国规模最大、销售面积最多的龙头房地产企业，目前在3个直辖市及25个省会级城市设立分公司（地区公司），在中国120多个主要城市拥有大型住宅项目200多个，覆盖中端、中高端、高端及旅游地产等多个产品系列。2011年，恒大销售804亿元，纳税89亿元；2012年上半年，恒大实现营业收入370.4亿元，中国第一。作为中国精品地产的领导者，恒大开发的楼盘在中国十大房地产企业里价格最低、品质卓越，性价比高，被中国很多老百姓誉为“民生地产”。十多年来，恒大还为中国慈善公益事业捐款超20亿元，连续五年获得国家民政部颁发的“中华慈善奖”。 未来，恒大将继续全面推进规模化、精品化、品牌化产业战略，全力打造二十一世纪规模一流、品牌一流、团队一流的具国际竞争力的世界顶级企业。 济南恒大西区置业有限公司为恒大地产集团与济南西城投资开发集团有限公司合资子公司。');
INSERT INTO `reb` VALUES ('1605', '济南海悦置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/0e6feb80-5b25-4ffc-bebe-a2c068747c10.shtml', '', '0161491', '刘浩', '济南市高新区龙奥北路909号海信龙奥9号2号楼501', '66775365', 'zhucui@hisense.com', '1000 万元', '民营企业', '青岛海信房地产股份公司成立于1995年7月，拥有建设部颁发的国家一级开发资质、甲级设计资质。在16年的发展历程中，先后获得\"中国房地产品牌企业50强\"、\"中国城市运营商50强\"、\"中国值得尊敬的房地产品牌企业\"等荣誉称号，所建设的项目多次获得鲁班奖、广厦奖、詹天佑住宅金奖等国家荣誉。2009年、2010年纳税额分别达到4.4亿元和6.9亿元，连续多年名列省房地产企业纳税前茅，是山东省综合实力最强的房地产企业之一。 \"有爱，建筑也动情\",是海信地产的核心理念。海信地产以责任为基础，以爱心为框架，浇筑几代人近百年的生活空间，一直致力于中高端住宅产品的开发和建设，目前已建成近50个精品住宅社区，拥有12万名业主，年开发量逾百万平方米，业务遍及青岛、济南、烟台、威海、潍坊、东营等省内城市，并于2011年走出山东，进入安徽房地产开发市场，已形成一整套具有自身特色的高端产品开发与运营模式，得到了社会各界的认可。公司近五年销售额年均增长率达到67%，2009年与2010年的销售额分别超过43亿元与50亿元。 在高端住宅开发的基础上，海信地产还成功开发了青岛海信广场高级百货项目，温泉王朝旅游度假项目，麦岛污水源热泵低碳、节能地产项目等，这些项目的成功面世，标志着海信地产已经由单纯的住宅开发企业，向综合性高端物业开发运营企业的方向稳步迈进。 \"做令人尊敬的企业\"，是海信地产的追求；高度的社会责任感和使命感是海信地产一贯的坚持。海信地产积极响应国家政策号召，在住宅节能方面积极探索和实验，为构建\"环境友好型，资源节约型\"社会做出了积极贡献。 十六年来，海信地产秉承\"有爱建筑也动情\"的企业理念，以质量为本、创新为魂，稳健发展，着力为居者提供高质量的居住产品和高品质的生活方式。海信地产以做电器的精细做地产，以做百年企业的责任感做建筑，让建筑动情，让居者动心。', '济南海悦置业有限公司null刘浩济南市高新区龙奥北路909号海信龙奥9号2号楼50166775365zhucui@hisense.com1000 万元民营企业青岛海信房地产股份公司成立于1995年7月，拥有建设部颁发的国家一级开发资质、甲级设计资质。在16年的发展历程中，先后获得\"中国房地产品牌企业50强\"、\"中国城市运营商50强\"、\"中国值得尊敬的房地产品牌企业\"等荣誉称号，所建设的项目多次获得鲁班奖、广厦奖、詹天佑住宅金奖等国家荣誉。2009年、2010年纳税额分别达到4.4亿元和6.9亿元，连续多年名列省房地产企业纳税前茅，是山东省综合实力最强的房地产企业之一。 \"有爱，建筑也动情\",是海信地产的核心理念。海信地产以责任为基础，以爱心为框架，浇筑几代人近百年的生活空间，一直致力于中高端住宅产品的开发和建设，目前已建成近50个精品住宅社区，拥有12万名业主，年开发量逾百万平方米，业务遍及青岛、济南、烟台、威海、潍坊、东营等省内城市，并于2011年走出山东，进入安徽房地产开发市场，已形成一整套具有自身特色的高端产品开发与运营模式，得到了社会各界的认可。公司近五年销售额年均增长率达到67%，2009年与2010年的销售额分别超过43亿元与50亿元。 在高端住宅开发的基础上，海信地产还成功开发了青岛海信广场高级百货项目，温泉王朝旅游度假项目，麦岛污水源热泵低碳、节能地产项目等，这些项目的成功面世，标志着海信地产已经由单纯的住宅开发企业，向综合性高端物业开发运营企业的方向稳步迈进。 \"做令人尊敬的企业\"，是海信地产的追求；高度的社会责任感和使命感是海信地产一贯的坚持。海信地产积极响应国家政策号召，在住宅节能方面积极探索和实验，为构建\"环境友好型，资源节约型\"社会做出了积极贡献。 十六年来，海信地产秉承\"有爱建筑也动情\"的企业理念，以质量为本、创新为魂，稳健发展，着力为居者提供高质量的居住产品和高品质的生活方式。海信地产以做电器的精细做地产，以做百年企业的责任感做建筑，让建筑动情，让居者动心。');
INSERT INTO `reb` VALUES ('1606', '济南恒大金碧房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7339c5a8-9aec-4047-ba0e-615d808de877.shtml', '', '016668', '谈朝晖', '工业北路58号恒大城2期20号楼底', '80983976', 'hengdajinan@163.com', '74000 万元', '民营企业', '恒大集团（3333.HK）是在香港联交所主板上市，集房地产规划设计、开发建设、物业管理于一体的现代化国际企业集团，逾百家国际知名投资银行、财团、基金股东遍布全球。目前恒大在中国拥有员工两万余名，92%以上工程技术及管理人员为大学本科以上学历，拥有中国一级资质的房地产开发公司、中国甲级资质的建筑设计院、中国一级资质的建筑工程公司、中国甲级资质的工程监理公司、中国一级资质的物业管理公司。 恒大集团已在广州、上海、深圳、天津、重庆、沈阳、成都、长沙、太原、武汉、济南、郑州、石家庄、合肥、南京、长春、南昌、贵阳、西安、海口、昆明、兰州、呼和浩特、启东、银川、南宁、哈尔滨、乌鲁木齐等3个直辖市及24个省会城市设立分公司（地区公司），在全国80多个主要城市拥有大型房地产项目150多个，覆盖中端、中高端、高端及旅游地产等多个产品系列，是中国在建工程面积最大、进入省会城市最多的房地产企业。2009年,恒大实现销售金额303亿元；2010年，恒大销售金额突破500亿大关，稳居中国房企第一军团；全球发债27.5亿美元，海外融资规模最高，并以超过80亿元的品牌价值位列全国房企第一。 恒大集团济南置业有限公司成立于2009年9月，是恒大地产集团全国战略布局北方的重要一步。济南公司目前在济南有济南恒大绿洲、济南恒大名都、济南恒大城等项目，在济南公司首次开盘后，即开始酝酿全省拓展，目前已经有莱芜恒大金碧天下、东营黄河生态城等在建项目，在临沂、泰安、潍坊等地也在筹备项目。 济南恒大金碧房地产开发有限公司成立于2010年5月18日，注册资本肆亿肆仟万元。主要开发“恒大城”项目，位于济南市快速发展的东部新城“王舍人办事处”西南方，总占地778.27亩，总建筑面积达170余万平方。集住宅、餐饮、商超、酒店、会所于一体，吃、传、住、行、游、娱、购面面俱全，足不出户尽享便利生活。', '济南恒大金碧房地产开发有限公司null谈朝晖工业北路58号恒大城2期20号楼底80983976hengdajinan@163.com74000 万元民营企业恒大集团（3333.HK）是在香港联交所主板上市，集房地产规划设计、开发建设、物业管理于一体的现代化国际企业集团，逾百家国际知名投资银行、财团、基金股东遍布全球。目前恒大在中国拥有员工两万余名，92%以上工程技术及管理人员为大学本科以上学历，拥有中国一级资质的房地产开发公司、中国甲级资质的建筑设计院、中国一级资质的建筑工程公司、中国甲级资质的工程监理公司、中国一级资质的物业管理公司。 恒大集团已在广州、上海、深圳、天津、重庆、沈阳、成都、长沙、太原、武汉、济南、郑州、石家庄、合肥、南京、长春、南昌、贵阳、西安、海口、昆明、兰州、呼和浩特、启东、银川、南宁、哈尔滨、乌鲁木齐等3个直辖市及24个省会城市设立分公司（地区公司），在全国80多个主要城市拥有大型房地产项目150多个，覆盖中端、中高端、高端及旅游地产等多个产品系列，是中国在建工程面积最大、进入省会城市最多的房地产企业。2009年,恒大实现销售金额303亿元；2010年，恒大销售金额突破500亿大关，稳居中国房企第一军团；全球发债27.5亿美元，海外融资规模最高，并以超过80亿元的品牌价值位列全国房企第一。 恒大集团济南置业有限公司成立于2009年9月，是恒大地产集团全国战略布局北方的重要一步。济南公司目前在济南有济南恒大绿洲、济南恒大名都、济南恒大城等项目，在济南公司首次开盘后，即开始酝酿全省拓展，目前已经有莱芜恒大金碧天下、东营黄河生态城等在建项目，在临沂、泰安、潍坊等地也在筹备项目。 济南恒大金碧房地产开发有限公司成立于2010年5月18日，注册资本肆亿肆仟万元。主要开发“恒大城”项目，位于济南市快速发展的东部新城“王舍人办事处”西南方，总占地778.27亩，总建筑面积达170余万平方。集住宅、餐饮、商超、酒店、会所于一体，吃、传、住、行、游、娱、购面面俱全，足不出户尽享便利生活。');
INSERT INTO `reb` VALUES ('1607', '济南福廷置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/272d0d81-3b3c-4c25-b997-1a234c3f512a.shtml', '', '016(py)0028', '王中龙', '平阴县安城乡开发区220国道东侧', '87898077', 'jnftzy@163.com', '2000 万元', '民营企业', '济南福廷置业有限公司成立于2011年7月15日，注册资本金贰仟万元，主要从事房地产开发。 公司下设财务部、工程部、销售部、开发部、办公室，拥有一支由多名专业技术人员组成的年富力强，勇于进取，善于创新，团结向上的高素质管理团队。其中高级工程师2人，各专业工程师4人，会计师、经济师、结构工程师、房地产管理等各类人员齐全，为我公司长久的发展奠定了良好的基础。 我公司秉承“以人为本，开拓创新”的经营理念，以“成就企业，造就人才，有益社会，服务大众”的企业宗旨，为平阴人民创建新颖优质、布局合理、环境优雅的美好家园。 我们将一如既往地把“热情、高效、服务用户，守约、保质、向客户提供精品工程”的质量承诺贯穿了各项工程建设中，倾心尽力，尽职尽责，具体落实国家提出的工程质量终身责任制。为客户提供高质量、快速度、保安全、高效率的国内高品质工程，在新的经济条件下，公司将以消费者为核心，以市场需求为纽带贯穿于未来物业的规划、设计、建设和营销、服务中，公司将以超前的理念、精良的素质、强劲的实力，搏击市场，创造良好的业绩回报社会。', '济南福廷置业有限公司null王中龙平阴县安城乡开发区220国道东侧87898077jnftzy@163.com2000 万元民营企业济南福廷置业有限公司成立于2011年7月15日，注册资本金贰仟万元，主要从事房地产开发。 公司下设财务部、工程部、销售部、开发部、办公室，拥有一支由多名专业技术人员组成的年富力强，勇于进取，善于创新，团结向上的高素质管理团队。其中高级工程师2人，各专业工程师4人，会计师、经济师、结构工程师、房地产管理等各类人员齐全，为我公司长久的发展奠定了良好的基础。 我公司秉承“以人为本，开拓创新”的经营理念，以“成就企业，造就人才，有益社会，服务大众”的企业宗旨，为平阴人民创建新颖优质、布局合理、环境优雅的美好家园。 我们将一如既往地把“热情、高效、服务用户，守约、保质、向客户提供精品工程”的质量承诺贯穿了各项工程建设中，倾心尽力，尽职尽责，具体落实国家提出的工程质量终身责任制。为客户提供高质量、快速度、保安全、高效率的国内高品质工程，在新的经济条件下，公司将以消费者为核心，以市场需求为纽带贯穿于未来物业的规划、设计、建设和营销、服务中，公司将以超前的理念、精良的素质、强劲的实力，搏击市场，创造良好的业绩回报社会。');
INSERT INTO `reb` VALUES ('1608', '山东日泰房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/27a96b61-7a8d-49d6-bff4-5a93b694c550.shtml', '', '0161360', '别程远', '山东省济南市市中区贵都花园11号楼底层', '66950006', 'Ritaifangchan@163.com', '5000 万元', '民营企业', '山东日泰房地产开发有限公司成立于2011年9月23日，位于山东省济南市市中区贵都花园11号楼底层，主要从事房地产开发、经营、建筑装饰装修工程于一体的综合性公司，注册资金1000万元。具有房地产开发暂定资质。到目前为止，公司共有员工12人，其中具有高级职称的2人，中级职称8人，初级2人。 山东日泰房地产开发有限公司为日照安泰集团全资子公司，日照安泰集团成立于2000年，经过十年的发展，至今已成为集房地产开发、金融投资、营销策划、物业管理等于一体的多元化集团公司。目前，集团下设二十三个子公司，集团总资产几十亿元，已通过ISO国际质量管理体系认证, 并于2009年顺利晋升全国房地产开发一级资质企业，跻身山东房地产开发综合实力50强。十年，30多个项目、近400万平米的开发量见证了安泰集团卓越的发展速度，见证了安泰人拼搏进取的精神，同时也激励着着安泰人不断积极进取、开拓创新。目前在北京、济南、青岛、临沂均设有子公司。 山东日泰房地产开发有限公司将秉承集团的经营理念，始终贯彻以人为本、关注细节、开拓创新、卓越管理的企业精神，以“时刻关心您的生活质量”为服务宗旨，为济南大地奉献安泰精品，展现安泰精神。', '山东日泰房地产开发有限公司null别程远山东省济南市市中区贵都花园11号楼底层66950006Ritaifangchan@163.com5000 万元民营企业山东日泰房地产开发有限公司成立于2011年9月23日，位于山东省济南市市中区贵都花园11号楼底层，主要从事房地产开发、经营、建筑装饰装修工程于一体的综合性公司，注册资金1000万元。具有房地产开发暂定资质。到目前为止，公司共有员工12人，其中具有高级职称的2人，中级职称8人，初级2人。 山东日泰房地产开发有限公司为日照安泰集团全资子公司，日照安泰集团成立于2000年，经过十年的发展，至今已成为集房地产开发、金融投资、营销策划、物业管理等于一体的多元化集团公司。目前，集团下设二十三个子公司，集团总资产几十亿元，已通过ISO国际质量管理体系认证, 并于2009年顺利晋升全国房地产开发一级资质企业，跻身山东房地产开发综合实力50强。十年，30多个项目、近400万平米的开发量见证了安泰集团卓越的发展速度，见证了安泰人拼搏进取的精神，同时也激励着着安泰人不断积极进取、开拓创新。目前在北京、济南、青岛、临沂均设有子公司。 山东日泰房地产开发有限公司将秉承集团的经营理念，始终贯彻以人为本、关注细节、开拓创新、卓越管理的企业精神，以“时刻关心您的生活质量”为服务宗旨，为济南大地奉献安泰精品，展现安泰精神。');
INSERT INTO `reb` VALUES ('1609', '山东宝润置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/28008ea5-3771-4e23-b0af-c030fc05a620.shtml', '', '016(JY016)', '王元菊', '济阳县纬三路39号310室', '84568777', '', '2050 万元', '民营企业', '山东宝润置业有限公司成立于2011年1月份，注册资本人民币1000万元。公司现有高级职称人员2人，中级职称人员8人，是一家专业从事房地产开发的规范企业。 公司成立以后，以提高城市建设为目标，打造放心适用房为己任，积极改善人们的居住环境，恪守诚实信用，自觉规范市场行为，以人为本加大科技投入，狠抓工程质量，应用新技术、新工艺，注重节能、环保商品房的开发，公司成立之初的定位就是要做科技地产的践行者，认真履行社会责任，让消费者买到货真价实的房子。 公司开发建设的海棠湾（国际）温泉旅游度假村项目是由宝润置业斥资6.8亿元打造的纯生态科技温泉度假项目。', '山东宝润置业有限公司null王元菊济阳县纬三路39号310室845687772050 万元民营企业山东宝润置业有限公司成立于2011年1月份，注册资本人民币1000万元。公司现有高级职称人员2人，中级职称人员8人，是一家专业从事房地产开发的规范企业。 公司成立以后，以提高城市建设为目标，打造放心适用房为己任，积极改善人们的居住环境，恪守诚实信用，自觉规范市场行为，以人为本加大科技投入，狠抓工程质量，应用新技术、新工艺，注重节能、环保商品房的开发，公司成立之初的定位就是要做科技地产的践行者，认真履行社会责任，让消费者买到货真价实的房子。 公司开发建设的海棠湾（国际）温泉旅游度假村项目是由宝润置业斥资6.8亿元打造的纯生态科技温泉度假项目。');
INSERT INTO `reb` VALUES ('1610', '济南中再生置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/9d8f7a5e-b35b-43f7-aa96-de8d333f2455.shtml', '', '0161330', '朱枫', '孙集镇民生街', '053168786777', '', '2000 万元', '国有企业', '', '济南中再生置业有限公司null朱枫孙集镇民生街0531687867772000 万元国有企业');
INSERT INTO `reb` VALUES ('1611', '济南坤豪置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/57ecaacd-6471-474f-a823-0a159144683b.shtml', '', '016(JY006)', '孙美华', '济北开发区花园小区物业平房9号商铺', '13176446709', '', '1800 万元', '民营企业', '济南坤豪置业有限公司于2014年2月27日成立。注册资金1800万元人民币。公司是自主经营、独立核算、自负盈亏具有独立法人资格的经济实体公司，主要从事房地产开发、销售及二手房交易。公司共划分为：董事会、总经办、营销策划中心、工程管理中心、销售部、设计部等部门。在职职工总数为30人，有职称的专业人员20人，其中中级以上10人，为房地产开发暂定资质企业，也是目前济阳地区较有活力的房地产开发企业之一。 公司自2014年2月开始正式运作，本着以“温馨舒适的环境，科学规范的管理，优质高效的服务”的经营理念，根据企业规范化、标准化、科学化的需求，以适应市场竞争为导向，全面引进现代企业管理机制，认真规范企业内部管理。随着时代的步伐及市场经济的不断完善，人民群众的生活水平不断提高，为了满足城市居民对商业及办公的需求，公司于2014年3月实施了对“新元商务中心”商业办公综合楼的开发建设工作，该项目位于济阳县新老城交汇处，北邻济北派出所及小背篓、南邻新元大街、距济阳第十中学、济阳中医院以及各大机关较近，是济阳县城区的纽带，是济阳县的黄金地带，地理位置十分优越，项总投资5000余万元，打造济阳铂金地段自然环境与配套设施完美结合的精品商务办公综合体。公司本着“以品质铸品牌”的经营理念,以市场需求为导向，注重开发楼盘的经济性和实用性，充分体现了舒适、实用、经济和安全的人性化开发理念，满足不同消费群体的不同需求。 公司规划核心：本着绿色健康，造福百姓，美化环境，贡献社会，一切以您的需要为原则，把温馨、舒适、健康、欢乐、幸福的家园呈现给广大市民，既获得了社会效益，也创造了自身的效益。 此外，公司将继续用心制作，不断加大开发项目的科技含量，为每一个选择我们的人打造您心中的精品。 “创精品楼市、造健康家园”是我们的宗旨；“温馨舒适的环境、科学规范的管理、优质高效的服务”是我们的理念；您的满意是我们成功的动力！ 济南坤豪置业有限公司', '济南坤豪置业有限公司null孙美华济北开发区花园小区物业平房9号商铺131764467091800 万元民营企业济南坤豪置业有限公司于2014年2月27日成立。注册资金1800万元人民币。公司是自主经营、独立核算、自负盈亏具有独立法人资格的经济实体公司，主要从事房地产开发、销售及二手房交易。公司共划分为：董事会、总经办、营销策划中心、工程管理中心、销售部、设计部等部门。在职职工总数为30人，有职称的专业人员20人，其中中级以上10人，为房地产开发暂定资质企业，也是目前济阳地区较有活力的房地产开发企业之一。 公司自2014年2月开始正式运作，本着以“温馨舒适的环境，科学规范的管理，优质高效的服务”的经营理念，根据企业规范化、标准化、科学化的需求，以适应市场竞争为导向，全面引进现代企业管理机制，认真规范企业内部管理。随着时代的步伐及市场经济的不断完善，人民群众的生活水平不断提高，为了满足城市居民对商业及办公的需求，公司于2014年3月实施了对“新元商务中心”商业办公综合楼的开发建设工作，该项目位于济阳县新老城交汇处，北邻济北派出所及小背篓、南邻新元大街、距济阳第十中学、济阳中医院以及各大机关较近，是济阳县城区的纽带，是济阳县的黄金地带，地理位置十分优越，项总投资5000余万元，打造济阳铂金地段自然环境与配套设施完美结合的精品商务办公综合体。公司本着“以品质铸品牌”的经营理念,以市场需求为导向，注重开发楼盘的经济性和实用性，充分体现了舒适、实用、经济和安全的人性化开发理念，满足不同消费群体的不同需求。 公司规划核心：本着绿色健康，造福百姓，美化环境，贡献社会，一切以您的需要为原则，把温馨、舒适、健康、欢乐、幸福的家园呈现给广大市民，既获得了社会效益，也创造了自身的效益。 此外，公司将继续用心制作，不断加大开发项目的科技含量，为每一个选择我们的人打造您心中的精品。 “创精品楼市、造健康家园”是我们的宗旨；“温馨舒适的环境、科学规范的管理、优质高效的服务”是我们的理念；您的满意是我们成功的动力！ 济南坤豪置业有限公司');
INSERT INTO `reb` VALUES ('1612', '济南意达置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/28f9bef5-a72a-46dd-8314-35cdee576b78.shtml', '', '016(JY014)', '张建国', '济阳县纬一路321号（济阳县建筑设计院办公楼四层）', '81177177', '910967019@qq.com', '1000 万元', '民营企业', '济南意达置业有限公司成立于2010年8月，是经济南市工商局注册的民营企业，位于济阳县城纬一路321号，注册资金1000万元，是我县具有较强综合实力的房地产开发企业，主营房地产开发、商品房销售及租赁。 本公司共有员工20余人，其中高级职称3人，中级职称6人，大专以上专业人才15余人，公司倡导“能着上，平者让，庸者下\'的以人为本的用人理念，给每个人搭建一个学习和锻炼的平台，让员工充分施展才智，提升自我，成就自我，实现梦想。 各部门之间实行严格的绩效考核制度，与个人收益挂钩，互相学习，互相促进，协调配合，使公司形成了团结高效、协调联动、能打硬仗的坚强整体，实现了”管理无死角，人人有责任“，责、权、利相统一的管理运行模式。', '济南意达置业有限公司null张建国济阳县纬一路321号（济阳县建筑设计院办公楼四层）81177177910967019@qq.com1000 万元民营企业济南意达置业有限公司成立于2010年8月，是经济南市工商局注册的民营企业，位于济阳县城纬一路321号，注册资金1000万元，是我县具有较强综合实力的房地产开发企业，主营房地产开发、商品房销售及租赁。 本公司共有员工20余人，其中高级职称3人，中级职称6人，大专以上专业人才15余人，公司倡导“能着上，平者让，庸者下\'的以人为本的用人理念，给每个人搭建一个学习和锻炼的平台，让员工充分施展才智，提升自我，成就自我，实现梦想。 各部门之间实行严格的绩效考核制度，与个人收益挂钩，互相学习，互相促进，协调配合，使公司形成了团结高效、协调联动、能打硬仗的坚强整体，实现了”管理无死角，人人有责任“，责、权、利相统一的管理运行模式。');
INSERT INTO `reb` VALUES ('1613', '济南三鼎房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/50812fd8-82b0-472a-8682-f0e5f0957635.shtml', '', '0161329', '张辉', '历下区文化东路51号汇东星座大厦1-1605B', '83197772', 'sanding_chn@126.com', '1000 万元', '国有企业', '济南三鼎房地产成立于2007年4月26日，公司注册资本金1000万元人民币，公司现有员工16人，其中高级职称5人，中级职称9人，本科以上学历人员14人。公司全部人员均具有丰富的房地产开发经营经验，对济南房地产市场有着深刻的认识，一并合作开发过汇东星座，汇鑫国际商务大厦等项目，曾获得“济南市商业地产十强，济南市最佳写字楼，济南卓越商业地产项目，卓越地产品牌企业”。公司在所有合作单位中一直具有较高的信誉，“诚信，稳健，专业”是公司坚持的基本理念。', '济南三鼎房地产开发有限公司null张辉历下区文化东路51号汇东星座大厦1-1605B83197772sanding_chn@126.com1000 万元国有企业济南三鼎房地产成立于2007年4月26日，公司注册资本金1000万元人民币，公司现有员工16人，其中高级职称5人，中级职称9人，本科以上学历人员14人。公司全部人员均具有丰富的房地产开发经营经验，对济南房地产市场有着深刻的认识，一并合作开发过汇东星座，汇鑫国际商务大厦等项目，曾获得“济南市商业地产十强，济南市最佳写字楼，济南卓越商业地产项目，卓越地产品牌企业”。公司在所有合作单位中一直具有较高的信誉，“诚信，稳健，专业”是公司坚持的基本理念。');
INSERT INTO `reb` VALUES ('1614', '济南汇泉新世界置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/24bc70cd-4261-45fc-819b-dfe86a3cc7f2.shtml', '', '0161511', '冯火', '济南市历下区县西巷2号116、117室', '86111872', '807028146@qq.com', '5000 万元', '民营企业', '济南汇泉新世界置业有限公司2004年注册成立，注册资本人民币5000万元，主营房地产开发。截至目前，公司拥有员工56人，其中具有专业技术资格的有11人，本科学历以上的占90％。 济南汇泉新世界置业有限公司２００４年以3.07亿元拍卖获得县西巷土地，项目占地面积4万多平方米，长500多米，总建筑面积近5万平方米,总投资近8亿元,因其项目总价值、每亩单价均创历史最高，被济南媒体誉为地王，又因项目内名泉荟萃，因此命名为汇泉地王广场,现项目命名为“泉乐坊”。 本公司拟把该项目建成一个具有泉城历史文化和独特自然景观特色的，集新型体验式商业、特色旅游、文化艺术、创意产业为一体的、令广大市民和游客流连忘返的现代城市生活中心。', '济南汇泉新世界置业有限公司null冯火济南市历下区县西巷2号116、117室86111872807028146@qq.com5000 万元民营企业济南汇泉新世界置业有限公司2004年注册成立，注册资本人民币5000万元，主营房地产开发。截至目前，公司拥有员工56人，其中具有专业技术资格的有11人，本科学历以上的占90％。 济南汇泉新世界置业有限公司２００４年以3.07亿元拍卖获得县西巷土地，项目占地面积4万多平方米，长500多米，总建筑面积近5万平方米,总投资近8亿元,因其项目总价值、每亩单价均创历史最高，被济南媒体誉为地王，又因项目内名泉荟萃，因此命名为汇泉地王广场,现项目命名为“泉乐坊”。 本公司拟把该项目建成一个具有泉城历史文化和独特自然景观特色的，集新型体验式商业、特色旅游、文化艺术、创意产业为一体的、令广大市民和游客流连忘返的现代城市生活中心。');
INSERT INTO `reb` VALUES ('1615', '济南山川房地产有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/65e74b75-f66d-4fe5-bfd8-0d08dd8ad885.shtml', '', '0161584', '杨茂升', '无影山北路16号', '13698643255', '77108455@qq.com', '1000 万元', '民营企业', '济南山川房地产有限公司是一家正在蓬勃发展的，以房地产综合开发为主，兼营房屋销售、物业管理等业务的房地产开发 企业。公司成立于2010年，注册资金1000万元，公司秉承诚信、务实、严格、实事求是的理念，不断提高综合水平，力争成为实力强、发展规模大的民营企业之一。', '济南山川房地产有限公司null杨茂升无影山北路16号1369864325577108455@qq.com1000 万元民营企业济南山川房地产有限公司是一家正在蓬勃发展的，以房地产综合开发为主，兼营房屋销售、物业管理等业务的房地产开发 企业。公司成立于2010年，注册资金1000万元，公司秉承诚信、务实、严格、实事求是的理念，不断提高综合水平，力争成为实力强、发展规模大的民营企业之一。');
INSERT INTO `reb` VALUES ('1616', '济南银都房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/6696c927-d890-4aaa-bce5-f698036075a4.shtml', '', '016(JY022)', '滕元芳', '济阳县城开元街133号4号楼5层南办公室1-2室', '84369716', 'yindufangchan@163.com', '1000 万元', '民营企业', '济南银都房地产开发有限公司位于山东省济北开发区开元大街中段北侧龙海路西侧（信誉商厦六楼607室）,公司注册资金壹仟万元,主要从事房地产开发、销售，公司设置工程开发设计部、工程管理部、综合事业部、财务部，计划开发建设的银都花园小区一期工程10万平方米，2011年12月交付使用。公司的宗旨:“以人性、健康为开发设计理念，建设绿化、舒适的人居环境。 目前主要建设内容： 一、目前项目的场址位于济南市济阳济北开发区，济阳县人民医院以北，银河路以东、富阳街以南，场地内地形平坦。场址四周对外交通便利。本项目包含小高层住宅7幢（11F5幢，10F2幢），高层住宅2幢（24F），15层商务楼1幢，5层商务楼1幢，3层商业广场1座（20060.4平方米），2层商业街4448.7平方米、地下汽车库及地下室8728.54平方米、地下商城11626.37平方米（人防工程）。 二、本项目总用地面积为67705.88平方米，总建筑面积为169347.4平方米，其中地上住宅面积99843.95平方米，地上商业、办公及其他公建面积49148.54平方米，地下商业及车库等20354.91平方米。 项目居住户数为1080户。', '济南银都房地产开发有限公司null滕元芳济阳县城开元街133号4号楼5层南办公室1-2室84369716yindufangchan@163.com1000 万元民营企业济南银都房地产开发有限公司位于山东省济北开发区开元大街中段北侧龙海路西侧（信誉商厦六楼607室）,公司注册资金壹仟万元,主要从事房地产开发、销售，公司设置工程开发设计部、工程管理部、综合事业部、财务部，计划开发建设的银都花园小区一期工程10万平方米，2011年12月交付使用。公司的宗旨:“以人性、健康为开发设计理念，建设绿化、舒适的人居环境。 目前主要建设内容： 一、目前项目的场址位于济南市济阳济北开发区，济阳县人民医院以北，银河路以东、富阳街以南，场地内地形平坦。场址四周对外交通便利。本项目包含小高层住宅7幢（11F5幢，10F2幢），高层住宅2幢（24F），15层商务楼1幢，5层商务楼1幢，3层商业广场1座（20060.4平方米），2层商业街4448.7平方米、地下汽车库及地下室8728.54平方米、地下商城11626.37平方米（人防工程）。 二、本项目总用地面积为67705.88平方米，总建筑面积为169347.4平方米，其中地上住宅面积99843.95平方米，地上商业、办公及其他公建面积49148.54平方米，地下商业及车库等20354.91平方米。 项目居住户数为1080户。');
INSERT INTO `reb` VALUES ('1617', '济南东环置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/099d2780-520b-4fbe-8ec6-6622f62cb9a5.shtml', '', '0161351', '白瀚文', '济南市历城区山大北路54号2号楼1幢402室', '82316789', 'Jndhzy@126.com', '1000 万元', '民营企业', '济南东环置业有限公司是于2009年10月即济南东环综合商贸中心项目立项后一并成立的。公司发起人由济南国泰工贸有限公司、济南国泰投资发展有限公司、济南国泰消防有限公司共同注资组建。公司拥有员工299人，其中高级职称13人，中级职称29人，集房地产开发销售、物业管理、机电设备、消防设施工程、建筑智能化工程设计及施工为一体的综合性有限责任公司。 我公司将严格按照“经济隆起带、景观新走廊、交通大动脉”的主导思想，将《济南东环综合商贸中心》项目打造成我区的地标工程、亮点工程、精品工程，真正成为“新济南”的高端CBD，为我区城区改造当好龙头带头兵。 未来几年，公司将抓住各种发展机遇，弘扬只争朝夕、勇立潮头、崇尚科学、开放包容的创业精神，以创新为不竭动力，不断提升东环置业的产品、服务、管理，保持持续稳健的企业发展之路，努力成为优秀的房地产企业之一。 ? 企业愿景：力争成为具竞争力的中小城市（区）精品房产商！ ? 企业使命：筑造卓越社区生活空间，引领城市新生活。 ? 企业价值观：为政府创造税收；为客户提供优质服务；为员工谋求可持续发展。我公司2011年至2012年可完成销售收入6亿元，税金4000余万元。 ? 企业经营理念：诚信、专业、创新。 ? 企业经营战略：后发先至，迅速做强做大企业规模；上控资源，精品 打造优质物业管理综合集成服务；合理布局，实现跨区域战略发展。', '济南东环置业有限公司null白瀚文济南市历城区山大北路54号2号楼1幢402室82316789Jndhzy@126.com1000 万元民营企业济南东环置业有限公司是于2009年10月即济南东环综合商贸中心项目立项后一并成立的。公司发起人由济南国泰工贸有限公司、济南国泰投资发展有限公司、济南国泰消防有限公司共同注资组建。公司拥有员工299人，其中高级职称13人，中级职称29人，集房地产开发销售、物业管理、机电设备、消防设施工程、建筑智能化工程设计及施工为一体的综合性有限责任公司。 我公司将严格按照“经济隆起带、景观新走廊、交通大动脉”的主导思想，将《济南东环综合商贸中心》项目打造成我区的地标工程、亮点工程、精品工程，真正成为“新济南”的高端CBD，为我区城区改造当好龙头带头兵。 未来几年，公司将抓住各种发展机遇，弘扬只争朝夕、勇立潮头、崇尚科学、开放包容的创业精神，以创新为不竭动力，不断提升东环置业的产品、服务、管理，保持持续稳健的企业发展之路，努力成为优秀的房地产企业之一。 ? 企业愿景：力争成为具竞争力的中小城市（区）精品房产商！ ? 企业使命：筑造卓越社区生活空间，引领城市新生活。 ? 企业价值观：为政府创造税收；为客户提供优质服务；为员工谋求可持续发展。我公司2011年至2012年可完成销售收入6亿元，税金4000余万元。 ? 企业经营理念：诚信、专业、创新。 ? 企业经营战略：后发先至，迅速做强做大企业规模；上控资源，精品 打造优质物业管理综合集成服务；合理布局，实现跨区域战略发展。');
INSERT INTO `reb` VALUES ('1618', '山东恒生置地股份有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/1b8db1bb-a274-4dfb-a1e3-bf92e6f58f9d.shtml', '', '016623', '杨秀强', '济南市经十路2299号11号楼', '62309009', 'jgzy2010@126.com', '6000 万元', '民营企业', '山东恒生置地股份有限公司是经山东省工商局批准于2006年6月正式注册成立，注册资本6000万元，由恒生投资（香港）有限公司在济南投资成立的股份有限公司。 2009年12月9号采用招拍挂取得雪山项目土地使用权并达成了本项目签订，总投资约10亿元左右。 项目位于济南市经十东路奥体中心以东，占地76亩，总建筑面积16.0093万㎡。项目由香港开发商实力打造，引入一流设计理念，依雪山而建，注重山景景观和社区景观的和谐统一，以小高层和高层为主的高端物业产品。', '山东恒生置地股份有限公司null杨秀强济南市经十路2299号11号楼62309009jgzy2010@126.com6000 万元民营企业山东恒生置地股份有限公司是经山东省工商局批准于2006年6月正式注册成立，注册资本6000万元，由恒生投资（香港）有限公司在济南投资成立的股份有限公司。 2009年12月9号采用招拍挂取得雪山项目土地使用权并达成了本项目签订，总投资约10亿元左右。 项目位于济南市经十东路奥体中心以东，占地76亩，总建筑面积16.0093万㎡。项目由香港开发商实力打造，引入一流设计理念，依雪山而建，注重山景景观和社区景观的和谐统一，以小高层和高层为主的高端物业产品。');
INSERT INTO `reb` VALUES ('1619', '润华集团山东房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/465e1f12-4380-4ad2-add6-fd2e46818f11.shtml', '', '0161494', '陈罕频', '济南市市中区乐山南区4号', '66661417', 'Wz556@163.com', '20000 万元', '民营企业', '自1994年11月8日成立自今，系有限责任公司，注册登记10000万元。企业由温州市惠泽控股有限公司出资9750万元和济南中加泰勒斯科技开发有限公司出资250万组成。', '润华集团山东房地产开发有限公司null陈罕频济南市市中区乐山南区4号66661417Wz556@163.com20000 万元民营企业自1994年11月8日成立自今，系有限责任公司，注册登记10000万元。企业由温州市惠泽控股有限公司出资9750万元和济南中加泰勒斯科技开发有限公司出资250万组成。');
INSERT INTO `reb` VALUES ('1620', '山东时代发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/4662aecd-c484-4a33-89e2-76c98117ae12.shtml', '', '0161433', '郑明洁', '济南市槐荫区美里湖办事处', '82960211', 'Rencai698@163.com', '1800 万元', '民营企业', '山东时代发展有限公司成立于1996年11月，注册资金1080万元，是经山东省工商行政管理局注册的有限责任公司，主要从事机电产品销售批发业务及房地产开发，公司共有职工25人，其中高级专业技术职称6人，中级专业技术职称5人，初级专业技术职称1人，大专以上学历人员占公司职工人数的90%. 公司于2006年6月以出让的方式取得济南市历下区燕子山东坡土地一宗，目前正进行办理相关手续。除此之外，公司还与中国轻骑集团、中国重汽集团进行了长期的经营合作并建立了全国范围内的销售网络.', '山东时代发展有限公司null郑明洁济南市槐荫区美里湖办事处82960211Rencai698@163.com1800 万元民营企业山东时代发展有限公司成立于1996年11月，注册资金1080万元，是经山东省工商行政管理局注册的有限责任公司，主要从事机电产品销售批发业务及房地产开发，公司共有职工25人，其中高级专业技术职称6人，中级专业技术职称5人，初级专业技术职称1人，大专以上学历人员占公司职工人数的90%. 公司于2006年6月以出让的方式取得济南市历下区燕子山东坡土地一宗，目前正进行办理相关手续。除此之外，公司还与中国轻骑集团、中国重汽集团进行了长期的经营合作并建立了全国范围内的销售网络.');
INSERT INTO `reb` VALUES ('1621', '山东丽丰置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/67b0842f-3f20-435f-852f-7d8f6ff0eef8.shtml', '', '0161366', '李方', '济南市市中区舜耕路48号', '82868567', '17705310116@163.com', '1000 万元', '民营企业', '山东丽丰置业有限公司成立于2001年8月21日，注册资本1000万元，企业法人为杜若谦。', '山东丽丰置业有限公司null李方济南市市中区舜耕路48号8286856717705310116@163.com1000 万元民营企业山东丽丰置业有限公司成立于2001年8月21日，注册资本1000万元，企业法人为杜若谦。');
INSERT INTO `reb` VALUES ('1622', '山东中建西城楷泰置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/1d460ef1-5757-4f09-9587-a04c1bd80701.shtml', '', '0161590', '韩文东', '济南市槐荫区腊山北路北首荣祥商务楼6楼', '88805858', '1207121906@qq.com', '3000 万元', '国有企业', '山东中建西城楷泰置业有限公司是山东中建西城投资有限公司的独资企业，公司注册于2011年11月4日，注册资本3000万元。2014年6月10日，取得槐荫区青岛路以南、泰安路以西地块国有土地使用证，证号：槐荫国用（2014）第0300027号。公司现有职工20人，其中高级职称6人，中级职称9人，初级职称5人。', '山东中建西城楷泰置业有限公司null韩文东济南市槐荫区腊山北路北首荣祥商务楼6楼888058581207121906@qq.com3000 万元国有企业山东中建西城楷泰置业有限公司是山东中建西城投资有限公司的独资企业，公司注册于2011年11月4日，注册资本3000万元。2014年6月10日，取得槐荫区青岛路以南、泰安路以西地块国有土地使用证，证号：槐荫国用（2014）第0300027号。公司现有职工20人，其中高级职称6人，中级职称9人，初级职称5人。');
INSERT INTO `reb` VALUES ('1623', '平阴县城市建设发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d478d7cb-4cee-4746-a628-78a05003eaf0.shtml', '', '016(py)0024', '张勇', '榆山路55号', '87883610', 'pycjgs@163.com', '11000 万元', '国有企业', '平阴县城市建设发展有限公司成立于2008年2月，注资11000万元。拥有专业技术人员11人（其中：高级2人，中级7人，初级2人）。公司设有行管、财务、计划预算、工程管理、销售、质量安全、房屋维修、材料管理等职能部门。', '平阴县城市建设发展有限公司null张勇榆山路55号87883610pycjgs@163.com11000 万元国有企业平阴县城市建设发展有限公司成立于2008年2月，注资11000万元。拥有专业技术人员11人（其中：高级2人，中级7人，初级2人）。公司设有行管、财务、计划预算、工程管理、销售、质量安全、房屋维修、材料管理等职能部门。');
INSERT INTO `reb` VALUES ('1624', '济南茗筑华丽置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/0ad81327-e11e-4dea-87f6-e450f735877f.shtml', '', '0161458', '唐立新', '孙村镇科航路2877号研发楼一楼', '86133237', '754545303@qq.com', '3000 万元', '民营企业', '济南茗筑华丽置业有限公司成立于2009年6月，公司经营范围包括房地产开发及物业管理、高新技术产业及房地产投资等。 自成立以来，公司致力于以人性化和人文的角度去开发项目。“做实齐鲁，构筑全中国，走向国际化”是浪潮置业所坚持的战略；“人本、诚信、卓越”的理念是浪潮品牌的核心；“科学管理，创建精品，以人为本，优质服务”始终是公司坚持的质量方针。 济南茗筑华丽置业有限公司将坚持面向社会、服务社会的宗旨，不断追求卓越，凭借实力和诚信汇报社会，与广大客户及员工携手共创美好未来，为济南房地产的发展贡献力量。', '济南茗筑华丽置业有限公司null唐立新孙村镇科航路2877号研发楼一楼86133237754545303@qq.com3000 万元民营企业济南茗筑华丽置业有限公司成立于2009年6月，公司经营范围包括房地产开发及物业管理、高新技术产业及房地产投资等。 自成立以来，公司致力于以人性化和人文的角度去开发项目。“做实齐鲁，构筑全中国，走向国际化”是浪潮置业所坚持的战略；“人本、诚信、卓越”的理念是浪潮品牌的核心；“科学管理，创建精品，以人为本，优质服务”始终是公司坚持的质量方针。 济南茗筑华丽置业有限公司将坚持面向社会、服务社会的宗旨，不断追求卓越，凭借实力和诚信汇报社会，与广大客户及员工携手共创美好未来，为济南房地产的发展贡献力量。');
INSERT INTO `reb` VALUES ('1625', '济南禧福置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/1babd677-332d-475b-8312-67b1cbd4fb61.shtml', '', '016(JY029)', '张勇', '汇鑫路58号（禧福凤凰城22号楼二楼201室）', '81177010', 'liuxisheng88@163.com', '3000 万元', '民营企业', '济南禧福置业有限公司于2009年8月14日成立，注册资金为3000万元，隶属于禧福（福建）集团。经营范围：房地产开发、经营；建筑装饰工程设计、施工；物业管理。董事长连高云，总经理翁卫平。公司内设：综合管理部、开发部、工程部、预算部、财务部、销售部、物业管理公司等7部（司）。现有职工25人，其中有专业技术职称的15人，并组织了相关专业人员作为公司的工程技术负责人、财务负责人、经营负责人、经济管理和统计负责人等部门负责人，充实了本公司的人力资源力量，为企业的发展奠定了基础。 本公司自成立伊始，始终坚持“诚信是生存的血脉，创新是发展的灵魂”的理念，遵循“立德诚信、进取创新”的企业精神，坚持“高起点规划、高标准建设、高效能管理”的原则，牢牢把握“建一片凤凰城，树一座丰碑，交一方朋友”的主题，精心打造禧福凤凰城项目。 本项目占地面积211亩，总规划建筑面积约36平方米，由禧福（福建）集团投资约8亿元，于2009年6月份正式动工，到目前，一期工程（西区）8幢5.7万平方米已基本完成；东区13幢8.4万平方米，计划2013年3月份竣工交付使用；二期工程现已进行地下工程施工。', '济南禧福置业有限公司null张勇汇鑫路58号（禧福凤凰城22号楼二楼201室）81177010liuxisheng88@163.com3000 万元民营企业济南禧福置业有限公司于2009年8月14日成立，注册资金为3000万元，隶属于禧福（福建）集团。经营范围：房地产开发、经营；建筑装饰工程设计、施工；物业管理。董事长连高云，总经理翁卫平。公司内设：综合管理部、开发部、工程部、预算部、财务部、销售部、物业管理公司等7部（司）。现有职工25人，其中有专业技术职称的15人，并组织了相关专业人员作为公司的工程技术负责人、财务负责人、经营负责人、经济管理和统计负责人等部门负责人，充实了本公司的人力资源力量，为企业的发展奠定了基础。 本公司自成立伊始，始终坚持“诚信是生存的血脉，创新是发展的灵魂”的理念，遵循“立德诚信、进取创新”的企业精神，坚持“高起点规划、高标准建设、高效能管理”的原则，牢牢把握“建一片凤凰城，树一座丰碑，交一方朋友”的主题，精心打造禧福凤凰城项目。 本项目占地面积211亩，总规划建筑面积约36平方米，由禧福（福建）集团投资约8亿元，于2009年6月份正式动工，到目前，一期工程（西区）8幢5.7万平方米已基本完成；东区13幢8.4万平方米，计划2013年3月份竣工交付使用；二期工程现已进行地下工程施工。');
INSERT INTO `reb` VALUES ('1626', '济南滨湖地产有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/48eed182-831f-4faa-aa93-70f8ec468692.shtml', '', '0161386', '许为民', '济南市天桥区历山北路19号', '66594780', '993460167@qq.com', '1000 万元', '国有企业', '为全面加快滨河新区的建设步伐，适应快速变化的市场形势，最大的整合和优化现有资源，建立现代化、适应市场经济的机制和体制，结合滨河新区的建设特点和发展需要。经董事会研究决定，并经工商部门登记注册，成立济南滨湖地产有限公司。 一、公司总体定位 公司依托济南市小清河投融资管理中心，以管理和服务为主业，通过对小清河开发建设形成国有资产的管理，推进小清河开发建设范围内的产业发展，使小清河及两岸地区成为集旅游休闲、商贸服务、生活居住多功能、复合型城市综合体。 二、公司名称 济南滨湖地产有限公司 三、公司性质 公司为济南滨河新区建设投资集团有限公司下属的国有全资子公司。 四、注册资本 1000万元人民币 五、企业类型 有限责任公司 六、经营范围 房地产开发业务、房地产销售代理及咨询、建筑安装及建筑装饰、土地整理。', '济南滨湖地产有限公司null许为民济南市天桥区历山北路19号66594780993460167@qq.com1000 万元国有企业为全面加快滨河新区的建设步伐，适应快速变化的市场形势，最大的整合和优化现有资源，建立现代化、适应市场经济的机制和体制，结合滨河新区的建设特点和发展需要。经董事会研究决定，并经工商部门登记注册，成立济南滨湖地产有限公司。 一、公司总体定位 公司依托济南市小清河投融资管理中心，以管理和服务为主业，通过对小清河开发建设形成国有资产的管理，推进小清河开发建设范围内的产业发展，使小清河及两岸地区成为集旅游休闲、商贸服务、生活居住多功能、复合型城市综合体。 二、公司名称 济南滨湖地产有限公司 三、公司性质 公司为济南滨河新区建设投资集团有限公司下属的国有全资子公司。 四、注册资本 1000万元人民币 五、企业类型 有限责任公司 六、经营范围 房地产开发业务、房地产销售代理及咨询、建筑安装及建筑装饰、土地整理。');
INSERT INTO `reb` VALUES ('1627', '济南方达置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/0c65cad3-d40a-4b75-aa1c-fb0dc671c6e5.shtml', '', '016161', '张玉青', '龙山街道办事处办公楼三层西侧', '85894777', '', '1000 万元', '民营企业', '章丘国伟房地产开发有限公司是由于建国和宋伟同志分别以700万元和300万元的投资新成立的房地产开发企业。2009年12月17日，济南市工商行政管理局章丘分局核发了营业执照，注册号为370181200021238，已办理了企业代码，代码号69746257-0，同时办理了税务登记，税务登记号370181697462570。章丘国伟房地产开发有限公司注册地址为：章丘市垛庄镇南垛庄村。主要从事房地产开发、销售。公司现有员工12人，其中高级工程师2人，具有中级职称的6人，初级职称的1人。', '济南方达置业有限公司null张玉青龙山街道办事处办公楼三层西侧858947771000 万元民营企业章丘国伟房地产开发有限公司是由于建国和宋伟同志分别以700万元和300万元的投资新成立的房地产开发企业。2009年12月17日，济南市工商行政管理局章丘分局核发了营业执照，注册号为370181200021238，已办理了企业代码，代码号69746257-0，同时办理了税务登记，税务登记号370181697462570。章丘国伟房地产开发有限公司注册地址为：章丘市垛庄镇南垛庄村。主要从事房地产开发、销售。公司现有员工12人，其中高级工程师2人，具有中级职称的6人，初级职称的1人。');
INSERT INTO `reb` VALUES ('1628', '山东中建西城嘉昕置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b1adfab8-1346-4cec-8acb-aac19f1fce7b.shtml', '', '0161583', '韩文东', '济南市槐荫区腊山北路北首荣祥商务楼6楼', '88805858', '1207121906@qq.com', '1800 万元', '国有企业', '山东中建西城嘉昕置业有；公司是山东中建西城投资有限公司的独资企业，公司注册于2011年11月4日，注册资本1800万元。2012年11月12日，取得西客站片区安置一区十二-1地块国有土地使用证，证号：槐荫国用（2012）第0300049号。公司现有职工15人，其中高级职称3人，中级职称7人，初级职称5人。', '山东中建西城嘉昕置业有限公司null韩文东济南市槐荫区腊山北路北首荣祥商务楼6楼888058581207121906@qq.com1800 万元国有企业山东中建西城嘉昕置业有；公司是山东中建西城投资有限公司的独资企业，公司注册于2011年11月4日，注册资本1800万元。2012年11月12日，取得西客站片区安置一区十二-1地块国有土地使用证，证号：槐荫国用（2012）第0300049号。公司现有职工15人，其中高级职称3人，中级职称7人，初级职称5人。');
INSERT INTO `reb` VALUES ('1629', '济南鲁班鼎峰置业有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/a199812a-d1b8-4b3f-9573-c0cbf276afe8.shtml', '', '0161518', '孟禹辰', '历下区解放路22号燕山大厦812室', '68607859', '112530001@qq.com', '1000 万元', '民营企业', '济南鲁班鼎峰置业有限责任公司成立于2016年1月14日，目前正在开发项目鼎峰中心，位于济南市历下区解放路和二环东路交叉口西南。 项目总建筑面积约7.7万平方米，由一栋30层塔楼和商业群楼组成。其中地上约5.4万平方米，地下约2.2万平方米。由临街商铺、写字楼组成。', '济南鲁班鼎峰置业有限责任公司null孟禹辰历下区解放路22号燕山大厦812室68607859112530001@qq.com1000 万元民营企业济南鲁班鼎峰置业有限责任公司成立于2016年1月14日，目前正在开发项目鼎峰中心，位于济南市历下区解放路和二环东路交叉口西南。 项目总建筑面积约7.7万平方米，由一栋30层塔楼和商业群楼组成。其中地上约5.4万平方米，地下约2.2万平方米。由临街商铺、写字楼组成。');
