INSERT INTO `reb` VALUES ('1632', '山东六福房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/3aece2c8-9315-42b7-ba32-af4b9caaab5c.shtml', '', '016(JY013)', '刘光青', '济阳县城纬二路197号新世纪阳光花园小区内会所楼', '84240787', 'YPTXT@126.com', '3760 万元', '民营企业', '山东六福房地产开发有限公司成立于2006年2月23日，其前身为2004年6月成立的山东新世纪房地产开发有限公司济阳分公司，“六福”公司注册资金为3760万元。公司类型为：有限责任公司。总公司下设四个分公司，即：济南六福物业管理有限公司、济南六福广告有限公司、济阳六福商贸有限公司、海南六福房地产开发有限公司。总公司现有职工65人，其中具有中、高级专业技术职称的15余人。', '山东六福房地产开发有限公司null刘光青济阳县城纬二路197号新世纪阳光花园小区内会所楼84240787YPTXT@126.com3760 万元民营企业山东六福房地产开发有限公司成立于2006年2月23日，其前身为2004年6月成立的山东新世纪房地产开发有限公司济阳分公司，“六福”公司注册资金为3760万元。公司类型为：有限责任公司。总公司下设四个分公司，即：济南六福物业管理有限公司、济南六福广告有限公司、济阳六福商贸有限公司、海南六福房地产开发有限公司。总公司现有职工65人，其中具有中、高级专业技术职称的15余人。');
INSERT INTO `reb` VALUES ('1633', '山东齐鲁鞋城置业有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/5e171cbd-eb47-4894-a601-b04fb422457c.shtml', '', '0161358', '李延萍', '济南市天桥区济洛路82号', '85815936', '976836101@qq.com', '1000 万元', '民营企业', '公司由新疆兆投资有限公司和济南众鑫有限责任公司共同出资组建，2004年7月由济南市工商行政管理局核准成立。公司经营范围：房地产开发；投资办市场；房屋、场地租赁；批发、零售：鞋帽，服装，纺织品，日用百货，五金、交电，钢材。2006年11月13日经济南市工商行政管理局批准公司更名为“山东齐鲁鞋城开发有限责任公司”。公司通过出让方式，于2006年3月23日取得土地使用权，用途为商业用地，使用期限40年。2010年11月6日，济南众鑫有限责任公司出资1.3亿收回60%股权，2010年11月份正式更名为 山东齐鲁鞋城置业有限责任公司。 目前，公司在册职工15人，其中，拥有专业职称的人员11人。 公司2006年被评为一级AAA企业。', '山东齐鲁鞋城置业有限责任公司null李延萍济南市天桥区济洛路82号85815936976836101@qq.com1000 万元民营企业公司由新疆兆投资有限公司和济南众鑫有限责任公司共同出资组建，2004年7月由济南市工商行政管理局核准成立。公司经营范围：房地产开发；投资办市场；房屋、场地租赁；批发、零售：鞋帽，服装，纺织品，日用百货，五金、交电，钢材。2006年11月13日经济南市工商行政管理局批准公司更名为“山东齐鲁鞋城开发有限责任公司”。公司通过出让方式，于2006年3月23日取得土地使用权，用途为商业用地，使用期限40年。2010年11月6日，济南众鑫有限责任公司出资1.3亿收回60%股权，2010年11月份正式更名为 山东齐鲁鞋城置业有限责任公司。 目前，公司在册职工15人，其中，拥有专业职称的人员11人。 公司2006年被评为一级AAA企业。');
INSERT INTO `reb` VALUES ('1634', '济南建中房地产综合开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/3badebad-1126-438e-9e60-acf847086b71.shtml', '', '0161392', '侯树旺', '济南市市中区千佛山南路2号', '82596688', '407819994@qq.com', '9000 万元', '民营企业', '　　　　济南建中房地产综合开发有限公司，隶属于济南市市中区建设管理局，成立于1998年，现有员工11名，具有三级房地产开发资质，是济南市房地产开发企业中很有潜力的公司。公司下设项目部、材料部、工程部、财务部、办公室、销售部等，是集市场开发、报批报建、工程管理、楼盘销售、建筑材料销售、物业管理于一体的综合性房地产开发公司。 　　公司成立八年来，依托济南市市中区建设管理局雄厚的资金实力，良好的企业信誉，以一流的规划设计，一流的施工管理，一流的营销服务，开发建设的山景嘉园楼盘地处郎茂山、万灵山、兴济河两山一水的环抱之中，，规划道路直通英雄山路，K55,36,41路车途经市区繁华路段，交通方便快捷。本小区共由5栋六层住宅楼组成，总建筑面积16911m2，其中住宅建筑面积15286 m2公建建筑面积1625 m2。园区设地下停车场，景观由专业园林设计师设计，专业物管。半地下室层高2.5 m，顶层跃层阁楼，阳台用单框双玻塑钢窗封闭。', '济南建中房地产综合开发有限公司null侯树旺济南市市中区千佛山南路2号82596688407819994@qq.com9000 万元民营企业　　　　济南建中房地产综合开发有限公司，隶属于济南市市中区建设管理局，成立于1998年，现有员工11名，具有三级房地产开发资质，是济南市房地产开发企业中很有潜力的公司。公司下设项目部、材料部、工程部、财务部、办公室、销售部等，是集市场开发、报批报建、工程管理、楼盘销售、建筑材料销售、物业管理于一体的综合性房地产开发公司。 　　公司成立八年来，依托济南市市中区建设管理局雄厚的资金实力，良好的企业信誉，以一流的规划设计，一流的施工管理，一流的营销服务，开发建设的山景嘉园楼盘地处郎茂山、万灵山、兴济河两山一水的环抱之中，，规划道路直通英雄山路，K55,36,41路车途经市区繁华路段，交通方便快捷。本小区共由5栋六层住宅楼组成，总建筑面积16911m2，其中住宅建筑面积15286 m2公建建筑面积1625 m2。园区设地下停车场，景观由专业园林设计师设计，专业物管。半地下室层高2.5 m，顶层跃层阁楼，阳台用单框双玻塑钢窗封闭。');
INSERT INTO `reb` VALUES ('1635', '山东科德利置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8ebd0609-2227-4a3d-a25a-6cc17761c674.shtml', '', '016(py)0026', '李长传', '平阴县城翠屏街113号', '87880726', '443819018@qq.com', '2000 万元', '民营企业', '山东科德利置业有限公司，成立于2013年4月，注册资金2000万元，公司地址平阴县城翠屏街113号，是以市场开发运营及房地产开发销售、房地产营销策划、物业管理、服务等国家二级民营企业。公司现有员工38人，其中本科学历10人，大专学历15人，高级职称3人，管理人员10人。公司经营理念为“科学管理，德行天下，利国惠民”。', '山东科德利置业有限公司null李长传平阴县城翠屏街113号87880726443819018@qq.com2000 万元民营企业山东科德利置业有限公司，成立于2013年4月，注册资金2000万元，公司地址平阴县城翠屏街113号，是以市场开发运营及房地产开发销售、房地产营销策划、物业管理、服务等国家二级民营企业。公司现有员工38人，其中本科学历10人，大专学历15人，高级职称3人，管理人员10人。公司经营理念为“科学管理，德行天下，利国惠民”。');
