INSERT INTO `reb` VALUES ('1637', '山东巨匠房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7a14abc7-ba93-4f65-b66b-043390bc4d8e.shtml', '', '0161469', '吕世明', '济南市历下区转山西路7号银座花园怡景园入口商场', '67808909', 'sjjyzhb@163.com', '1800 万元', '民营企业', '山东巨匠房地产开发有限公司成立于2001年2月，注册资本人民币1800万元，由山东艺林房地产开发有限公司出资1800万元收购。主要从事房地产开发与经营管理等项目。现开发奥体中路以西轻风路以南住宅项目，总用地面积约17.08公顷。', '山东巨匠房地产开发有限公司null吕世明济南市历下区转山西路7号银座花园怡景园入口商场67808909sjjyzhb@163.com1800 万元民营企业山东巨匠房地产开发有限公司成立于2001年2月，注册资本人民币1800万元，由山东艺林房地产开发有限公司出资1800万元收购。主要从事房地产开发与经营管理等项目。现开发奥体中路以西轻风路以南住宅项目，总用地面积约17.08公顷。');
INSERT INTO `reb` VALUES ('1638', '济南银青置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b4f63d5e-eafa-4724-b6ce-72c8f86a61e8.shtml', '', '0161058', '马筱青', '济南市历下区龙奥西路1号银丰财富广场3号楼2404室', '81285566', '345074490@qq.com', '5000 万元', '民营企业', '济南银青置业有限公司是银丰地产集团有限公司全资子公司，成立于2010年6月，注册资本5000万元，法定代表人为马筱青。 济南银青置业有限公司经营范围包括：房地产开发、销售、市政公用工程，建筑装饰装修工程；建筑材料销售。', '济南银青置业有限公司null马筱青济南市历下区龙奥西路1号银丰财富广场3号楼2404室81285566345074490@qq.com5000 万元民营企业济南银青置业有限公司是银丰地产集团有限公司全资子公司，成立于2010年6月，注册资本5000万元，法定代表人为马筱青。 济南银青置业有限公司经营范围包括：房地产开发、销售、市政公用工程，建筑装饰装修工程；建筑材料销售。');
