INSERT INTO `reb` VALUES ('1640', '山东文华园住宅开发建设有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7a492516-5375-4c08-9ab3-e2655594f1ad.shtml', '', '0161545', '李金山', '济南市历下区历山路116号-4号', '86551237', '27714050@qq.com', '2000 万元', '民营企业', '公司简介 山东文华园住宅开发建设有限公司（以下简称文华园）成立于2004年8月，自成立以来即专注于济南市棚户区改造项目等建设工程的运作。 文华园注重内部结构的治理并健全了完善的质量管理体系，以诚心为本，推崇科技创新，以满足住户的真正需求为己任。现所签订合作或合作意向的单位均为国内外同行中的顶尖者。 2007年底，文华园取得了济南市最大棚户区改造工程之一、占地52亩的历下区历山路改造项目，该项目预计总投资为人民币10亿，拆迁工作将在2008年4月份全部完成，2008年6月动工，总建筑面积为15.98万平方米（含住宅、商用写字楼及配套建筑），2010年2月竣工交楼。 根据2005年7月1日施行的《山东省商品房销售条列》有关规定，文华园本项目在“完成基础工程”即可预售，可在开发的同时进行预售。鉴于本项目所处的地理位置较为理想及回迁户所占比例逾9成，故计划在2008年预售10%，2009年预售65%，2010年转为现房销售并销售25%。', '山东文华园住宅开发建设有限公司null李金山济南市历下区历山路116号-4号8655123727714050@qq.com2000 万元民营企业公司简介 山东文华园住宅开发建设有限公司（以下简称文华园）成立于2004年8月，自成立以来即专注于济南市棚户区改造项目等建设工程的运作。 文华园注重内部结构的治理并健全了完善的质量管理体系，以诚心为本，推崇科技创新，以满足住户的真正需求为己任。现所签订合作或合作意向的单位均为国内外同行中的顶尖者。 2007年底，文华园取得了济南市最大棚户区改造工程之一、占地52亩的历下区历山路改造项目，该项目预计总投资为人民币10亿，拆迁工作将在2008年4月份全部完成，2008年6月动工，总建筑面积为15.98万平方米（含住宅、商用写字楼及配套建筑），2010年2月竣工交楼。 根据2005年7月1日施行的《山东省商品房销售条列》有关规定，文华园本项目在“完成基础工程”即可预售，可在开发的同时进行预售。鉴于本项目所处的地理位置较为理想及回迁户所占比例逾9成，故计划在2008年预售10%，2009年预售65%，2010年转为现房销售并销售25%。');
