INSERT INTO `reb` VALUES ('1642', '山东经世置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7ac668f6-70a5-4447-aeff-b74331bd673a.shtml', '', '016613', '王令强', '济南市历下区姚家镇工业南路南致远路西', '053158796167', 'sdsjfdc@126.com', '1000 万元', '国有企业', '山东经世置业有限公司于2009年6月26日在济南市工商局登记注册，注册资本金1000万元，住所在姚家镇工业南路南志远路西，以地产开发为主，集物业管理服务、装饰工程、房屋租赁、建材销售为一体的综合性房地产开发企业。', '山东经世置业有限公司null王令强济南市历下区姚家镇工业南路南致远路西053158796167sdsjfdc@126.com1000 万元国有企业山东经世置业有限公司于2009年6月26日在济南市工商局登记注册，注册资本金1000万元，住所在姚家镇工业南路南志远路西，以地产开发为主，集物业管理服务、装饰工程、房屋租赁、建材销售为一体的综合性房地产开发企业。');
INSERT INTO `reb` VALUES ('1643', '山东三功房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7baf1ebc-5caf-449f-a028-d8e2bdb70a6c.shtml', '', '016(JY033)', '王金销', '济南市济阳县济北开发区', '84235677', 'jnhuamin@163.com', '1800 万元', '中外合资经营企业', '山东三功房地产开发有限公司于2003年12月5日在山东省工商行政管理局登记注册，于2004年7月2日经山东省建设厅批准取得房地产开发经营资质。公司于2006年3月27日经山东省人民政府批准为台港澳侨投资企业，投资方为台湾三功集团主席谢修平先生，为扩大公司规模，促进公司发展，经政府有关部门批准同意增加投资，公司于2006年6月29日经工商行政管理部门批准注册资本增加到1800万元人民币。山东三功房地产开发有限公司是以房地产开发为龙头，集房地产开发咨询服务为一体的综合性公司。公司自2004年至2005年承担了山东大鲁阁织染工业有限公司厂区建设，保质保量的完成了此次工程，共计8万余平方米。同时我公司又购置了土地并开发建设了《三功·开元阁》小区，小区规划住宅楼三栋、商业楼一栋，现已完工二栋，小区内各项设施完备，环境优美，为济阳县的高档住宅小区，得到各方的肯定。相信我们会不断创新，积累经验，为广大业主提供更优质的产品，为济南市的建设做出我们应有的贡献。', '山东三功房地产开发有限公司null王金销济南市济阳县济北开发区84235677jnhuamin@163.com1800 万元中外合资经营企业山东三功房地产开发有限公司于2003年12月5日在山东省工商行政管理局登记注册，于2004年7月2日经山东省建设厅批准取得房地产开发经营资质。公司于2006年3月27日经山东省人民政府批准为台港澳侨投资企业，投资方为台湾三功集团主席谢修平先生，为扩大公司规模，促进公司发展，经政府有关部门批准同意增加投资，公司于2006年6月29日经工商行政管理部门批准注册资本增加到1800万元人民币。山东三功房地产开发有限公司是以房地产开发为龙头，集房地产开发咨询服务为一体的综合性公司。公司自2004年至2005年承担了山东大鲁阁织染工业有限公司厂区建设，保质保量的完成了此次工程，共计8万余平方米。同时我公司又购置了土地并开发建设了《三功·开元阁》小区，小区规划住宅楼三栋、商业楼一栋，现已完工二栋，小区内各项设施完备，环境优美，为济阳县的高档住宅小区，得到各方的肯定。相信我们会不断创新，积累经验，为广大业主提供更优质的产品，为济南市的建设做出我们应有的贡献。');
INSERT INTO `reb` VALUES ('1644', '山东茗筑华亭置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/986f8d19-940c-4e53-8d34-95a56b2b89aa.shtml', '', '0161079', '杨星', '济南市高新区孙村镇科航路2877号一层', '86133237', '754545303@qq.com', '3000 万元', '民营企业', '山东茗筑华亭置业有限公司成立于2004年7月26日，公司经营范围包括房地产开发、销售、物业管理（未取得专项许可的项目除外）。公司现有人员30名，具有中、高级职称资格的共有10人。', '山东茗筑华亭置业有限公司null杨星济南市高新区孙村镇科航路2877号一层86133237754545303@qq.com3000 万元民营企业山东茗筑华亭置业有限公司成立于2004年7月26日，公司经营范围包括房地产开发、销售、物业管理（未取得专项许可的项目除外）。公司现有人员30名，具有中、高级职称资格的共有10人。');
INSERT INTO `reb` VALUES ('1645', '山东金光置业投资有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b749653d-b112-4fe2-8913-e9f0e05927db.shtml', '', '0161353', '王怀平', '济南市趵突泉南路145、147号之间', '88015995', '13001738687@126.com', '5000 万元', '民营企业', '山东金光置业投资有限公司，于2006年3月15日在山东省工商行政管理局正式注册成立，注册资金为5000万元，我公司配备了拥有多年工作经验的注册建筑师、结构工程师、设备工程师、造价工程师、项目管理师、会计师及其他专业人才。专业技术人才占公司总员工95%以上，我公司发展的宗旨是：以质量求生存，为济南的城市建设贡献智慧和力量，为美化泉城增光添彩。', '山东金光置业投资有限公司null王怀平济南市趵突泉南路145、147号之间8801599513001738687@126.com5000 万元民营企业山东金光置业投资有限公司，于2006年3月15日在山东省工商行政管理局正式注册成立，注册资金为5000万元，我公司配备了拥有多年工作经验的注册建筑师、结构工程师、设备工程师、造价工程师、项目管理师、会计师及其他专业人才。专业技术人才占公司总员工95%以上，我公司发展的宗旨是：以质量求生存，为济南的城市建设贡献智慧和力量，为美化泉城增光添彩。');
INSERT INTO `reb` VALUES ('1646', '绿地地产（济南）腊山有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d79df4cf-2f43-47f4-b99d-0e33e03484dd.shtml', '', '0161453', '刘民', '济南市槐荫区济兖路462号213室', '66696811', '809399901@qq.com', '60000 万元', '民营企业', '绿地地产（济南）腊山有限公司成立于2010年8月，是经济南市工商局注册的有限责任公司，位于济南市槐荫区济兖路462号，注册资金20000万元，主营房地产投资及房地产开发经营。 作为公司投资主体的济南绿地泉景地产股份有限公司成立于1975年,是具有国家一级房地产开发资质、山东省成立时间最早的从事城市综合开发建设的大型股份有限公司。公司成立30年来，坚持统一规划、合理布局、综合开发、配套建设的方针，按照城市总体规划，先后开发建设住宅及配套、办公商业楼宇600多万平方米，改造建设道路30多公里，为济南市城市建设和旧城改造做出了突出贡献。', '绿地地产（济南）腊山有限公司null刘民济南市槐荫区济兖路462号213室66696811809399901@qq.com60000 万元民营企业绿地地产（济南）腊山有限公司成立于2010年8月，是经济南市工商局注册的有限责任公司，位于济南市槐荫区济兖路462号，注册资金20000万元，主营房地产投资及房地产开发经营。 作为公司投资主体的济南绿地泉景地产股份有限公司成立于1975年,是具有国家一级房地产开发资质、山东省成立时间最早的从事城市综合开发建设的大型股份有限公司。公司成立30年来，坚持统一规划、合理布局、综合开发、配套建设的方针，按照城市总体规划，先后开发建设住宅及配套、办公商业楼宇600多万平方米，改造建设道路30多公里，为济南市城市建设和旧城改造做出了突出贡献。');
INSERT INTO `reb` VALUES ('1647', '济南帝华房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7cdb199e-3b8b-411e-9d58-2eb9c68b9b71.shtml', '', '0161002', '李在明', '济阳县济北开发区银河路东汇鑫路西', '81179689', '79872975@qq.com', '10000 万元', '民营企业', '济南帝华房地产开发有限公司是帝华集团下属全资子公司，济南帝华房地产开发有限公司将本着“诚信、务实、奋进、创新”的企业宗旨，凭借着年轻的生命力，向资本多元化、经营多样化的现代化企业管理模式迈进。公司将在积极投入房地产开发的实践中，为推动地方山东省房地产业的发展全力以赴，做出新的贡献。 公司坚持以“市场为主导、客户为中心”的经营方针，信奉“开发一个项目，造福一方人民，广交一批朋友”的精神，努力开发出更多有特色、有品位、适应市场需求的住宅项目，竭诚与各界人士携手并进，共同开拓，共创辉煌！ 公司本着“素质决定实力”的企业精神和“营造高品质生活”的开发理念，引进人才，强化管理，贯彻“以质量取胜”的原则，借鉴国内外先进的房地产开发经验，注重现代建筑科技与民族传统风格的统一，在规划设计上秉承“以人为本”的理念，以“创新、求变”的精神去适应市场需求，致力于精品楼盘的开发建设，实现企业经济效益、社会效益、环境效益的统一。 面对房地产开发热潮，济南帝华房地产开发有限公司将紧紧抓住难得的发展机遇，在帝华集团的领导下，充分利用集团自身的人才、资金、区域、技术等各类优势，制定出新的产业发展规划和新的企业扩张目标，为山东省的经济建设添砖加瓦，为我国中国特色的社会主义建设事业贡献商业智慧和经济力量。', '济南帝华房地产开发有限公司null李在明济阳县济北开发区银河路东汇鑫路西8117968979872975@qq.com10000 万元民营企业济南帝华房地产开发有限公司是帝华集团下属全资子公司，济南帝华房地产开发有限公司将本着“诚信、务实、奋进、创新”的企业宗旨，凭借着年轻的生命力，向资本多元化、经营多样化的现代化企业管理模式迈进。公司将在积极投入房地产开发的实践中，为推动地方山东省房地产业的发展全力以赴，做出新的贡献。 公司坚持以“市场为主导、客户为中心”的经营方针，信奉“开发一个项目，造福一方人民，广交一批朋友”的精神，努力开发出更多有特色、有品位、适应市场需求的住宅项目，竭诚与各界人士携手并进，共同开拓，共创辉煌！ 公司本着“素质决定实力”的企业精神和“营造高品质生活”的开发理念，引进人才，强化管理，贯彻“以质量取胜”的原则，借鉴国内外先进的房地产开发经验，注重现代建筑科技与民族传统风格的统一，在规划设计上秉承“以人为本”的理念，以“创新、求变”的精神去适应市场需求，致力于精品楼盘的开发建设，实现企业经济效益、社会效益、环境效益的统一。 面对房地产开发热潮，济南帝华房地产开发有限公司将紧紧抓住难得的发展机遇，在帝华集团的领导下，充分利用集团自身的人才、资金、区域、技术等各类优势，制定出新的产业发展规划和新的企业扩张目标，为山东省的经济建设添砖加瓦，为我国中国特色的社会主义建设事业贡献商业智慧和经济力量。');
INSERT INTO `reb` VALUES ('1648', '山东黄金绿苑房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7cea3861-fec8-46ae-92db-8e3564ac47c5.shtml', '', '0161362', '孙秀恩', '济南市历下区浆水泉路17号黄金99景城4-1-103、104号商铺', '88519969', 'sdhjly@163.com', '3000 万元', '国有企业', '山东黄金绿苑房地产开发有限公司于2002年6月经山东省工商行政管理局批准成立，注册资金3000万元人民币。 公司开发的浆水泉项目已于2006年8月4日摘牌成功，并与济南市国土资源局签定了成交确认书，摘牌面积近617亩，首期土地证已办理完毕。此项目总建筑面积近65万平方米，堪称东部大盘之一。该项目处于济南市的\"黄金地带\"--济南市历下区东南部，距济南市市中心仅有5公里。西边紧邻50米宽的二环东路，南靠洄龙山和浆水泉公园，北临济南市的景观大道--60米宽的经十东路，中有荆山，旅游路从居住区中部穿过。自然环境得天独厚。 浆水泉居住区规划设计主要是突出生态概念、生态系统的构筑，贯穿在整个规划设计的理念中。项目的规划设计中充分利用了山和水这两个自然要素，设计了一条自然流畅的环形步行林荫带环绕整个居住区，直接把自然环境引入住宅区内；形成一个整体连贯、自然开敞的绿地系统，我们要做的宗旨就是：山环水抱，与自然共呼吸；以人为本，回家就是度假。', '山东黄金绿苑房地产开发有限公司null孙秀恩济南市历下区浆水泉路17号黄金99景城4-1-103、104号商铺88519969sdhjly@163.com3000 万元国有企业山东黄金绿苑房地产开发有限公司于2002年6月经山东省工商行政管理局批准成立，注册资金3000万元人民币。 公司开发的浆水泉项目已于2006年8月4日摘牌成功，并与济南市国土资源局签定了成交确认书，摘牌面积近617亩，首期土地证已办理完毕。此项目总建筑面积近65万平方米，堪称东部大盘之一。该项目处于济南市的\"黄金地带\"--济南市历下区东南部，距济南市市中心仅有5公里。西边紧邻50米宽的二环东路，南靠洄龙山和浆水泉公园，北临济南市的景观大道--60米宽的经十东路，中有荆山，旅游路从居住区中部穿过。自然环境得天独厚。 浆水泉居住区规划设计主要是突出生态概念、生态系统的构筑，贯穿在整个规划设计的理念中。项目的规划设计中充分利用了山和水这两个自然要素，设计了一条自然流畅的环形步行林荫带环绕整个居住区，直接把自然环境引入住宅区内；形成一个整体连贯、自然开敞的绿地系统，我们要做的宗旨就是：山环水抱，与自然共呼吸；以人为本，回家就是度假。');
INSERT INTO `reb` VALUES ('1649', '山东友邦置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/9a8aed23-5dd6-46df-9cef-c046701f1612.shtml', '', '0161503', '王国栋', '双山街道办事处大学路296号易安明郡一期3#102室', '88233788', '1824865275@qq.com', '1000 万元', '民营企业', '山东友邦置业有限公司成立于二零零七年六月二十五日，公司位于济南市旅游路8号，注册资金1000万元，主要经营项目：房地产开发经营；园林绿化工程施工', '山东友邦置业有限公司null王国栋双山街道办事处大学路296号易安明郡一期3#102室882337881824865275@qq.com1000 万元民营企业山东友邦置业有限公司成立于二零零七年六月二十五日，公司位于济南市旅游路8号，注册资金1000万元，主要经营项目：房地产开发经营；园林绿化工程施工');
INSERT INTO `reb` VALUES ('1650', '祥恒置业（济南）有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/5ef6cead-df68-4202-9ff6-c8b98ffae500.shtml', '', '0161542', '钱少华', '泺源大街150号济南中信广场A座八层818室', '55583903', 'candy.h.wang@kerryprops.com', '60000 万元', '外资企业', '祥恒置业（济南）有限公司，是由嘉里置业（中国）有限公司和香格里拉中国有限公司共同投资成立的外商独资企业，为建设济南嘉里综合发展项目（一、二期）（即香格里拉大酒店、办公楼及配套商业项目）而成立。', '祥恒置业（济南）有限公司null钱少华泺源大街150号济南中信广场A座八层818室55583903candy.h.wang@kerryprops.com60000 万元外资企业祥恒置业（济南）有限公司，是由嘉里置业（中国）有限公司和香格里拉中国有限公司共同投资成立的外商独资企业，为建设济南嘉里综合发展项目（一、二期）（即香格里拉大酒店、办公楼及配套商业项目）而成立。');
INSERT INTO `reb` VALUES ('1651', '山东华港置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/e4958d90-2966-4481-b561-6abc258aeb04.shtml', '', '0161466', '宋君国', '高新区开拓路2269号办公楼1-107室', '80963988', 'Haofeng8916@163.com', '2000 万元', '民营企业', '山东华港置业有限公司成立于2010年1月，注册资本2000万元。公司主要经营范围为房地产开发、物业管理、商品房销售、建筑工程装饰施工等。 公司自成立以来秉承专注品质、建筑无限生活的开发理念，坚持以市场为导向的经营策略，实施现代企业的先进管理模式。 山东华港置业有限公司拥有一支高素质的专业管理团队，现有职工17人，均为大专以上学历，是一支朝气蓬勃、团结进取的团队。 在未来几年，公司将结合市场需要，有计划、有步骤地以优质的品牌产品和品牌形象参与市场竞争，实施公司战略开发计划，通过不断创新来满足社会需求，从而实现以改善居民居住条件和企业利润稳步增长相结合的企业战略发展目标。', '山东华港置业有限公司null宋君国高新区开拓路2269号办公楼1-107室80963988Haofeng8916@163.com2000 万元民营企业山东华港置业有限公司成立于2010年1月，注册资本2000万元。公司主要经营范围为房地产开发、物业管理、商品房销售、建筑工程装饰施工等。 公司自成立以来秉承专注品质、建筑无限生活的开发理念，坚持以市场为导向的经营策略，实施现代企业的先进管理模式。 山东华港置业有限公司拥有一支高素质的专业管理团队，现有职工17人，均为大专以上学历，是一支朝气蓬勃、团结进取的团队。 在未来几年，公司将结合市场需要，有计划、有步骤地以优质的品牌产品和品牌形象参与市场竞争，实施公司战略开发计划，通过不断创新来满足社会需求，从而实现以改善居民居住条件和企业利润稳步增长相结合的企业战略发展目标。');
INSERT INTO `reb` VALUES ('1652', '济南北洋置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/e63aa016-d1f5-4ed2-92dd-10d2457ec691.shtml', '', '0161407', '葛国庆', '济南市天桥区北园办事处杨庄居342号', '85911555', '371912362@qq.com', '1372.53 万元', '民营企业', '济南北洋置业有限公司是1995年11月2日在济南市工商局登记注册成立的有限责任公司，注册资金1372.53万元。济南北洋置业有限公司是济南市油墨厂和济南市北郊纸箱包装厂共同出资共同出资成立的有限责任公司，曾投资建设了杨庄装饰市场、欧亚达家具市场等项目，现在开发项目为天桥区北园大街北杨庄东路13号的幸福逸居项目，建筑面积24731平方米。', '济南北洋置业有限公司null葛国庆济南市天桥区北园办事处杨庄居342号85911555371912362@qq.com1372.53 万元民营企业济南北洋置业有限公司是1995年11月2日在济南市工商局登记注册成立的有限责任公司，注册资金1372.53万元。济南北洋置业有限公司是济南市油墨厂和济南市北郊纸箱包装厂共同出资共同出资成立的有限责任公司，曾投资建设了杨庄装饰市场、欧亚达家具市场等项目，现在开发项目为天桥区北园大街北杨庄东路13号的幸福逸居项目，建筑面积24731平方米。');
INSERT INTO `reb` VALUES ('1653', '山东文孚置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7d353852-adb4-4114-be51-418338190af7.shtml', '', '0161620', '邢刚', '济南市市中区英雄山路21-15号6楼', '82028885', 'sdwfzyyxgs@163.com', '1800 万元', '民营企业', '山东文孚置业有限公司成立于1998年3月。经营范围：建筑、装饰工程设计、施工；房地产开发经营。自公司成立以来，人员日益增多，业务不断发展，注册资本已经由捌佰万元增加到壹仟捌佰万元，法人代表由高澎文变更为邢刚。', '山东文孚置业有限公司null邢刚济南市市中区英雄山路21-15号6楼82028885sdwfzyyxgs@163.com1800 万元民营企业山东文孚置业有限公司成立于1998年3月。经营范围：建筑、装饰工程设计、施工；房地产开发经营。自公司成立以来，人员日益增多，业务不断发展，注册资本已经由捌佰万元增加到壹仟捌佰万元，法人代表由高澎文变更为邢刚。');
INSERT INTO `reb` VALUES ('1654', '山东吉瑞置业有限责任公司', 'http://www.jnfdc.gov.cn/kfqy/show/0ffc90ac-b028-49ce-ba8c-2512baddc48c.shtml', '', '016(JY032)', '韦炜', '济阳县纬三路39号（原济阳镇政府办公楼406室）', '053181175119', '', '10000 万元', '民营企业', '', '山东吉瑞置业有限责任公司null韦炜济阳县纬三路39号（原济阳镇政府办公楼406室）05318117511910000 万元民营企业');
INSERT INTO `reb` VALUES ('1655', '山东华盈置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/e82c118e-95c1-4929-9941-03d56c9e702c.shtml', '', '0161534', '王韶英', '济南市槐荫区南辛庄中街126号世佳欣居1-2-101室', '82383888', 'lantingjianzhu@163.com', '5000 万元', '民营企业', '本公司成立于2007年6月。经营地址为：济南市槐荫区南辛庄中街126号世佳欣居1-2-101室。法人代表：王韶英。注册资本（人民币）：伍仟万元。实收资本（人民币）伍仟万元。公司类型：有限责任公司。经营范围：项目投资及担保（不含金融业务）；资产委托管理；企业兼、并、并购、重组咨询服务；财务咨询；设备、房屋租赁；房地产开发经营、销售；房地产经纪、中介服务；建筑安装工程施工；装饰装修工程设计施工（须经许可经营）。', '山东华盈置业有限公司null王韶英济南市槐荫区南辛庄中街126号世佳欣居1-2-101室82383888lantingjianzhu@163.com5000 万元民营企业本公司成立于2007年6月。经营地址为：济南市槐荫区南辛庄中街126号世佳欣居1-2-101室。法人代表：王韶英。注册资本（人民币）：伍仟万元。实收资本（人民币）伍仟万元。公司类型：有限责任公司。经营范围：项目投资及担保（不含金融业务）；资产委托管理；企业兼、并、并购、重组咨询服务；财务咨询；设备、房屋租赁；房地产开发经营、销售；房地产经纪、中介服务；建筑安装工程施工；装饰装修工程设计施工（须经许可经营）。');
INSERT INTO `reb` VALUES ('1656', '济南温泉空港置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/e99ba5e1-ed8a-4e71-a8b9-2cbd2f84dff1.shtml', '', '013748', '于乐', '济南市历城区遥墙镇机场路西（遥墙建委北侧）', '82785888', 'sux10723@163.com', '6000 万元', '民营企业', '济南温泉空港置业有限公司成立于2009年11月，注册资金壹仟捌佰万元整，专业从事房地产开发及销售。公司2009年12月10日取得济南市临港开发区B区内地块，拟建设温泉小镇住宅小区项目', '济南温泉空港置业有限公司null于乐济南市历城区遥墙镇机场路西（遥墙建委北侧）82785888sux10723@163.com6000 万元民营企业济南温泉空港置业有限公司成立于2009年11月，注册资金壹仟捌佰万元整，专业从事房地产开发及销售。公司2009年12月10日取得济南市临港开发区B区内地块，拟建设温泉小镇住宅小区项目');
INSERT INTO `reb` VALUES ('1657', '山东泉利置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a7f6bbe5-49b5-4a01-bf36-143dd66b4ff6.shtml', '', '0161387', '周利平', '济南市天桥区蓝翔路59号', '81256666', '80687033@qq.com', '1800 万元', '民营企业', '重汽配件城项目介绍 1、泉利置业 山东泉利置业有限公司是一家集重汽配件物流中心兴建、运营为一体的新兴实业投资实体，企业资金实力雄厚，行业运营经验丰富。 公司的发起人宋殿泉先生，济南天桥区人。其于2005年在历山北路，投资1.5亿元人民币建设6万平方米现代化商场，并成功招商全国家居展销行业最具影响力的公司之一——红星美凯龙；2008年又在泰安市投资2.2亿元人民币成功建成8万平方米的泰安红星美凯龙；2009年又成功引进全国家居展销行业最具影响力的公司之一——居然之家，并与其签订合作协议；投资3亿元，建筑面积10万平方米的青岛居然之家正在建设之中。公司成立10几年来，创造了上万个就业机会，上交利税过亿元。 公司另一发起人——周利平拥有20余年重汽配件的运营经验，现为昆明管家佳商贸公司董事长。该公司是云南省最大最专业的重型汽车配件代理批发商，拥有对重汽配件行业丰富的产业经验。 2011年强强联合，成立山东泉利置业有限公司，公司设有行政管理、劳动人事、财务、计划预算、工程管理、销售管理、运营管理等近十个职能部门，五十余名员工。公司自成立以来，一直本着“领创产业价值新标地”的企业经营理念，努力践行企业责任，坚持以人为本，开拓进取，努力实践与大众携手共创美好未来的企业承诺，正全力打造30万平米济南市重点物流项目——泉利?重汽配件城，对该项目的策划论证、手续办理、资金筹措、建设实施、经营管理及日常工作实行全过程管理经营。公司发展战略为“稳扎稳打，做精做强”，以济南泉利重汽配件城为发展依托，逐步扩展全省乃至全国重汽配件行业市场。', '山东泉利置业有限公司null周利平济南市天桥区蓝翔路59号8125666680687033@qq.com1800 万元民营企业重汽配件城项目介绍 1、泉利置业 山东泉利置业有限公司是一家集重汽配件物流中心兴建、运营为一体的新兴实业投资实体，企业资金实力雄厚，行业运营经验丰富。 公司的发起人宋殿泉先生，济南天桥区人。其于2005年在历山北路，投资1.5亿元人民币建设6万平方米现代化商场，并成功招商全国家居展销行业最具影响力的公司之一——红星美凯龙；2008年又在泰安市投资2.2亿元人民币成功建成8万平方米的泰安红星美凯龙；2009年又成功引进全国家居展销行业最具影响力的公司之一——居然之家，并与其签订合作协议；投资3亿元，建筑面积10万平方米的青岛居然之家正在建设之中。公司成立10几年来，创造了上万个就业机会，上交利税过亿元。 公司另一发起人——周利平拥有20余年重汽配件的运营经验，现为昆明管家佳商贸公司董事长。该公司是云南省最大最专业的重型汽车配件代理批发商，拥有对重汽配件行业丰富的产业经验。 2011年强强联合，成立山东泉利置业有限公司，公司设有行政管理、劳动人事、财务、计划预算、工程管理、销售管理、运营管理等近十个职能部门，五十余名员工。公司自成立以来，一直本着“领创产业价值新标地”的企业经营理念，努力践行企业责任，坚持以人为本，开拓进取，努力实践与大众携手共创美好未来的企业承诺，正全力打造30万平米济南市重点物流项目——泉利?重汽配件城，对该项目的策划论证、手续办理、资金筹措、建设实施、经营管理及日常工作实行全过程管理经营。公司发展战略为“稳扎稳打，做精做强”，以济南泉利重汽配件城为发展依托，逐步扩展全省乃至全国重汽配件行业市场。');
INSERT INTO `reb` VALUES ('1658', '山东大强实业集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c67100f4-097f-4018-9533-4d6b36d6adf7.shtml', '', '0161601', '冯承强', '济南市历城区温泉路1号', '82628911', 'lihx@vanke.com', '8600 万元', '民营企业', '山东大强实业集团有限公司是一家集煤炭销售、运营、深加工、房地产开发、环保供热、外经贸、奶牛养殖、特殊用途化妆品、工业园、林业园为一体的大型民营企业集团，公司固定资产10亿元，集团总部设在济南市历城区温泉路1号。', '山东大强实业集团有限公司null冯承强济南市历城区温泉路1号82628911lihx@vanke.com8600 万元民营企业山东大强实业集团有限公司是一家集煤炭销售、运营、深加工、房地产开发、环保供热、外经贸、奶牛养殖、特殊用途化妆品、工业园、林业园为一体的大型民营企业集团，公司固定资产10亿元，集团总部设在济南市历城区温泉路1号。');
INSERT INTO `reb` VALUES ('1659', '济南荣耀房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/dce4f0d2-88a9-4e83-8978-7b6204a1d8a8.shtml', '', '0161597', '马晓伟', '济南市历城区北园路43号405室', '13789802727', '13789802727@126.com', '1800 万元', '民营企业', '济南荣耀房地产开发有限公司成立于2016年9月27日，位于济南市历城区北园路43号405室，开发的项目是时代首府项目。', '济南荣耀房地产开发有限公司null马晓伟济南市历城区北园路43号405室1378980272713789802727@126.com1800 万元民营企业济南荣耀房地产开发有限公司成立于2016年9月27日，位于济南市历城区北园路43号405室，开发的项目是时代首府项目。');
INSERT INTO `reb` VALUES ('1660', '济南新华南山置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ecf19900-2f2a-48b9-a62b-2c7e8e116599.shtml', '', '0161485', '宿一峰', '英雄山路10-2号', '68826999', 'kang31213113@163.com', '10000 万元', '民营企业', '济南新华南山置业有限公司成立于2014年，现注册资金10000万元。主要从事房地产投资、开发、物业管理等业务，公司致力于文化地产的开发与建设。 公司现有山东书画艺术中心项目，位于济南市市中区经十路南侧、中光明街东侧，总占地面积14314㎡，规划建筑面积约73600㎡，物业类型为商业商务项目，周边配套醇熟完善，交通便利，商业繁华，地理位置优势明显。目前前期相关手续已经办理完成，现进行施工建设。', '济南新华南山置业有限公司null宿一峰英雄山路10-2号68826999kang31213113@163.com10000 万元民营企业济南新华南山置业有限公司成立于2014年，现注册资金10000万元。主要从事房地产投资、开发、物业管理等业务，公司致力于文化地产的开发与建设。 公司现有山东书画艺术中心项目，位于济南市市中区经十路南侧、中光明街东侧，总占地面积14314㎡，规划建筑面积约73600㎡，物业类型为商业商务项目，周边配套醇熟完善，交通便利，商业繁华，地理位置优势明显。目前前期相关手续已经办理完成，现进行施工建设。');
INSERT INTO `reb` VALUES ('1661', '山东新汇福投资有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ecd43384-a227-424c-a18b-2deabd1b28b0.shtml', '', '0161512', '李雷', '济南市历下区解放路12号', '68695551', 'frzy@163.com', '6000 万元', '民营企业', '山东新汇福投资有限公司成立于2003年，注册资本为6000万元，主要经营范围为房地产投资、开发、销售、咨询，物业管理服务，具有房地产开发暂定资质。目前公司项目位于济南市经十路南侧，拟建设两栋高层建筑，总建筑面积约45000平方米。', '山东新汇福投资有限公司null李雷济南市历下区解放路12号68695551frzy@163.com6000 万元民营企业山东新汇福投资有限公司成立于2003年，注册资本为6000万元，主要经营范围为房地产投资、开发、销售、咨询，物业管理服务，具有房地产开发暂定资质。目前公司项目位于济南市经十路南侧，拟建设两栋高层建筑，总建筑面积约45000平方米。');
INSERT INTO `reb` VALUES ('1662', '山东财富纵横置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ac400776-2a09-42ff-a357-8604fcecc00d.shtml', '', '0161493', '胡裕波', '济南市历下区七家村49号501室', '88920766', '270942946@qq.com', '5000 万元', '民营企业', '山东财富纵横置业有限公司成立于2009年2月，公司类型为有限责任公司，注册资本为伍仟万元。经营范围主要为房地产开发。', '山东财富纵横置业有限公司null胡裕波济南市历下区七家村49号501室88920766270942946@qq.com5000 万元民营企业山东财富纵横置业有限公司成立于2009年2月，公司类型为有限责任公司，注册资本为伍仟万元。经营范围主要为房地产开发。');
INSERT INTO `reb` VALUES ('1663', '济南市城市建设投资有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ac9988b5-0f4c-488b-a7ca-6c5722cfe060.shtml', '', '0161618', '聂军', '济南市历下区经十东路10567号', '67989500', 'CT82920318@163.com', '700000 万元', '国有企业', '济南市城市建设投资有限公司成立于1996年，是城市建设资金筹措和管理的专业公司，现有职工40人，实行企业化管理。公司主要职能是受济南市政府的委托，收缴、筹措、管理和使用城市建设资金，承担城建项目的投资、管理、开发、经营和项目预算审查，监督拨款及国有资产管理，按照市政府批准的城建项目进行投资。 公司组建十年来，按照市委、市政府的要求，一是加大了融资筹资工作的力度。通过抓好政策性收费、争取上级资金、社会化融资、招商引资、银行贷款等方式，累计城市建设筹集资金达110亿元。二是加大对项目投资的管理。先后组织实施了顺河高架路建设工程、泉城广场建设工程、济南水泥厂和东方红水泥厂环保迁建工程、纬六路高架桥、鹊山水库、玉清湖水库、污水处理、热电、煤气以及高架桥北延、经十东路拓宽改造等近20余项省市重点工程，为实现济南“五年大变样”的奋斗目标做出了应有的贡献。三是进一步扩大了投资任务实施范围。自2003年以来，城投公司作为城区工程指挥部的项目法人，按照市政府的要求，充分发挥自身优势，在不到一年的时间里，融资35.45亿元，先后实施了经十路、经一路、县西巷、玉绣河、燕山健身广场、植物园、舜耕路、济洛路及东部新城等近20个项目的建设投资任务，确保了以“实现新跨越、建设新泉城”为目标的新一轮城市建设的全面启动。目前经十路、经一路、县西巷、玉绣河、燕山健身广场、植物园以及舜耕路周边改造已按计划胜利竣工，并在一系列的国际、国内会展中，充分展示了济南的良好面貌，受到中外宾客和泉城市民的好评。', '济南市城市建设投资有限公司null聂军济南市历下区经十东路10567号67989500CT82920318@163.com700000 万元国有企业济南市城市建设投资有限公司成立于1996年，是城市建设资金筹措和管理的专业公司，现有职工40人，实行企业化管理。公司主要职能是受济南市政府的委托，收缴、筹措、管理和使用城市建设资金，承担城建项目的投资、管理、开发、经营和项目预算审查，监督拨款及国有资产管理，按照市政府批准的城建项目进行投资。 公司组建十年来，按照市委、市政府的要求，一是加大了融资筹资工作的力度。通过抓好政策性收费、争取上级资金、社会化融资、招商引资、银行贷款等方式，累计城市建设筹集资金达110亿元。二是加大对项目投资的管理。先后组织实施了顺河高架路建设工程、泉城广场建设工程、济南水泥厂和东方红水泥厂环保迁建工程、纬六路高架桥、鹊山水库、玉清湖水库、污水处理、热电、煤气以及高架桥北延、经十东路拓宽改造等近20余项省市重点工程，为实现济南“五年大变样”的奋斗目标做出了应有的贡献。三是进一步扩大了投资任务实施范围。自2003年以来，城投公司作为城区工程指挥部的项目法人，按照市政府的要求，充分发挥自身优势，在不到一年的时间里，融资35.45亿元，先后实施了经十路、经一路、县西巷、玉绣河、燕山健身广场、植物园、舜耕路、济洛路及东部新城等近20个项目的建设投资任务，确保了以“实现新跨越、建设新泉城”为目标的新一轮城市建设的全面启动。目前经十路、经一路、县西巷、玉绣河、燕山健身广场、植物园以及舜耕路周边改造已按计划胜利竣工，并在一系列的国际、国内会展中，充分展示了济南的良好面貌，受到中外宾客和泉城市民的好评。');
INSERT INTO `reb` VALUES ('1664', '济南德天置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/92f211e5-1ef2-464f-904a-625cbe33a489.shtml', '', '016(PY)0021', '阴元晓', '平阴县五岭路南段西侧沿街商业楼', '87886663', '', '3300 万元', '民营企业', '济南德天置业有限公司成立于2010年3月，有职工12人，其中高级职称2人，中级职称7人，初级职称3人，注册资金三千三百万元人民币，开发建设了幸福里小区、水岸连城小区，房地产开发资质等级为暂定资质。', '济南德天置业有限公司null阴元晓平阴县五岭路南段西侧沿街商业楼878866633300 万元民营企业济南德天置业有限公司成立于2010年3月，有职工12人，其中高级职称2人，中级职称7人，初级职称3人，注册资金三千三百万元人民币，开发建设了幸福里小区、水岸连城小区，房地产开发资质等级为暂定资质。');
INSERT INTO `reb` VALUES ('1665', '济南诚和成置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/904d40af-7bd1-4b97-8f6e-ef4aa9810be5.shtml', '', '0161385', '高雅', '济南市市中区十六里河街道办事处内省道103线699号', '86265197', '495162815@qq.com', '1000 万元', '民营企业', '济南诚和成置业有限公司是注册于山东济南市的房地产开发公司。公司以山东浙江商会及济南温州商会为依托，由温州本土、温州欧洲海外实体企业共同搭建公司广阔资金平台，注册资本金1000万元。秉承“以人为本，诚信经营，服务社会”的经营宗旨，近期准备开发和运作多个商业、住宅及更多元化领域地产项目。', '济南诚和成置业有限公司null高雅济南市市中区十六里河街道办事处内省道103线699号86265197495162815@qq.com1000 万元民营企业济南诚和成置业有限公司是注册于山东济南市的房地产开发公司。公司以山东浙江商会及济南温州商会为依托，由温州本土、温州欧洲海外实体企业共同搭建公司广阔资金平台，注册资本金1000万元。秉承“以人为本，诚信经营，服务社会”的经营宗旨，近期准备开发和运作多个商业、住宅及更多元化领域地产项目。');
INSERT INTO `reb` VALUES ('1666', '山东银座久信房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/af4b1632-234e-4795-8263-caffdd54cf99.shtml', '', '0161507', '李明', '济南市历下区转山西路7号', '55557809', 'jx7809@163.com', '3333 万元', '国有企业', '合资企业山东银座久信房地产开发有限公司是由省内外享誉盛名的山东银座商城股份有限公司与台湾久信金属股份有限公司、台湾甲山林房地产咨询（上海）有限公司和上海方辰投资有限公司合资成立的，注册资金3333万元，房地产开发二级资质，主要从事房地产综合开发与经营、房地产代理等业务。作为山东商界的耀眼明星，“银座”品牌在济南、在山东已是家喻户晓、英名远扬；如今，“银座房产”已成为山东房地产界新的风向标。 公司的经营宗旨是“奉献精品，诚信久远”，以创造“银座房产”知名品牌为目标，坚持科学决策，精心设计，精心组织，精心施工，为广大消费者提供精品物业，为山东省城市建设增光添彩。 公司现有员工100余人，有中高级职称的技术人员30%以上，其中工程技术人员大都参加过银座商城、索菲特银座大饭店、银座会展中心等著名标志性建筑的施工和管理工作，有着丰富的工程建设及管理经验。公司成功开发银座花园的同时，整合商业集团的优势资源，于2003年大踏步地进军商业地产的开发领域，陆续开工了东营银座城市广场、莱芜银座城市广场、泰安银座城市广场，形成并完善了具有鲜明竞争品牌优势的“银座房产”开发模式。', '山东银座久信房地产开发有限公司null李明济南市历下区转山西路7号55557809jx7809@163.com3333 万元国有企业合资企业山东银座久信房地产开发有限公司是由省内外享誉盛名的山东银座商城股份有限公司与台湾久信金属股份有限公司、台湾甲山林房地产咨询（上海）有限公司和上海方辰投资有限公司合资成立的，注册资金3333万元，房地产开发二级资质，主要从事房地产综合开发与经营、房地产代理等业务。作为山东商界的耀眼明星，“银座”品牌在济南、在山东已是家喻户晓、英名远扬；如今，“银座房产”已成为山东房地产界新的风向标。 公司的经营宗旨是“奉献精品，诚信久远”，以创造“银座房产”知名品牌为目标，坚持科学决策，精心设计，精心组织，精心施工，为广大消费者提供精品物业，为山东省城市建设增光添彩。 公司现有员工100余人，有中高级职称的技术人员30%以上，其中工程技术人员大都参加过银座商城、索菲特银座大饭店、银座会展中心等著名标志性建筑的施工和管理工作，有着丰富的工程建设及管理经验。公司成功开发银座花园的同时，整合商业集团的优势资源，于2003年大踏步地进军商业地产的开发领域，陆续开工了东营银座城市广场、莱芜银座城市广场、泰安银座城市广场，形成并完善了具有鲜明竞争品牌优势的“银座房产”开发模式。');
INSERT INTO `reb` VALUES ('1667', '济南宏泰置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c7d9ce56-be7e-494f-a342-df7a3cbc208d.shtml', '', '0161315', '李希波', '济南市商河县商中路26号', '84878877', 'qlhyjt@163.com', '2000 万元', '民营企业', '济南宏泰置业有限公司于2009年7月3日成立，位于济南市商河县张坊乡政府驻地，，注册资本金2000万元人民币。其中，李希波出资200万元，张文奎、李汉利各出资180万元。公司主要从事房地产开发、建设、销售；物业管理；建筑材料的采购和销售；建筑工程机械装备的采购和销售（未取得专项许可的项目除外）。公司现有职工12人，其中总经理１名，高级工程师1名，工程师5名，经营负责人1名，会计负责人1名，统计负责人１名。', '济南宏泰置业有限公司null李希波济南市商河县商中路26号84878877qlhyjt@163.com2000 万元民营企业济南宏泰置业有限公司于2009年7月3日成立，位于济南市商河县张坊乡政府驻地，，注册资本金2000万元人民币。其中，李希波出资200万元，张文奎、李汉利各出资180万元。公司主要从事房地产开发、建设、销售；物业管理；建筑材料的采购和销售；建筑工程机械装备的采购和销售（未取得专项许可的项目除外）。公司现有职工12人，其中总经理１名，高级工程师1名，工程师5名，经营负责人1名，会计负责人1名，统计负责人１名。');
