INSERT INTO `reb` VALUES ('1670', '济南三名房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b10bfdb1-1e92-4ad7-87ff-052f8c6eab3c.shtml', '', '0161359', '侯睿', '市中区济微路90号1号楼311室', '88195719', 'smfc2009@126.com', '1000 万元', '民营企业', '济南三名房地产开发有限公司成立于2009年10月16日，公司注册资金1000万元人民币。现有员工18人，其中高级职称2人，中级职称6人，本科以上学历人员10人。公司全部人员均具有丰富的房地产开发经营经验，对济南房地产市场有着深刻的认识。公司秉承“诚信为本”的企业理念，诚实待人，踏实工作，力求完成一个项目，留下一个亮点。', '济南三名房地产开发有限公司null侯睿市中区济微路90号1号楼311室88195719smfc2009@126.com1000 万元民营企业济南三名房地产开发有限公司成立于2009年10月16日，公司注册资金1000万元人民币。现有员工18人，其中高级职称2人，中级职称6人，本科以上学历人员10人。公司全部人员均具有丰富的房地产开发经营经验，对济南房地产市场有着深刻的认识。公司秉承“诚信为本”的企业理念，诚实待人，踏实工作，力求完成一个项目，留下一个亮点。');
INSERT INTO `reb` VALUES ('1671', '山东巨鼎置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a916a43e-3bdb-4e2d-9955-2d4832a26287.shtml', '', '016SH004', '李曰滨', '山东省济南市商河县贾庄镇商业街28号', '84811111', '', '1800 万元', '民营企业', '', '山东巨鼎置业有限公司null李曰滨山东省济南市商河县贾庄镇商业街28号848111111800 万元民营企业');
INSERT INTO `reb` VALUES ('1672', '山东万平房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/bb7b1433-abe0-4d1f-852e-220fc848e653.shtml', '', '0161489', '刘彦国', '经十路124号综合楼北单元二楼', '82050208', 'jinanwanping@126.com', '3000 万元', '民营企业', '山东万平房地产开发有限公司是万平科贸集团旗下专业从事房地产开发、经营、管理的企业。公司成立于2004年4月,2005年5月变更为房地产开发企业,公司注册资本金3000万元人民币，公司坐落在济南市历下区东顺城23号综合楼。公司现有主业技术职称的人员20位，其中高级职称的5位，具有中级职称的15位。 公司将立足济南市场，迅速把企业做大做强。', '山东万平房地产开发有限公司null刘彦国经十路124号综合楼北单元二楼82050208jinanwanping@126.com3000 万元民营企业山东万平房地产开发有限公司是万平科贸集团旗下专业从事房地产开发、经营、管理的企业。公司成立于2004年4月,2005年5月变更为房地产开发企业,公司注册资本金3000万元人民币，公司坐落在济南市历下区东顺城23号综合楼。公司现有主业技术职称的人员20位，其中高级职称的5位，具有中级职称的15位。 公司将立足济南市场，迅速把企业做大做强。');
INSERT INTO `reb` VALUES ('1673', '山东鲁信置地有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8442562d-5bcd-4968-b750-c2179dbef19a.shtml', '', '0161398', '孙黎', '济南市历下区解放路37号', '85103320', '373734050@qq.com', '20000 万元', '国有企业', '山东鲁信置地有限公司（简称鲁信置地公司）成立于2001年9月11日，是山东鲁信房地产投资开发有限公司的全资子公司，专营房地产业务的开发，拥有3级房地产开发资质，注册资本3000万元。 鲁信置地公司成立以来，先后成功开发了济南市按察司街、南辛苑小区、荣成市荣圣?铭仕海岸别墅以及淄博鲁信花园等多个住宅小区项目，其中南辛苑一期3个多层住宅项目获得2002年济南市“放心楼盘”荣誉称号；荣圣?铭仕海岸别墅位于荣成市首个国家级城市湿地自然保护区——13.91平方公里的桑沟湾湿地生态公园、万亩龙岛湖生态公园之间，占地约186亩，规划总建筑面积3万余平方米，以其优越的地理位置和独特的设计内涵在当地引起了轰动；淄博鲁信花园项目位于人民公园附近，地理位置优越，占地32.79亩，规划总面积11.4万平米，是淄博市中高档高层商住楼的典范项目之一。 鲁信置地公司始终坚持“诚信为本、品质至上”的经营理念，依托鲁信集团的资源优势，抢抓机遇，努力打造鲁信地产品牌。目前，鲁信置地公司正蓄势待发，着手开发济南东郊饭店改造项目。', '山东鲁信置地有限公司null孙黎济南市历下区解放路37号85103320373734050@qq.com20000 万元国有企业山东鲁信置地有限公司（简称鲁信置地公司）成立于2001年9月11日，是山东鲁信房地产投资开发有限公司的全资子公司，专营房地产业务的开发，拥有3级房地产开发资质，注册资本3000万元。 鲁信置地公司成立以来，先后成功开发了济南市按察司街、南辛苑小区、荣成市荣圣?铭仕海岸别墅以及淄博鲁信花园等多个住宅小区项目，其中南辛苑一期3个多层住宅项目获得2002年济南市“放心楼盘”荣誉称号；荣圣?铭仕海岸别墅位于荣成市首个国家级城市湿地自然保护区——13.91平方公里的桑沟湾湿地生态公园、万亩龙岛湖生态公园之间，占地约186亩，规划总建筑面积3万余平方米，以其优越的地理位置和独特的设计内涵在当地引起了轰动；淄博鲁信花园项目位于人民公园附近，地理位置优越，占地32.79亩，规划总面积11.4万平米，是淄博市中高档高层商住楼的典范项目之一。 鲁信置地公司始终坚持“诚信为本、品质至上”的经营理念，依托鲁信集团的资源优势，抢抓机遇，努力打造鲁信地产品牌。目前，鲁信置地公司正蓄势待发，着手开发济南东郊饭店改造项目。');
INSERT INTO `reb` VALUES ('1674', '山东银丰投资集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ab6dcaa0-4b71-48cf-bb49-a6f0c779aca7.shtml', '', '0161611', '王伟', '济南市市中区历阳大街6号银丰大厦', '89019566', 'Yinfeng8901@163.com', '110000 万元', '民营企业', '山东银丰投资集团有限公司成立于1999年8月，主要从事投资、资本经营、投资咨询、房地产开发及销售等业务。目前公司注册资金50000万元，截至2007年底，公司总资产超过12亿元。 在“诚信做人、认真做事、张弛有度、开拓进取 ”的企业精神指导下，公司利用自己在金融市场的优势，不断进行实业投资，公司先后涉足房地产开发、金融、干细胞工程、国际国内贸易、物业管理等多项产业。旗下主要的全资和控股子公司包括济南银丰房地产开发有限公司、山东省齐鲁干细胞工程有限公司、山东德仁经济贸易有限公司、山东银丰汽车销售服务公司、山东银丰物业管理有限公司、加拿大利建实业有限公司等。 2006年公司投资临沂商业银行，成为该行大股东之一。2007年投资安徽安联高速公路。并在美国、加拿大、韩国、香港、澳门等国家和地区设立了子公司及办事处。 山东银丰投资有限公司是个跨世纪的企业，她既承接二十世纪的历史与厚重，又具备二十一世纪的敏感与睿智。她成立于上世纪，必将发展、腾飞于本世纪。', '山东银丰投资集团有限公司null王伟济南市市中区历阳大街6号银丰大厦89019566Yinfeng8901@163.com110000 万元民营企业山东银丰投资集团有限公司成立于1999年8月，主要从事投资、资本经营、投资咨询、房地产开发及销售等业务。目前公司注册资金50000万元，截至2007年底，公司总资产超过12亿元。 在“诚信做人、认真做事、张弛有度、开拓进取 ”的企业精神指导下，公司利用自己在金融市场的优势，不断进行实业投资，公司先后涉足房地产开发、金融、干细胞工程、国际国内贸易、物业管理等多项产业。旗下主要的全资和控股子公司包括济南银丰房地产开发有限公司、山东省齐鲁干细胞工程有限公司、山东德仁经济贸易有限公司、山东银丰汽车销售服务公司、山东银丰物业管理有限公司、加拿大利建实业有限公司等。 2006年公司投资临沂商业银行，成为该行大股东之一。2007年投资安徽安联高速公路。并在美国、加拿大、韩国、香港、澳门等国家和地区设立了子公司及办事处。 山东银丰投资有限公司是个跨世纪的企业，她既承接二十世纪的历史与厚重，又具备二十一世纪的敏感与睿智。她成立于上世纪，必将发展、腾飞于本世纪。');
INSERT INTO `reb` VALUES ('1675', '济南万筑房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/1c164a12-9df8-48a0-9562-27f077480aa9.shtml', '', '0161487', '黄运林', '济南市历下区解放东路95号', '68610510', 'Lihx01@vanke.com', '10000 万元', '民营企业', '济南万筑房地产开发有限公司成立于2012年12月10日，注册资本壹亿元整。项目为万科城，位于济南市历下区奥体西路。', '济南万筑房地产开发有限公司null黄运林济南市历下区解放东路95号68610510Lihx01@vanke.com10000 万元民营企业济南万筑房地产开发有限公司成立于2012年12月10日，注册资本壹亿元整。项目为万科城，位于济南市历下区奥体西路。');
INSERT INTO `reb` VALUES ('1676', '济南中建信和置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/be0210e9-8ad7-433f-af25-7af33e388a7e.shtml', '', '013846', '王庆云', '山东省济南市大学科技园大学路4366号105室', '69616666', '958511083@qq.com', '10000 万元', '民营企业', '济南中建信和置业有限公司，是由中建信和地产有限公司与济南市西区建设投资有限公司两方发起成立。于2011年6月16日在济南长清注册成立，注册资本人民币10000万元，实收资本为4000万元。', '济南中建信和置业有限公司null王庆云山东省济南市大学科技园大学路4366号105室69616666958511083@qq.com10000 万元民营企业济南中建信和置业有限公司，是由中建信和地产有限公司与济南市西区建设投资有限公司两方发起成立。于2011年6月16日在济南长清注册成立，注册资本人民币10000万元，实收资本为4000万元。');
INSERT INTO `reb` VALUES ('1677', '济南星都置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a0e915c6-9f9e-4b7b-8bd5-35d3a3a05c5f.shtml', '', '016SH001', '郑海英', '山东省济南市商河县银河路96号', '0531-84870222', 'jnxdzy@163.com', '1200 万元', '', '济南星都置业有限公司是一家以房地产开发为主，涉及电力设施设备、房产营销等行业的企业，现拥有资深博士一名，高中级职称、原班及专业人才30余人。 　　公司现正在投资开发的星都财富广场是今年商河政府重点招商引资项目，该项目的运作是以济南市北垮的大格局为背景，对于调整当地的商业结构，带动当地的旅游事业，提高经济发展水平。 　　星都财富广场是借助商河近年来开发的地热资源而塑造环保节能的项目。该项目位于济南市商河县商业政务中心，商中路与银河路交界处，占地５０亩，建筑面积近６万平方米，总投资额预计1.5亿元人民币，建设周期为2年，拟建立一座12层地标性温泉度假酒店，一座六层办公写字楼，一座精品购物商场以及沿街中、小商铺。规划布局强调户外广场、步行街、购物街等，合理空间设置，塑造娱乐性购物消费的功能，并借着新颖的建筑设计外观、舒适的室内格局，强调人潮聚集及疏散分流的活动功能流畅。促进沿街商铺的均好性，达到商贸活动的合理布局发展。 　　公司在市场调查研究的基础上，通过自己的营销策略，该项目发展前景非常良好，我们目前最大的任务就是在建设周期保质保量的完成建设任务，以全新的形象面对政府与群众的期待与监督。', '济南星都置业有限公司null郑海英山东省济南市商河县银河路96号0531-84870222jnxdzy@163.com1200 万元济南星都置业有限公司是一家以房地产开发为主，涉及电力设施设备、房产营销等行业的企业，现拥有资深博士一名，高中级职称、原班及专业人才30余人。 　　公司现正在投资开发的星都财富广场是今年商河政府重点招商引资项目，该项目的运作是以济南市北垮的大格局为背景，对于调整当地的商业结构，带动当地的旅游事业，提高经济发展水平。 　　星都财富广场是借助商河近年来开发的地热资源而塑造环保节能的项目。该项目位于济南市商河县商业政务中心，商中路与银河路交界处，占地５０亩，建筑面积近６万平方米，总投资额预计1.5亿元人民币，建设周期为2年，拟建立一座12层地标性温泉度假酒店，一座六层办公写字楼，一座精品购物商场以及沿街中、小商铺。规划布局强调户外广场、步行街、购物街等，合理空间设置，塑造娱乐性购物消费的功能，并借着新颖的建筑设计外观、舒适的室内格局，强调人潮聚集及疏散分流的活动功能流畅。促进沿街商铺的均好性，达到商贸活动的合理布局发展。 　　公司在市场调查研究的基础上，通过自己的营销策略，该项目发展前景非常良好，我们目前最大的任务就是在建设周期保质保量的完成建设任务，以全新的形象面对政府与群众的期待与监督。');
INSERT INTO `reb` VALUES ('1678', '济南信豪房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a1dc067f-2e7a-4fbd-8449-5cc1eed88828.shtml', '', '0161464', '张铁军', '济南市历城区王舍人街道建委路', '67886700', '35306555@qq.com', '1000 万元', '民营企业', '济南信豪房地产开发有限公司成立于2011年4月14日，现有员工100余人。公司注册资本1000万人民币，公司住所地址位于：济南市历城区王舍人街道建委路。主要经营：房地产开发、销售、营销策划，物业管理等。', '济南信豪房地产开发有限公司null张铁军济南市历城区王舍人街道建委路6788670035306555@qq.com1000 万元民营企业济南信豪房地产开发有限公司成立于2011年4月14日，现有员工100余人。公司注册资本1000万人民币，公司住所地址位于：济南市历城区王舍人街道建委路。主要经营：房地产开发、销售、营销策划，物业管理等。');
INSERT INTO `reb` VALUES ('1679', '山东银座地产有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c108f9f8-d5e3-4206-af48-ec9590eadd74.shtml', '', '0161585', '董红林', '山东省济南市市中区顺河东街66号银座晶都国际广场2号楼3801室', '66688891', '1786183082@qq.com', '7628 万元', '国有企业', '山东银座地产有限公司成立于2003年，注册资金近8000万元。公司奉行可持续发展的经营理念，秉承“科学决策、优化配置、高效经营”的发展原则，继续深化银座品牌内涵。公司主要发展方向为：一是自主开发住宅及商业地产项目；二是为银座展店服务，在各地建设银座分号。 公司下设五部一室，具体为：工程部、销售部、外联部、发展部、财务部、办公室。现公司正在开发济南银座晶都国际大型综合项目，并投资控股开发青岛即墨项目。', '山东银座地产有限公司null董红林山东省济南市市中区顺河东街66号银座晶都国际广场2号楼3801室666888911786183082@qq.com7628 万元国有企业山东银座地产有限公司成立于2003年，注册资金近8000万元。公司奉行可持续发展的经营理念，秉承“科学决策、优化配置、高效经营”的发展原则，继续深化银座品牌内涵。公司主要发展方向为：一是自主开发住宅及商业地产项目；二是为银座展店服务，在各地建设银座分号。 公司下设五部一室，具体为：工程部、销售部、外联部、发展部、财务部、办公室。现公司正在开发济南银座晶都国际大型综合项目，并投资控股开发青岛即墨项目。');
INSERT INTO `reb` VALUES ('1680', '济南润安房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8a98c7e8-8309-409d-86cc-4e18b7d59414.shtml', '', '0161001', '陈骏', '转山西路3号济南市历下区龙洞街道转山西路社区居委会228室', '88923257', 'sdjyzzyxgs@163.com', '1000 万元', '国有企业', '2009年9月18日成立，位于济南市历下区解放东路3号，注册资金1000万元，现有职工12人。', '济南润安房地产开发有限公司null陈骏转山西路3号济南市历下区龙洞街道转山西路社区居委会228室88923257sdjyzzyxgs@163.com1000 万元国有企业2009年9月18日成立，位于济南市历下区解放东路3号，注册资金1000万元，现有职工12人。');
INSERT INTO `reb` VALUES ('1681', '山东瑞驰置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8bdaf141-b68b-43c9-8c6b-5e66da4ae37b.shtml', '', '0161390', '王勇', '济南市市中区舜玉路30号', '83189906', '13953172677@163.com', '1900 万元', '民营企业', '企业成立于2005年12月7号，主营房地产开发，房屋租赁及建材的销售。公司下设有：工程部、销售部、财务部等部门。公司法人代表；王勇。', '山东瑞驰置业有限公司null王勇济南市市中区舜玉路30号8318990613953172677@163.com1900 万元民营企业企业成立于2005年12月7号，主营房地产开发，房屋租赁及建材的销售。公司下设有：工程部、销售部、财务部等部门。公司法人代表；王勇。');
INSERT INTO `reb` VALUES ('1682', '山东惠盛置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a3a8d2ab-1b7b-46ca-b742-daba81576b03.shtml', '', '0161541', '金成发', '济南市历下区千佛山东路19号', '053166115622', 'Lvdishandong@126.com', '1000 万元', '民营企业', '山东惠盛置业有限公司成立于2011年11月2日，注册资本金为壹仟万元整。公司成立后建设开发了龙洞住宅项目。山东烟草投资管理有限公司将持有的山东惠盛置业有限公司100%国有产权以招标方式转让给绿地地产（济南）有限公司。双方在2016年5月6日进行工商变更登记。', '山东惠盛置业有限公司null金成发济南市历下区千佛山东路19号053166115622Lvdishandong@126.com1000 万元民营企业山东惠盛置业有限公司成立于2011年11月2日，注册资本金为壹仟万元整。公司成立后建设开发了龙洞住宅项目。山东烟草投资管理有限公司将持有的山东惠盛置业有限公司100%国有产权以招标方式转让给绿地地产（济南）有限公司。双方在2016年5月6日进行工商变更登记。');
INSERT INTO `reb` VALUES ('1683', '恒生地产济南有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/461f716e-69a6-4461-840c-ab00f00ecf3c.shtml', '', '0161550', '李刚', '张庄路297号', '55515555', 'jgzy2010@126.com', '5000 万元', '民营企业', '恒生地产济南有限公司，起步于山东，立足于环渤海区域，发展于全国。是一家专注于创造品质生活，为客户提供优质产品和服务的专业地产公司。以社会效益为第一位、肩负社会效益、身负企业责任， 盖“老百姓买的起”的房子、建“多数人住的起”的房子。将经济效益和环境效益并存，积极纳税、回报社会，以改善环境、提升居住水平为己任。', '恒生地产济南有限公司null李刚张庄路297号55515555jgzy2010@126.com5000 万元民营企业恒生地产济南有限公司，起步于山东，立足于环渤海区域，发展于全国。是一家专注于创造品质生活，为客户提供优质产品和服务的专业地产公司。以社会效益为第一位、肩负社会效益、身负企业责任， 盖“老百姓买的起”的房子、建“多数人住的起”的房子。将经济效益和环境效益并存，积极纳税、回报社会，以改善环境、提升居住水平为己任。');
INSERT INTO `reb` VALUES ('1684', '济南鼎隆置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8d102ee1-9598-4017-8101-aab768cfb963.shtml', '', '0161606', '见伟', '为济南市槐荫区纬八路129号', '85945008', 'LYL9919@163.com', '3280 万元', '民营企业', '济南鼎隆置业有限公司是2003年8月经济南市工商局批准注册成立的房地产开发企业，公司内部机构设置为总经理室、分管经理室、财务部、销售经营部、开发经营部、工程施工部。公司在职职工39人，在册有职称职工15人。其中高级职称职工3人，中级职称职工7人，初级职称职工5人。公司注册资本1100万元。主要经营项目为房地产开发、销售。辅营建筑用金属制品及构件的租赁；贸易信息咨询。 公司自创建以来，以“塑造品牌、求新创优、服务社会”为追求，以“稳健、创新、高效”为宗旨。在同行业中树立起良好的形象。', '济南鼎隆置业有限公司null见伟为济南市槐荫区纬八路129号85945008LYL9919@163.com3280 万元民营企业济南鼎隆置业有限公司是2003年8月经济南市工商局批准注册成立的房地产开发企业，公司内部机构设置为总经理室、分管经理室、财务部、销售经营部、开发经营部、工程施工部。公司在职职工39人，在册有职称职工15人。其中高级职称职工3人，中级职称职工7人，初级职称职工5人。公司注册资本1100万元。主要经营项目为房地产开发、销售。辅营建筑用金属制品及构件的租赁；贸易信息咨询。 公司自创建以来，以“塑造品牌、求新创优、服务社会”为追求，以“稳健、创新、高效”为宗旨。在同行业中树立起良好的形象。');
INSERT INTO `reb` VALUES ('1685', '济南海尔绿城置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/9c950627-ed9a-45eb-9fc1-ad5926a54c7b.shtml', '', '0161486', '赵凤存', '济南市历下区经十东路南侧', '89706955', 'Zhangman0377@126.com', '20000 万元', '民营企业', '海尔绿城全运村简介 海尔绿城全运村为济南城市东部核心区——奥体文博片区建设重点工程、第十一届全运会重点配套项目，由位居民族品牌之首的海尔集团和中国房地产百强企业综合实力TOP10的绿城集团携手开发，是两大集团品牌优势加之绿城集团十余年房地产开发专业经验强强联合的结晶。 项目坐落于济南的东部区域，位于经十东路奥体场馆以南，龙奥大厦以东，风景秀美的城市主干道——旅游路将项目自然划分成南、北两个地块，旅游路以北是全运村酒店项目，以南为全运村住宅项目。项目总占地面积1300余亩，规划地上总建筑面积130余万平方米。物业类型包括高层、小高层、多层、产权式酒店、平层官邸、小独栋及联排多层住宅、五星级酒店、商业街等。 海尔绿城全运村住宅部分西邻龙鼎大道，北界旅游路，东侧和南侧分别毗邻山体，秉承绿城桂花、百合、御园三大系列经典产品，引领济南社区居住品质发展方向。全运村项目共分三期开发，一期占地面积20余万平方米，地上建筑面积近40万平方米，包括多层、小高层、高层以及一个15000平方米的运动主题会所。 海尔绿城全运村秉承海尔绿城“创造城市的美丽”的开发使命，构建以城市东部核心区为依托、以齐鲁文脉为底蕴、以高标准生态环境和便利交通为支撑，全力营造和谐、富有独特魅力和宜居的东部新城。', '济南海尔绿城置业有限公司null赵凤存济南市历下区经十东路南侧89706955Zhangman0377@126.com20000 万元民营企业海尔绿城全运村简介 海尔绿城全运村为济南城市东部核心区——奥体文博片区建设重点工程、第十一届全运会重点配套项目，由位居民族品牌之首的海尔集团和中国房地产百强企业综合实力TOP10的绿城集团携手开发，是两大集团品牌优势加之绿城集团十余年房地产开发专业经验强强联合的结晶。 项目坐落于济南的东部区域，位于经十东路奥体场馆以南，龙奥大厦以东，风景秀美的城市主干道——旅游路将项目自然划分成南、北两个地块，旅游路以北是全运村酒店项目，以南为全运村住宅项目。项目总占地面积1300余亩，规划地上总建筑面积130余万平方米。物业类型包括高层、小高层、多层、产权式酒店、平层官邸、小独栋及联排多层住宅、五星级酒店、商业街等。 海尔绿城全运村住宅部分西邻龙鼎大道，北界旅游路，东侧和南侧分别毗邻山体，秉承绿城桂花、百合、御园三大系列经典产品，引领济南社区居住品质发展方向。全运村项目共分三期开发，一期占地面积20余万平方米，地上建筑面积近40万平方米，包括多层、小高层、高层以及一个15000平方米的运动主题会所。 海尔绿城全运村秉承海尔绿城“创造城市的美丽”的开发使命，构建以城市东部核心区为依托、以齐鲁文脉为底蕴、以高标准生态环境和便利交通为支撑，全力营造和谐、富有独特魅力和宜居的东部新城。');
INSERT INTO `reb` VALUES ('1686', '济南源泰置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b9637478-be1b-47a8-a8a6-4063e3f2b509.shtml', '', '0161346', '刘永杰', '济南市历下区工业南路43号', '80961666', '13626401111@163.com', '5000 万元', '民营企业', '济南源泰置业有限公司成立于2011年11月08日，公司注册资本5000万元，为山东北大资源地产有限公司投资的全资公司，公司注册地址为济南市历下区工业南路43号，办公面积约500平方米，主营业务为房地产开发、经营，公司现有职工15人，其中专业技术人员10人。 公司投资开发建设的“尚品?学府”住宅项目位于济南市东部盛福片区，为东部发展的核心区域。项目东临紫御东郡、绿城百合花园，北临中林路，西临奥体西路延长线。项目位置优越，周边配套完善。项目占地面积82061平方米，建筑面积25.9万平方米。项目以营造生态绿色住宅区为首要原则，贯彻以人为本的思想，以建设生态型居住环境为规划目标，创造一个布局合理、功能齐备、交通便捷、绿意盎然、生活方便、具有文化内涵的住宅区。', '济南源泰置业有限公司null刘永杰济南市历下区工业南路43号8096166613626401111@163.com5000 万元民营企业济南源泰置业有限公司成立于2011年11月08日，公司注册资本5000万元，为山东北大资源地产有限公司投资的全资公司，公司注册地址为济南市历下区工业南路43号，办公面积约500平方米，主营业务为房地产开发、经营，公司现有职工15人，其中专业技术人员10人。 公司投资开发建设的“尚品?学府”住宅项目位于济南市东部盛福片区，为东部发展的核心区域。项目东临紫御东郡、绿城百合花园，北临中林路，西临奥体西路延长线。项目位置优越，周边配套完善。项目占地面积82061平方米，建筑面积25.9万平方米。项目以营造生态绿色住宅区为首要原则，贯彻以人为本的思想，以建设生态型居住环境为规划目标，创造一个布局合理、功能齐备、交通便捷、绿意盎然、生活方便、具有文化内涵的住宅区。');
INSERT INTO `reb` VALUES ('1687', '济南恒大翡翠华庭置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/db1a67b2-08f9-410c-a81b-fdfba2b68314.shtml', '', '0161409', '廖嘉宁', '济南市历下区山大路201号天业商务大厦', '83125936', '285785006@qq.com', '75000 万元', '民营企业', '恒大集团（3333.HK）是在香港联交所主板上市，以住宅产业为主，集商业、酒店、体育及文化产业为一体的特大型企业集团，是中国规模最大、销售面积最多的龙头房地产企业，目前在3个直辖市及25个省会级城市设立分公司（地区公司），在中国120多个主要城市拥有大型住宅项目200多个，覆盖中端、中高端、高端及旅游地产等多个产品系列。2011年，恒大销售804亿元，纳税89亿元；2012年上半年，恒大实现营业收入370.4亿元，中国第一。作为中国精品地产的领导者，恒大开发的楼盘在中国十大房地产企业里价格最低、品质卓越，性价比高，被中国很多老百姓誉为“民生地产”。十多年来，恒大还为中国慈善公益事业捐款超20亿元，连续五年获得国家民政部颁发的“中华慈善奖”。 未来，恒大将继续全面推进规模化、精品化、品牌化产业战略，全力打造二十一世纪规模一流、品牌一流、团队一流的具国际竞争力的世界顶级企业。 济南恒大翡翠华庭置业有限公司为是恒大地产集团济南置业有限公司全资子公司。', '济南恒大翡翠华庭置业有限公司null廖嘉宁济南市历下区山大路201号天业商务大厦83125936285785006@qq.com75000 万元民营企业恒大集团（3333.HK）是在香港联交所主板上市，以住宅产业为主，集商业、酒店、体育及文化产业为一体的特大型企业集团，是中国规模最大、销售面积最多的龙头房地产企业，目前在3个直辖市及25个省会级城市设立分公司（地区公司），在中国120多个主要城市拥有大型住宅项目200多个，覆盖中端、中高端、高端及旅游地产等多个产品系列。2011年，恒大销售804亿元，纳税89亿元；2012年上半年，恒大实现营业收入370.4亿元，中国第一。作为中国精品地产的领导者，恒大开发的楼盘在中国十大房地产企业里价格最低、品质卓越，性价比高，被中国很多老百姓誉为“民生地产”。十多年来，恒大还为中国慈善公益事业捐款超20亿元，连续五年获得国家民政部颁发的“中华慈善奖”。 未来，恒大将继续全面推进规模化、精品化、品牌化产业战略，全力打造二十一世纪规模一流、品牌一流、团队一流的具国际竞争力的世界顶级企业。 济南恒大翡翠华庭置业有限公司为是恒大地产集团济南置业有限公司全资子公司。');
INSERT INTO `reb` VALUES ('1688', '济南银丰融盛房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/4ae4f74e-b63d-4696-8e9d-6068c1b45682.shtml', '', '016(JY031)', '赵培勇', '崔寨镇前街村民委员会办公楼401室', '84367155', '345074490@qq.com', '1000 万元', '民营企业', '济南银丰融盛房地产开发有限公司成立于2016年1月28日，隶属于银丰地产集团有限公司，注册资金壹千万元。主要从事房地产开发与销售；建筑装饰装修工程，建筑工程项目管理。公司秉持“诚信卓越、精品永恒”之理念，坚持绿色环保、创新驱动之可持续发展经营策略，以创新产品线和精品战略拓宽企业发展空间，专注于优质房地产产品的开发，产品形态涵盖中高端住宅、别墅等住宅系列。', '济南银丰融盛房地产开发有限公司null赵培勇崔寨镇前街村民委员会办公楼401室84367155345074490@qq.com1000 万元民营企业济南银丰融盛房地产开发有限公司成立于2016年1月28日，隶属于银丰地产集团有限公司，注册资金壹千万元。主要从事房地产开发与销售；建筑装饰装修工程，建筑工程项目管理。公司秉持“诚信卓越、精品永恒”之理念，坚持绿色环保、创新驱动之可持续发展经营策略，以创新产品线和精品战略拓宽企业发展空间，专注于优质房地产产品的开发，产品形态涵盖中高端住宅、别墅等住宅系列。');
INSERT INTO `reb` VALUES ('1689', '济南盛雪置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/43bacda5-4bc9-43ac-9ad6-55a89ea26f8d.shtml', '', '0161528', '常克艺', '济南市历城区唐冶街道办事处241室', '67961961', '331234516@qq.com', '210000 万元', '民营企业', '济南盛雪置业有限公司成立于2015年12月，现开发龙湖春江郦城项目，项目位于济南市经十路以北，世纪大道以南，韩仓河以东。注册资金21亿。', '济南盛雪置业有限公司null常克艺济南市历城区唐冶街道办事处241室67961961331234516@qq.com210000 万元民营企业济南盛雪置业有限公司成立于2015年12月，现开发龙湖春江郦城项目，项目位于济南市经十路以北，世纪大道以南，韩仓河以东。注册资金21亿。');
