INSERT INTO `reb` VALUES ('1691', '济南东创置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7102ea26-4a1d-45cd-9cbd-1ac25065d71f.shtml', '', '0161467', '赵晨', '舜华路2000号舜泰广场6号楼3301房间', '81927809', '271349259@qq.com', '30000 万元', '民营企业', '建设地点；汉峪片区，旅游路南侧，西至舜华南路，东侧为山体，建设内容；项目总占地约76.8亩（净用地）总建筑面积约80万平方米，项目建设性质是居住及商业。项目可规划建设用地面积333342.4m2。规划总建筑面积844747m2，其中地上建筑面积649007m2（包括高层住宅482440m2，高层写字楼123960m2，商业30586m2，配套12021m2），地下建筑面积195740m2，（包括地下储藏室45114m2，地下车库及设备用房150626m2。', '济南东创置业有限公司null赵晨舜华路2000号舜泰广场6号楼3301房间81927809271349259@qq.com30000 万元民营企业建设地点；汉峪片区，旅游路南侧，西至舜华南路，东侧为山体，建设内容；项目总占地约76.8亩（净用地）总建筑面积约80万平方米，项目建设性质是居住及商业。项目可规划建设用地面积333342.4m2。规划总建筑面积844747m2，其中地上建筑面积649007m2（包括高层住宅482440m2，高层写字楼123960m2，商业30586m2，配套12021m2），地下建筑面积195740m2，（包括地下储藏室45114m2，地下车库及设备用房150626m2。');
INSERT INTO `reb` VALUES ('1692', '济南天哲置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c396f240-a5e8-4cd6-8fa2-b73ccfd209ee.shtml', '', '0161455', '安玉田', '和平路36号210室', '18660788905', '35212229@qq.com', '5000 万元', '民营企业', '', '济南天哲置业有限公司null安玉田和平路36号210室1866078890535212229@qq.com5000 万元民营企业');
INSERT INTO `reb` VALUES ('1693', '济南申海置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b63371df-2881-4ad5-a3e4-e5518470f436.shtml', '', '0161333', '马旬', '经一路88号明珠商务港2611室', '82920865', 'yuhuaqiang.828@163.com', '10000 万元', '民营企业', '济南申海置业有限公司,注册资金10000万元。公司主营业务为房地产开发、经营，物业管理。公司位于济南市市中区经一路88号。股东为马旬（持股70%）和潍坊潍乐经贸有限公司（持股30%）。公司于2013年7月通过竞拍方式取得了宗地编号为2013-G067的济南市市中区天桥南三角地，开发建设“朗诚中心”写字楼项目，计划总投资5亿元人民币，将其建设成包含5A级写字楼、金融办公及德式别墅综合一体的商业项目。', '济南申海置业有限公司null马旬经一路88号明珠商务港2611室82920865yuhuaqiang.828@163.com10000 万元民营企业济南申海置业有限公司,注册资金10000万元。公司主营业务为房地产开发、经营，物业管理。公司位于济南市市中区经一路88号。股东为马旬（持股70%）和潍坊潍乐经贸有限公司（持股30%）。公司于2013年7月通过竞拍方式取得了宗地编号为2013-G067的济南市市中区天桥南三角地，开发建设“朗诚中心”写字楼项目，计划总投资5亿元人民币，将其建设成包含5A级写字楼、金融办公及德式别墅综合一体的商业项目。');
INSERT INTO `reb` VALUES ('1694', '山东希城置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/973b4d0c-fe15-4cc7-8589-3255ee3e5b37.shtml', '', '0161375', '王令强', '经四路681号', '58796167', 'sdsjfdc@126.com', '1000 万元', '国有企业', '山东希城置业有限公司成立于2010年3月23日，登记机关为山东省工商行政管理局。公司注册地点为济南市槐荫区经四路681号，注册资本金为1000万元，是国有独资企业，法定代表人为王令强。公司业务涵盖房地产开发法、营销策划及房屋出租业务，目前主要从事经四纬十二棚户区改造项目的开发运营工作。', '山东希城置业有限公司null王令强经四路681号58796167sdsjfdc@126.com1000 万元国有企业山东希城置业有限公司成立于2010年3月23日，登记机关为山东省工商行政管理局。公司注册地点为济南市槐荫区经四路681号，注册资本金为1000万元，是国有独资企业，法定代表人为王令强。公司业务涵盖房地产开发法、营销策划及房屋出租业务，目前主要从事经四纬十二棚户区改造项目的开发运营工作。');
INSERT INTO `reb` VALUES ('1695', '山东泰商城置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/caf93b3a-65ca-4c50-b716-86f0f59055d8.shtml', '', '0161160', '赖辉耀', '山东省济南市商河县商西路33号', '84826677', '15001775674@163.com', '1800 万元', '民营企业', '山东泰商诚置业有限公司，成立于2011年7月。根据《山东省国民经济和社会发展第十二个五年规划纲要》确定的服务业发展总体方向、基本思路，我公司拟在济南商河县建设一座具有现代化意义的“泰商国际商城”。建设情况：占地面积 239998 平米，总建筑面积 396667平米（包括购物中心 36090平米、MALL 60324平米、商铺 102602平米、商务酒店7560平米、场馆22140平米、配建住宅121511平米、会所5000平米、幼儿园2030平米、仓储26480平米、沿街商业12930平米），项目总投资 11亿人民币。 一个接轨国际市场的“中转站”，一个社会、企业、经营者、百姓多方共赢的大型商贸平台和产业孵化基地，最终产生明显的社会效益和巨大的经济效益。项目以小商品、服饰、家居装饰、五金机电、汽摩汽配、农资农机、购物中心、星级酒店为一体的综合型、批零兼具的大型商贸中心。 　　　泰商国际商城是全国工商联重点扶持市场，山东省承接产业转移示范基地，山东省浙江商会推荐品牌，济南市商贸局重点市场，商河县重点招商引资项目，本着“高起点、高效率、高品质”的开发理念，集“购物中心、会展贸易、产品批发、仓储物流、商务办公、网上交易、休闲广场、精品居住”八项功能为一体，通过引进“浙商经营模式”和第六代新型市场管理经验，力求呈献给商河人民一个集购物、休闲、餐饮、娱乐、办公、居住等为一体的现代化、高档次、一站式的城市商业综合体。', '山东泰商城置业有限公司null赖辉耀山东省济南市商河县商西路33号8482667715001775674@163.com1800 万元民营企业山东泰商诚置业有限公司，成立于2011年7月。根据《山东省国民经济和社会发展第十二个五年规划纲要》确定的服务业发展总体方向、基本思路，我公司拟在济南商河县建设一座具有现代化意义的“泰商国际商城”。建设情况：占地面积 239998 平米，总建筑面积 396667平米（包括购物中心 36090平米、MALL 60324平米、商铺 102602平米、商务酒店7560平米、场馆22140平米、配建住宅121511平米、会所5000平米、幼儿园2030平米、仓储26480平米、沿街商业12930平米），项目总投资 11亿人民币。 一个接轨国际市场的“中转站”，一个社会、企业、经营者、百姓多方共赢的大型商贸平台和产业孵化基地，最终产生明显的社会效益和巨大的经济效益。项目以小商品、服饰、家居装饰、五金机电、汽摩汽配、农资农机、购物中心、星级酒店为一体的综合型、批零兼具的大型商贸中心。 　　　泰商国际商城是全国工商联重点扶持市场，山东省承接产业转移示范基地，山东省浙江商会推荐品牌，济南市商贸局重点市场，商河县重点招商引资项目，本着“高起点、高效率、高品质”的开发理念，集“购物中心、会展贸易、产品批发、仓储物流、商务办公、网上交易、休闲广场、精品居住”八项功能为一体，通过引进“浙商经营模式”和第六代新型市场管理经验，力求呈献给商河人民一个集购物、休闲、餐饮、娱乐、办公、居住等为一体的现代化、高档次、一站式的城市商业综合体。');
INSERT INTO `reb` VALUES ('1696', '山东海信绿苑房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/cbbb1d9d-3e1f-4049-aa12-faf32a8b7137.shtml', '', '0161533', '孙秀恩', '济南市历下区浆水泉村', '83177711', 'sdhxly@163.com', '2000 万元', '国有企业', '黄金山水郡项目位于山东省济南市历下区东南部，东接黄金99，西邻二环东路，南靠洄龙山和浆水泉公园，北到旅游路，土地面积约合416亩。 本工程为集住宅、商业等配套设施齐全的大型社区，包括高层住宅、低住宅、配套商业网点、小学、回迁办公区、幼儿园、体育活动中心等。', '山东海信绿苑房地产开发有限公司null孙秀恩济南市历下区浆水泉村83177711sdhxly@163.com2000 万元国有企业黄金山水郡项目位于山东省济南市历下区东南部，东接黄金99，西邻二环东路，南靠洄龙山和浆水泉公园，北到旅游路，土地面积约合416亩。 本工程为集住宅、商业等配套设施齐全的大型社区，包括高层住宅、低住宅、配套商业网点、小学、回迁办公区、幼儿园、体育活动中心等。');
INSERT INTO `reb` VALUES ('1697', '山东华夏帝苑房地产有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/cbd07376-ec80-4944-a765-fb306711f213.shtml', '', '0161159', '司继生', '济南市历城区唐冶新区围子山路1号', '62323335', 'sdhxdy@163.com', '5000 万元', '民营企业', '山东华夏帝苑房地产有限公司是山东泰山帝苑集团有限公司在济南投资的全资子公司，其注册资本为5000万元，公司注册地为济南市历城区唐冶新区围子山路1号。业务范围主要是：房地产开发，房屋销售、租赁；物业管理。公司下设综合部、财务部、成本控制部、工程部4个职能部门和2个项目部，自2012年3月7日成立至今。', '山东华夏帝苑房地产有限公司null司继生济南市历城区唐冶新区围子山路1号62323335sdhxdy@163.com5000 万元民营企业山东华夏帝苑房地产有限公司是山东泰山帝苑集团有限公司在济南投资的全资子公司，其注册资本为5000万元，公司注册地为济南市历城区唐冶新区围子山路1号。业务范围主要是：房地产开发，房屋销售、租赁；物业管理。公司下设综合部、财务部、成本控制部、工程部4个职能部门和2个项目部，自2012年3月7日成立至今。');
INSERT INTO `reb` VALUES ('1698', '济南祥瑞置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/cc7e749d-9095-4491-ad16-5e31d0371652.shtml', '', '016(JY007)', '高方同', '济阳县济北富阳街北、省道248线东（新汽车站东邻）', '81175577', 'jnxrzy@126.com', '1000 万元', '民营企业', '济南祥瑞置业有限公司成立于二0一一年元月，注册资金1000万元。现有员工15人，部门员工均由房地产的专业、资深人士组成。属现代新型民营企业。 企业成立以来，在县委和县政府的正确领带下，我们本着一流的开发项目，一流的营销服务，一流的物业管理的发展融合现代管理制度和经营理念，以市场为向导，以打造精品项目为宗旨，以房地产开发经营为战略核心而构成的专业化公司。', '济南祥瑞置业有限公司null高方同济阳县济北富阳街北、省道248线东（新汽车站东邻）81175577jnxrzy@126.com1000 万元民营企业济南祥瑞置业有限公司成立于二0一一年元月，注册资金1000万元。现有员工15人，部门员工均由房地产的专业、资深人士组成。属现代新型民营企业。 企业成立以来，在县委和县政府的正确领带下，我们本着一流的开发项目，一流的营销服务，一流的物业管理的发展融合现代管理制度和经营理念，以市场为向导，以打造精品项目为宗旨，以房地产开发经营为战略核心而构成的专业化公司。');
INSERT INTO `reb` VALUES ('1699', '济南长箭房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/cd934eb7-ddea-4a40-bfe7-ddf3a48c0a05.shtml', '', '0161509', '魏刚毅', '大学路6900号', '87222584', 'JNCJFDC@163.com', '3016 万元', '国有企业', '济南市长箭房地产开发有限公司原济南市长清区建工房地产开发有限公司成立于2001年3月20日，2002年9月 19日经省建设厅批准，从事房地产开发经营。公司注册资金3016万元，本公司现有干部职工20人其中中级以上各类专业人员12人，公司下设综合部、工程部、开发部、营销部、财务部等五个职能部门。', '济南长箭房地产开发有限公司null魏刚毅大学路6900号87222584JNCJFDC@163.com3016 万元国有企业济南市长箭房地产开发有限公司原济南市长清区建工房地产开发有限公司成立于2001年3月20日，2002年9月 19日经省建设厅批准，从事房地产开发经营。公司注册资金3016万元，本公司现有干部职工20人其中中级以上各类专业人员12人，公司下设综合部、工程部、开发部、营销部、财务部等五个职能部门。');
INSERT INTO `reb` VALUES ('1700', '山东宝恒房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7600b89c-2737-4bc9-997e-82c909a0bccd.shtml', '', '012745', '王秀英', '山东省济南市商河县田园路南首', '58682116', '123785718@qq.com', '5000 万元', '民营企业', '山东宝恒房地产开发有限公司简介 来自深圳，智耕天下，远见成就未来！ 山东宝恒房地产开发有限公司有限公司，是一家专门从事房地产开发、经营、管理的专业公司。公司源自深圳，业务范围涉及天津、深圳、济南、潍坊、滨州等多个省市，累计开发住宅、商业数百万平方米，积累了十余年丰富的开发经验。实力造就金牌品质，荣誉闪耀品牌辉煌。 自公司成立以来，本着“高标准规划、高质量建设、高水平管理”的经营原则，以“心系客户，超值享受”为服务宗旨，牢固树立“质量第一，用户至上”的质量方针。长期以来，山东宝恒房地产开发有限公司始终将社区规划与居民利益相结合，将自然与人文文化融为一体，居室设计科学合理；同时把声誉视为企业生存的根本，努力打造诚信企业，在社会上树立了良好的企业形象，受到社会各界的好评。 山东宝恒房地产开发有限公司被山东大众报业集团地产部评为“2009年诚信建设单位”、投资开发的名门现代城项目，于2010年被评为“用户满意工程”、宝恒?水木清华项目被评为“2011年最值得期待十大楼盘”。山东宝恒房地产开发有限公司先后在企业信用、产品设计、工程质量、社区建设、社会回馈等多方面多次获得嘉奖，使宝恒品牌享誉全国。 山东宝恒房地产开发有限公司进入山东市场后，凭借良好的企业形象与独特的建筑设计理念，先后开发了名门现代城、玫瑰?太古城、金榜华庭、宝恒?水木清华、卓越?玫瑰园等项目，所开发的项目皆成为所在地区具代表性的楼盘，多数项目还相继被所在地区政府相关部门及社会大众评为优质小区。 山东宝恒房地产开发有限公司将继续巩固在山东省内的投资开发，并积极开拓新的市场、寻求新的投资项目。发扬企业精神，不断完善自我，为客户提供最满意的产品和服务，为创建和谐社会做出自己的贡献。', '山东宝恒房地产开发有限公司null王秀英山东省济南市商河县田园路南首58682116123785718@qq.com5000 万元民营企业山东宝恒房地产开发有限公司简介 来自深圳，智耕天下，远见成就未来！ 山东宝恒房地产开发有限公司有限公司，是一家专门从事房地产开发、经营、管理的专业公司。公司源自深圳，业务范围涉及天津、深圳、济南、潍坊、滨州等多个省市，累计开发住宅、商业数百万平方米，积累了十余年丰富的开发经验。实力造就金牌品质，荣誉闪耀品牌辉煌。 自公司成立以来，本着“高标准规划、高质量建设、高水平管理”的经营原则，以“心系客户，超值享受”为服务宗旨，牢固树立“质量第一，用户至上”的质量方针。长期以来，山东宝恒房地产开发有限公司始终将社区规划与居民利益相结合，将自然与人文文化融为一体，居室设计科学合理；同时把声誉视为企业生存的根本，努力打造诚信企业，在社会上树立了良好的企业形象，受到社会各界的好评。 山东宝恒房地产开发有限公司被山东大众报业集团地产部评为“2009年诚信建设单位”、投资开发的名门现代城项目，于2010年被评为“用户满意工程”、宝恒?水木清华项目被评为“2011年最值得期待十大楼盘”。山东宝恒房地产开发有限公司先后在企业信用、产品设计、工程质量、社区建设、社会回馈等多方面多次获得嘉奖，使宝恒品牌享誉全国。 山东宝恒房地产开发有限公司进入山东市场后，凭借良好的企业形象与独特的建筑设计理念，先后开发了名门现代城、玫瑰?太古城、金榜华庭、宝恒?水木清华、卓越?玫瑰园等项目，所开发的项目皆成为所在地区具代表性的楼盘，多数项目还相继被所在地区政府相关部门及社会大众评为优质小区。 山东宝恒房地产开发有限公司将继续巩固在山东省内的投资开发，并积极开拓新的市场、寻求新的投资项目。发扬企业精神，不断完善自我，为客户提供最满意的产品和服务，为创建和谐社会做出自己的贡献。');
INSERT INTO `reb` VALUES ('1701', '济南秋阳置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/bf4d0fc8-17b0-4705-b2bb-a26012f61537.shtml', '', '0161643', '黄波', '山东省济南市槐荫区地平梦世界一期（B-2）地块项目7号配套公建', '87299963', 'xiangmubu@runhua.com.cn', '1000 万元', '民营企业', '济南秋阳置业有限公司为山东地平置业有限公司的全资子公司，山东地平置业有限公司是二级开发资质企业，目前公司正在开发建设济南市槐荫区西客站片区，项目地理位置优越、交通方便，东接市区、西接长清区。 济南秋阳置业有限公司在槐荫区日照路南侧、滨州路西侧投资建设的地块C项目，土地出让合同编号“济南-01-2015-051号”，不动产权证书号：鲁（2015）济南市不动产权第0000064号，建设用地规划许可证号：地字第370104201700130号，建设工程规划许可证号：建字第370104201700171号。项目占地42105㎡，共11个单体，总建筑面积160221㎡，其中地上126315㎡，地下33906㎡。', '济南秋阳置业有限公司null黄波山东省济南市槐荫区地平梦世界一期（B-2）地块项目7号配套公建87299963xiangmubu@runhua.com.cn1000 万元民营企业济南秋阳置业有限公司为山东地平置业有限公司的全资子公司，山东地平置业有限公司是二级开发资质企业，目前公司正在开发建设济南市槐荫区西客站片区，项目地理位置优越、交通方便，东接市区、西接长清区。 济南秋阳置业有限公司在槐荫区日照路南侧、滨州路西侧投资建设的地块C项目，土地出让合同编号“济南-01-2015-051号”，不动产权证书号：鲁（2015）济南市不动产权第0000064号，建设用地规划许可证号：地字第370104201700130号，建设工程规划许可证号：建字第370104201700171号。项目占地42105㎡，共11个单体，总建筑面积160221㎡，其中地上126315㎡，地下33906㎡。');
INSERT INTO `reb` VALUES ('1702', '中铁十局集团投资开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/931af8a9-4025-4fb2-b3f5-a669af0607c9.shtml', '', '0161662', '王根宏', '济南市高新区工业南路59号中铁财智中心8号楼17、18层', '85598888', 'zysjfdc@163.com', '50000 万元', '国有企业', '中铁十局集团投资开发有限公司成立于2001年4月6日，是中铁十局集团唯一的集房地产开发与经营为主、房地产中介代理及咨询服务为一体的企业，注册资金2000万元，具有国家批准的房地产开发企业叁级资质。 公司成立以来，开发了“鲁铁·花样年华”项目、淄博东海春城项目、“中铁·汇展国际”项目、“中铁汇苑”项目。项目控股物业公司担负着24万多平方米住宅和办公楼的物业管理。 公司母公司中铁十局集团公司，年产值70亿元，具有强大的资金实力，为房地产开发提供了坚实的资金支持。房地产公司背靠集团公司，有一套管理严密的论证、营销、策划、效益保障体系，坚持以科学技术为先导，广泛应用现代管理和先进技术增强企业整体实力。 中铁十局集团投资开发有限公司，坚持“安全、优质、高效、重信”的经营宗旨，弘扬“诚信、和谐、求知、创新”的企业精神，实施大市场战略、管理创新战略、品牌战略、科技兴企战略、人才战略和企业文化战略，本着“服务社会、惠利用户”的经营理念，坚持“社会效益、环境效益、经济效益”为一体的原则，贯彻“统一规划、合理布局、配套完善、优质价廉”的经营方针，竭诚为广大用户提供满意的服务。', '中铁十局集团投资开发有限公司null王根宏济南市高新区工业南路59号中铁财智中心8号楼17、18层85598888zysjfdc@163.com50000 万元国有企业中铁十局集团投资开发有限公司成立于2001年4月6日，是中铁十局集团唯一的集房地产开发与经营为主、房地产中介代理及咨询服务为一体的企业，注册资金2000万元，具有国家批准的房地产开发企业叁级资质。 公司成立以来，开发了“鲁铁·花样年华”项目、淄博东海春城项目、“中铁·汇展国际”项目、“中铁汇苑”项目。项目控股物业公司担负着24万多平方米住宅和办公楼的物业管理。 公司母公司中铁十局集团公司，年产值70亿元，具有强大的资金实力，为房地产开发提供了坚实的资金支持。房地产公司背靠集团公司，有一套管理严密的论证、营销、策划、效益保障体系，坚持以科学技术为先导，广泛应用现代管理和先进技术增强企业整体实力。 中铁十局集团投资开发有限公司，坚持“安全、优质、高效、重信”的经营宗旨，弘扬“诚信、和谐、求知、创新”的企业精神，实施大市场战略、管理创新战略、品牌战略、科技兴企战略、人才战略和企业文化战略，本着“服务社会、惠利用户”的经营理念，坚持“社会效益、环境效益、经济效益”为一体的原则，贯彻“统一规划、合理布局、配套完善、优质价廉”的经营方针，竭诚为广大用户提供满意的服务。');
INSERT INTO `reb` VALUES ('1703', '山东省华森置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/9514fc81-4b75-4851-b5ee-cc865587c0a4.shtml', '', '0161656', '李华民', '济南市历下区兴港路8号', '88938777', '595561747@qq.com', '2560 万元', '民营企业', '山东省华森置业有限公司是山东华艺集团的核心企业之一，公司成立于2001年1月，注册资金2000万元，具有房地产三级开发资质。经营范围是房地产开发经营、建筑材料销售。公司下设办公室、财务部、项目部、工程部、销售部、供应部等管理部门。 公司成立以来在“诚信为本、持续发展”原则指导下，把创立品牌作为公司发展的基本战略。在开发过程中我公司始终坚持依法办事、诚信经营，本着“精心的规划设计、上乘的建筑质量、齐全的配套设施和完善的售后服务、大众化的精品路线、良好的市场信誉”的质量方针成功开发了“华森碧云天”项目。开发建设借鉴了国内外先进的开发理念和施工管理经验，以人为本，符合市场需要，取得了良好的业绩。 公司坚持高起点、高标准的企业管理思路，建立健全现代化企业制度，规范企业行为，始终贯彻以人为本的管理方针，以标准化、规范化管理手段提升员工队伍素质，以提高项目的科技、生态、文化含量为最终方向，努力建设现代化企业。', '山东省华森置业有限公司null李华民济南市历下区兴港路8号88938777595561747@qq.com2560 万元民营企业山东省华森置业有限公司是山东华艺集团的核心企业之一，公司成立于2001年1月，注册资金2000万元，具有房地产三级开发资质。经营范围是房地产开发经营、建筑材料销售。公司下设办公室、财务部、项目部、工程部、销售部、供应部等管理部门。 公司成立以来在“诚信为本、持续发展”原则指导下，把创立品牌作为公司发展的基本战略。在开发过程中我公司始终坚持依法办事、诚信经营，本着“精心的规划设计、上乘的建筑质量、齐全的配套设施和完善的售后服务、大众化的精品路线、良好的市场信誉”的质量方针成功开发了“华森碧云天”项目。开发建设借鉴了国内外先进的开发理念和施工管理经验，以人为本，符合市场需要，取得了良好的业绩。 公司坚持高起点、高标准的企业管理思路，建立健全现代化企业制度，规范企业行为，始终贯彻以人为本的管理方针，以标准化、规范化管理手段提升员工队伍素质，以提高项目的科技、生态、文化含量为最终方向，努力建设现代化企业。');
INSERT INTO `reb` VALUES ('1704', '山东中建西城楷悦置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/bb3752d3-02c3-49ce-a6df-bc694f70c811.shtml', '', '0161382', '左臣华', '济南市槐荫区泰安路1456号锦绣城14号楼二楼', '88805858', '1120832062@qq.com', '20000 万元', '国有企业', '山东中建西城楷悦置业有限公司是由中国建筑第八工程局有限公司和济南西城投资集团合资成立的山东中建西城投资有限公司的独资企业，公司注册于2011年11月，注册资金2000万元，用于开发位于济南市西客站片区安置一区南侧地块十二-2,十一-2，十-2。', '山东中建西城楷悦置业有限公司null左臣华济南市槐荫区泰安路1456号锦绣城14号楼二楼888058581120832062@qq.com20000 万元国有企业山东中建西城楷悦置业有限公司是由中国建筑第八工程局有限公司和济南西城投资集团合资成立的山东中建西城投资有限公司的独资企业，公司注册于2011年11月，注册资金2000万元，用于开发位于济南市西客站片区安置一区南侧地块十二-2,十一-2，十-2。');
INSERT INTO `reb` VALUES ('1705', '济南恒大绿洲置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/bb721209-9700-4fbb-857a-ed6aaf8396e3.shtml', '', '0161531', '廖嘉宁', '山东省济南市长清区大学路6155号', '83125288', '285785006@qq.com', '87000 万元', '民营企业', '恒大地产集团（香港联合交易所股票代码：3333）是集房地产规划设计、开发建设、物业管理于一体的现代化大型房地产综合企业。公司于2009年11月5日在香港联交所主板上市，是中国标准化运营的精品地产领导者，连续六年荣登中国房地产企业10强。集团拥有中国一级资质的房地产开发公司、中国甲级资质的建筑设计规划研究院、中国一级资质的建筑施工公司、中国一级资质的建筑监理公司、中国一级资质的物业管理公司。目前，公司在广州、天津、重庆、沈阳、武汉、成都、南京、西安、长沙、太原、昆明、合肥等全国24个主要城市拥有恒大华府、恒大名都、恒大城、恒大绿洲、恒大金碧天下等系列项目54个，覆盖高端、中端及中高端、旅游地产等多个产品系列。 济南恒大绿洲置业有限公司是恒大地产集团济南置业有限公司的全资子公司。', '济南恒大绿洲置业有限公司null廖嘉宁山东省济南市长清区大学路6155号83125288285785006@qq.com87000 万元民营企业恒大地产集团（香港联合交易所股票代码：3333）是集房地产规划设计、开发建设、物业管理于一体的现代化大型房地产综合企业。公司于2009年11月5日在香港联交所主板上市，是中国标准化运营的精品地产领导者，连续六年荣登中国房地产企业10强。集团拥有中国一级资质的房地产开发公司、中国甲级资质的建筑设计规划研究院、中国一级资质的建筑施工公司、中国一级资质的建筑监理公司、中国一级资质的物业管理公司。目前，公司在广州、天津、重庆、沈阳、武汉、成都、南京、西安、长沙、太原、昆明、合肥等全国24个主要城市拥有恒大华府、恒大名都、恒大城、恒大绿洲、恒大金碧天下等系列项目54个，覆盖高端、中端及中高端、旅游地产等多个产品系列。 济南恒大绿洲置业有限公司是恒大地产集团济南置业有限公司的全资子公司。');
INSERT INTO `reb` VALUES ('1706', '山东新华汇建设投资有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ce29bd6d-56eb-4921-84a2-1bc5b92a2828.shtml', '', '0161459', '胡静安', '济南市历下区花园路306号泉景恒展商务大厦1-1302室', '62337716', '1539514102@qq.com', '2000 万元', '国有企业', '山东新华汇建设投资有限公司是于2006年3月3日经济南市工商行政管理局批准注册的成立的有限责任公司，注册资本1500万元，主要经营：对房地产、建筑业、商业的投资与管理；电子技术开发；销售；电子产品。 公司职工高级职称3人，中级8人，初级3人，全部大专以上学历，是一支素质高、能力强，团结向上的工作团队。并已购置繁华地段开发土地一块，为公司发展打下良好基础。', '山东新华汇建设投资有限公司null胡静安济南市历下区花园路306号泉景恒展商务大厦1-1302室623377161539514102@qq.com2000 万元国有企业山东新华汇建设投资有限公司是于2006年3月3日经济南市工商行政管理局批准注册的成立的有限责任公司，注册资本1500万元，主要经营：对房地产、建筑业、商业的投资与管理；电子技术开发；销售；电子产品。 公司职工高级职称3人，中级8人，初级3人，全部大专以上学历，是一支素质高、能力强，团结向上的工作团队。并已购置繁华地段开发土地一块，为公司发展打下良好基础。');
INSERT INTO `reb` VALUES ('1707', '山东匡山琪鑫置业股份有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7806b4c0-2e21-442c-bb77-05549cf49a53.shtml', '', '0161355', '王万滨', '济南市槐荫区匡山小区幸福街9号', '85976522', 'Ksqxzy@126.com', '24633.3943 万元', '民营企业', '', '山东匡山琪鑫置业股份有限公司null王万滨济南市槐荫区匡山小区幸福街9号85976522Ksqxzy@126.com24633.3943 万元民营企业');
INSERT INTO `reb` VALUES ('1708', '济南都市报业房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/7902e165-7a45-4175-905b-48b3fd5963ff.shtml', '', '0161363', '王晓梅', '济南市槐荫区经十路29581号1614房间', '82886014', 'jnabd@sohu.com', '1000 万元', '国有企业', '济南都市报业房地产开发有限公司成立于2000年5月，由济南日报社、济南日报社印刷厂共同出资组建，注册资本金壹仟万元，主要从事于房地产开发、销售工作。公司实行董事会领导下的总经理负责制，设置了项目开发部、工程管理部、综合管理部、财务部等多个职能部门。', '济南都市报业房地产开发有限公司null王晓梅济南市槐荫区经十路29581号1614房间82886014jnabd@sohu.com1000 万元国有企业济南都市报业房地产开发有限公司成立于2000年5月，由济南日报社、济南日报社印刷厂共同出资组建，注册资本金壹仟万元，主要从事于房地产开发、销售工作。公司实行董事会领导下的总经理负责制，设置了项目开发部、工程管理部、综合管理部、财务部等多个职能部门。');
INSERT INTO `reb` VALUES ('1709', '济南嘉拓房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b2b440bf-5409-4f8f-94d0-36f585fada0c.shtml', '', '0161548', '林彬', '济南市长清区清河街中段路南', '87902066', '423322745@qq.com', '9100 万元', '民营企业', '济南嘉拓房地产开发有限公司是专为开发长清区房地产项目，由长清区政府招商引资而注册的，公司成立于二零零七年十一月，注册资本壹千万元。', '济南嘉拓房地产开发有限公司null林彬济南市长清区清河街中段路南87902066423322745@qq.com9100 万元民营企业济南嘉拓房地产开发有限公司是专为开发长清区房地产项目，由长清区政府招商引资而注册的，公司成立于二零零七年十一月，注册资本壹千万元。');
INSERT INTO `reb` VALUES ('1710', '济南嘉瑞房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b3480dba-c484-4e93-889c-81ff08dc654f.shtml', '', '016(py)0031', '张俊华', '济南市平阴县振兴街东段', '87678666', 'jinanjiarui@126.com', '1800 万元', '民营企业', '济南嘉瑞房地产开发有限公司于2003年3月12日成立，注册资金1800万。公司已开发环秀嘉园及嘉瑞铭城一期项目，已按期竣工并交付使用。现正在办理嘉瑞铭城二期手续。', '济南嘉瑞房地产开发有限公司null张俊华济南市平阴县振兴街东段87678666jinanjiarui@126.com1800 万元民营企业济南嘉瑞房地产开发有限公司于2003年3月12日成立，注册资金1800万。公司已开发环秀嘉园及嘉瑞铭城一期项目，已按期竣工并交付使用。现正在办理嘉瑞铭城二期手续。');
INSERT INTO `reb` VALUES ('1711', '山东建大合源置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8d914807-2524-4a93-a236-919d0ded9ebd.shtml', '', '0161415', '闫卫国', '港沟镇山东建筑大学新校区（西门北侧）', '58718060', 'jdzyhr@163.com', '2000 万元', '民营企业', '山东建大合源置业有限公司成立于2012年3月16日，开发建设的项目有建大花园。', '山东建大合源置业有限公司null闫卫国港沟镇山东建筑大学新校区（西门北侧）58718060jdzyhr@163.com2000 万元民营企业山东建大合源置业有限公司成立于2012年3月16日，开发建设的项目有建大花园。');
INSERT INTO `reb` VALUES ('1712', '济南华硕置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/3570b85f-29ad-4350-991a-76f2b48e68d7.shtml', '', '0161349', '赵民', '济北开发区龙海路1号1号楼4号商铺二楼', '81172877', '', '2000 万元', '民营企业', '济南华硕置业有限公司于2009年7月29日正式成立，注册资金2000万元人民币。现有员工13人，其中高级职称4人、中级职称5人、初级职称2人。 公司于2009年6月23日，以竞买方式竞得位于济阳县济北开发区开元大街与汇鑫路交叉口西北角的商品住房用地49.35亩。该地块规划建筑面积64000平方米。 一期工程1—5号楼已全面竣工，现已准备竣工验收；6—10号楼主体已验收，内外装正在施工中；11—12号楼桩基已验收，基础工程正在施工中，预计2012年底全面竣工。', '济南华硕置业有限公司null赵民济北开发区龙海路1号1号楼4号商铺二楼811728772000 万元民营企业济南华硕置业有限公司于2009年7月29日正式成立，注册资金2000万元人民币。现有员工13人，其中高级职称4人、中级职称5人、初级职称2人。 公司于2009年6月23日，以竞买方式竞得位于济阳县济北开发区开元大街与汇鑫路交叉口西北角的商品住房用地49.35亩。该地块规划建筑面积64000平方米。 一期工程1—5号楼已全面竣工，现已准备竣工验收；6—10号楼主体已验收，内外装正在施工中；11—12号楼桩基已验收，基础工程正在施工中，预计2012年底全面竣工。');
INSERT INTO `reb` VALUES ('1713', '山东融汇房地产有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/558a4fd8-60c0-48b7-90e1-cb60ff857894.shtml', '', '0161492', '黄祖仕', '济南市市中区纬三路47号', '81287162', '76811494@qq.com', '40000 万元', '民营企业', '山东融汇房地产公司于2010年8月12日成立，注册资金四亿元。2010年12月19日，山东融汇房地产有限公司签署《中山公园东片区棚户区改造项目土地熟化合作协议》，成为该项目的唯一投资熟化人。 山东融汇房地产有限公司秉承融汇集团“融汇城市梦想·筑就品质生活”的经营理念，以“融汇世界成就梦想”为使命，追求融汇世界卓越的人才和先进的科技、理念，把“融汇”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。', '山东融汇房地产有限公司null黄祖仕济南市市中区纬三路47号8128716276811494@qq.com40000 万元民营企业山东融汇房地产公司于2010年8月12日成立，注册资金四亿元。2010年12月19日，山东融汇房地产有限公司签署《中山公园东片区棚户区改造项目土地熟化合作协议》，成为该项目的唯一投资熟化人。 山东融汇房地产有限公司秉承融汇集团“融汇城市梦想·筑就品质生活”的经营理念，以“融汇世界成就梦想”为使命，追求融汇世界卓越的人才和先进的科技、理念，把“融汇”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。');
INSERT INTO `reb` VALUES ('1714', '山东鲁能朱家峪开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ded674d2-b439-43cb-abc4-f32de66cef05.shtml', '', '016（ZQ）014', '曲勇', '章丘市官庄乡朱家峪村', '18663707298', '', '6700 万元', '国有企业', '山东鲁能朱家峪开发有限公司位于国家级历史文化名村-朱家峪，2004年8月注册成立。 经营范围：旅游开发管理；房地产开发（凭资质经营）；机械电子设备、钢材、木材、五金交电、汽车（不含小轿车）及配件的销售；商品信息咨询服务。 所在地址：山东省章丘市 注册资金：6700万元 企业性质：国有企业 管理人员：22人', '山东鲁能朱家峪开发有限公司null曲勇章丘市官庄乡朱家峪村186637072986700 万元国有企业山东鲁能朱家峪开发有限公司位于国家级历史文化名村-朱家峪，2004年8月注册成立。 经营范围：旅游开发管理；房地产开发（凭资质经营）；机械电子设备、钢材、木材、五金交电、汽车（不含小轿车）及配件的销售；商品信息咨询服务。 所在地址：山东省章丘市 注册资金：6700万元 企业性质：国有企业 管理人员：22人');
