INSERT INTO `reb` VALUES ('1717', '济南保利城置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/78a049c5-bc07-4fdc-92be-5b3019c6ae02.shtml', '', '0161460', '李阳', '解放东路95号院内东楼303、304号', '82391888', '', '5000 万元', '国有企业', '济南保利城置业有限公司成立于2012年9月5日，由山东保利嘉园置业有限公司独资1000万元在济南市工商行政管理局注册成立注册成立。从事房地产开发与经营、物业管理和房地产营销策划等经营活动。公司拥有优秀的管理团队和丰富的房地产项目开发经验，凭借自身优势，在济南积极开拓房地产开发业务，为济南的经济发展做出贡献。', '济南保利城置业有限公司null李阳解放东路95号院内东楼303、304号823918885000 万元国有企业济南保利城置业有限公司成立于2012年9月5日，由山东保利嘉园置业有限公司独资1000万元在济南市工商行政管理局注册成立注册成立。从事房地产开发与经营、物业管理和房地产营销策划等经营活动。公司拥有优秀的管理团队和丰富的房地产项目开发经验，凭借自身优势，在济南积极开拓房地产开发业务，为济南的经济发展做出贡献。');
INSERT INTO `reb` VALUES ('1718', '济南永顺置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ff24181f-4188-4d94-9f40-b268b045af2c.shtml', '', '016(py)0027', '王业阔', '平阴县府前街23号', '87885106', 'jnyszy2010@163.com', '1800 万元', '民营企业', '公司成立于2008年1月，现有工程部、财务部、销售部等多个科室，现有职工总数28人，有职称的专业人员17人。2009年公司共完成房地产开发投资7055.43万元，竣工房屋面积54629.83万㎡，合格达到100%，无重大工程质量事故；2010年已完成房地产开发投资3382.58万元，施工房屋面积28188.18万㎡，合格率100%，无重大工程质量事故，现在建项目3143.3万㎡，该项目总投资700万元，已完成投资400万元，预计2010年下半年竣工。随着公司的发展，规模的不断壮大，相信我们以后会做的更好，更精，更扎实。', '济南永顺置业有限公司null王业阔平阴县府前街23号87885106jnyszy2010@163.com1800 万元民营企业公司成立于2008年1月，现有工程部、财务部、销售部等多个科室，现有职工总数28人，有职称的专业人员17人。2009年公司共完成房地产开发投资7055.43万元，竣工房屋面积54629.83万㎡，合格达到100%，无重大工程质量事故；2010年已完成房地产开发投资3382.58万元，施工房屋面积28188.18万㎡，合格率100%，无重大工程质量事故，现在建项目3143.3万㎡，该项目总投资700万元，已完成投资400万元，预计2010年下半年竣工。随着公司的发展，规模的不断壮大，相信我们以后会做的更好，更精，更扎实。');
INSERT INTO `reb` VALUES ('1719', '山东德海房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/f22cc5bf-50ec-41a5-8013-4e9b6e543b9f.shtml', '', '016(JY012)', '赵德海', '济阳县崔寨镇前街村中心街四区8号', '84581838', '', '1000 万元', '民营企业', '山东德海房地产开发有限公司成立于2007年，当年取得暂定资质证书，并于2009年升级为四级资质企业。公司现正致力于省城北跨的桥头堡——济阳县崔寨镇的各项建设中。', '山东德海房地产开发有限公司null赵德海济阳县崔寨镇前街村中心街四区8号845818381000 万元民营企业山东德海房地产开发有限公司成立于2007年，当年取得暂定资质证书，并于2009年升级为四级资质企业。公司现正致力于省城北跨的桥头堡——济阳县崔寨镇的各项建设中。');
INSERT INTO `reb` VALUES ('1720', '济南卓亚房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/1c216fcb-50c6-42b9-bf19-cf610a1320d5.shtml', '', '016(py)0034', '徐焕普', '榆山街道中桥口村', '053187855796', '', '1000 万元', '民营企业', '济南卓亚房地产开发有限公司成立于2011年8月12日，为聊城卓亚房地产开发有限公司投资的独立法人子公司。公司于2013年3月18日以挂牌方式取得中桥口水库以西、小区路以东、云翠街以南51302平方米的宗地，该宗地规划总建筑面积12万平方米，容积率2.1。', '济南卓亚房地产开发有限公司null徐焕普榆山街道中桥口村0531878557961000 万元民营企业济南卓亚房地产开发有限公司成立于2011年8月12日，为聊城卓亚房地产开发有限公司投资的独立法人子公司。公司于2013年3月18日以挂牌方式取得中桥口水库以西、小区路以东、云翠街以南51302平方米的宗地，该宗地规划总建筑面积12万平方米，容积率2.1。');
INSERT INTO `reb` VALUES ('1721', '山东安和置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/4461ead8-de97-417e-86b5-ed7e2addcefc.shtml', '', '016669', '马莹', '转山西路3号222室', '86078888', 'qlzy-zh@vip.163.com', '12000 万元', '民营企业', '山东安和置业有限公司成立于2010年6月30日，公司位于济南市历下区解放东路95号，主要从事房地产的开发与经营。现公司在济南市国土资源局通过挂牌方式，取得济南奥体中心核心商圈2010-G072地块国有土地使用权，土地用途为商业金融业，此项目地上容积率不大于4.5，地下容积率不大于1.8，建筑密度不大于30%，绿地路不小于30%，我公司拟把该项目打造成高品质的综合楼，目前此项目正在办理前期各项手续和方案设计阶段。', '山东安和置业有限公司null马莹转山西路3号222室86078888qlzy-zh@vip.163.com12000 万元民营企业山东安和置业有限公司成立于2010年6月30日，公司位于济南市历下区解放东路95号，主要从事房地产的开发与经营。现公司在济南市国土资源局通过挂牌方式，取得济南奥体中心核心商圈2010-G072地块国有土地使用权，土地用途为商业金融业，此项目地上容积率不大于4.5，地下容积率不大于1.8，建筑密度不大于30%，绿地路不小于30%，我公司拟把该项目打造成高品质的综合楼，目前此项目正在办理前期各项手续和方案设计阶段。');
INSERT INTO `reb` VALUES ('1722', '商河城镇开发置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/e7cd8931-2a7b-4294-9766-179fd8938557.shtml', '', '016SH005', '牟超', '鑫源路建行办公楼二楼', '68781061', '392232742@qq.com', '19578 万元', '国有企业', '商河城镇开发置业有限公司成立于2013年05月16日，是商河国有资本投资运营集团有限公司下设的子公司，注册资金10000万元。', '商河城镇开发置业有限公司null牟超鑫源路建行办公楼二楼68781061392232742@qq.com19578 万元国有企业商河城镇开发置业有限公司成立于2013年05月16日，是商河国有资本投资运营集团有限公司下设的子公司，注册资金10000万元。');
