INSERT INTO `reb` VALUES ('1724', '济南新城地产有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/74b50df6-d0bd-4d14-9b8e-d5007b7c816a.shtml', '', '016518', '薛振友', '济南市历城区工业北路69-1号', '88820525', 'quxinjiaisme@126.com', '120000 万元', '民营企业', '济南新城地产有限公司隶属于山东天鸿置业开发有限公司，在济南东北部，开发的天鸿·田园新城项目开始建设。天鸿地产以多年来在北京进行区域城市开发的经验全面的规划该项目，建成以后的天鸿·田园新城项目将会成为一个具有齐全的生活、娱乐配套的社区，并会成为未来的东部新城市核心区。', '济南新城地产有限公司null薛振友济南市历城区工业北路69-1号88820525quxinjiaisme@126.com120000 万元民营企业济南新城地产有限公司隶属于山东天鸿置业开发有限公司，在济南东北部，开发的天鸿·田园新城项目开始建设。天鸿地产以多年来在北京进行区域城市开发的经验全面的规划该项目，建成以后的天鸿·田园新城项目将会成为一个具有齐全的生活、娱乐配套的社区，并会成为未来的东部新城市核心区。');
INSERT INTO `reb` VALUES ('1725', '山东科信远景置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/f9fc17cd-1e65-4d8e-b175-1af33b775f7f.shtml', '', '0161322', '张咏强', '舜风路322号2号楼201-7', '88870587', 'liujuan5246@163.com', '2000 万元', '民营企业', '山东科信远景置业有限公司成立于2013年6月，主营业务涉及工业园区的开发；城市基础设施建设；房地产开发经营；房地产经纪服务；房屋租赁；物业管理；以自有资金进行投资等。公司开发的项目为济南市高新区战略性新兴产业基地，位于高新区春晖路以东、科远路以北。', '山东科信远景置业有限公司null张咏强舜风路322号2号楼201-788870587liujuan5246@163.com2000 万元民营企业山东科信远景置业有限公司成立于2013年6月，主营业务涉及工业园区的开发；城市基础设施建设；房地产开发经营；房地产经纪服务；房屋租赁；物业管理；以自有资金进行投资等。公司开发的项目为济南市高新区战略性新兴产业基地，位于高新区春晖路以东、科远路以北。');
