INSERT INTO `reb` VALUES ('1728', '山东嘉铭置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b575bf64-37da-4c1a-bc1d-34c69d5e1f7d.shtml', '', '0161462', '于大卫', '幸福柳路8号2层', '81666708', 'liulili@samtak.cn', '2000 万元', '民营企业', '山东嘉铭置业有限公司成立于2015年9月18日，注册资本2000万元。经营范围为房地产开发、销售。 公司按照现代企业制度的管理模式，遵循有限责任公司制度的运作方式，下设人力行政部、营销部、工程部、财务部，在总经理的领导下，通力合作，相互协调，初步形成了一个团结上进、勇于开拓的企业团队。', '山东嘉铭置业有限公司null于大卫幸福柳路8号2层81666708liulili@samtak.cn2000 万元民营企业山东嘉铭置业有限公司成立于2015年9月18日，注册资本2000万元。经营范围为房地产开发、销售。 公司按照现代企业制度的管理模式，遵循有限责任公司制度的运作方式，下设人力行政部、营销部、工程部、财务部，在总经理的领导下，通力合作，相互协调，初步形成了一个团结上进、勇于开拓的企业团队。');
