INSERT INTO `reb` VALUES ('1730', '济南三盛房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/94ac05d7-95b8-4f49-8527-c5b709691922.shtml', '', '0161448', '林荣滨', '舜华路2000号舜泰广场8号楼1-201-1房间', '88208833', 'xta26020@126.com', '10000 万元', '中外合资经营企业', '三盛地产是三盛集团旗下三大产业之一的全资企业。地产集团总部和子公司分布在香港、福建、四川、武汉、江西、北京、济南等地，形成了以房地产开发为核心，以物业管理等相关行业为配套的专业化地产集团。 2014三盛地产正式进驻济南，作为三盛地产集团迈向全国的重要一步，济南区域公司将秉承三盛地产集团“激情投入，坦诚共赢”的企业文化，继续致力于推动城市发展高品质房地产开发。', '济南三盛房地产开发有限公司null林荣滨舜华路2000号舜泰广场8号楼1-201-1房间88208833xta26020@126.com10000 万元中外合资经营企业三盛地产是三盛集团旗下三大产业之一的全资企业。地产集团总部和子公司分布在香港、福建、四川、武汉、江西、北京、济南等地，形成了以房地产开发为核心，以物业管理等相关行业为配套的专业化地产集团。 2014三盛地产正式进驻济南，作为三盛地产集团迈向全国的重要一步，济南区域公司将秉承三盛地产集团“激情投入，坦诚共赢”的企业文化，继续致力于推动城市发展高品质房地产开发。');
INSERT INTO `reb` VALUES ('1731', '济南鑫苑万卓置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/07ba1996-26d2-406e-b9f3-ac66f368c147.shtml', '', '0161631', '张立洲', '齐州路西城大厦1302室', '053187912228', 'boya.wang@xyre.com', '30000 万元', '民营企业', '济南鑫苑万卓置业有限公司成立于2013年12月4日，其股东为山东鑫苑置业有限公司，作为山东鑫苑置业有限公司的全资子公司，济南鑫苑万卓置业有限公司将继续秉承鑫苑公司“追求进步，超越自我”的企业精神，以“创建美好家园是我们的共同心愿”为使命，积极致力于改善济南市民居住环境和城市高尚社区的开发建设，全面做好鑫苑在济南西客站片区的项目开发建设工作。', '济南鑫苑万卓置业有限公司null张立洲齐州路西城大厦1302室053187912228boya.wang@xyre.com30000 万元民营企业济南鑫苑万卓置业有限公司成立于2013年12月4日，其股东为山东鑫苑置业有限公司，作为山东鑫苑置业有限公司的全资子公司，济南鑫苑万卓置业有限公司将继续秉承鑫苑公司“追求进步，超越自我”的企业精神，以“创建美好家园是我们的共同心愿”为使命，积极致力于改善济南市民居住环境和城市高尚社区的开发建设，全面做好鑫苑在济南西客站片区的项目开发建设工作。');
