INSERT INTO `reb` VALUES ('1738', '济阳县华宇置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/fa449ffc-1ade-4c05-9e92-a9d52955422d.shtml', '', '016(JY020)', '陈国良', '济阳县济北街道汇鑫苑社区12号楼1单元202室', '58609566', '', '1000 万元', '民营企业', '济阳县华宇置业有限公司成立于2012年12月14日，是以主营房地产开发的民营企业，公司董事长陈国良。公司现有员工31人，其中管理人员12名，大专以上学历者8名，具有高、中、初级专业职称者4名。注册资金1仟万元。 公司秉持海纳百川，广纳贤才，上下同欲，以义取利的企业精神，众成华宇，志成辉煌是企业追求的目标。 　　公司文化理念为：诚为本，德为基，情为重，艺为高。 　　公司经营信条为：诚信、务实、创新、守法。 　　公司经营策略为：高人一等，快人一步，赢在战略，胜在品牌。 　　公司管理模式为：整合资源，统而用之，落实责任，分而治之。', '济阳县华宇置业有限公司null陈国良济阳县济北街道汇鑫苑社区12号楼1单元202室586095661000 万元民营企业济阳县华宇置业有限公司成立于2012年12月14日，是以主营房地产开发的民营企业，公司董事长陈国良。公司现有员工31人，其中管理人员12名，大专以上学历者8名，具有高、中、初级专业职称者4名。注册资金1仟万元。 公司秉持海纳百川，广纳贤才，上下同欲，以义取利的企业精神，众成华宇，志成辉煌是企业追求的目标。 　　公司文化理念为：诚为本，德为基，情为重，艺为高。 　　公司经营信条为：诚信、务实、创新、守法。 　　公司经营策略为：高人一等，快人一步，赢在战略，胜在品牌。 　　公司管理模式为：整合资源，统而用之，落实责任，分而治之。');
