INSERT INTO `reb` VALUES ('1740', '济南融润房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/35263ba4-01b3-4e07-addf-59110c711b82.shtml', '', '0161437', '王长珠', '泺口街道赵庄居委会综合办公楼', '82707679', '229283537@qq.com', '6000 万元', '民营企业', '济南融润房地产开发有限公司是加州房地产公司集团下属子公司，主要业务涉及房地产开发建设、房产投资、建筑工程施工、建筑装饰工程等。近十年来，在福建、江苏、湖南、武汉、山东等省市累计开发超过300万平方米的商住房，并有超过2000亩的开发储备地。', '济南融润房地产开发有限公司null王长珠泺口街道赵庄居委会综合办公楼82707679229283537@qq.com6000 万元民营企业济南融润房地产开发有限公司是加州房地产公司集团下属子公司，主要业务涉及房地产开发建设、房产投资、建筑工程施工、建筑装饰工程等。近十年来，在福建、江苏、湖南、武汉、山东等省市累计开发超过300万平方米的商住房，并有超过2000亩的开发储备地。');
