INSERT INTO `reb` VALUES ('1750', '济南柯基置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/24ad8ba7-1b58-4175-92d1-505096a1109f.shtml', '', '016(JY001)', '徐恩明', '济阳县富强街24号沿街楼一楼', '053184237113', 'jinankeji@163.com', '1800 万元', '民营企业', '济南柯基置业有限公司位于济南市济阳县富强街24号，成立于2014年3月20日，公司注册资金壹仟捌佰万元，管理人员15人，主要从事房地产开发、销售。公司设有开发设计部、工程管理部、综合事业部、财务部，公司拥有高级职称3人，中级职称5人，初级2人。公司宗旨“以人性、健康为开发设计理念，建设绿化、舒适的居住环境”。', '济南柯基置业有限公司null徐恩明济阳县富强街24号沿街楼一楼053184237113jinankeji@163.com1800 万元民营企业济南柯基置业有限公司位于济南市济阳县富强街24号，成立于2014年3月20日，公司注册资金壹仟捌佰万元，管理人员15人，主要从事房地产开发、销售。公司设有开发设计部、工程管理部、综合事业部、财务部，公司拥有高级职称3人，中级职称5人，初级2人。公司宗旨“以人性、健康为开发设计理念，建设绿化、舒适的居住环境”。');
INSERT INTO `reb` VALUES ('1751', '济南市闽台中天房地产有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/46dce398-07bb-4cfc-82ad-ec7134963daa.shtml', '', '0161338', '林福伙', '双山街道办事处城东工业园三涧大道东侧双山创业服务中心302室', '83338333', '332974573@qq.com', '16800 万元', '民营企业', '济南市闽台中天房地产有限公司成立于2014年5月16日，注册资金壹亿陆仟捌佰万元整。主要从事房地产开发、销售（凭资质）；出租和管理自建商品房及配套设施；房地产信息咨询；物业管理；建筑工程、市政工程设计、施工（凭资质）；建筑安装工程施工（凭资质）。', '济南市闽台中天房地产有限公司null林福伙双山街道办事处城东工业园三涧大道东侧双山创业服务中心302室83338333332974573@qq.com16800 万元民营企业济南市闽台中天房地产有限公司成立于2014年5月16日，注册资金壹亿陆仟捌佰万元整。主要从事房地产开发、销售（凭资质）；出租和管理自建商品房及配套设施；房地产信息咨询；物业管理；建筑工程、市政工程设计、施工（凭资质）；建筑安装工程施工（凭资质）。');
