INSERT INTO `reb` VALUES ('1758', '济南综合保税区开发投资集团有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/ef33265f-9fbf-4d4c-a1f1-196f2db5ebfa.shtml', '', '0161394', '杨文明', '港兴一路899号1号楼1-410', '88237901', 'gaoxinchanye@163.com', '84188 万元', '国有企业', '济南综合保税区开发投资集团有限公司（原山东高芯产业发展有限公司）于2013年9月3日成立。 2015年3月11日原山东高芯产业发展有限公司变更为山东高芯产业集团有限公司。 2015年4月10日山东高芯产业集团有限公司变更为济南综合保税区开发投资集团有限公司。 2015年5月26日济南综合保税区开发投资集团有限公司取得房地产开发企业暂定资质证书。 济南综合保税区开发投资集团有限公司经营范围为以自有资金进行投资，房地产开发经营；计算机软硬件技术开发；国内贸易代理；城市基础设施建设；企业管理咨询服务；建筑及园林绿化工程；房屋租赁；建材的销售；货物及技术进出口。', '济南综合保税区开发投资集团有限公司null杨文明港兴一路899号1号楼1-41088237901gaoxinchanye@163.com84188 万元国有企业济南综合保税区开发投资集团有限公司（原山东高芯产业发展有限公司）于2013年9月3日成立。 2015年3月11日原山东高芯产业发展有限公司变更为山东高芯产业集团有限公司。 2015年4月10日山东高芯产业集团有限公司变更为济南综合保税区开发投资集团有限公司。 2015年5月26日济南综合保税区开发投资集团有限公司取得房地产开发企业暂定资质证书。 济南综合保税区开发投资集团有限公司经营范围为以自有资金进行投资，房地产开发经营；计算机软硬件技术开发；国内贸易代理；城市基础设施建设；企业管理咨询服务；建筑及园林绿化工程；房屋租赁；建材的销售；货物及技术进出口。');
INSERT INTO `reb` VALUES ('1759', '济南泉升置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/959768ad-a0b2-450a-bb70-9ac12f6fffa2.shtml', '', '0161515', '邹景泉', '济南市经济开发区经十西路7888号', '87218898', '87998018@163.com', '2000 万元', '民营企业', '济南泉升置业有限公司，成立于2013年4月10日，是一家股份制企业，是以房地产开发、销售为主的房地产开发公司，注册资金人民币2000万元。 我公司将以“以顾客为中心，以市场需求为导向，开发建设精品工程，树企业形象、与时俱进，追求持续卓越”的方针。公司将严格按照现代化企业制度规范运作，合法经营，开拓创新，铸造精品，为顾客提供优良的服务和满意的产品。', '济南泉升置业有限公司null邹景泉济南市经济开发区经十西路7888号8721889887998018@163.com2000 万元民营企业济南泉升置业有限公司，成立于2013年4月10日，是一家股份制企业，是以房地产开发、销售为主的房地产开发公司，注册资金人民币2000万元。 我公司将以“以顾客为中心，以市场需求为导向，开发建设精品工程，树企业形象、与时俱进，追求持续卓越”的方针。公司将严格按照现代化企业制度规范运作，合法经营，开拓创新，铸造精品，为顾客提供优良的服务和满意的产品。');
INSERT INTO `reb` VALUES ('1760', '济南鑫茂新兴科技产业园置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/fa19bbf7-c601-4272-82c5-18b60472fdf3.shtml', '', '0161599', '杜克荣', '桑梓店镇308国道以北济南化工产业园区内裕兴路以西、鑫源大道以南', '55715600', '232206822@qq.com', '5000 万元', '民营企业', '济南鑫茂新兴科技产业园有限公司成立于2012年12月，公司注册资本为人民币3000万元，法人代表为杜克荣，主要经营范围为：技术开发、转让、服务（新型建筑材料、结构体系、施工技术及设备的技术及产品）；用自有资金对科技企业投资；文化艺术交流服务（演出除外）；房地产开发及销售；商品房销售代理、房地产信息咨询；自有房屋租赁；科技企业孵化；物业管理；转口贸易、贸易项下加工整理及相关业务代理、咨询服务。 该公司是由济南化工产业园有限公司与天津鑫茂科技投资集团有限公司为在济南新材料产业园区内共同开发建设、经营管理鑫茂？齐鲁科技城而组建的。', '济南鑫茂新兴科技产业园置业有限公司null杜克荣桑梓店镇308国道以北济南化工产业园区内裕兴路以西、鑫源大道以南55715600232206822@qq.com5000 万元民营企业济南鑫茂新兴科技产业园有限公司成立于2012年12月，公司注册资本为人民币3000万元，法人代表为杜克荣，主要经营范围为：技术开发、转让、服务（新型建筑材料、结构体系、施工技术及设备的技术及产品）；用自有资金对科技企业投资；文化艺术交流服务（演出除外）；房地产开发及销售；商品房销售代理、房地产信息咨询；自有房屋租赁；科技企业孵化；物业管理；转口贸易、贸易项下加工整理及相关业务代理、咨询服务。 该公司是由济南化工产业园有限公司与天津鑫茂科技投资集团有限公司为在济南新材料产业园区内共同开发建设、经营管理鑫茂？齐鲁科技城而组建的。');
INSERT INTO `reb` VALUES ('1761', '山东信伟置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/294f4baf-a827-4f53-97aa-17825fadcff8.shtml', '', '0161594', '于大卫', '幸福柳8号', '81666708', 'liulili@samtak.cn', '6094 万元', '民营企业', '　山东信伟置业有限公司成立于2010年12月3日，注册资本6094万元。经营范围为房地产开发经营、销售，房地产投资咨询，建筑工程施工，建材销售。公司按照现代企业制度的管理模式，遵循有限责任公司制度的运作方式，下设人力行政部、营销部、工程部、财务部，在总经理的领导下，通力合作，相互协调，初步形成了一个团结上进、勇于开拓的企业团队。', '山东信伟置业有限公司null于大卫幸福柳8号81666708liulili@samtak.cn6094 万元民营企业　山东信伟置业有限公司成立于2010年12月3日，注册资本6094万元。经营范围为房地产开发经营、销售，房地产投资咨询，建筑工程施工，建材销售。公司按照现代企业制度的管理模式，遵循有限责任公司制度的运作方式，下设人力行政部、营销部、工程部、财务部，在总经理的领导下，通力合作，相互协调，初步形成了一个团结上进、勇于开拓的企业团队。');
INSERT INTO `reb` VALUES ('1762', '山东乐水置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/473f7f46-21c5-4069-8d94-efd3597d97aa.shtml', '', '0161337', '黄运林', '济南市槐荫区正华园小区4号楼一楼', '68610577', '', '2000 万元', '民营企业', '山东乐水置业有限公司是由济南万科房地产开发有限公司和山东龙腾房地产开发有限公司共同出资成立的专业从事房地产开发的公司。目前开发公园里项目。该项目位于槐荫区，西侧紧邻二环西路，交通便利，距离西客站仅3公里,距离济南火车站仅4公里，距离大明湖、万达广场等济南老城区核心约5公里，且南侧紧邻800亩森林公园，土地属性为稀缺G2类土地属性，项目涵盖高档住宅、商业等，计划总投资15亿人民币。', '山东乐水置业有限公司null黄运林济南市槐荫区正华园小区4号楼一楼686105772000 万元民营企业山东乐水置业有限公司是由济南万科房地产开发有限公司和山东龙腾房地产开发有限公司共同出资成立的专业从事房地产开发的公司。目前开发公园里项目。该项目位于槐荫区，西侧紧邻二环西路，交通便利，距离西客站仅3公里,距离济南火车站仅4公里，距离大明湖、万达广场等济南老城区核心约5公里，且南侧紧邻800亩森林公园，土地属性为稀缺G2类土地属性，项目涵盖高档住宅、商业等，计划总投资15亿人民币。');
INSERT INTO `reb` VALUES ('1763', '山东中投建邦置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/709ca983-f96b-47f2-95c9-a8061db5c913.shtml', '', '0161339', '陈箭', '济南市历下区龙奥北路8号玉兰广场壹号办公楼7层701室', '58708166', '521180035@qq.com', '10000 万元', '民营企业', '融创中国是一家于香港联交所上市的专业从事住宅及商业地产综合开发的企业，在京、津、沪、渝、杭拥有众多处于不同发展阶段的项目，产品涵盖高端住宅、别墅、商业、写字楼等多种物业类型，公司专注于高端物业的开发和管理。2013年获得中国房地产上市公司排行榜第10名，中国房地产企业年度销售TOP50第11名。2014年5月，融创中国以63亿港元收购绿城集团（2013年销售额全国第十名）24%股份，成为绿城第一大股东，近年来房地产界最大的一场并购案，进一步增强了融创的实力。山东建邦集团是一家股份制企业，注册资本2.43亿元。经过多年的发展，公司逐渐成长为有较大资产规模和较强经济实力的企业化集团，形成了以基础设施、房地产、金融投资、文化传媒、新材料产业五大板块为核心的业务领域。 秉承融创高端精品战略，融创中国、建邦泛亚强强联合，打造济南奥体CBD中心地段首个都会综合体——转山西路项目。该项目占地约500亩，总建筑面积160万方，紧靠经十路，东临奥体中心，西靠历下公园，位于济南市绝版黄金地段。项目涵盖金融总部基地、甲级商务办公集群、五星级酒店公寓、国际时尚商街、高端生态住区五大产品业态，属于济南奥体CBD内规模最大品质最高的大型都会综合体项目。', '山东中投建邦置业有限公司null陈箭济南市历下区龙奥北路8号玉兰广场壹号办公楼7层701室58708166521180035@qq.com10000 万元民营企业融创中国是一家于香港联交所上市的专业从事住宅及商业地产综合开发的企业，在京、津、沪、渝、杭拥有众多处于不同发展阶段的项目，产品涵盖高端住宅、别墅、商业、写字楼等多种物业类型，公司专注于高端物业的开发和管理。2013年获得中国房地产上市公司排行榜第10名，中国房地产企业年度销售TOP50第11名。2014年5月，融创中国以63亿港元收购绿城集团（2013年销售额全国第十名）24%股份，成为绿城第一大股东，近年来房地产界最大的一场并购案，进一步增强了融创的实力。山东建邦集团是一家股份制企业，注册资本2.43亿元。经过多年的发展，公司逐渐成长为有较大资产规模和较强经济实力的企业化集团，形成了以基础设施、房地产、金融投资、文化传媒、新材料产业五大板块为核心的业务领域。 秉承融创高端精品战略，融创中国、建邦泛亚强强联合，打造济南奥体CBD中心地段首个都会综合体——转山西路项目。该项目占地约500亩，总建筑面积160万方，紧靠经十路，东临奥体中心，西靠历下公园，位于济南市绝版黄金地段。项目涵盖金融总部基地、甲级商务办公集群、五星级酒店公寓、国际时尚商街、高端生态住区五大产品业态，属于济南奥体CBD内规模最大品质最高的大型都会综合体项目。');
INSERT INTO `reb` VALUES ('1764', '济南海智房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/48cc1936-7ef7-4784-abb4-2396ba53b95b.shtml', '', '0161344', '赵凤存', '水屯北路2号北园街道办事处', '55666011', '1044058466@qq.com', '5000 万元', '民营企业', '', '济南海智房地产开发有限公司null赵凤存水屯北路2号北园街道办事处556660111044058466@qq.com5000 万元民营企业');
INSERT INTO `reb` VALUES ('1765', '济南西城世中置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/eb084cf1-2198-4aa8-ad02-23b845cd6887.shtml', '', '0161628', '史海成', '济南长清区崮云湖街道办事处丹凤小区北区大彦管区办公室203房间', '69909177', '470912812@qq.com', '100000 万元', '国有企业', '济南西城投资开发集团有限公司是2011年9月成立的国有独资有限责任企业，主要负责大学科技园片区、西客站片区、济西湿地生态区三个片区为核心共计450平方公里土地西部新城的开发建设。济南西城世中置业有限公司作为济南西城投资开发集团有限公司的全资子公司济南西城置业的子公司，将坚持集团理念，为济南“加快科学发展、建设美丽泉城”做出重大贡献。', '济南西城世中置业有限公司null史海成济南长清区崮云湖街道办事处丹凤小区北区大彦管区办公室203房间69909177470912812@qq.com100000 万元国有企业济南西城投资开发集团有限公司是2011年9月成立的国有独资有限责任企业，主要负责大学科技园片区、西客站片区、济西湿地生态区三个片区为核心共计450平方公里土地西部新城的开发建设。济南西城世中置业有限公司作为济南西城投资开发集团有限公司的全资子公司济南西城置业的子公司，将坚持集团理念，为济南“加快科学发展、建设美丽泉城”做出重大贡献。');
INSERT INTO `reb` VALUES ('1766', '山东北城庆合置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c1bb27b3-c445-4013-bfed-65e738a425fb.shtml', '', '0161510', '李金勇', '新泺大街786号济南大陆机电股份有限公司办公楼504房间', '81256789', '250297286@qq.com', '1800 万元', '民营企业', '我公司山东北城庆合置业有限公司成立于2012年1月，注册资金1800万元人民币，公司住所：济南市高新区新泺大街786号济南大陆机电股份有限公司办公楼504房间，公司一般经营项目：房地产开发、经营。', '山东北城庆合置业有限公司null李金勇新泺大街786号济南大陆机电股份有限公司办公楼504房间81256789250297286@qq.com1800 万元民营企业我公司山东北城庆合置业有限公司成立于2012年1月，注册资金1800万元人民币，公司住所：济南市高新区新泺大街786号济南大陆机电股份有限公司办公楼504房间，公司一般经营项目：房地产开发、经营。');
INSERT INTO `reb` VALUES ('1767', '济南和瑞地产有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/13d77461-ddd3-4397-9d94-1f036746fb90.shtml', '', '0161621', '姜小作', '济南市历下区解放路16号506室', '67899576', '1147565111@qq.com', '2000 万元', '民营企业', '', '济南和瑞地产有限公司null姜小作济南市历下区解放路16号506室678995761147565111@qq.com2000 万元民营企业');
INSERT INTO `reb` VALUES ('1768', '济南申融房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/614d66c2-533c-4bb5-a614-653aec962cbb.shtml', '', '0161256', '高文强', '五峰路南段路西综合楼', '82665899', 'shenrong12345@163.com', '2000 万元', '民营企业', '济南申融房地产开发有限公司是2013年3月由长清区政府招商引资的房地产开发企业。公司坐落在济南市长清区，注册资金2000万元。主营房地产开发，股东为山东申融投资有限公司。现有员工58人，其中高级职称5人，中级职称12人。 　　　工资按照现代化企业制度管理模式遵循有限责任公司制度的运作方式，下设市场研发拓展中心、综合部、企划营销推广部、工程部及财务部，在高文强董事长的带领下，通力合作，相互协调，初步形成了一个积极上进、勇于开拓的企业团队。公司始终坚持以市场为导向、发展为重点，经营为龙头，质量为根本的发展理念和经营方针，紧紧围绕市场狠抓经营，强化管理，不断研究和观察投资市场行情，积极探索与市场机制相适应的经营模式和发展策略，走品牌化之路。 公司目前开发建设的原山官邸项目位于济南市长清区城区南段，文昌片玉峰山路南段路东，该项目规划建设总用地面积为168亩，分三期建设，一期为A地块57亩，二期为B地块43亩，三期为C地块68亩。我公司于2013年9月25日在济南市国土局摘得该项目第一期A地块，10月5日我公司与济南市国土资源局签订（长清区农药厂地块）国有建设用地使用权出让合同，现已办理了土地使用证。在当地政府和有关部门的大力支持下，现在已入场，正在积极完善各项手续，进行开工建设。', '济南申融房地产开发有限公司null高文强五峰路南段路西综合楼82665899shenrong12345@163.com2000 万元民营企业济南申融房地产开发有限公司是2013年3月由长清区政府招商引资的房地产开发企业。公司坐落在济南市长清区，注册资金2000万元。主营房地产开发，股东为山东申融投资有限公司。现有员工58人，其中高级职称5人，中级职称12人。 　　　工资按照现代化企业制度管理模式遵循有限责任公司制度的运作方式，下设市场研发拓展中心、综合部、企划营销推广部、工程部及财务部，在高文强董事长的带领下，通力合作，相互协调，初步形成了一个积极上进、勇于开拓的企业团队。公司始终坚持以市场为导向、发展为重点，经营为龙头，质量为根本的发展理念和经营方针，紧紧围绕市场狠抓经营，强化管理，不断研究和观察投资市场行情，积极探索与市场机制相适应的经营模式和发展策略，走品牌化之路。 公司目前开发建设的原山官邸项目位于济南市长清区城区南段，文昌片玉峰山路南段路东，该项目规划建设总用地面积为168亩，分三期建设，一期为A地块57亩，二期为B地块43亩，三期为C地块68亩。我公司于2013年9月25日在济南市国土局摘得该项目第一期A地块，10月5日我公司与济南市国土资源局签订（长清区农药厂地块）国有建设用地使用权出让合同，现已办理了土地使用证。在当地政府和有关部门的大力支持下，现在已入场，正在积极完善各项手续，进行开工建设。');
