INSERT INTO `reb` VALUES ('1773', '山东铭晖置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/bb1dfca2-18f6-40cc-a6ee-64202ce9e3ca.shtml', '', '0161334', '许金岑', '商河县城区产业园新兴街', '053182339997', '', '5000 万元', '民营企业', '山东铭晖置业有限公司成立于2013年8月，注册资本5000万人民币，公司坐落于山东商河县规划府东路以西、花园街以南，土地面积31.75亩。', '山东铭晖置业有限公司null许金岑商河县城区产业园新兴街0531823399975000 万元民营企业山东铭晖置业有限公司成立于2013年8月，注册资本5000万人民币，公司坐落于山东商河县规划府东路以西、花园街以南，土地面积31.75亩。');
