INSERT INTO `reb` VALUES ('1776', '济南东城帝华房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8881f193-3c6d-43d7-a32f-a43df68000bc.shtml', '', '0161627', '李再东', '历城区唐冶新区围子山路1号唐冶管委会院内', '80989775', '908101502@qq.com', '20000 万元', '民营企业', '济南东城房地产开发有限公司成立于2013年11月1日。在山东省济南市唐冶新区，公司已经通过招拍挂的方式获得了土地几百亩，精心打造集居住、商务、休闲等功能与一体的生态园林精品地产项目。 项目位于济南市历城区唐冶新区，紧邻山东省会济南市，北依世纪大道，南临经十东路，交通十分便利。 济南东城房地产开发有限公司在唐冶片区的开工建设，必将成为济南市城市东跨城镇化战略的重要一步，引领济南市东部新城建设的居住潮流，为济南东部的城市建设增添一道靓丽的风景线', '济南东城帝华房地产开发有限公司null李再东历城区唐冶新区围子山路1号唐冶管委会院内80989775908101502@qq.com20000 万元民营企业济南东城房地产开发有限公司成立于2013年11月1日。在山东省济南市唐冶新区，公司已经通过招拍挂的方式获得了土地几百亩，精心打造集居住、商务、休闲等功能与一体的生态园林精品地产项目。 项目位于济南市历城区唐冶新区，紧邻山东省会济南市，北依世纪大道，南临经十东路，交通十分便利。 济南东城房地产开发有限公司在唐冶片区的开工建设，必将成为济南市城市东跨城镇化战略的重要一步，引领济南市东部新城建设的居住潮流，为济南东部的城市建设增添一道靓丽的风景线');
