INSERT INTO `reb` VALUES ('1778', '济南中海兴业房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/e2b8a840-5cfe-457c-a416-e1032a3f7062.shtml', '', '0161591', '欧阳国欣', '高新区舜华东路600号5楼', '66773850', 'Xuhe0090732@163.com', '2000 万元', '外资企业', '济南中海兴业房地产开有限公司成立于2013年6月，注册资本金2000万人民币，主营房地产开发与销售。公司将秉承中海地产“诚信卓越、精品永恒”的一贯理念，为济南市场提供高尚的住宅产品。', '济南中海兴业房地产开发有限公司null欧阳国欣高新区舜华东路600号5楼66773850Xuhe0090732@163.com2000 万元外资企业济南中海兴业房地产开有限公司成立于2013年6月，注册资本金2000万人民币，主营房地产开发与销售。公司将秉承中海地产“诚信卓越、精品永恒”的一贯理念，为济南市场提供高尚的住宅产品。');
