INSERT INTO `reb` VALUES ('1781', '济南中融置业发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c32ebcb2-8531-433f-a837-d65bb7d1c823.shtml', '', '0161444', '刘娟娟', '人民政府唐冶街道办事处院内116室', '15066150095', '521180035@qq.com', '2000 万元', '民营企业', '济南中融置业发展有限公司于2015年6月成立，公司注册资金贰仟万元，是法人（刘娟娟女士）独资房地产开发企业。 公司秉承 “中融地产？筑就品质生活”的经营理念，以“中融地产？成就梦想”为使命，追求中融地产卓越的人才和先进的科技、理念，把“中融”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。', '济南中融置业发展有限公司null刘娟娟人民政府唐冶街道办事处院内116室15066150095521180035@qq.com2000 万元民营企业济南中融置业发展有限公司于2015年6月成立，公司注册资金贰仟万元，是法人（刘娟娟女士）独资房地产开发企业。 公司秉承 “中融地产？筑就品质生活”的经营理念，以“中融地产？成就梦想”为使命，追求中融地产卓越的人才和先进的科技、理念，把“中融”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。');
INSERT INTO `reb` VALUES ('1782', '济南泉景文卓置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/335a4824-3abf-4617-a4a8-dd754f77e1a5.shtml', '', '0161495', '刘民', '济微路90号-1-103室', '66696811', '809399901@qq.com', '120000.5 万元', '民营企业', '济南泉景文卓置业有限公司成立于2015年3月5日，注册资本3000万元，是济南绿地泉景地产股份依法成立的全资子公司，负责开发文庄片区B9地块的商品房建设，开发面积约24.74万㎡；项目位于二环南快速路以北，马武寨山西侧，环境优美，交通便利，是济南二环内生态宜居的又一典范。', '济南泉景文卓置业有限公司null刘民济微路90号-1-103室66696811809399901@qq.com120000.5 万元民营企业济南泉景文卓置业有限公司成立于2015年3月5日，注册资本3000万元，是济南绿地泉景地产股份依法成立的全资子公司，负责开发文庄片区B9地块的商品房建设，开发面积约24.74万㎡；项目位于二环南快速路以北，马武寨山西侧，环境优美，交通便利，是济南二环内生态宜居的又一典范。');
