INSERT INTO `reb` VALUES ('1784', '山东中建弘孚房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/9521f607-5ebb-4a6f-bad4-cb7915163375.shtml', '', '0161373', '左臣华', '山东省济南市历下区历山东路30号', '88805858', '155262104@qq.com', '3674 万元', '国有企业', '山东中建弘孚房地产开发有限公司注册资本为3674万元，其中山东中建房地产开发有限公司注册资本1800万元，股权占比49%；中信信诚资产管理有限公司注册资本为1874万元，股权占比51%，公司成立于2014年06月23日，运营项目为中建国熙台，地块为D-1和D-2块地，其中D-1地块总面积为24.95万平方米，位置在历下区解放路以北，山大路以西。公司在册职员工15人，其中高级职称4人，中级职称7人，初级职称4人。', '山东中建弘孚房地产开发有限公司null左臣华山东省济南市历下区历山东路30号88805858155262104@qq.com3674 万元国有企业山东中建弘孚房地产开发有限公司注册资本为3674万元，其中山东中建房地产开发有限公司注册资本1800万元，股权占比49%；中信信诚资产管理有限公司注册资本为1874万元，股权占比51%，公司成立于2014年06月23日，运营项目为中建国熙台，地块为D-1和D-2块地，其中D-1地块总面积为24.95万平方米，位置在历下区解放路以北，山大路以西。公司在册职员工15人，其中高级职称4人，中级职称7人，初级职称4人。');
INSERT INTO `reb` VALUES ('1785', '济南未来城置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/2a5f5afa-07ac-4ac9-8365-df35c7b730a0.shtml', '', '0161457', '陈箭', '山东省济南市槐荫区段兴西路8号306室', '58708166', '521180035@qq.com', '1000 万元', '民营企业', '济南未来城置业有限公司于2014年12月成立，公司注册资金壹仟万元，是法人（陈箭先生）独资房地产开发企业。 公司秉承“未来城地产 筑就品质生活”的经营理念，以“未来城地产 梦想的开始”为使命，追求未来城地产卓越的人才和先进的科技、理念，打造西部重点项目未来城项目，本项目可规划用地面积87158㎡。规划总建筑面积409642.6㎡，其中地上建筑面积278905.6㎡。包括住宅251580㎡，室内副食品市场1200㎡及配套商业26125.6㎡。力把“未来城”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。', '济南未来城置业有限公司null陈箭山东省济南市槐荫区段兴西路8号306室58708166521180035@qq.com1000 万元民营企业济南未来城置业有限公司于2014年12月成立，公司注册资金壹仟万元，是法人（陈箭先生）独资房地产开发企业。 公司秉承“未来城地产 筑就品质生活”的经营理念，以“未来城地产 梦想的开始”为使命，追求未来城地产卓越的人才和先进的科技、理念，打造西部重点项目未来城项目，本项目可规划用地面积87158㎡。规划总建筑面积409642.6㎡，其中地上建筑面积278905.6㎡。包括住宅251580㎡，室内副食品市场1200㎡及配套商业26125.6㎡。力把“未来城”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。');
INSERT INTO `reb` VALUES ('1786', '鲁中房产（济南）有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/6334ce23-38df-467a-b7f7-e3fd1c394760.shtml', '', '016(PY)0032', '田爱昌', '山东省济南市平阴县翠屏街110号', '87616677', '', '3000 万元', '国有企业', '公司于2014年8月29日注册成立了全资子公司，鲁中房产（济南）有限公司，注册资本3000元，2014年9月30日通过竞拍取得平阴县云翠街以北·锦水河景观以西两地块（合计141亩）进行开发建设，现在正积极办理各种前期手续。', '鲁中房产（济南）有限公司null田爱昌山东省济南市平阴县翠屏街110号876166773000 万元国有企业公司于2014年8月29日注册成立了全资子公司，鲁中房产（济南）有限公司，注册资本3000元，2014年9月30日通过竞拍取得平阴县云翠街以北·锦水河景观以西两地块（合计141亩）进行开发建设，现在正积极办理各种前期手续。');
INSERT INTO `reb` VALUES ('1787', '山东鲁信龙山置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/db4824f6-65fa-496d-a4f8-c83188dcd17a.shtml', '', '0161321', '赵子坤', '山东省济南市历城区旅游路6777号', '67779117', 'lxlssjb@163.com', '5000 万元', '民营企业', '山东鲁信龙山置业有限公司成立于2013年12月10日，位于山东省济南市历城区旅游路6777号，项目为鲁信蟠龙山。', '山东鲁信龙山置业有限公司null赵子坤山东省济南市历城区旅游路6777号67779117lxlssjb@163.com5000 万元民营企业山东鲁信龙山置业有限公司成立于2013年12月10日，位于山东省济南市历城区旅游路6777号，项目为鲁信蟠龙山。');
INSERT INTO `reb` VALUES ('1788', '山东瑞康置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/109628f6-1774-45e2-acb7-646ffe0447b1.shtml', '', '0161410', '王令强', '二环北路7299号', '58796180', 'sdsjfdc@126.com', '10000 万元', '国有企业', '山东瑞康置业有限公司成立于2014年6月11日，登记机关为山东省工商行政管理局。公司注册地点为济南市天桥区二环北路7299号，注册资本金为10000万元，是国有独资企业，法定代表人为王令强。公司业务涵盖房地产开发法、营销策划及房屋出租业务，目前主要从事三箭﹒瑞景苑项目的开发运营工作。', '山东瑞康置业有限公司null王令强二环北路7299号58796180sdsjfdc@126.com10000 万元国有企业山东瑞康置业有限公司成立于2014年6月11日，登记机关为山东省工商行政管理局。公司注册地点为济南市天桥区二环北路7299号，注册资本金为10000万元，是国有独资企业，法定代表人为王令强。公司业务涵盖房地产开发法、营销策划及房屋出租业务，目前主要从事三箭﹒瑞景苑项目的开发运营工作。');
INSERT INTO `reb` VALUES ('1789', '济南华隆置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/adc08519-64f9-453b-96a1-476e32dc6010.shtml', '', '0161513', '金建明', '龙鼎大道东侧龙奥新居龙洞村民委员会办公室215室', '55585617', '34642800@qq.com', '100000 万元', '民营企业', '济南华隆置业有限公司是一家专业从事房地产开发经营管理的地产开发民营企业，公司成立于2012年8月8日，注册资金7.5亿元人民币。隶属于实力雄厚的“中国房地产开发综合实力100强”企业“大华（集团）有限公司”，总公司已有26年从事房地产开发的历史，并连续多年销售过百亿。 公司目前开发项目地处济南未来CBD核心区域，紧邻景色宜人的龙洞风景区，项目总体量28万平米。公司拥有一个高度专业的经营管理团队，秉承诚信、务实、高效的经营理念，力争为济南的建设贡献力量，造福济南人民。', '济南华隆置业有限公司null金建明龙鼎大道东侧龙奥新居龙洞村民委员会办公室215室5558561734642800@qq.com100000 万元民营企业济南华隆置业有限公司是一家专业从事房地产开发经营管理的地产开发民营企业，公司成立于2012年8月8日，注册资金7.5亿元人民币。隶属于实力雄厚的“中国房地产开发综合实力100强”企业“大华（集团）有限公司”，总公司已有26年从事房地产开发的历史，并连续多年销售过百亿。 公司目前开发项目地处济南未来CBD核心区域，紧邻景色宜人的龙洞风景区，项目总体量28万平米。公司拥有一个高度专业的经营管理团队，秉承诚信、务实、高效的经营理念，力争为济南的建设贡献力量，造福济南人民。');
INSERT INTO `reb` VALUES ('1790', '平阴茂昌世纪置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/e1aa5894-d6ba-426b-b37d-73df1756b291.shtml', '', '0169(py)0018', '何德利', '榆山路中段茂昌银座新天地商业东区五楼', '87888577', '', '5000 万元', '民营企业', '平阴茂昌世纪置业有限公司成立于2011年8月，注册资金5000万元，是一家以房地产综合开发为主营业务的公司。该公司为山东茂昌世纪投资有限公司的全资子公司。公司秉承了母公司规范、诚信和稳健经营的一贯优点，不断提高自身的专业化运作水平，以“熔铸精英团队、实现精细管理、打造精品工程”为目标，以母公司强大的经济实力为后盾，坚持“点滴做起，持之以恒”的企业精神，以坚持打造精品项目为己任，遵循科学管理、严谨开发、强势发展的经营理念', '平阴茂昌世纪置业有限公司null何德利榆山路中段茂昌银座新天地商业东区五楼878885775000 万元民营企业平阴茂昌世纪置业有限公司成立于2011年8月，注册资金5000万元，是一家以房地产综合开发为主营业务的公司。该公司为山东茂昌世纪投资有限公司的全资子公司。公司秉承了母公司规范、诚信和稳健经营的一贯优点，不断提高自身的专业化运作水平，以“熔铸精英团队、实现精细管理、打造精品工程”为目标，以母公司强大的经济实力为后盾，坚持“点滴做起，持之以恒”的企业精神，以坚持打造精品项目为己任，遵循科学管理、严谨开发、强势发展的经营理念');
INSERT INTO `reb` VALUES ('1791', '山东建大合新发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a7f9e32e-659c-410e-a0f0-ee7f44e726f3.shtml', '', '0161484', '闫卫国', '崮云湖街道办事处丹凤小区北区大彦管区办公室220房', '55612666', 'sdjdhx@163.com', '5000 万元', '民营企业', '', '山东建大合新发展有限公司null闫卫国崮云湖街道办事处丹凤小区北区大彦管区办公室220房55612666sdjdhx@163.com5000 万元民营企业');
INSERT INTO `reb` VALUES ('1792', '济南西业置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/26def99c-8a11-4d58-91e6-1b6d4918554b.shtml', '', '0161240', '廖嘉宁', '段北路157号张庄街道办事处1层4号房', '67775888', '285785006@qq.com', '1800 万元', '民营企业', '', '济南西业置业有限公司null廖嘉宁段北路157号张庄街道办事处1层4号房67775888285785006@qq.com1800 万元民营企业');
INSERT INTO `reb` VALUES ('1793', '山东大明胜开置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/534e0c98-bfd7-4b40-9ff7-20203b8c2c73.shtml', '', '0161644', '林寿利', '山东省济南市济阳县济北开发区新元大街21号（山东胜开控股集团有限公司办公楼101室）', '81179991', '523748065@qq.com', '1000 万元', '民营企业', '山东大明胜开置业有限公司成立于2012年8月，是在山东大明胜开实业有限公司基础上成立。公司主要以经营房地产产业为主，是集工程项目投资和项目开发建设为一体的多元化服务型企业，资本实力雄厚。 凭借准确的市场定位和严谨的战略决策，公司目前开发建设的项目主要以大明胜景项目为主。公司坚持“专业创造价值”的经营理念，始终致力以专业化的管理团队和业务流程为客户提供满意的产品与服务，并通过标准化、规范化、信息化的控制体系专注于产品质量的不断提升，为客户、股东、员工和公司创造最大价值。公司充分关注产业发展方向及用户的真正需求，在提供“家”产品的同时，立志以自己不简单的加倍努力只为让客户体验简单而具体的幸福，通过“达人”与“立己”，以踏实进取、诚实守信的企业态度实现\"传播幸福， 成就梦想\"的愿景目标。 公司从满足城市人居环境出发，以专业精神打造高性价比产品。公司注重人才引进，从全国前10大开发公司高薪聘请管理人才，力求打造最好的产品。大明胜景在产品品质、设施配套、园林环境赢得了广大业主的普遍认同，业主推荐购置率达40%以上。公司结合管理人才多年的住宅产品开发经验，在着眼未来品牌体系建设基础上通过产品线研究，形成了鲜明的产品特色。同时，源于精细化管理的要求，大明正着力由产品模式向服务模式转变，合理细分目标市场，持续关注客户满意度提升，提出了全面以客户为中心的服务理念，以踏实进取、诚实守信的企业态度实现\"传播幸福 成就梦想\"的愿景目标。', '山东大明胜开置业有限公司null林寿利山东省济南市济阳县济北开发区新元大街21号（山东胜开控股集团有限公司办公楼101室）81179991523748065@qq.com1000 万元民营企业山东大明胜开置业有限公司成立于2012年8月，是在山东大明胜开实业有限公司基础上成立。公司主要以经营房地产产业为主，是集工程项目投资和项目开发建设为一体的多元化服务型企业，资本实力雄厚。 凭借准确的市场定位和严谨的战略决策，公司目前开发建设的项目主要以大明胜景项目为主。公司坚持“专业创造价值”的经营理念，始终致力以专业化的管理团队和业务流程为客户提供满意的产品与服务，并通过标准化、规范化、信息化的控制体系专注于产品质量的不断提升，为客户、股东、员工和公司创造最大价值。公司充分关注产业发展方向及用户的真正需求，在提供“家”产品的同时，立志以自己不简单的加倍努力只为让客户体验简单而具体的幸福，通过“达人”与“立己”，以踏实进取、诚实守信的企业态度实现\"传播幸福， 成就梦想\"的愿景目标。 公司从满足城市人居环境出发，以专业精神打造高性价比产品。公司注重人才引进，从全国前10大开发公司高薪聘请管理人才，力求打造最好的产品。大明胜景在产品品质、设施配套、园林环境赢得了广大业主的普遍认同，业主推荐购置率达40%以上。公司结合管理人才多年的住宅产品开发经验，在着眼未来品牌体系建设基础上通过产品线研究，形成了鲜明的产品特色。同时，源于精细化管理的要求，大明正着力由产品模式向服务模式转变，合理细分目标市场，持续关注客户满意度提升，提出了全面以客户为中心的服务理念，以踏实进取、诚实守信的企业态度实现\"传播幸福 成就梦想\"的愿景目标。');
