INSERT INTO `reb` VALUES ('1796', '山东正唐置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c1038f27-ba8c-47a2-9897-363b8f25c519.shtml', '', '0161350', '李保坤', '山东省济南市历城区西营镇西营北路51号501室', '86102006', '', '15000 万元', '民营企业', '企业简介 山东正唐置业有限公司成立于2010年12月，注册资本壹亿伍仟万元，公司以房地产开发为主，兼营房屋销售、物业管理等业务的房地产开发企业，公司实行董事会领导下的总经理负责制，目前设立综合管理部、计划财务部、合约审计部、设计部、工程管理部、营销策划部等部门。现有经营管理人员10人，具有中、高级职称的专业技术人员15人。公司组织机构健全，分工明确，层次分明，企业运作高效有序。全体员工齐心协力、奋力拼搏,积极开展各项生产经营工作，努力把公司建设成为最具竞争力的房地产企业之一，为改善全民的住房条件和美化城市环境做出更大的贡献。目前开发的楼盘,位于章丘刁镇盛唐世佳小区。', '山东正唐置业有限公司null李保坤山东省济南市历城区西营镇西营北路51号501室8610200615000 万元民营企业企业简介 山东正唐置业有限公司成立于2010年12月，注册资本壹亿伍仟万元，公司以房地产开发为主，兼营房屋销售、物业管理等业务的房地产开发企业，公司实行董事会领导下的总经理负责制，目前设立综合管理部、计划财务部、合约审计部、设计部、工程管理部、营销策划部等部门。现有经营管理人员10人，具有中、高级职称的专业技术人员15人。公司组织机构健全，分工明确，层次分明，企业运作高效有序。全体员工齐心协力、奋力拼搏,积极开展各项生产经营工作，努力把公司建设成为最具竞争力的房地产企业之一，为改善全民的住房条件和美化城市环境做出更大的贡献。目前开发的楼盘,位于章丘刁镇盛唐世佳小区。');
INSERT INTO `reb` VALUES ('1797', '山东融汇文创置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a137b101-0e6a-4f3e-96a1-80dd98271cb3.shtml', '', '0161600', '黄祖仕', '党杨路陡沟村北四楼402室', '81289598', '76811494@qq.com', '22000 万元', '民营企业', '山东融汇文创置业有限公司于2013年7月8日成立，公司注册资本贰亿贰仟万元，办公地址位于济南市市中区党杨路陡沟村北四楼402室。 公司秉承秉承“融汇城市梦想·筑就品质生活”的经营理念，以“融汇世界·成就梦想”为使命，追求融汇世界卓越的人才和先进的科技、理念，把“融汇”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。', '山东融汇文创置业有限公司null黄祖仕党杨路陡沟村北四楼402室8128959876811494@qq.com22000 万元民营企业山东融汇文创置业有限公司于2013年7月8日成立，公司注册资本贰亿贰仟万元，办公地址位于济南市市中区党杨路陡沟村北四楼402室。 公司秉承秉承“融汇城市梦想·筑就品质生活”的经营理念，以“融汇世界·成就梦想”为使命，追求融汇世界卓越的人才和先进的科技、理念，把“融汇”建设成全国知名实力品牌，给城市和客户一个可以实现的美好梦想。');
