INSERT INTO `reb` VALUES ('1799', '济南万融置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/046f2a16-e6a0-4af1-af2b-926146eacbd7.shtml', '', '0161629', '史海成', '济兖路462号215、216室', '86105699', '470912812@qq.com', '8000 万元', '国有企业', '济南万融置业有限公司成立于2011年，注册资金8000万元，主营房地产开发、经营、经济、营销策划，建筑工程施工；房地产中介服务；计算机网络工程及综合布线；工程管理服务；钢材、建筑材料、装饰材料、消防设备及器材、计算机硬件的销售。', '济南万融置业有限公司null史海成济兖路462号215、216室86105699470912812@qq.com8000 万元国有企业济南万融置业有限公司成立于2011年，注册资金8000万元，主营房地产开发、经营、经济、营销策划，建筑工程施工；房地产中介服务；计算机网络工程及综合布线；工程管理服务；钢材、建筑材料、装饰材料、消防设备及器材、计算机硬件的销售。');
INSERT INTO `reb` VALUES ('1800', '济南天鸿永信房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/d2e91d70-44b5-4bb6-8786-202337036223.shtml', '', '0161263', '薛振友', '济南市历城区工业北路69-1号', '88820525', 'quxinjiaisme@126.com', '2000 万元', '民营企业', '济南天鸿永信房地产开发有限公司作为天鸿地产区域公司——山东天鸿置业开发有限公司旗下的全资项目公司，注册资金2000万元,现在员工30余人。济南天鸿永信房地产开发有限公司以房地产开发建设为主业，室内外装潢、信息咨询、建筑材料经营销售为辅业。 公司以人本为中心，重视员工发展和成长，为员工提供了具有竞争力的薪资计划和完善的福利保证，并为员工提供各种培训和职位再提升的机会和动力。依托集团公司的强大实力，济南天鸿永信房地产开发有限公司本着“以品牌赢得市场”的宗旨在不断成长,并迅速发展壮大。 目前，济南天鸿永信房地产开发有限公司在济南东部正运营大型住宅项目——田园新城片区。项目总体规划数百万平米，其中启动区占地约678亩，总建筑面积近100万平米，是济南东部又一大规模的现代高品质复合型社区。', '济南天鸿永信房地产开发有限公司null薛振友济南市历城区工业北路69-1号88820525quxinjiaisme@126.com2000 万元民营企业济南天鸿永信房地产开发有限公司作为天鸿地产区域公司——山东天鸿置业开发有限公司旗下的全资项目公司，注册资金2000万元,现在员工30余人。济南天鸿永信房地产开发有限公司以房地产开发建设为主业，室内外装潢、信息咨询、建筑材料经营销售为辅业。 公司以人本为中心，重视员工发展和成长，为员工提供了具有竞争力的薪资计划和完善的福利保证，并为员工提供各种培训和职位再提升的机会和动力。依托集团公司的强大实力，济南天鸿永信房地产开发有限公司本着“以品牌赢得市场”的宗旨在不断成长,并迅速发展壮大。 目前，济南天鸿永信房地产开发有限公司在济南东部正运营大型住宅项目——田园新城片区。项目总体规划数百万平米，其中启动区占地约678亩，总建筑面积近100万平米，是济南东部又一大规模的现代高品质复合型社区。');
