INSERT INTO `reb` VALUES ('1807', '山东银丰文创谷房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/a6d7b8ba-dad6-4a2a-841c-a1d49da3b729.shtml', '', '0161380', '王彤', '唐冶新区围子山路1号', '88805326', '345074490@qq.com', '1800 万元', '民营企业', '山东银丰文创谷房地产开发有限公司成立于2014年5月，公司由银丰地产集团有限公司和济南唐冶城市建设投资开发有限公司共同出资设立，公司注册资本金1800万。 公司秉承“诚信做人、认真做事、张弛有度、开拓进取”的核心价值观，以及“银丰，诚信与品质的保证”的发展理念，积极打造“银丰地产”的品牌优势与影响力。', '山东银丰文创谷房地产开发有限公司null王彤唐冶新区围子山路1号88805326345074490@qq.com1800 万元民营企业山东银丰文创谷房地产开发有限公司成立于2014年5月，公司由银丰地产集团有限公司和济南唐冶城市建设投资开发有限公司共同出资设立，公司注册资本金1800万。 公司秉承“诚信做人、认真做事、张弛有度、开拓进取”的核心价值观，以及“银丰，诚信与品质的保证”的发展理念，积极打造“银丰地产”的品牌优势与影响力。');
INSERT INTO `reb` VALUES ('1808', '济南齐郡置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/42c892b9-a8f1-45f1-b521-63fa400fda48.shtml', '', '0161371', '李刚', '济南市槐荫区南辛庄70号428号', '82631115', '827070743@qq.com', '1800 万元', '民营企业', '企 业 简 介 济南齐郡置业有限公司成立于2013年5月2日，注册资本1800万元，经营地址济南槐荫区南辛庄70号428号，主营房地产开发、物业管理、房屋销售。 本公司是新成立的公司，具有经营、建筑、销售专业技术人员数十人，公司的股东及员工从事房地产开发工作多年，具有一定的经营、销售经验。公司以坚持创新、发展、勤奋、务实的企业精神，恪守“质量第一、信誉第一”的企业宗旨，发扬企业以人为本， 精心设计造舒适住宅，规范管理创一流品牌，为广大客户营造一个温馨舒适的住宅为宗旨，用我们的微笑、用优质的服务为更多的朋友提供一块属于自己的天地。 济南齐郡置业有限公司', '济南齐郡置业有限公司null李刚济南市槐荫区南辛庄70号428号82631115827070743@qq.com1800 万元民营企业企 业 简 介 济南齐郡置业有限公司成立于2013年5月2日，注册资本1800万元，经营地址济南槐荫区南辛庄70号428号，主营房地产开发、物业管理、房屋销售。 本公司是新成立的公司，具有经营、建筑、销售专业技术人员数十人，公司的股东及员工从事房地产开发工作多年，具有一定的经营、销售经验。公司以坚持创新、发展、勤奋、务实的企业精神，恪守“质量第一、信誉第一”的企业宗旨，发扬企业以人为本， 精心设计造舒适住宅，规范管理创一流品牌，为广大客户营造一个温馨舒适的住宅为宗旨，用我们的微笑、用优质的服务为更多的朋友提供一块属于自己的天地。 济南齐郡置业有限公司');
INSERT INTO `reb` VALUES ('1809', '济南环通置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/08ad9b54-3945-4a06-8098-d5251e04e775.shtml', '', '0161573', '李继才', '奥体中路4267号3楼305室', '85870709', '12491969@qq.com', '5035 万元', '民营企业', '济南环通置业有限公司是在山东省工商行政管理局注册登记、依法成立的、具有独立法人资格的开发企业，成立于2015年12月25日，注册资本伍仟零叁拾伍万元，公司位于高新区奥体中路4267号，于2016年9月取得房产开发暂定资质，并拥有完善的内部局域网络，现代化办公设备配备齐全，各部门实行资源共享，日常办公实现网络化管理。高素质的员工队伍、严格的公司制度、雄厚的经济实力，将使公司综合实力逐步发展壮大。', '济南环通置业有限公司null李继才奥体中路4267号3楼305室8587070912491969@qq.com5035 万元民营企业济南环通置业有限公司是在山东省工商行政管理局注册登记、依法成立的、具有独立法人资格的开发企业，成立于2015年12月25日，注册资本伍仟零叁拾伍万元，公司位于高新区奥体中路4267号，于2016年9月取得房产开发暂定资质，并拥有完善的内部局域网络，现代化办公设备配备齐全，各部门实行资源共享，日常办公实现网络化管理。高素质的员工队伍、严格的公司制度、雄厚的经济实力，将使公司综合实力逐步发展壮大。');
