INSERT INTO `reb` VALUES ('1827', '济南唐冶帝华置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/5bcf5ec8-a83e-4f9d-a86c-4be5c3c7f16f.shtml', '', '0161279', '李在明', '唐冶新区围子山路1号管委会院内', '80989785', '908101502@qq.com', '10000 万元', '民营企业', '济南唐冶帝华置业有限公司成立于2012年7月6日。在山东省济南市唐冶新区，公司已经通过招拍挂的方式获得了土地几百亩，精心打造集居住、商务、休闲等功能与一体的生态园林精品地产项目。 项目位于济南市历城区唐冶新区，紧邻山东省会济南市，北依世纪大道，南临经十东路，交通十分便利。 济南唐冶帝华置业有限公司在唐冶片区的开工建设，必将成为济南市城市东跨城镇化战略的重要一步，引领济南市东部新城建设的居住潮流，为济南东部的城市建设增添一道靓丽的风景线', '济南唐冶帝华置业有限公司null李在明唐冶新区围子山路1号管委会院内80989785908101502@qq.com10000 万元民营企业济南唐冶帝华置业有限公司成立于2012年7月6日。在山东省济南市唐冶新区，公司已经通过招拍挂的方式获得了土地几百亩，精心打造集居住、商务、休闲等功能与一体的生态园林精品地产项目。 项目位于济南市历城区唐冶新区，紧邻山东省会济南市，北依世纪大道，南临经十东路，交通十分便利。 济南唐冶帝华置业有限公司在唐冶片区的开工建设，必将成为济南市城市东跨城镇化战略的重要一步，引领济南市东部新城建设的居住潮流，为济南东部的城市建设增添一道靓丽的风景线');
INSERT INTO `reb` VALUES ('1828', '济南绿地康鲁置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c743e160-d413-4acc-9e11-06d05b960e58.shtml', '', '0161612', '金成发', '望岳路786号', '66696955', 'sunhanmeng@ldjt.com.cn', '6250 万元', '民营企业', '成立于2016年11月4日，建设发开济南绿地南北康项目。', '济南绿地康鲁置业有限公司null金成发望岳路786号66696955sunhanmeng@ldjt.com.cn6250 万元民营企业成立于2016年11月4日，建设发开济南绿地南北康项目。');
INSERT INTO `reb` VALUES ('1829', '济南安齐房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/39c4c921-5dec-4b2a-bf81-1417375c2a8f.shtml', '', '0161648', '许良飞', '济南市历下区解放东路95号院内东楼311号', '85321780', 'zhaoqiaoxi386@pingan.com.cn', '5000 万元', '民营企业', '　济南安齐房地产开发有限公司于2017年2月27日，注册资本5000万元人民币，平安不动产有限公司出资占比100%。公司经营范围为房地产开发及销售。', '济南安齐房地产开发有限公司null许良飞济南市历下区解放东路95号院内东楼311号85321780zhaoqiaoxi386@pingan.com.cn5000 万元民营企业　济南安齐房地产开发有限公司于2017年2月27日，注册资本5000万元人民币，平安不动产有限公司出资占比100%。公司经营范围为房地产开发及销售。');
INSERT INTO `reb` VALUES ('1830', '济南龙湖置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/982f4c12-c510-44f1-af56-b3734aa47a22.shtml', '', '013856', '常克艺', '济南市槐荫区腊山北路荣祥商务楼3层', '67961926', 'zhangmyue@longfor.com', '1000 万元', '民营企业', '济南龙湖置业有限公司成立于2013年12月13日，注册资本1000万元人民币；由重庆恒弘投资有限公司100%控股。公司经营范围为房地产开发、销售。', '济南龙湖置业有限公司null常克艺济南市槐荫区腊山北路荣祥商务楼3层67961926zhangmyue@longfor.com1000 万元民营企业济南龙湖置业有限公司成立于2013年12月13日，注册资本1000万元人民币；由重庆恒弘投资有限公司100%控股。公司经营范围为房地产开发、销售。');
INSERT INTO `reb` VALUES ('1831', '济南荣建置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/cd10bd16-4222-41ff-9bc1-6b0d55617bdb.shtml', '', '0161652', '唐云龙', '济南市槐荫区济兖路168号综合楼', '55515579', 'liuyan3@xincheng.com', '2000 万元', '民营企业', '济南荣建置业有限公司成立于2014年12月5日，注册资金贰仟万元整，有限责任公司。公司办公地点位于济南市槐荫区济兖路168号综合楼，开发项目位于济南市槐荫区。主要进行房地产开发、配套设施项目的建设。 公司将秉承以人为本、追求卓越的开发理念，注重品牌宣传，逐步扩大公司社会影响力。', '济南荣建置业有限公司null唐云龙济南市槐荫区济兖路168号综合楼55515579liuyan3@xincheng.com2000 万元民营企业济南荣建置业有限公司成立于2014年12月5日，注册资金贰仟万元整，有限责任公司。公司办公地点位于济南市槐荫区济兖路168号综合楼，开发项目位于济南市槐荫区。主要进行房地产开发、配套设施项目的建设。 公司将秉承以人为本、追求卓越的开发理念，注重品牌宣传，逐步扩大公司社会影响力。');
INSERT INTO `reb` VALUES ('1832', '山东中建嘉孚置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/78bb06a8-878c-46ca-92fe-26198f516fa1.shtml', '', '0161609', '韩文东', '山东省济南市槐荫区齐州路西城大厦13楼1302室', '88805858', '155262104@qq.com', '10000 万元', '国有企业', '山东中建嘉孚置业有限公司注册资本为10000万元，其中山东中建房地产开发有限公司注册资本2000万元，股权占比20%；上海国际信托有限公司注册资本8000万，股权占比80%，企业成立于2013年11月05日，运营项目为中建锦绣蘭庭，地块为西客站片区生态园区南侧A地块和C地块，其中A地块已竣工，总面积为14.23万平方米；C区总面积为16.8万平方米，具体位置为槐荫区青岛路南侧，腊山河东路东侧。公司在册职员工15人，其中高级职称4人，中级职称8人，初级职称3人。', '山东中建嘉孚置业有限公司null韩文东山东省济南市槐荫区齐州路西城大厦13楼1302室88805858155262104@qq.com10000 万元国有企业山东中建嘉孚置业有限公司注册资本为10000万元，其中山东中建房地产开发有限公司注册资本2000万元，股权占比20%；上海国际信托有限公司注册资本8000万，股权占比80%，企业成立于2013年11月05日，运营项目为中建锦绣蘭庭，地块为西客站片区生态园区南侧A地块和C地块，其中A地块已竣工，总面积为14.23万平方米；C区总面积为16.8万平方米，具体位置为槐荫区青岛路南侧，腊山河东路东侧。公司在册职员工15人，其中高级职称4人，中级职称8人，初级职称3人。');
