INSERT INTO `reb` VALUES ('1834', '济南东方帝华房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/02cc1f78-d0d8-4d9a-a24d-24601b697c07.shtml', '', '0161352', '李再东', '唐冶新区围子山路1号唐冶新区管委会院内', '053180989975', '908101502@qq.com', '20000 万元', '民营企业', '济南东方帝华房地产开发有限公司成立于2013年11月01日。在山东省济南市唐冶新区，公司已经通过招拍挂的方式获得了土地几百亩，精心打造集酒店、商务办公、休闲等功能与一体的生态园林精品地产项目。', '济南东方帝华房地产开发有限公司null李再东唐冶新区围子山路1号唐冶新区管委会院内053180989975908101502@qq.com20000 万元民营企业济南东方帝华房地产开发有限公司成立于2013年11月01日。在山东省济南市唐冶新区，公司已经通过招拍挂的方式获得了土地几百亩，精心打造集酒店、商务办公、休闲等功能与一体的生态园林精品地产项目。');
INSERT INTO `reb` VALUES ('1835', '济南中海城房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/01c1fbd5-6d10-4288-9be4-2ef4f5becf36.shtml', '', '0161278', '欧阳国欣', '将军路191号', '66773850', 'xuhe0090732@163.com', '3000 万元', '民营企业', '济南中海城房地产开发有限公司成立于2015年，由中海地产集团注资3000万，主营房地产开发与销售。目前主要经营历城区华山片区，公司将秉承中海地产“诚信卓越、精品永恒”的一贯理念，为济南市场提供高尚的住宅产品。', '济南中海城房地产开发有限公司null欧阳国欣将军路191号66773850xuhe0090732@163.com3000 万元民营企业济南中海城房地产开发有限公司成立于2015年，由中海地产集团注资3000万，主营房地产开发与销售。目前主要经营历城区华山片区，公司将秉承中海地产“诚信卓越、精品永恒”的一贯理念，为济南市场提供高尚的住宅产品。');
INSERT INTO `reb` VALUES ('1836', '济南贵达置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/47cb04b5-0a8e-4fc3-997b-26d737e4eefe.shtml', '', '0161525', '林鑫', '济南市历城区郭店街道办事处李家庄东村248号', '88779903', 'jngdzy2013@163.com', '7000 万元', '民营企业', '福建加州集团成立于2003年，总部位于福建省福州市。历经十余年发展，集团规模不断扩大，如今已经成为一家集房地产开发、商业运营和食品生产为一体的大型综合性企业集团。公司始终致力于提升人居品质和居住品位，开发建设了一批中高档住宅小区和商业物业，开发一处房产，兴旺一片区域，为客户提供超值的产品，并逐渐形成“加州”精品品牌系列产品。', '济南贵达置业有限公司null林鑫济南市历城区郭店街道办事处李家庄东村248号88779903jngdzy2013@163.com7000 万元民营企业福建加州集团成立于2003年，总部位于福建省福州市。历经十余年发展，集团规模不断扩大，如今已经成为一家集房地产开发、商业运营和食品生产为一体的大型综合性企业集团。公司始终致力于提升人居品质和居住品位，开发建设了一批中高档住宅小区和商业物业，开发一处房产，兴旺一片区域，为客户提供超值的产品，并逐渐形成“加州”精品品牌系列产品。');
