INSERT INTO `reb` VALUES ('1839', '济南正信置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/331ea43b-ed1a-44a6-9d15-e38ed0d1e269.shtml', '', '0161602', '段辉文', '山东省济南市槐荫区齐州路绿地缤纷城2楼213室', '13280023077', '10439937@qq.com', '1000 万元', '国有企业', '济南正信置业有限公司成立于2014年1月9日，注册地址位于济南市槐荫区齐州路绿地缤纷城2楼213室，注册资金1000万元，公司经营范围以自有资产对外投资，主要用于房地产开发项目。', '济南正信置业有限公司null段辉文山东省济南市槐荫区齐州路绿地缤纷城2楼213室1328002307710439937@qq.com1000 万元国有企业济南正信置业有限公司成立于2014年1月9日，注册地址位于济南市槐荫区齐州路绿地缤纷城2楼213室，注册资金1000万元，公司经营范围以自有资产对外投资，主要用于房地产开发项目。');
INSERT INTO `reb` VALUES ('1840', '章丘宏厦房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/0d686581-8329-4360-8e98-505da9b02673.shtml', '', '016（ZQ）016', '李宗增', '明水街道办事处查旧村西', '83233687', '441619021@qq.com', '1000 万元', '民营企业', '我单位成立于2010年10月21日，位于明水街道办事处查旧村西，从事房地产开发、销售。（凭资质）（依法须经批准的项目，经相关部门批准后方可开展经营活动）', '章丘宏厦房地产开发有限公司null李宗增明水街道办事处查旧村西83233687441619021@qq.com1000 万元民营企业我单位成立于2010年10月21日，位于明水街道办事处查旧村西，从事房地产开发、销售。（凭资质）（依法须经批准的项目，经相关部门批准后方可开展经营活动）');
INSERT INTO `reb` VALUES ('1841', '山东明化置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/187afc4b-1357-4c68-8c3c-9c1f2a979be1.shtml', '', '016（ZQ）017', '冀国庆', '济南市章丘区明水街道办事处绣江人家小区11号商铺', '83600015', '155361357@qq.com', '1000 万元', '国有企业', '黄金生态城项目所在区域是章丘区北跨战略城北片区改造的核心区域，根据规划这一区域将与百脉泉、绣江河整体进行开发。项目位于济南市章丘区百脉泉北侧，东至绣水大街，南至百脉泉公园，西至绣江河公园，北侧为规划道路。', '山东明化置业有限公司null冀国庆济南市章丘区明水街道办事处绣江人家小区11号商铺83600015155361357@qq.com1000 万元国有企业黄金生态城项目所在区域是章丘区北跨战略城北片区改造的核心区域，根据规划这一区域将与百脉泉、绣江河整体进行开发。项目位于济南市章丘区百脉泉北侧，东至绣水大街，南至百脉泉公园，西至绣江河公园，北侧为规划道路。');
INSERT INTO `reb` VALUES ('1842', '济阳县鸿源置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/fc4c9732-3875-4703-a44b-1ac26b2738a5.shtml', '', '016(JY023)', '刘云莲', '济北开发区汇鑫路三功开元阁1号楼1单元301室', '81176777', '', '2000 万元', '民营企业', '本公司成立于2015年11月24日，位于山东省济南市济阳县济北开发区汇鑫路三功开元阁1号楼1单元301室，注册资金为贰仟万元整，经营范围为房地产开发、销售、企业营销策划服务、物业管理。公司开发项目为济阳县纬三路中段（原银花纺织），总占地面积为110亩地，总投资6.4亿元，分三期开发建设。规划建设27万平方米的住宅和2万平方米的地下农贸商城.项目地理位置优越，打造济阳县最具有影响力的优质学区大盘。', '济阳县鸿源置业有限公司null刘云莲济北开发区汇鑫路三功开元阁1号楼1单元301室811767772000 万元民营企业本公司成立于2015年11月24日，位于山东省济南市济阳县济北开发区汇鑫路三功开元阁1号楼1单元301室，注册资金为贰仟万元整，经营范围为房地产开发、销售、企业营销策划服务、物业管理。公司开发项目为济阳县纬三路中段（原银花纺织），总占地面积为110亩地，总投资6.4亿元，分三期开发建设。规划建设27万平方米的住宅和2万平方米的地下农贸商城.项目地理位置优越，打造济阳县最具有影响力的优质学区大盘。');
INSERT INTO `reb` VALUES ('1843', '山东鹊华投资发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/8d5d8887-ed8a-4683-97b8-120976c877a8.shtml', '', '0161526', '滕善明', '华山街道大桥路117号', '88268722', '82046959@qq.com', '2000 万元', '民营企业', '山东鹊华投资发展有限公司成立于2014年9月17日，在建项目为济南电子商务（生产性）仓储物流服务园一期。', '山东鹊华投资发展有限公司null滕善明华山街道大桥路117号8826872282046959@qq.com2000 万元民营企业山东鹊华投资发展有限公司成立于2014年9月17日，在建项目为济南电子商务（生产性）仓储物流服务园一期。');
INSERT INTO `reb` VALUES ('1844', '济南中智置业发展有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/55d169c3-715b-4d03-b345-9f4ebe08bea9.shtml', '', '0161588', '陈箭', '人民政府唐冶街道办事处院内117室', '58708166', '767019703@qq.com', '2000 万元', '民营企业', '济南中智置业发展有限公司成立于2015年6月，公司注册资本贰仟万元整。 公司秉承“中智地产 筑就品质生活”的经营理念，以“中智地产 梦想的开始”为使命，追求中智地产卓越的人才和先进的科技、理念，打造东部中新国际城项目，本项目位于济南市历城区世纪大道以北，绕城高速以西。可规划用地面积125018㎡。总建筑面积391052.4㎡，其中地上建筑面积287541.4㎡，地下建筑面积103511平方米。主要建设住宅楼、社区管理与服务综合中心、商业设施、地下储藏室、人防设施、地下车库及设备用房。力把“中智”建设成知名实力品牌，给城市和客户一个可以实现的美好梦想。', '济南中智置业发展有限公司null陈箭人民政府唐冶街道办事处院内117室58708166767019703@qq.com2000 万元民营企业济南中智置业发展有限公司成立于2015年6月，公司注册资本贰仟万元整。 公司秉承“中智地产 筑就品质生活”的经营理念，以“中智地产 梦想的开始”为使命，追求中智地产卓越的人才和先进的科技、理念，打造东部中新国际城项目，本项目位于济南市历城区世纪大道以北，绕城高速以西。可规划用地面积125018㎡。总建筑面积391052.4㎡，其中地上建筑面积287541.4㎡，地下建筑面积103511平方米。主要建设住宅楼、社区管理与服务综合中心、商业设施、地下储藏室、人防设施、地下车库及设备用房。力把“中智”建设成知名实力品牌，给城市和客户一个可以实现的美好梦想。');
INSERT INTO `reb` VALUES ('1845', '济南远孚置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/427b97c1-ad0b-4ccc-9eaf-5ad27658002f.shtml', '', '0161569', '左臣华', '文苑街101号唐冶街道办事处院内131室', '88805858', '1207121906@qq.com', '3000 万元', '民营企业', '济南远孚置业有限公司是济南智慧城置业发展有限公司的独资企业，公司注册于2015年12月21日。注册资本金1800万元。2015年7月与济南市国土资源局签订位于济南市历城区世纪大道以北地块国有土地使用权出让合同。公司现在拥有职工15人，其中高级职称3人，中级职称7人，初级职称5人。', '济南远孚置业有限公司null左臣华文苑街101号唐冶街道办事处院内131室888058581207121906@qq.com3000 万元民营企业济南远孚置业有限公司是济南智慧城置业发展有限公司的独资企业，公司注册于2015年12月21日。注册资本金1800万元。2015年7月与济南市国土资源局签订位于济南市历城区世纪大道以北地块国有土地使用权出让合同。公司现在拥有职工15人，其中高级职称3人，中级职称7人，初级职称5人。');
INSERT INTO `reb` VALUES ('1846', '绿地集团济南绿鲁置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/47fb93d0-8a26-4424-ad2a-15d0bbdcee0c.shtml', '', '0161570', '金成发', '济南市历下区解放东路95院内东楼三楼', '053166696955', 'chao92975@163.com', '5100 万元', '民营企业', '绿地集团济南绿鲁置业有限公司成立于2016年7月13日，注册资本5000万元，由绿地控股集团有限公司100%出资成立。', '绿地集团济南绿鲁置业有限公司null金成发济南市历下区解放东路95院内东楼三楼053166696955chao92975@163.com5100 万元民营企业绿地集团济南绿鲁置业有限公司成立于2016年7月13日，注册资本5000万元，由绿地控股集团有限公司100%出资成立。');
INSERT INTO `reb` VALUES ('1847', '济南荣丰房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/997cb0e9-c77d-4818-97ec-65472bb8584e.shtml', '', '0161619', '马晓伟', '郭店三区18号', '15665733111', '185576397@qq.com', '5000 万元', '民营企业', '　济南荣丰房地产开发有限公司成立于2016年9月27日，注册资本1800万元，注册地为山东省济南市历城区郭店三区18号，公司现有员工27人，其中本科以上学历27人，占员工总数的100%，高级职称2人，中级职称6人，初级职称2人，公司现设有总工办、工程管理部、成本管理部、营销策划部、人事行政办公室、项目部等职能部门。', '济南荣丰房地产开发有限公司null马晓伟郭店三区18号15665733111185576397@qq.com5000 万元民营企业　济南荣丰房地产开发有限公司成立于2016年9月27日，注册资本1800万元，注册地为山东省济南市历城区郭店三区18号，公司现有员工27人，其中本科以上学历27人，占员工总数的100%，高级职称2人，中级职称6人，初级职称2人，公司现设有总工办、工程管理部、成本管理部、营销策划部、人事行政办公室、项目部等职能部门。');
INSERT INTO `reb` VALUES ('1848', '山东港舜置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/76f27f54-8d03-4d24-b04a-c31888dc13b9.shtml', '', '0161519', '秦学军', '舜华路751号B103-1室', '85582905', 'zqdcgs@126.com', '20000 万元', '国有企业', '山东港舜置业有限公司，成立于2008年，注册资金2亿元人民币，为中国重汽集团房地产开发有限公司全资子公司。 公司秉承重汽地产以\"品质源自卓越、诚信铸就百年\"为企业经营理念，倡导并推动着\"诚信为本、创新为魂、立足品牌、跨越发展\"的企业文化，不断学习先进的开发意识, 引进先进的产品设计思想。成功开发位于高新区的重汽1956项目。在取得较好经济效益的同时，也取得了良好的社会效应，并获得了社会各界的广泛好评。 重汽1956项目位于济南市政务中心奥体片区。项目南边临风景优美的旅游路，北靠汉峪金谷，东临奥体中心，与南未来的第一金融大道凤凰路一步之遥，西面是舜华南路，距离奥体中心仅1.5公里。', '山东港舜置业有限公司null秦学军舜华路751号B103-1室85582905zqdcgs@126.com20000 万元国有企业山东港舜置业有限公司，成立于2008年，注册资金2亿元人民币，为中国重汽集团房地产开发有限公司全资子公司。 公司秉承重汽地产以\"品质源自卓越、诚信铸就百年\"为企业经营理念，倡导并推动着\"诚信为本、创新为魂、立足品牌、跨越发展\"的企业文化，不断学习先进的开发意识, 引进先进的产品设计思想。成功开发位于高新区的重汽1956项目。在取得较好经济效益的同时，也取得了良好的社会效应，并获得了社会各界的广泛好评。 重汽1956项目位于济南市政务中心奥体片区。项目南边临风景优美的旅游路，北靠汉峪金谷，东临奥体中心，与南未来的第一金融大道凤凰路一步之遥，西面是舜华南路，距离奥体中心仅1.5公里。');
INSERT INTO `reb` VALUES ('1849', '济南首钜置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/156587db-237e-43ef-afc6-d9b9913610d1.shtml', '', '0161604', '蒋荣虎', '济南市历城区围子山路1号唐冶新区管理委员会南区101号办公室', '81210900', 'zhangyue@bcjuda.com', '21000 万元', '中外合资经营企业', '济南首钜置业有限公司成立于2016年8月1日，由中国上海钜礐投资管理有限公司与首创钜大奥莱管理有限公司共同出资成立，注册资金人民币21000万元。', '济南首钜置业有限公司null蒋荣虎济南市历城区围子山路1号唐冶新区管理委员会南区101号办公室81210900zhangyue@bcjuda.com21000 万元中外合资经营企业济南首钜置业有限公司成立于2016年8月1日，由中国上海钜礐投资管理有限公司与首创钜大奥莱管理有限公司共同出资成立，注册资金人民币21000万元。');
INSERT INTO `reb` VALUES ('1850', '山东樾昊房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/2e04f01a-2d57-404e-8fc1-c978dcc21b5f.shtml', '', '0161635', '蔡虎', '山东省济南市槐荫区西客站东广场西城大厦21楼2101室', '18660416593', 'zhaoxy@puyuecapital.com', '1000 万元', '民营企业', '房地产开发；工程项目管路；企业管理咨询；工程咨询；建筑装修装饰工程设计；景观设计；企业营销策划；物业管理；房屋租赁。', '山东樾昊房地产开发有限公司null蔡虎山东省济南市槐荫区西客站东广场西城大厦21楼2101室18660416593zhaoxy@puyuecapital.com1000 万元民营企业房地产开发；工程项目管路；企业管理咨询；工程咨询；建筑装修装饰工程设计；景观设计；企业营销策划；物业管理；房屋租赁。');
INSERT INTO `reb` VALUES ('1851', '济南中物房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/853fa3b4-6b37-420d-9d20-9a5e52b21b05.shtml', '', '0161617', '丁威', '济南市历城区唐冶新区唐冶东路777号新闻中心202室', '88929507', '18660143991@163.com', '5000 万元', '民营企业', '济南中物房地产开发有限公司，是由浙江中物九鼎科技孵化器有限公司，与济南唐冶城市建设投资开发有限公司，共同出资成立的房地产开发公司。 浙江中物九鼎科技孵化器有限公司，是国家级科技企业孵化器、国家级众创空间、国家技术转移示范机构、国家高新技术创业服务中心。依托中国唯一核武器研制生产单位——中国工程物理研究院（简称“中物院”），高度契合《中国制造2025》的战略要求，以“军民两用技术协同发展”为践行使命，以“中物智造、智造中国”为发展愿景，以“区域智能制造服务中心”为发展定位，以“中物院八大军转民优势领域”为产业主导，以“搭建创新平台、转型升级、新兴培育”为核心服务，结合区域产业环境及产业发展规划，搭建创新链释放国防科技潜能，完善产业链促进产业结构调整，力争构建中国制造2025示范基地。 济南唐冶城投属于国有独资有限责任公司，其股东为济南历城区财政局。济南市唐冶城市建设投资开发有限公司为历城区政府全额出资的国有独资企业，成立于2013年，注册资金伍仟万元，经营范围包括城乡技术设施建设、运营、管理；农村社区建设、村民安置房建设；城乡土地综合整治；土地熟化、开发、收购；房屋和土木工程建设施工；建筑安装、装饰施工等。公司成立后，主要负责历城区唐冶新区范围内的土地熟化、基础设施投资以及产业项目投资等。公司于2014年与济南市委宣传部、银丰地产集团有限公司合作，开发了山东设计创意产业园项目（即东8区企业公馆）。 鉴于党中央、国务院明确指出：“实施军民融合发展战略，形成全要素、多领域、高效益的军民深度融合发展格局”。《山东省十三五规划》提出：“建设一批创业孵化基地和创业园区”、“加快推进军民融合协同创新”、“着力推进军民产业融合”。《济南市十三五规划》提出：“打造全国重要的区域性科技创新中心”、历城区全力推进“产学研一体先行区建设、推动建设一批高新技术产业基地和科技成果转化基地”。 根据以上发展要求，为促进济南市科技创新发展、产业结构升级、新兴产业培育，经中物九鼎与唐冶城投双方友好协商，在历城区共同打造军民融合创新创业示范基地。', '济南中物房地产开发有限公司null丁威济南市历城区唐冶新区唐冶东路777号新闻中心202室8892950718660143991@163.com5000 万元民营企业济南中物房地产开发有限公司，是由浙江中物九鼎科技孵化器有限公司，与济南唐冶城市建设投资开发有限公司，共同出资成立的房地产开发公司。 浙江中物九鼎科技孵化器有限公司，是国家级科技企业孵化器、国家级众创空间、国家技术转移示范机构、国家高新技术创业服务中心。依托中国唯一核武器研制生产单位——中国工程物理研究院（简称“中物院”），高度契合《中国制造2025》的战略要求，以“军民两用技术协同发展”为践行使命，以“中物智造、智造中国”为发展愿景，以“区域智能制造服务中心”为发展定位，以“中物院八大军转民优势领域”为产业主导，以“搭建创新平台、转型升级、新兴培育”为核心服务，结合区域产业环境及产业发展规划，搭建创新链释放国防科技潜能，完善产业链促进产业结构调整，力争构建中国制造2025示范基地。 济南唐冶城投属于国有独资有限责任公司，其股东为济南历城区财政局。济南市唐冶城市建设投资开发有限公司为历城区政府全额出资的国有独资企业，成立于2013年，注册资金伍仟万元，经营范围包括城乡技术设施建设、运营、管理；农村社区建设、村民安置房建设；城乡土地综合整治；土地熟化、开发、收购；房屋和土木工程建设施工；建筑安装、装饰施工等。公司成立后，主要负责历城区唐冶新区范围内的土地熟化、基础设施投资以及产业项目投资等。公司于2014年与济南市委宣传部、银丰地产集团有限公司合作，开发了山东设计创意产业园项目（即东8区企业公馆）。 鉴于党中央、国务院明确指出：“实施军民融合发展战略，形成全要素、多领域、高效益的军民深度融合发展格局”。《山东省十三五规划》提出：“建设一批创业孵化基地和创业园区”、“加快推进军民融合协同创新”、“着力推进军民产业融合”。《济南市十三五规划》提出：“打造全国重要的区域性科技创新中心”、历城区全力推进“产学研一体先行区建设、推动建设一批高新技术产业基地和科技成果转化基地”。 根据以上发展要求，为促进济南市科技创新发展、产业结构升级、新兴产业培育，经中物九鼎与唐冶城投双方友好协商，在历城区共同打造军民融合创新创业示范基地。');
