INSERT INTO `reb` VALUES ('1856', '山东新广友置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/0b1246f9-924d-4f7c-8506-6016daab1977.shtml', '', '0161622', '杨金峰', '济南市槐荫区张庄路46号办公楼228室', '88167111', '309732818@qq.com', '3673.46 万元', '民营企业', '山东新广友置业有限公司为力高地产下属子公司天津力高基业有限公司与杨金峰先生的合资公司，目前开发力高君御世家项目为待建项目，建筑面积约137000万㎡。', '山东新广友置业有限公司null杨金峰济南市槐荫区张庄路46号办公楼228室88167111309732818@qq.com3673.46 万元民营企业山东新广友置业有限公司为力高地产下属子公司天津力高基业有限公司与杨金峰先生的合资公司，目前开发力高君御世家项目为待建项目，建筑面积约137000万㎡。');
INSERT INTO `reb` VALUES ('1857', '山东敦和置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/c4b0e030-a126-46cf-a546-6923b3d490b5.shtml', '', '0161529', '魏秉江', '山东省济南市历下区转山西路3号206室', '88996773', 'lszyzhgc@163.com', '10000 万元', '民营企业', '山东敦和置业有限公司成立于2013年10月17日，注册资本金壹亿元整，企业在册职工15人，其中有专业技术职称的12人，经营范围是房地产开发经营、房屋销售、租赁。 公司于2014年2月21日以招拍挂方式取得位于历下区经十路以南、转山西路东侧土地一宗，用地性质为商业金融用地，使用权面积12350㎡，地上容积率不大于6.0，地下容积率不大于2.8，建筑密度不大于40%，绿地率不小于25%，项目工程预计2017年10月开工建设。', '山东敦和置业有限公司null魏秉江山东省济南市历下区转山西路3号206室88996773lszyzhgc@163.com10000 万元民营企业山东敦和置业有限公司成立于2013年10月17日，注册资本金壹亿元整，企业在册职工15人，其中有专业技术职称的12人，经营范围是房地产开发经营、房屋销售、租赁。 公司于2014年2月21日以招拍挂方式取得位于历下区经十路以南、转山西路东侧土地一宗，用地性质为商业金融用地，使用权面积12350㎡，地上容积率不大于6.0，地下容积率不大于2.8，建筑密度不大于40%，绿地率不小于25%，项目工程预计2017年10月开工建设。');
