INSERT INTO `reb` VALUES ('1859', '济南中力房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/b0bfbdfc-7e70-47be-84df-8cb93a32737d.shtml', '', '0161568', '唐亚雷', '平安办事处平安中路北平安山庄济柴家园公建101', '58680581', '346387421@qq.com', '1000 万元', '民营企业', '济南中力房地产开发有限公司成立于2013年11月12日，为北京华油房地产开发有限公司的全资子公司，法定代表人唐亚雷，负责济南“御清苑”项目的开发、建设与经营管理。 项目总建设用地面积为38603平方米（约57.9亩），容积率2.199，总拟建规模99851.72平方米，地上面积84903.7平方米（其中住宅建筑面积80985.78平方米，住宅748套；商业网点及其他配套公建面积3917.92平方米），地下面积14948.02平方米（其中地下车库面积8811.02平方米，地下车位412个；地下储藏室面积6091.23平方米），小区住宅共7栋，其中18层6栋（2#-7#楼）、 26层1栋（1#楼）住宅，配套商业楼1栋。', '济南中力房地产开发有限公司null唐亚雷平安办事处平安中路北平安山庄济柴家园公建10158680581346387421@qq.com1000 万元民营企业济南中力房地产开发有限公司成立于2013年11月12日，为北京华油房地产开发有限公司的全资子公司，法定代表人唐亚雷，负责济南“御清苑”项目的开发、建设与经营管理。 项目总建设用地面积为38603平方米（约57.9亩），容积率2.199，总拟建规模99851.72平方米，地上面积84903.7平方米（其中住宅建筑面积80985.78平方米，住宅748套；商业网点及其他配套公建面积3917.92平方米），地下面积14948.02平方米（其中地下车库面积8811.02平方米，地下车位412个；地下储藏室面积6091.23平方米），小区住宅共7栋，其中18层6栋（2#-7#楼）、 26层1栋（1#楼）住宅，配套商业楼1栋。');
INSERT INTO `reb` VALUES ('1860', '济南泰盛房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/47932276-cda6-47fe-bb91-6a40031a9180.shtml', '', '0161577', '常克艺', '济南市槐荫区烟台路西元大厦西座706室', '66697779', '46987754@qq.com', '15000 万元', '民营企业', '济南泰盛房地产开发有限公司 成立于2015-09-16，注册资本15000万元。现开发建设位于济南市槐荫区西客站片区的龙湖水晶郦城项目。', '济南泰盛房地产开发有限公司null常克艺济南市槐荫区烟台路西元大厦西座706室6669777946987754@qq.com15000 万元民营企业济南泰盛房地产开发有限公司 成立于2015-09-16，注册资本15000万元。现开发建设位于济南市槐荫区西客站片区的龙湖水晶郦城项目。');
INSERT INTO `reb` VALUES ('1861', '济南福都房地产开发有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/73ea8e53-53d4-447b-99e4-c77149a72672.shtml', '', '016SH015', '边德强', '贾庄镇政府驻地', '13698617528', '1060296640@qq.com', '2000 万元', '民营企业', '济南福都房地产开发有限公司成立于2014年12月23日，注册资金2000万元，法定代表人边德强，投资1000万元，占50%，刘广河投资1000万元，占50%。公司拥有高级职称人员2人，中级职称职称人员8人，在职员工30余人。主要开展房地产开发、销售经营活动。', '济南福都房地产开发有限公司null边德强贾庄镇政府驻地136986175281060296640@qq.com2000 万元民营企业济南福都房地产开发有限公司成立于2014年12月23日，注册资金2000万元，法定代表人边德强，投资1000万元，占50%，刘广河投资1000万元，占50%。公司拥有高级职称人员2人，中级职称职称人员8人，在职员工30余人。主要开展房地产开发、销售经营活动。');
INSERT INTO `reb` VALUES ('1862', '济南璞园置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/2980ed97-7752-469a-8027-7ee8ba63322f.shtml', '', '016(ZQ)019', '高帅', '明水经济开发区工业四路1268号矿业工业园五楼', '80959065', '397034920@qq.com', '5000 万元', '国有企业', '以自有资金对房地产投资（未经金融监管部门批准，不得从事吸收存款、融资担保、代客理财等金融业务）；房地产开发与经营、酒店经营与管理、物业经营与管理（含房屋出租）；企业管理咨询；工程招投标代理，工程监理；国内广告的设计、制作、代理、发布；建筑材料、苗木花卉的销售；园林绿化工程施工（凭资质）、市政公用工程施工（凭资质）、新型农村社区建设。（依法须经批准的项目，经相关部门批准后方可开展经营活动）', '济南璞园置业有限公司null高帅明水经济开发区工业四路1268号矿业工业园五楼80959065397034920@qq.com5000 万元国有企业以自有资金对房地产投资（未经金融监管部门批准，不得从事吸收存款、融资担保、代客理财等金融业务）；房地产开发与经营、酒店经营与管理、物业经营与管理（含房屋出租）；企业管理咨询；工程招投标代理，工程监理；国内广告的设计、制作、代理、发布；建筑材料、苗木花卉的销售；园林绿化工程施工（凭资质）、市政公用工程施工（凭资质）、新型农村社区建设。（依法须经批准的项目，经相关部门批准后方可开展经营活动）');
