INSERT INTO `reb` VALUES ('1866', '山东中垠置业有限公司', 'http://www.jnfdc.gov.cn/kfqy/show/f97bc9ae-09e8-4bb9-85b6-e040349de7cd.shtml', '', '0161616', '张亚峰', '山东省济南市高新区舜泰广场B5-9层', '55535777', '331234516@qq.com', '10000 万元', '国有企业', '山东中垠置业有限公司于2015年3月18日注册成立，是国有特大型企业——兖矿集团有限公司为深度整合旗下房地产业而设立的中垠地产有限公司的全资子公司,肩负着做大做强中垠品牌，加快形成新的经济增长极的重要使命。公司总部设在山东省省会济南市，前期注册资本1亿元。', '山东中垠置业有限公司null张亚峰山东省济南市高新区舜泰广场B5-9层55535777331234516@qq.com10000 万元国有企业山东中垠置业有限公司于2015年3月18日注册成立，是国有特大型企业——兖矿集团有限公司为深度整合旗下房地产业而设立的中垠地产有限公司的全资子公司,肩负着做大做强中垠品牌，加快形成新的经济增长极的重要使命。公司总部设在山东省省会济南市，前期注册资本1亿元。');
